INSERT INTO `house` VALUES (16540, 0, 0, '2021-05-26 15:50:22', 0, '2021-05-26 16:17:23', 202105054, '领峰花园', 'E-5#,E-6#,E-12#', ' 9848.15  ', 80, 23415, '龙川路与历口路交口', '包河区', '住宅 商业 办公', '高层 小高层 洋房', '合肥金玖房地产开发有限公司', '安徽寰宇建筑设计院 ', '上海金地物业服务有限公司', '加侨国际广场、百大合家福购物广场、自建约4万方办公商业、代建1.3万方公园绿地。附近有淝河中央公园、淝河生态公园、南淝河生态公园、合肥中央公园。', '周边公交线路与地铁线路均可抵达本项目，公交线路为101路、122路、9路、138路；地铁线路为四号线花山路站（规划建设中）；马鞍山路高架；高铁南站。', 7755, 1, '2021', '202105');
INSERT INTO `house` VALUES (16541, 0, 0, '2021-05-26 15:50:22', 0, '2021-05-26 16:18:10', 202105047, '晖悦花园', 'Y1,Y2,Y3,Y5,Y6', ' 20295.36  ', 160, 15998, '大众路与浍水路交口', '新站区', '住宅', '高层住宅、低层洋房、其它住宅', '绿地集团合肥美湖置业有限公司', '华东建筑设计研究院有限公司', '长城物业集团股份有限公司', '寿春中学、园上园小学等优教簇拥；近享磨店商业街、百大商业广场、黉街等商业配套，自带1500㎡社区菁英商街', '周边拥有多条公交线路，40路（刘大郢站）、303路（安徽粮食学院站）、304路（安徽粮食学院站）、301路（梦溪小城站）等，紧邻地铁3号线（岱河路站）', 7810, 1, '2021', '202105');
INSERT INTO `house` VALUES (16542, 0, 0, '2021-05-26 15:50:22', 0, '2021-05-26 16:18:19', 202105043, '熙岸雅轩', 'Y1,Y2,Y3,Y5,Y6,Y7,Y8', ' 36758.65  ', 326, 15769, '九顶山路与淮南路交口', '新站区', '住宅', '小高层 洋房', '合肥中海海惠房地产有限公司', '梁黄顾建筑设计（深圳）有限公司', '中海宏洋物业管理有限公司合肥分公司', '项目毗邻板桥河景观长廊，北侧及南侧规划景观绿地，距东北方向陶冲湖公园约4km，项目紧邻华润熙云府社区商业配套，距离京商商贸城约7km、武里山天街约5km，生活配套成熟。', '项目位于淮南路与九顶山路交口，紧邻城市主干道，淮南路直接连通主城主干道北二环。项目距离合肥站约8km，距离地铁1号线北延线（在建）天水路站站口约2km，区域交通较为便捷。', 7814, 1, '2021', '202105');
INSERT INTO `house` VALUES (16543, 0, 0, '2021-05-26 15:50:22', 0, '2021-05-26 16:18:19', 202105044, '凯乐轩', '1', ' 19057.27  ', 221, 21399, '合肥市瑶海区胜利路58号', '瑶海区', '住宅', '高层', '安徽中天投资集团有限公司', '中铁合肥建筑市政工程设计研究院有限公司', '安徽省金中物业管理有限公司', '项目位于合肥市老城区，周边配套成熟完善，坐享滁州路小学、三十八中优质学区；距淮河路步行街仅一路之隔，银泰中心、包河万达等大型商场近在咫尺；省立医院、妇幼保健院等医疗资源丰富；近享逍遥津、环城公园。', '胜利路与滁州路交口，紧邻地铁1号线明光路站、2号线大东门站，胜利路、滁州路、明光路、长江东路、铜陵路高架等峰速驳接全城，交通十分便利。', 7815, 1, '2021', '202105');
INSERT INTO `house` VALUES (16544, 0, 0, '2021-05-26 15:50:22', 0, '2021-05-26 16:18:20', 202105040, '雍容雅苑', 'A8,A9', ' 7157.20  ', 48, 23527, '包河区北京路与歙县路交叉口', '包河区', '住宅 商业', '高层 小高层 洋房', '合肥禹博房地产开发有限公司', ' 安徽寰宇建筑设计院', '禹洲物业服务有限公司', '项目周边分布马鞍山路沿线商圈，其中包括万达广场、加侨国际广场、绿地瀛海、百大购物广场、新都会环球购物广场等多个醇熟商业，购物、美食、休闲、娱乐应有尽有。', '轨道交通：紧邻的2条地铁线分别是地铁1号线(葛大店站)、地铁4号线(大强路站)；以及规划中的5号线、6号线。 道路交通：项目被“四横五纵”城市主干道围绕。四横为南二环（郎溪路）、祁门路、龙川路、繁华大道，可快速到达政务区、经开区；五纵为徽州大道、庐州大道、包河大道、上海路及北京路，可快速到达老城区、滨湖新区。', 7813, 1, '2021', '202105');
INSERT INTO `house` VALUES (16545, 0, 0, '2021-05-26 15:50:22', 0, '2021-05-26 16:18:20', 202105034, '文一塘溪津门', '13', ' 10855.61  ', 69, 24499, '滨湖新区包河大道与杭州路交口', '滨湖区', '住宅', '高层、洋房', '安徽省文一投资控股集团滨江置业有限公司', '北京高能筑博建筑设计有限公司', '安徽省文一物业管理有限公司', '环境：项目紧邻方兴湖和巢湖两大水系，同时为塘西河公园、金斗公园、方兴湖公园和岸上草原所环抱，公园面积高达万亩。商业：项目自持近10万方的文化商业街，打造合肥城市会客厅。此外，南接万达文旅城和恒大中心，东邻银泰中心和中心书城，北连悦方IDmall和世纪金源，众多商业中心伺散。学区：项目南面沿云谷路建有幼儿园和小学。同时一中、四十八中、四十六中和师范附小等名校坐落周边，教育资源得天独厚。医疗：滨湖医院距离项目仅4公里。省立医院总部正在规划筹建，位于项目北侧，相距不过5分钟车程。旅游：万达文化旅游城、牛角大圩生态旅游区、滨湖湿地公园、巢湖岸边的岸上草原、滨湖十大省级文化场馆，加上会申报国家AAAA级景区的塘溪津门水街将，形成一片完整的环巢湖旅游带。', '项目交通状况用“一环二铁三纵四横”来概括。“一环”，即环巢湖大道，被誉为“合肥最美道路”之一。沿线向东可达巢湖城区，向西达国家AAAAA级风景区——三河古镇。“二铁”，指高铁南站和三条地铁线。高铁南站距项目约10公里，借此可达省外；其次项目紧邻三条地铁，1号线已开通营运，由滨湖新区直达合肥火车站，是合肥南北向交通的主动脉，距项目最近的云谷路站约为1.1公里；5号线已经开建，其东史岗路站与华山路站与项目无缝对接。S1号线，途经新桥机场、新高铁西站、高铁南站最终抵达巢湖岸边，将于项目东南角设站。“三纵”指三条南北向主干道——徽州大道、庐州大道和包河大道，连接滨湖新区与老城核心。“四横 ”为锦绣大道、紫云路、方兴大道和云谷路，贯穿滨湖新区和经开区。沿方兴大道向西驱车10分钟可上京台高速，30分钟可达机场高速入口，构成全方位、立体化的交通体系网，通达四周。', 7807, 1, '2021', '202105');
