INSERT INTO `house` VALUES (16548, 0, 0, '2021-05-26 15:50:22', 0, '2021-05-26 16:18:22', 202105035, '湖岸澜庭二期', 'V23,V52,V53,V55,V56,V57', ' 11247.77  ', 38, 21208, '合肥市蜀山区邓店路以南、山茶路以西', '蜀山区', '住宅', '多层、低层', '合肥中海宏洋海悦房地产开发有限公司', '上海原构设计咨询有限公司', '中海宏洋物业管理有限公司合肥分公司', '项目毗邻天然氧吧蜀山湖及蜀山湖湿地公园，邻近大蜀山，自然生态环境优越。从项目出发2.5公里可直达长江西路商圈，4km范围内覆盖乐客来国际广场、奥特莱斯、CBC拓基广场。此外，沿长江西路可快速通达国购、之心城、天鹅湖万达、万象城、银泰中心等合肥高端的商业配套群。 ', '项目位于蜀山经济开发区北部，位于沁源路与宝月路交口东北角。项目距离长江西路、地铁2号线站口、绕城高速出入口约3.5km，距离机场约17km，区域交通较为便捷。', 7795, 1, '2021', '202105');
INSERT INTO `house` VALUES (16549, 0, 0, '2021-05-26 15:50:22', 0, '2021-05-26 16:18:22', 202105027, '花海雅居', '6,7,10', ' 20747.39  ', 184, 19497, '东临皖山路，西至雪霁路，北侧为天狮路，南侧为规划支路', '蜀山区', '住宅', '小高层洋房', '合肥溯源房地产开发有限公司', '北京建谊高能建筑设计研究院有限公司', '浙江佳源物业服务集团有限公司', '佳源·花海印象，坐拥合肥环蜀山板块，区域内拥有得天独厚的生态资源，（约）8500亩国家森林公园、（约）4667公顷董铺湖、（约）2944亩四季花海环伺左右， 同时紧邻安徽第一路——长江路，地铁2号线（振兴路站）在侧，向西可并入绕城高速、机场高速，向东直抵老城区，可满足不同人群多样的出行方式；项目拥有12班自建幼儿园、乐农小学及五十中东校（蜀山中学）等优质教育资源环绕；自建邻里中心、奥园城市天地、半边街、砂之船奥特莱斯、祥源银泰城毗邻左右，集休闲、购物、餐饮、娱乐等多重繁华于一体，轻松满足吃、喝、玩、乐、购；市一院（西区）、安医附院（高新分院）临近周边，醇熟完善的医疗配套，将为我们的幸福生活保驾护航。', '交通：公交车56路、533路、650路可直达项目附近，步行可到达本项目； 地铁：2号线可到振兴路站下，步行可到达本项目', 7791, 2, '2021', '202105');
