INSERT INTO `house` VALUES (16551, 0, 0, '2021-05-26 15:50:22', 0, '2021-05-26 16:18:23', 202104051, '东望雅苑', 'G03#,G05#,G11#', ' 31825.04  ', 342, 20749, '合肥市包河区天津路与哈尔滨路交口东南角', '包河区', '住宅', '高层、小高层', '合肥瑞盛房地产开发有限公司', '江苏中和建筑设计有限公司', '招商局物业管理有限公司合肥分公司', '距离项目西侧2公里为万泓中心与世纪金源联手打造的大型购物中心，同时旁边还有一个以宋代建筑风格打造的文化商圈贡街。距离项目东侧约1公里为安凯汽车集团公司医院，项目西侧约2公里为合肥长江医院。项目向西约4公里为骆岗中央公园，往东是国家4A级旅游景区-大圩生态农业旅游景区.', '项目位于包河区哈尔滨路与天津路交口东南角，地处包河中轴的枢纽位置，交通非常便利，形成了“三横四纵双轨道”的立体式交通路网，三横即繁华大道、绕城高速、龙川路， 四纵即南淝河路、天津路、上海路、包河大道 。 三轨道即地铁4号线（在建中）、5号线。', 7765, 2, '2021', '202104');
