INSERT INTO `house` VALUES (16554, 0, 0, '2021-05-26 15:50:22', 0, '2021-05-26 16:18:25', 202104039, '雍容雅苑', 'A6,A7', ' 9514.62  ', 64, 23526, '包河区北京路与歙县路交叉口', '包河区', '住宅 商业', '高层 小高层 洋房', '合肥禹博房地产开发有限公司', ' 安徽寰宇建筑设计院', '禹洲物业服务有限公司', '项目周边分布马鞍山路沿线商圈，其中包括万达广场、加侨国际广场、绿地瀛海、百大购物广场、新都会环球购物广场等多个醇熟商业，购物、美食、休闲、娱乐应有尽有。', '轨道交通：紧邻的2条地铁线分别是地铁1号线(葛大店站)、地铁4号线(大强路站)；以及规划中的5号线、6号线。 道路交通：项目被“四横五纵”城市主干道围绕。四横为南二环（郎溪路）、祁门路、龙川路、繁华大道，可快速到达政务区、经开区；五纵为徽州大道、庐州大道、包河大道、上海路及北京路，可快速到达老城区、滨湖新区。', 7756, 2, '2021', '202104');
INSERT INTO `house` VALUES (16555, 0, 0, '2021-05-26 15:50:22', 0, '2021-05-26 16:18:25', 202104040, '东望雅苑', 'G08#,G18#,G20#,G21#,G22#,G23#', ' 39427.20  ', 424, 23149, '合肥市包河区天津路与哈尔滨路交口东南角', '包河区', '住宅', '高层、小高层', '合肥瑞盛房地产开发有限公司', '江苏中和建筑设计有限公司', '招商局物业管理有限公司合肥分公司', '距离项目西侧2公里为万泓中心与世纪金源联手打造的大型购物中心，同时旁边还有一个以宋代建筑风格打造的文化商圈贡街。距离项目东侧约1公里为安凯汽车集团公司医院，项目西侧约2公里为合肥长江医院。项目向西约4公里为骆岗中央公园，往东是国家4A级旅游景区-大圩生态农业旅游景区.', '项目位于包河区哈尔滨路与天津路交口东南角，地处包河中轴的枢纽位置，交通非常便利，形成了“三横四纵双轨道”的立体式交通路网，三横即繁华大道、绕城高速、龙川路， 四纵即南淝河路、天津路、上海路、包河大道 。 三轨道即地铁4号线（在建中）、5号线。', 7737, 2, '2021', '202104');
