INSERT INTO `house` VALUES (16559, 0, 0, '2021-05-26 15:50:24', 0, '2021-05-26 16:18:27', 202104041, '檀悦花园', 'Y25,Y27,Y29,Y31', ' 19356.66  ', 128, 25407, '滨湖区包河大道以东，万泉河路路以南', '滨湖区', '一级资质', '高层、小高层、洋房', '合肥光煜房地产开发有限公司', '成都基准方中建筑设计有限公司', '阳光城物业服务有限公司', '商业：世纪金源购物中心、悦方、百大心悦城、利港银河广场、佳源广场等 医疗：在项目东北角在建设安徽省立医院', '四横从北往南分别为锦绣大道、紫云路、方兴大道、云谷路；四纵是从东往西分别为上海路、包河大道、庐州大道、徽州大道；四地铁有现在已经运营的地铁1号线（会展中心站和紫庐站，1号线贯穿合肥南北），已经进入施工阶段地铁5号线（扬子江路，5号线为一条南北向线路，全长32.9公里，共设27座车站，其中有5座轨道交通换乘车站。主要功能是加强主城区与滨湖新区的联系，引导并促进滨湖新区的发展）和规划中的7号线（紫云路站，约300米，7号线贯穿东西城区，主要连接高新区、经开区、滨湖中心）及S1号线（徽富路站，距离项目约400米；地铁S1号线从新桥机场起步，经清溪路附近的新西站交通枢纽，南下与4号线交汇之后，向东南方向前进，在和1号线在合肥南站附近交汇之后，进入滨湖新区，最终抵达巢湖岸边）。沿方兴大道上G3京台高速入口沿六安方向，可快速直达新桥国际机场。公交车：B7/B5/66等', 7659, 3, '2021', '202104');
