INSERT INTO `house` VALUES (16567, 0, 0, '2021-05-26 15:50:24', 0, '2021-05-26 16:18:30', 202104002, '湖滨兰园', 'G11,G9,G10', ' 30890.26  ', 247, 23384, '滨湖区包河大道与南京路交口东南角', '滨湖区', '住宅', '高层，洋房', '安徽舜鸿房地产开发有限公司', '上海联创设计集团股份有限公司', '绿城物业服务集团有限公司', '一路之隔的招商雍华府自带13万方商业综合体、百大心悦城、悦方、利港银河广场、佳源商业购物中心、银泰百货、万达茂等大型购物中心，满足您日常购物、休闲娱乐的的需求。省立总院医疗健康护航，幼儿园、小学、初中全龄教育，2KM多公园环绕，2KM四大商圈环绕', '项目北侧道路为南京路，西侧为包河大道，南侧为万泉河路，东侧为安徽路，1号线、5号线双地铁，项目所在区域整体的交通道路可以简单的概括为三纵三横一轨道，形成一个四通八达的内部交通网。', 7559, 3, '2021', '202104');
INSERT INTO `house` VALUES (16568, 0, 0, '2021-05-26 15:50:24', 0, '2021-05-26 16:18:31', 202104003, '和枫雅园', 'Y21#,Y22#,Y23#,Y25#,Y26#,Y27#,Y28#,Y29#,Y30#,Y31#', ' 40130.72  ', 296, 22215, '合肥市经济技术开发区宿松路以东、规划支路以北', '经开区', '住宅', '高层、小高层、洋房', '合肥居峰置业有限公司', '安徽省城建设计研究总院股份有限公司 / 华东建筑设计研究院有限公司', '招商局物业管理有限公司合肥分公司', '周边3公里范围内有华润万象城、银泰、万达、正大广场等高端商业，此外距离刚刚签约的华润万象天地约1公里左右，商业配套成熟。距离海恒商业街、海恒农贸市场，日之惠等约1.6公里，生活便利。距离巨无霸“中央公园”仅约1.7公里，尽享中央公园的发展红利。同时中央公园也是天然氧吧，还有十五里河环绕，生态宜人。', '项目位于经开区宿松路与坝下路交口往北100米，位于政务东，中央公园旁，土地资源稀缺，发展潜力无限。距离1号线南站南广场站直线距离约2公里，未来还有4号线（在建），S1号线（规划中）汇聚于此，近距离享受地铁时代的便利。', 7734, 3, '2021', '202104');
INSERT INTO `house` VALUES (16569, 0, 0, '2021-05-26 15:50:24', 0, '2021-05-26 16:18:31', 202104004, '金茂湾', 'D5,D6,D9,D10,D12,D15,D17', ' 27319.30  ', 126, 24882, '文曲路和习友路东南角', '高新区', '住宅、商业', '高层、其他住宅', '安徽新华新茂置业有限公司', '华东建筑设计研究院有限公司', '中国金茂物业管理（北京）有限公司', '安徽医科大学附属口腔医院，小区配套幼儿园，梦园小学，中加国际学校，合肥七中新校区', '地铁2号线、4号线，7号线。习友路西接方兴大道，向北直达政务区，向南直通滨湖新区，交通四通八达。', 7735, 4, '2021', '202104');
