INSERT INTO `house` VALUES (16575, 0, 0, '2021-05-26 15:50:24', 0, '2021-05-26 16:18:35', 202103049, '湖岸澜庭二期', 'V25,V26,V29,V30,V31,V32,V38,V39,V50,V51', ' 18620.22  ', 62, 21208, '合肥市蜀山区邓店路以南、山茶路以西', '蜀山区', '住宅', '多层、低层', '合肥中海宏洋海悦房地产开发有限公司', '上海原构设计咨询有限公司', '中海宏洋物业管理有限公司合肥分公司', '项目毗邻天然氧吧蜀山湖及蜀山湖湿地公园，邻近大蜀山，自然生态环境优越。从项目出发2.5公里可直达长江西路商圈，4km范围内覆盖乐客来国际广场、奥特莱斯、CBC拓基广场。此外，沿长江西路可快速通达国购、之心城、天鹅湖万达、万象城、银泰中心等合肥高端的商业配套群。 ', '项目位于蜀山经济开发区北部，位于沁源路与宝月路交口东北角。项目距离长江西路、地铁2号线站口、绕城高速出入口约3.5km，距离机场约17km，区域交通较为便捷。', 7706, 4, '2021', '202103');
