INSERT INTO `house` VALUES (16578, 0, 0, '2021-05-26 15:50:24', 0, '2021-05-26 16:18:36', 202103055, '云境景轩', '5,6,3,12', ' 16318.88  ', 96, 25698, '合肥市庐阳区北松路以东、紫兰街以北', '庐阳区', '住宅，商业，车位等', '多层、小高层', '合肥祥创置业有限公司', '上海天华建筑设计有限公司', '浙江祥生物业服务有限公司', '配套成熟：周边三公里内，商业、教育、医疗资源具备； 生态优越：紧邻大房郢水库、四里河，且有四里河公园、庐州公园等大型市政公园，生态景观资源优越。', '项目位于合肥市庐阳区，庐阳区是合肥的行政中心、经济中心、文化中心，人口聚集度高，配套成熟，拥有全市最好的商业、医 疗及教育资源。地块位于庐阳区四里河板块与老城板块交界之处，受两大板块优质资源的双重辐射', 7705, 4, '2021', '202103');
INSERT INTO `house` VALUES (16579, 0, 0, '2021-05-26 15:50:25', 0, '2021-05-26 16:18:37', 202103045, '云琅花园', '8#,11#,16#', ' 19199.13  ', 162, 21749, '龙川路与棠樾路交口', '包河区', '住宅', '小高层', '安徽瑞正置业有限公司', '上海天华建筑设计有限公司', '河南宏港物业服务有限公司', '【商业】沿线分布加侨国际广场、星隆购物广场、万达广场等多个成熟商业，购物、休闲、娱乐应有尽有。淝河新中心商圈是政府重点打造的集生态、科技、商业和文化为一体的综合性商圈 【教育】项目周边两公里，共计有幼儿园8所项目北边有屯溪路小学龙川路校区、西北侧有四十八中，另有合肥实验学校、合肥大地中学等多所学校 【医疗】省儿童医院、友好医院、妇幼保健院项目北侧规划合肥市中医院和合肥市第三人民医院新区，将打造包河区亿元走廊，为您和家人健康保驾护航。 【景观生态】南淝河生态景观带、高铁沿线郊野绿廊，实现300米见绿，500米见园淝河智慧生态公园、1.3万方绿轴公园', '项目周边拥有3条地铁线（分别为地铁一号线、地铁四号线以及地铁五号线）其中4号线花山路站与本项目距离约700米，随着合肥轨道交通的不断发展，未来业主将可以用最短的时间通达全城各个区域。道路交通方面，项目被“四纵两横”城市主干道围绕，四纵为徽州大道、包河大道、上海路及北京路，可快速到达老城区、滨湖新区。二横为南二环、龙川路，可快速到达政务区、经开区；四通八达的交通路网完美地保障了未来业主的便捷出行。', 7703, 5, '2021', '202103');
