INSERT INTO `house` VALUES (16585, 0, 0, '2021-05-26 15:50:25', 0, '2021-05-26 16:18:39', 202103029, '云栖麓小区', 'G3#,G5#,G10#', ' 15623.30  ', 168, 14999, '三乘寺路以东、金水湾路以北', '蜀山区', '住宅', '小高层、多层', '合肥坤尚置业有限公司', '上海联创设计集团股份有限公司', '上海上坤物业管理有限公司', '地块东侧规划有商业街区、距离砂之船奥莱直线距离约7公里、距离银泰城（在建）直线距离约9公里。十公里范围内医疗资源丰富，安徽医科大学第一附属医院（高新院区），安徽省妇幼保健院（西院）、安徽医科大学临床医学院及附属医院（规划中）。', '距离地铁2号线南岗站直线距离约7公里、距离地铁4号线（在建）鸡鸣山路站直线距离约4公里，地铁6号线（规划中）、地铁2号线延长线（规划中）。', 7702, 5, '2021', '202103');
INSERT INTO `house` VALUES (16586, 0, 0, '2021-05-26 15:50:25', 0, '2021-05-26 16:18:40', 202103018, '海悦公馆', 'A7,A8', ' 15465.47  ', 132, 15999, '瑶海区明皇路与龙岗路交口', '瑶海区', '住宅、车位、商业等', '高层、洋房、其他', '合肥和旭房地产有限公司', '中外建工程设计与顾问公司', '保利物业发展股份有限公司安徽分公司', '项目东北边约2km学林公园，总规划面积约1600亩。该公园规划为一座生态休闲游乐型公园，结合高教基地特色商业街区，丰富人们的城市生活，构建环境优美开放式的城市空间。项目东南面是月亮湾公园，东起龙岗路、西至大众路，北起长江东路、南至合裕路，利用二十埠河等河流进行打造。本项目邻近瑶海万达、保利广场、瑶海天街，宝业东城广场四大商圈，完美满足吃喝玩乐购一站式消费。', '我们项目周边交通发达，由城市主干道、高架、地铁、高速、高铁、公交线路等立体交通网络组成，出行十分便捷。项目周边有“五纵五横”的城市主干道：东西向长江东路、新安江路（长江东大街）、裕溪路高架、包公大道、临泉东路成“五横”，内接主城，外辐江浙；南北向铜陵路高架、东二环、郎溪路、大众路、龙岗路为“五纵”。项目距离地铁2号线龙岗站直线距离约1.7KM；另外项目西北边1.5km处是轨道交通3号线，距离3号线的星海大道站直线距离约1.5KM、窦桥湾约1.7KM。', 7687, 5, '2021', '202103');
