INSERT INTO `house` VALUES (16593, 0, 0, '2021-05-26 15:50:25', 0, '2021-05-26 16:18:44', 202103010, '尚锦花园', 'G8', ' 8635.20  ', 80, 18699, '经开区繁华大道与宿松路交口', '经开区', '住宅/商业/地库', '洋房、小高层、高层', '合肥中海海荣房地产有限责任公司', '安徽地平线建筑设计有限公司', '中海宏洋物业管理有限公司合肥分公司', '项目毗邻合肥中央公园（规划中），距东南方向南艳湖公园约2.6km，项目自带约1.5万方社区商业配套，距离有信达邻里坊、中海环宇天地商业街约1.5km，生活配套成熟。此外，项目距经开区正大广场、政务区万象城等商业配套群约4km，商业配套齐全。', '项目位城市主干道繁华大道与宿松路交口，项目距离合肥南站、地铁1号线南站南广场站口约2km、绕城高速出入口约4km，区域交通较为便捷。', 7646, 6, '2021', '202103');
INSERT INTO `house` VALUES (16594, 0, 0, '2021-05-26 15:50:25', 0, '2021-05-26 16:18:44', 202103011, '东望雅苑', 'G02#,G15#,G17#,G25#,G26#', ' 31734.78  ', 344, 23149, '合肥市包河区天津路与哈尔滨路交口东南角', '包河区', '住宅', '高层、小高层', '合肥瑞盛房地产开发有限公司', '江苏中和建筑设计有限公司', '招商局物业管理有限公司合肥分公司', '距离项目西侧2公里为万泓中心与世纪金源联手打造的大型购物中心，同时旁边还有一个以宋代建筑风格打造的文化商圈贡街。距离项目东侧约1公里为安凯汽车集团公司医院，项目西侧约2公里为合肥长江医院。项目向西约4公里为骆岗中央公园，往东是国家4A级旅游景区-大圩生态农业旅游景区.', '项目位于包河区哈尔滨路与天津路交口东南角，地处包河中轴的枢纽位置，交通非常便利，形成了“三横四纵双轨道”的立体式交通路网，三横即繁华大道、绕城高速、龙川路， 四纵即南淝河路、天津路、上海路、包河大道 。 三轨道即地铁4号线（在建中）、5号线。', 7664, 6, '2021', '202103');
