INSERT INTO `house` VALUES (16609, 0, 0, '2021-05-26 15:50:26', 0, '2021-05-26 16:18:51', 202012043, '美科公馆', '18,19,20,21,22,23,26', ' 41000.58  ', 380, 14500, '淮海大道与相城路交口西南角', '新站区', '住宅', '高层、少量沿街商业', '合肥金骏美合房地产开发有限公司', '成都基准方中', '金科智慧服务有限公司', '学校资源：本项目自带15班幼儿园规划、规划新九中与项目一路之隔； 商超：项目自带6栋沿街商业的规划，可以满足日常的生活消费，职教城商圈还拥有黉街、磨店街、百大商业广场等成熟配套； 医院：坐拥三所大型专业医疗机构，分别是安徽医科大学第四附属医院、安徽首家数字化全科医院（京东方医院）、安徽中医药大学中西医结合医院。', '本项目是多维立体化交通，本项目通过淮海大道、大众路的紧密连接，交通通达性强，地铁3号线始发站相城路站位于小区东北角，可直转地铁1号线和2号线，有效连接与主城区各个区域，交通便捷度高。', 7481, 8, '2020', '202012');
INSERT INTO `house` VALUES (16610, 0, 0, '2021-05-26 15:50:26', 0, '2021-05-26 16:18:52', 202101055, '花海雅居', '8,9,11,12', ' 28788.16  ', 248, 19497, '东临皖山路，西至雪霁路，北侧为天狮路，南侧为规划支路', '蜀山区', '住宅', '小高层洋房', '合肥溯源房地产开发有限公司', '北京建谊高能建筑设计研究院有限公司', '浙江佳源物业服务集团有限公司', '佳源·花海印象，坐拥合肥环蜀山板块，区域内拥有得天独厚的生态资源，（约）8500亩国家森林公园、（约）4667公顷董铺湖、（约）2944亩四季花海环伺左右， 同时紧邻安徽第一路——长江路，地铁2号线（振兴路站）在侧，向西可并入绕城高速、机场高速，向东直抵老城区，可满足不同人群多样的出行方式；项目拥有12班自建幼儿园、乐农小学及五十中东校（蜀山中学）等优质教育资源环绕；自建邻里中心、奥园城市天地、半边街、砂之船奥特莱斯、祥源银泰城毗邻左右，集休闲、购物、餐饮、娱乐等多重繁华于一体，轻松满足吃、喝、玩、乐、购；市一院（西区）、安医附院（高新分院）临近周边，醇熟完善的医疗配套，将为我们的幸福生活保驾护航。', '交通：公交车56路、533路、650路可直达项目附近，步行可到达本项目； 地铁：2号线可到振兴路站下，步行可到达本项目', 7609, 8, '2021', '202101');
INSERT INTO `house` VALUES (16611, 0, 0, '2021-05-26 15:50:26', 0, '2021-05-26 16:18:53', 202101054, '云境景轩', '15,16,17,18,19,20', ' 29197.85  ', 176, 25698, '合肥市庐阳区北松路以东、紫兰街以北', '庐阳区', '住宅，商业，车位等', '多层、小高层', '合肥祥创置业有限公司', '上海天华建筑设计有限公司', '浙江祥生物业服务有限公司', '配套成熟：周边三公里内，商业、教育、医疗资源具备； 生态优越：紧邻大房郢水库、四里河，且有四里河公园、庐州公园等大型市政公园，生态景观资源优越。', '项目位于合肥市庐阳区，庐阳区是合肥的行政中心、经济中心、文化中心，人口聚集度高，配套成熟，拥有全市最好的商业、医 疗及教育资源。地块位于庐阳区四里河板块与老城板块交界之处，受两大板块优质资源的双重辐射', 7591, 8, '2021', '202101');
INSERT INTO `house` VALUES (16612, 0, 0, '2021-05-26 15:50:26', 0, '2021-05-26 16:18:53', 202101064, '云栖雅苑', 'B3#,B5#,B6#,B11#', ' 22540.82  ', 226, 13399, '瑶海区戚继光路以东、程士范路以南', '瑶海区', '住宅', '小高层', '合肥瑜阳房地产开发有限公司', '广州市天作建筑规划设计有限公司', '安徽省文一物业管理有限公司', '? 学区配套：家门口市政配套幼儿园（规划中），皇马花园幼儿园，合肥市琥珀名城小学(明皇路校区)，合肥市五十五中东校区（原龙岗中学）； ? 商业配套：距在建的瑶海天街（预计年底开业） 约1.5公里，同时保利广场和瑶海万达广场环伺， 1公里范围内有满天星购物中心、永辉超市，2公里范围内有百思购，3公里范围内有万欢购物广场和大润发购物广场； ? 医疗配套：板桥河东边为医疗用地（规划中），1.5公里范围广慈医院，2公里龙岗医院，5公里范围内合肥市第二人民医院； ? 生活休闲配套：南边市场配套公园（规划中），瑞泰公园，华凌游园； ', '距离项目1.5公里处地铁2号线王岗站，便捷全城；地块700米以内的王岗路公交车站有2、146、154、502路公交，花神郢公交车站有39、508等多条公交路线', 7580, 8, '2021', '202101');
INSERT INTO `house` VALUES (16613, 0, 0, '2021-05-26 15:50:26', 0, '2021-05-26 16:18:54', 202101041, '云境景轩', '1,2,13', ' 16344.49  ', 138, 23198, '合肥市庐阳区北松路以东、紫兰街以北', '庐阳区', '住宅，商业，车位等', '多层、小高层', '合肥祥创置业有限公司', '上海天华建筑设计有限公司', '浙江祥生物业服务有限公司', '配套成熟：周边三公里内，商业、教育、医疗资源具备； 生态优越：紧邻大房郢水库、四里河，且有四里河公园、庐州公园等大型市政公园，生态景观资源优越。', '项目位于合肥市庐阳区，庐阳区是合肥的行政中心、经济中心、文化中心，人口聚集度高，配套成熟，拥有全市最好的商业、医 疗及教育资源。地块位于庐阳区四里河板块与老城板块交界之处，受两大板块优质资源的双重辐射', 7590, 8, '2021', '202101');
INSERT INTO `house` VALUES (16614, 0, 0, '2021-05-26 15:50:26', 0, '2021-05-26 16:18:54', 202101051, '翰林天筑小区', '9#,12#', ' 14657.01  ', 108, 16698, '新安江路与大众路交口东北角', '瑶海区', '住宅', '高层、小高层', '安徽建工地产有限公司', '上海柏涛建筑设计有限公司', '安徽绿城物业管理有限公司', '优质学区：和平路小学三小、38中东校区和新十中已入驻，项目北侧规划有12班的公立幼儿园，另外有9年义务教育用地。 生态环境方面：瑶海湾湿地公园，20万方的月亮湾公园已投入使用，还有街头游园如龙岗游园，思潮游园，项目西南角游园。 商业环境方面：龙湖天街、保利广场、宝业东城广场，瑶海万达距离项目近在咫尺。 医疗资源方面：合肥市新二院，妇幼保健院东区，静安医院，在建的上海长海医院', '“五横”“五纵”十条主干道的完善交通网，“五横”分别为包公大道、临泉东路、长江东路、新安江路和裕溪路高架；“五纵”分别为铜陵路高架、东二环当涂路、郎溪路、龙岗路和大众路。轨道交通方面，地铁2号线。', 7601, 8, '2021', '202101');
INSERT INTO `house` VALUES (16615, 0, 0, '2021-05-26 15:50:26', 0, '2021-05-26 16:18:55', 202101052, '云琅花园', '5#,7#,15#', ' 21330.78  ', 184, 21749, '龙川路与棠樾路交口', '包河区', '住宅', '小高层', '安徽瑞正置业有限公司', '上海天华建筑设计有限公司', '河南宏港物业服务有限公司', '【商业】沿线分布加侨国际广场、星隆购物广场、万达广场等多个成熟商业，购物、休闲、娱乐应有尽有。淝河新中心商圈是政府重点打造的集生态、科技、商业和文化为一体的综合性商圈 【教育】项目周边两公里，共计有幼儿园8所项目北边有屯溪路小学龙川路校区、西北侧有四十八中，另有合肥实验学校、合肥大地中学等多所学校 【医疗】省儿童医院、友好医院、妇幼保健院项目北侧规划合肥市中医院和合肥市第三人民医院新区，将打造包河区亿元走廊，为您和家人健康保驾护航。 【景观生态】南淝河生态景观带、高铁沿线郊野绿廊，实现300米见绿，500米见园淝河智慧生态公园、1.3万方绿轴公园', '项目周边拥有3条地铁线（分别为地铁一号线、地铁四号线以及地铁五号线）其中4号线花山路站与本项目距离约700米，随着合肥轨道交通的不断发展，未来业主将可以用最短的时间通达全城各个区域。道路交通方面，项目被“四纵两横”城市主干道围绕，四纵为徽州大道、包河大道、上海路及北京路，可快速到达老城区、滨湖新区。二横为南二环、龙川路，可快速到达政务区、经开区；四通八达的交通路网完美地保障了未来业主的便捷出行。', 7565, 8, '2021', '202101');
INSERT INTO `house` VALUES (16616, 0, 0, '2021-05-26 15:50:26', 0, '2021-05-26 16:18:55', 202101042, '锦徽园', 'A2,A3', ' 14716.52  ', 140, 21685, '包河区祁门路以南、徽州大道以西锦徽园', '包河区', '住宅', '小高层、洋房', '合肥业诺置业有限公司', '上海沪张思建筑规划设计事务所（有限合伙）', '重庆华宇第一太平戴维斯物业服务集团有限公司', '“四横三纵”城市主干道围绕，四横为南二环、祁门路、龙川路、繁华大道，可快速到达政务区、经开区；三纵为徽州大道、包河大道、宏图路，可快速到达老及城区、滨湖新区,附近有望湖城生态公园及加侨中心商业圈。', '公交1、108、116路，地铁4、5号线', 7592, 8, '2021', '202101');
INSERT INTO `house` VALUES (16617, 0, 0, '2021-05-26 15:50:26', 0, '2021-05-26 16:18:56', 202101043, '和锦南园', 'G2,G3', ' 15652.24  ', 136, 25213, '滨湖区上海路以东、紫云路以北', '滨湖区', '住宅，商业', '洋房、小高层、高层', '合肥和禹房地产开发有限公司', '安徽地平线建筑设计有限公司', '保利物业发展股份有限公司安徽分公司', '项目自建约5000㎡社区商业，一路之隔为在建的招商花漫里商业街区，3公里范围内有百大心悦城、悦方IDMALL等商业综合体；自建2座21班幼儿园，02地块西南侧规划学校用地；临近在建的省立医院总院；享十五里河公园、方兴湖公园等景观。', '西侧上海路，南侧紫云路；紧邻在建的地铁5号线与规划的地铁7号线交汇站“紫云路”站，靠近在建的地铁5号线“扬子江路”站。', 7597, 8, '2021', '202101');
INSERT INTO `house` VALUES (16618, 0, 0, '2021-05-26 15:50:26', 0, '2021-05-26 16:18:56', 202101044, '和锦东园', 'G9,G10,G11,G12', ' 32349.68  ', 282, 25213, '上海路以东，紫云路以北', '滨湖区', '住宅，商业 ', '洋房、小高层、高层 ', '合肥和禹房地产开发有限公司', '安徽地平线建筑设计有限公司', '保利物业发展股份有限公司安徽分公司', '项目自建约5000㎡社区商业，一路之隔为在建的招商花漫里商业街区，3公里范围内有百大心悦城、悦方IDMALL等商业综合体；自建2座21班幼儿园，02地块西南侧规划学校用地；临近在建的省立医院总院；享十五里河公园、方兴湖公园等景观。', '西侧上海路，南侧紫云路；紧邻在建的地铁5号线与规划的地铁7号线交汇站“紫云路”站，靠近在建的地铁5号线“扬子江路”站。', 7598, 8, '2021', '202101');
INSERT INTO `house` VALUES (16619, 0, 0, '2021-05-26 15:50:27', 0, '2021-05-26 16:18:57', 202101045, '柏嘉公馆', 'Y1,Y2,Y3,Y6,Y7,Y9,Y10,Y12,Y13', ' 27309.11  ', 224, 13962, '合肥市新站区东至大众路，南至涣水路、西至烈山路、北邻岱河路', '新站区', '住宅、配套商业', '高层住宅、低层洋房、配套商业 ', '绿地集团合肥美湖置业有限公司', '华东建筑设计研究院有限公司', '长城物业集团股份有限公司', '寿春中学、园上园小学等优教簇拥；近享磨店商业街、百大商业广场、黉街等商业配套，自带1500㎡社区菁英商街', '周边拥有多条公交线路，40路（刘大郢站）、303路（安徽粮食学院站）、304路（安徽粮食学院站）、301路（梦溪小城站）等，紧邻地铁3号线（岱河路站）', 7566, 9, '2021', '202101');
INSERT INTO `house` VALUES (16620, 0, 0, '2021-05-26 15:50:27', 0, '2021-05-26 16:18:57', 202101016, '文一塘溪津门', '48', ' 3754.34  ', 20, 26303, '滨湖新区包河大道与杭州路交口', '滨湖区', '住宅', '高层、洋房', '安徽省文一投资控股集团滨江置业有限公司', '北京高能筑博建筑设计有限公司', '安徽省文一物业管理有限公司', '环境：项目紧邻方兴湖和巢湖两大水系，同时为塘西河公园、金斗公园、方兴湖公园和岸上草原所环抱，公园面积高达万亩。商业：项目自持近10万方的文化商业街，打造合肥城市会客厅。此外，南接万达文旅城和恒大中心，东邻银泰中心和中心书城，北连悦方IDmall和世纪金源，众多商业中心伺散。学区：项目南面沿云谷路建有幼儿园和小学。同时一中、四十八中、四十六中和师范附小等名校坐落周边，教育资源得天独厚。医疗：滨湖医院距离项目仅4公里。省立医院总部正在规划筹建，位于项目北侧，相距不过5分钟车程。旅游：万达文化旅游城、牛角大圩生态旅游区、滨湖湿地公园、巢湖岸边的岸上草原、滨湖十大省级文化场馆，加上会申报国家AAAA级景区的塘溪津门水街将，形成一片完整的环巢湖旅游带。', '项目交通状况用“一环二铁三纵四横”来概括。“一环”，即环巢湖大道，被誉为“合肥最美道路”之一。沿线向东可达巢湖城区，向西达国家AAAAA级风景区——三河古镇。“二铁”，指高铁南站和三条地铁线。高铁南站距项目约10公里，借此可达省外；其次项目紧邻三条地铁，1号线已开通营运，由滨湖新区直达合肥火车站，是合肥南北向交通的主动脉，距项目最近的云谷路站约为1.1公里；5号线已经开建，其东史岗路站与华山路站与项目无缝对接。S1号线，途经新桥机场、新高铁西站、高铁南站最终抵达巢湖岸边，将于项目东南角设站。“三纵”指三条南北向主干道——徽州大道、庐州大道和包河大道，连接滨湖新区与老城核心。“四横 ”为锦绣大道、紫云路、方兴大道和云谷路，贯穿滨湖新区和经开区。沿方兴大道向西驱车10分钟可上京台高速，30分钟可达机场高速入口，构成全方位、立体化的交通体系网，通达四周。', 7555, 9, '2021', '202101');
INSERT INTO `house` VALUES (16621, 0, 0, '2021-05-26 15:50:27', 0, '2021-05-26 16:18:57', 202012042, '琥珀晴川里', '3#,7#,8#,11#,12#,15#,16#,19#', ' 41657.10  ', 256, 21749, '上海路东大圩路北', '包河区', '住宅', '小高层、洋房', '合肥城建发展股份有限公司', '安徽地平线建筑设计有限公司', '安徽琥珀物业服务有限公司', '周边配套：目前项目中小学配套有西安路学校（实验学校）、黄河路小学、合肥上海外国语学校 综合商场：悦方IDmall、百大心悦城、滨湖银泰城、茶里水街、禾润阳光购物广场 医院：滨湖医院、项目南侧安徽省立医院滨湖总部在建 银行：中国银行（花园大道自助），徽商银行（延安路自助），交通银行（北京路支行），邮政储蓄银行（晓星营业厅）', '交通状况：公交：517路公交车 地铁：5号线黄河路站，花园大道站（预计2021年开通使用） 主干道：双向8车道上海路、包河大道、锦绣大道', 7513, 9, '2020', '202012');
INSERT INTO `house` VALUES (16622, 0, 0, '2021-05-26 15:50:27', 0, '2021-05-26 16:18:58', 202101017, '雅学苑', '16,23,25', ' 12246.63  ', 96, 14399, '合肥市新站区卧龙湖路与龙子湖路交口', '新站区', '住宅', '小高层、洋房', '合肥雅坤房地产开发有限公司', '成都基准方中建筑设计有限公司', '雅居乐雅生活服务股份有限公司', '康桥学校', '东至：卧龙湖路 南至：用地界线 西至：规划康桥路 北至：龙子湖路', 7576, 9, '2021', '202101');
