INSERT INTO `house` VALUES (16625, 0, 0, '2021-05-26 15:50:27', 0, '2021-05-26 16:18:59', 202101010, '湖畔诚园', 'Y23,Y25,Y26,Y27,Y28,Y29,Y30,Y31,Y32', ' 38761.44  ', 220, 23999, '合肥市滨湖新区大理路与嘉陵江路交口西南角', '滨湖区', '住宅', '高层，洋房', '安徽绿隽置业有限公司', '安徽省人防建筑设计研究院/中铁合肥建筑市政工程设计研究院有限公司', '绿城物业', '商业有世纪金源购物中心、文旅城、银泰城、联投中心、百大、奥特莱斯购物中心、公元天下，还有近10万方商业；有 21家金融机构的总部及金融基地落户；本项目幼儿园、小学、初中、高中环绕，15年全龄教育配套，一站式配齐，毗校而居，为孩子的未来保驾护航；拥有六大公园环绕三大旅游胜地。', '滨湖区域内的道路呈井字型有序排布，交通“五纵五横一环” “双地铁” “一高铁一高速”来形容【五纵：四川路、徽州大道、庐州大道、包河大道高架、上海路（在建）五横：锦绣大道、紫云路、方兴大道、云谷路、珠江路（待建）一环：环湖北路】、“双地铁” 地铁1号线（距离站点约900m、地铁5号线距离站点约500m）（高铁南站、京台高速）：纵向四川路全程2.2公里，双向6车道，未来是联通金融板块的主干道之一。', 7434, 9, '2021', '202101');
INSERT INTO `house` VALUES (16626, 0, 0, '2021-05-26 15:50:27', 0, '2021-05-26 16:18:59', 202101011, '双湖公馆', '37#,38#,39#', ' 9406.77  ', 74, 15013, '合肥市庐阳区合淮路以东、文广路以北', '庐阳区', '普通住宅', '高层住宅、小高层、洋房', '合肥碧腾房地产有限公司', '广东博意建筑设计研究院有限公司', '广东碧桂园物业服务有限公司庐阳分公司', '项目周边商业配套成熟完善，紧邻本项目的大型商业体有明发商业广场、万科汇、汇银广场，里面拥有永辉超市、港荣百货、金逸影城，餐饮、银行等配套，购物休闲娱乐应有尽有，基本满足您的日常生活需求，全方位满足您的生活需求。', '四里河路、北一环、西二环、潜山路、长江西路四里河路、东至湖畔路，西至合淮路，南至文广路，北至草堂路，距离高速入口9.8公里，合肥老城区7.6公里。', 7557, 9, '2021', '202101');
