INSERT INTO `house` VALUES (16629, 0, 0, '2021-05-26 15:50:27', 0, '2021-05-26 16:19:01', 202103021, '鸿学府', '1,7,8', ' 32447.77  ', 284, 22013, '蜀山区龙河路与肥西路交口西南角', '蜀山区', '普通住宅', '高层、小高层、洋房', '安徽大富至诚房地产开发有限公司', '国华工程科技（集团）有限责任公司', '安徽大富物业管理有限公司', '项目位于蜀山区，临近安徽大学龙河校区，2.5公里范围内有之心城、国购广场、华润五彩城、百大CBD等，附近有安医第一附属医院、中医院、普瑞眼科医院，配套完善。', '周边有黄山路、南一环路、金寨路高架、合作化路高架几条城市主干线路，附近有119、125、102、103、108、10、118、121、125、129、149、158、162、56路等14条公交线路，临近地铁2号线与规划地铁9号线，交通便利。', 7546, 10, '2021', '202103');
INSERT INTO `house` VALUES (16630, 0, 0, '2021-05-26 15:50:27', 0, '2021-05-26 16:19:02', 202101004, '和水雅居', '1,2,6,7', ' 19175.92  ', 160, 13997, '项王路和卧龙湖路交口', '新站区', '住宅', '小高层、洋房', '合肥茂旸置业有限公司', '上海方大建筑设计事务所', '优居美家物业服务有限责任公司合肥分公司', '紧邻项目西侧规划的 254 地块未来会设有一个大型的 商业中心，配备不少于 150间客房的星级酒店和 5 万方的街区商业。东方大道与铜陵北路交口还规划一个 5 万方左右的地铁商业，如果您想感受下民族文化氛围，项目周边 2km 左右范围内，有极具特色的 1500 米磨店老街、百大商业广场，拓基广场、黉街和文一陶冲湖城市广场商业圈，包含购物广场、超市、影院等商业配套亦可满足您的日常需求。如果您想去稍微远一点的商场，从新蚌埠路 15 分钟左右可以直达武里山天街、家天下生活广场；30 分钟左右车程即可到达瑶海万达、宝业东城广场、保利广场商圈，满足吃、喝、玩、乐、购一站式购物需求。 学区配套： 项目西北角配备了一个面积达 4500 ㎡的 15班幼儿园，也是作为公立幼儿园的最高标准建设的，东南 1.2 公里左右的庆平学校是由红军战士王庆平的名字命名的，可以说也是红色教育基地，是目前新站最大的公办学校，师资力量也是非常优秀的，同时也是安徽省最大的图书馆流通网点，有利于孩子的成长。项目 1 公里左右还有规划的少荃小学，为孩子提供更好的国际化教育，项目南侧 700 米左右的台湾康桥国际学校更是拥有从幼儿园到高中的一站式国际化教育服务。 医疗配套： 新站区最好的两个医院距离本项目均在10分钟左右车程。安医大第四附属医院，它是省城东北部第一家三甲级医院。以及安徽首家数字化全科医院，京东方数字医院，这是北上广等一线城市才会有的数字化医院，整个医院投资32个亿，并于19年3月21日已经正式开诊。', '项目位于东方大道与卧龙湖路交口，东接合肥东城新区，西与庐阳相通，北连北部新城，南与市区无缝对接。项目周边道路四通八达，形成三横三纵一地铁三维立体交通网，出行十分便捷。三横为魏武路、东方大道、淮海大道，三纵为新蚌埠路、铜陵北路、文忠路。由东方大道到新蚌埠路上三十头绕城高速，迅速到达省内外；而新蚌埠路向南可以到达老城区步行街银泰；而临近项目的铜陵北路高架则是合肥未来最长的一条高架（预计 2021 年通车），到达滨湖融创茂也只需要 30 分钟左右的车程，同时它可以连接包河，滨湖，政务，经开等主要区域。 地铁配套：地铁 4 号线（地铁 4 号线北起新站，途经政务区天鹅湖，西至高新区，预计 2021 年 12月通车），首发站东方大道站距离项目仅 300 米，步行5分钟左右即可到达！可以说是我们最纯正的地铁房，未来的 4 号线可以无缝对接合肥1-2-3-5 等多条地铁线路，让您可以畅通合肥的各个角落，地铁4号线预计2021年1月通车；公交配套：项目周边有 681 路、686 路，直接连通火车站和市区方向，可以快速到达老城区。', 7549, 10, '2021', '202101');
INSERT INTO `house` VALUES (16631, 0, 0, '2021-05-26 15:50:27', 0, '2021-05-26 16:19:02', 202101050, '领峰花园', 'C-2#,C-10#,C-11#', ' 11195.03  ', 90, 21207, '龙川路与历口路交口', '包河区', '住宅 商业 办公', '高层 小高层 洋房', '合肥金玖房地产开发有限公司', '安徽寰宇建筑设计院 ', '上海金地物业服务有限公司', '加侨国际广场、百大合家福购物广场、自建约4万方办公商业、代建1.3万方公园绿地。附近有淝河中央公园、淝河生态公园、南淝河生态公园、合肥中央公园。', '周边公交线路与地铁线路均可抵达本项目，公交线路为101路、122路、9路、138路；地铁线路为四号线花山路站（规划建设中）；马鞍山路高架；高铁南站。', 7552, 10, '2021', '202101');
INSERT INTO `house` VALUES (16632, 0, 0, '2021-05-26 15:50:27', 0, '2021-05-26 16:19:03', 202101005, '新悦里', 'Y07,Y08,Y09,Y10', ' 21325.35  ', 198, 12995, '新站高新区铜陵北路与项王东路交口东南角', '瑶海区', '住宅', '高层 小高层', '合肥皖投东方置业有限公司', '上海尤安建筑设计股份有限公司', '安徽外滩物业有限公司', '项目拟开发7栋商业，总建面约14500平方米。另外其中2栋商业楼，1栋商业上盖酒店，建面约9000平方米，规划内需建设客房数不少于150间的酒店，并全部自持。1栋商业上盖办公，建面约8100平方米。1栋独栋睦邻中心，建面约4500平方米。', '新悦里项目位于新站高新区铜陵北路以东、项王东路以南，紧邻在建地铁4号线始发站东方大道站，面积124.14亩，总建面20万方，规划用途为居住、商业用地，其中居住94.38亩，容积率≤1.8，总建面约15万方，商业29.77亩，容积率≤2.0，总建面约5万方。', 7537, 10, '2021', '202101');
INSERT INTO `house` VALUES (16633, 0, 0, '2021-05-26 15:50:27', 0, '2021-05-26 16:19:04', 202101048, '翰林天筑小区', '1#,4#,7#', ' 22282.99  ', 164, 16698, '新安江路与大众路交口东北角', '瑶海区', '住宅', '高层、小高层', '安徽建工地产有限公司', '上海柏涛建筑设计有限公司', '安徽绿城物业管理有限公司', '优质学区：和平路小学三小、38中东校区和新十中已入驻，项目北侧规划有12班的公立幼儿园，另外有9年义务教育用地。 生态环境方面：瑶海湾湿地公园，20万方的月亮湾公园已投入使用，还有街头游园如龙岗游园，思潮游园，项目西南角游园。 商业环境方面：龙湖天街、保利广场、宝业东城广场，瑶海万达距离项目近在咫尺。 医疗资源方面：合肥市新二院，妇幼保健院东区，静安医院，在建的上海长海医院', '“五横”“五纵”十条主干道的完善交通网，“五横”分别为包公大道、临泉东路、长江东路、新安江路和裕溪路高架；“五纵”分别为铜陵路高架、东二环当涂路、郎溪路、龙岗路和大众路。轨道交通方面，地铁2号线。', 7528, 10, '2021', '202101');
