INSERT INTO `house` VALUES (16668, 0, 0, '2021-05-26 15:50:29', 0, '2021-05-26 16:19:21', 202012006, '卓锦园', 'C18,C21', ' 7704.48  ', 64, 20997, '合肥市包河区花园大道与重庆路交口', '包河区', '住宅', '高层、小高层、洋房', '合肥瑞钰置业有限公司', '上海尤安建筑设计院有限公司、安徽地平线建筑设计有限公司', '重庆华宇第一太平戴维斯物业服务集团有限公司', '项目临近地铁5号线花园大道站，位居省府之北，坐拥上海路、北京路、包河大道、繁华大道、锦绣大道等立体交通路网，无缝衔接合肥未来最具魅力的城市新空间、环巢湖国家级科创大走廊的核心区。周边滨湖国家森林公园、十五里河公园、骆岗中央公园三大公园环伺，生态资源丰富。', '', 7458, 13, '2020', '202012');
INSERT INTO `house` VALUES (16669, 0, 0, '2021-05-26 15:50:29', 0, '2021-05-26 16:19:22', 202012005, '和枫雅园', 'Y13#,Y19#,Y20#', ' 11508.08  ', 84, 22194, '合肥市经济技术开发区宿松路以东、规划支路以北', '经开区', '住宅', '高层、小高层、洋房', '合肥居峰置业有限公司', '安徽省城建设计研究总院股份有限公司 / 华东建筑设计研究院有限公司', '招商局物业管理有限公司合肥分公司', '周边3公里范围内有华润万象城、银泰、万达、正大广场等高端商业，此外距离刚刚签约的华润万象天地约1公里左右，商业配套成熟。距离海恒商业街、海恒农贸市场，日之惠等约1.6公里，生活便利。距离巨无霸“中央公园”仅约1.7公里，尽享中央公园的发展红利。同时中央公园也是天然氧吧，还有十五里河环绕，生态宜人。', '项目位于经开区宿松路与坝下路交口往北100米，位于政务东，中央公园旁，土地资源稀缺，发展潜力无限。距离1号线南站南广场站直线距离约2公里，未来还有4号线（在建），S1号线（规划中）汇聚于此，近距离享受地铁时代的便利。', 7441, 14, '2020', '202012');
INSERT INTO `house` VALUES (16670, 0, 0, '2021-05-26 15:50:29', 0, '2021-05-26 16:19:22', 202012008, '乐悦湾', '6,9,11', ' 12713.32  ', 132, 12999, '新站区天水路以南九顶山路以西', '新站区', '住宅', '小高层', '合肥瀚德房地产开发有限公司', '启迪设计集团股份有限公司', '安徽乐富强物业管理有限公司', '1、商业配套：项目配建综合社区中心，附近有宜家超市、宝湾国际建材家居城、武里山天街。2、医疗配套：安徽省第二人民医院、长荣医院。3、教育配套：淮合花园幼儿园、小学、中学。', '项目位于三条城市主干道九顶山路与淮南路交口东北角，天水路西侧，出门即有多条公交线，距离地铁1号线延长线和阜阳北路高架仅5分钟车程，距离北二环仅3分钟车程，交通便利，通达性极强。', 7445, 14, '2020', '202012');
INSERT INTO `house` VALUES (16671, 0, 0, '2021-05-26 15:50:29', 0, '2021-05-26 16:19:23', 202012015, '瑞禧园', '19#,22#', ' 12559.13  ', 80, 21749, '合肥市包河区合巢路以北、马鞍山路以西', '包河区', '小高层；洋房', '剪力墙', '安徽汇和置业有限公司', '柏涛建筑设计（深圳）有限公司', '安徽信联物业服务有限公司', '商业配套：此处生活氛围浓厚醇熟，罍街、后街，5分钟即可到达，一路之隔就是百大购物中心，绿地缤纷城等城市综合体，除此之外，开车五、十分钟车程（地铁三站路）即可到达银泰中心或包河万达商圈。 教育配套：作为积累多年的主城区核心位置，占据最优质的学区资源：项目自建二十四班制的幼儿园，周边卫岗小学、六十五中、三十二中、合工大、中科大. 医疗配套：项目周边医疗资源十分丰富，西向是合肥市第二人民医院、合肥市第三人民医院，还可以快速的抵达安医附院、省立医院，10分钟左右即可到达安徽省儿童医院等，众多大型三级甲等综合性医院环伺。', '公共交通：项目紧邻地铁1号线(秋浦河路站)相距百米，下楼举步即达，同时与合肥2号线、在建3、4、5号线都有交汇换成站，周边还有一条规划6号线地铁，届时将形成米字型地铁交通网。项目周边有多条公交线路：51路、99路、109路、138路、515路、902路、B7路等； 道路交通：坐拥便捷多元的立体交通，路网四通八达，项目被“三横三纵”城市主干道围绕：三横为南二环、南一环、望江路，三条主干道贯穿东西，连接合肥城市路网，三纵为徽州大道、马鞍山路、东二环（郎溪路），立体的交通网络，快速通达主城区各个区域，四通八达的交通路网完美地保障了未来业主的出行.', 7190, 14, '2020', '202012');
