INSERT INTO `house` VALUES (16674, 0, 0, '2021-05-26 15:50:29', 0, '2021-05-26 16:19:25', 202011047, '悦融湾', '3,5', ' 7338.30  ', 52, 20997, '合肥市包河区河南路与西安路交口西北角', '包河区', '住宅', '高层、洋房', '合肥乐富强房地产开发有限公司', '安徽地平线建筑设计有限公司', '安徽乐富强物业管理有限公司', '周边配套：自然资源：十五里河景观带、中央公园、巢湖、滨湖国家森林公园、方兴湖、塘西河公园； 商业配套：自带的约13万方综合体、百大心悦城、世纪金源、悦方MALL、世纪金源万泓中心； 医疗配套：安徽省立医院总部、长海医院合肥分院等； 教育配套：黄河路小学，合肥实验中学，上海外国语学校', '交通路网：临近花园大道、上海路、包河大道、繁华大道等交通主干道； 轨道交通：建设中5号线（花园大道站）； 公交路线：902、141、B5、B7等', 7320, 14, '2020', '202011');
INSERT INTO `house` VALUES (16675, 0, 0, '2021-05-26 15:50:29', 0, '2021-05-26 16:19:25', 202011046, '文宸苑', '3,5,7,10,12,13,16', ' 36412.44  ', 360, 17199, '高新区将军岭路与磨子潭路交口东南角', '高新区', '住宅', '小高层', '合肥瀚博房地产开发有限公司', '华东建筑设计研究院有限公司', '安徽乐富强物业管理有限公司', '1、商业配套：附近有砂之船奥特莱斯、银泰。2、医疗配套：安徽医科大学高新分院、妇幼保健院西区。3、教育配套：自建幼儿园、初中，项目对面即是小学。', '项目位于高新区长江西路与将军岭路交口向北300米，临近地铁2号线、合六轻轨，附近有3条公交线，交通便利。', 7407, 14, '2020', '202011');
INSERT INTO `house` VALUES (16676, 0, 0, '2021-05-26 15:50:29', 0, '2021-05-26 16:19:25', 202011039, '空港城', '（4号地块）35幢,（4号地块）38幢,（4号地块）41幢,（4号地块）45幢,（4号地块）49幢,（4号地块）51幢,（4号地块）56幢,（4号地块）1幢,（4号地块）2幢,（4号地块）3幢,（4号地块）5幢,（4号地块）6幢,（4号地块）7幢,（4号地块）8幢,（4号地块）9幢,（4号地块）10幢,（4号地块）11幢,（4号地块）12幢,（4号地块）15幢,（4号地块）16幢,（4号地块）17幢,（4号地块）19幢,（4号地块）20幢,（4号地块）21幢,（4号地块）22幢,（4号地块）23幢,（4号地块）25幢,（4号地块）29幢,（4号地块）32幢', ' 99731.22  ', 879, 9848, '经开区东自启德路，....南起花莲路，北邻宝安路。（宝教寺路西、施水路南）空港城（4号地块）', '经开区', '住宅', '小高层、洋房', '合肥华侨城实业发展有限公司', '上海联创设计集团有限公司', '华侨城物业(集团)有限公司', '项目周边生态配套丰富，享受宝教寺湖及焦湖两湖景观资源，紧邻空港国际小镇中央绿轴自然资源；周边未来即将建成大型商业、商务办公、星级酒店、展示中心、教育学校等生活工作配套，日常所需一应俱全。', '项目距离紧邻空港经济示范区核心主干道启德路与宝安路，交通便利；紧邻规划地铁S1号线国际小镇站，通达合肥庐阳、蜀山、政务及滨湖区。', 7387, 14, '2020', '202011');
INSERT INTO `house` VALUES (16677, 0, 0, '2021-05-26 15:50:29', 0, '2021-05-26 16:19:26', 202011027, '和水雅居', '9', ' 6682.18  ', 72, 12997, '项王路和卧龙湖路交口', '新站区', '住宅', '小高层、洋房', '合肥茂旸置业有限公司', '上海方大建筑设计事务所', '优居美家物业服务有限责任公司合肥分公司', '紧邻项目西侧规划的 254 地块未来会设有一个大型的 商业中心，配备不少于 150间客房的星级酒店和 5 万方的街区商业。东方大道与铜陵北路交口还规划一个 5 万方左右的地铁商业，如果您想感受下民族文化氛围，项目周边 2km 左右范围内，有极具特色的 1500 米磨店老街、百大商业广场，拓基广场、黉街和文一陶冲湖城市广场商业圈，包含购物广场、超市、影院等商业配套亦可满足您的日常需求。如果您想去稍微远一点的商场，从新蚌埠路 15 分钟左右可以直达武里山天街、家天下生活广场；30 分钟左右车程即可到达瑶海万达、宝业东城广场、保利广场商圈，满足吃、喝、玩、乐、购一站式购物需求。 学区配套： 项目西北角配备了一个面积达 4500 ㎡的 15班幼儿园，也是作为公立幼儿园的最高标准建设的，东南 1.2 公里左右的庆平学校是由红军战士王庆平的名字命名的，可以说也是红色教育基地，是目前新站最大的公办学校，师资力量也是非常优秀的，同时也是安徽省最大的图书馆流通网点，有利于孩子的成长。项目 1 公里左右还有规划的少荃小学，为孩子提供更好的国际化教育，项目南侧 700 米左右的台湾康桥国际学校更是拥有从幼儿园到高中的一站式国际化教育服务。 医疗配套： 新站区最好的两个医院距离本项目均在10分钟左右车程。安医大第四附属医院，它是省城东北部第一家三甲级医院。以及安徽首家数字化全科医院，京东方数字医院，这是北上广等一线城市才会有的数字化医院，整个医院投资32个亿，并于19年3月21日已经正式开诊。', '项目位于东方大道与卧龙湖路交口，东接合肥东城新区，西与庐阳相通，北连北部新城，南与市区无缝对接。项目周边道路四通八达，形成三横三纵一地铁三维立体交通网，出行十分便捷。三横为魏武路、东方大道、淮海大道，三纵为新蚌埠路、铜陵北路、文忠路。由东方大道到新蚌埠路上三十头绕城高速，迅速到达省内外；而新蚌埠路向南可以到达老城区步行街银泰；而临近项目的铜陵北路高架则是合肥未来最长的一条高架（预计 2021 年通车），到达滨湖融创茂也只需要 30 分钟左右的车程，同时它可以连接包河，滨湖，政务，经开等主要区域。 地铁配套：地铁 4 号线（地铁 4 号线北起新站，途经政务区天鹅湖，西至高新区，预计 2021 年 12月通车），首发站东方大道站距离项目仅 300 米，步行5分钟左右即可到达！可以说是我们最纯正的地铁房，未来的 4 号线可以无缝对接合肥1-2-3-5 等多条地铁线路，让您可以畅通合肥的各个角落，地铁4号线预计2021年1月通车；公交配套：项目周边有 681 路、686 路，直接连通火车站和市区方向，可以快速到达老城区。', 7428, 14, '2020', '202011');
INSERT INTO `house` VALUES (16678, 0, 0, '2021-05-26 15:50:29', 0, '2021-05-26 16:19:26', 202011035, '瑞禧园', '18#,21#', ' 16412.86  ', 133, 21735, '合肥市包河区合巢路以北、马鞍山路以西', '包河区', '小高层；洋房', '剪力墙', '安徽汇和置业有限公司', '柏涛建筑设计（深圳）有限公司', '安徽信联物业服务有限公司', '商业配套：此处生活氛围浓厚醇熟，罍街、后街，5分钟即可到达，一路之隔就是百大购物中心，绿地缤纷城等城市综合体，除此之外，开车五、十分钟车程（地铁三站路）即可到达银泰中心或包河万达商圈。 教育配套：作为积累多年的主城区核心位置，占据最优质的学区资源：项目自建二十四班制的幼儿园，周边卫岗小学、六十五中、三十二中、合工大、中科大. 医疗配套：项目周边医疗资源十分丰富，西向是合肥市第二人民医院、合肥市第三人民医院，还可以快速的抵达安医附院、省立医院，10分钟左右即可到达安徽省儿童医院等，众多大型三级甲等综合性医院环伺。', '公共交通：项目紧邻地铁1号线(秋浦河路站)相距百米，下楼举步即达，同时与合肥2号线、在建3、4、5号线都有交汇换成站，周边还有一条规划6号线地铁，届时将形成米字型地铁交通网。项目周边有多条公交线路：51路、99路、109路、138路、515路、902路、B7路等； 道路交通：坐拥便捷多元的立体交通，路网四通八达，项目被“三横三纵”城市主干道围绕：三横为南二环、南一环、望江路，三条主干道贯穿东西，连接合肥城市路网，三纵为徽州大道、马鞍山路、东二环（郎溪路），立体的交通网络，快速通达主城区各个区域，四通八达的交通路网完美地保障了未来业主的出行.', 7187, 14, '2020', '202011');
INSERT INTO `house` VALUES (16679, 0, 0, '2021-05-26 15:50:30', 0, '2021-05-26 16:19:27', 202011022, '檀悦花园', 'G5,Y9', ' 16247.30  ', 116, 24482, '滨湖区包河大道以东，万泉河路路以南', '滨湖区', '一级资质', '高层、小高层、洋房', '合肥光煜房地产开发有限公司', '成都基准方中建筑设计有限公司', '阳光城物业服务有限公司', '商业：世纪金源购物中心、悦方、百大心悦城、利港银河广场、佳源广场等 医疗：在项目东北角在建设安徽省立医院', '四横从北往南分别为锦绣大道、紫云路、方兴大道、云谷路；四纵是从东往西分别为上海路、包河大道、庐州大道、徽州大道；四地铁有现在已经运营的地铁1号线（会展中心站和紫庐站，1号线贯穿合肥南北），已经进入施工阶段地铁5号线（扬子江路，5号线为一条南北向线路，全长32.9公里，共设27座车站，其中有5座轨道交通换乘车站。主要功能是加强主城区与滨湖新区的联系，引导并促进滨湖新区的发展）和规划中的7号线（紫云路站，约300米，7号线贯穿东西城区，主要连接高新区、经开区、滨湖中心）及S1号线（徽富路站，距离项目约400米；地铁S1号线从新桥机场起步，经清溪路附近的新西站交通枢纽，南下与4号线交汇之后，向东南方向前进，在和1号线在合肥南站附近交汇之后，进入滨湖新区，最终抵达巢湖岸边）。沿方兴大道上G3京台高速入口沿六安方向，可快速直达新桥国际机场。公交车：B7/B5/66等', 7372, 15, '2020', '202011');
INSERT INTO `house` VALUES (16680, 0, 0, '2021-05-26 15:50:30', 0, '2021-05-26 16:19:27', 202011023, '檀悦花园', 'Y12,Y11,Y19,Y20,Y21,Y13,Y15,Y16,Y17,Y18', ' 45870.89  ', 272, 25609, '滨湖区包河大道以东，万泉河路路以南', '滨湖区', '一级资质', '高层、小高层、洋房', '合肥光煜房地产开发有限公司', '成都基准方中建筑设计有限公司', '阳光城物业服务有限公司', '商业：世纪金源购物中心、悦方、百大心悦城、利港银河广场、佳源广场等 医疗：在项目东北角在建设安徽省立医院', '四横从北往南分别为锦绣大道、紫云路、方兴大道、云谷路；四纵是从东往西分别为上海路、包河大道、庐州大道、徽州大道；四地铁有现在已经运营的地铁1号线（会展中心站和紫庐站，1号线贯穿合肥南北），已经进入施工阶段地铁5号线（扬子江路，5号线为一条南北向线路，全长32.9公里，共设27座车站，其中有5座轨道交通换乘车站。主要功能是加强主城区与滨湖新区的联系，引导并促进滨湖新区的发展）和规划中的7号线（紫云路站，约300米，7号线贯穿东西城区，主要连接高新区、经开区、滨湖中心）及S1号线（徽富路站，距离项目约400米；地铁S1号线从新桥机场起步，经清溪路附近的新西站交通枢纽，南下与4号线交汇之后，向东南方向前进，在和1号线在合肥南站附近交汇之后，进入滨湖新区，最终抵达巢湖岸边）。沿方兴大道上G3京台高速入口沿六安方向，可快速直达新桥国际机场。公交车：B7/B5/66等', 7373, 15, '2020', '202011');
INSERT INTO `house` VALUES (16681, 0, 0, '2021-05-26 15:50:30', 0, '2021-05-26 16:19:28', 202011028, '双湖公馆', '28#,40#,41#,36#', ' 14125.62  ', 114, 15013, '合肥市庐阳区合淮路以东、文广路以北', '庐阳区', '普通住宅', '高层住宅、小高层、洋房', '合肥碧腾房地产有限公司', '广东博意建筑设计研究院有限公司', '广东碧桂园物业服务有限公司庐阳分公司', '项目周边商业配套成熟完善，紧邻本项目的大型商业体有明发商业广场、万科汇、汇银广场，里面拥有永辉超市、港荣百货、金逸影城，餐饮、银行等配套，购物休闲娱乐应有尽有，基本满足您的日常生活需求，全方位满足您的生活需求。', '四里河路、北一环、西二环、潜山路、长江西路四里河路、东至湖畔路，西至合淮路，南至文广路，北至草堂路，距离高速入口9.8公里，合肥老城区7.6公里。', 7412, 15, '2020', '202011');
INSERT INTO `house` VALUES (16682, 0, 0, '2021-05-26 15:50:30', 0, '2021-05-26 16:19:28', 202011029, '云琅花园', '1#,13#,9#,10#', ' 21770.91  ', 184, 21749, '龙川路与棠樾路交口', '包河区', '住宅', '小高层', '安徽瑞正置业有限公司', '上海天华建筑设计有限公司', '河南宏港物业服务有限公司', '【商业】沿线分布加侨国际广场、星隆购物广场、万达广场等多个成熟商业，购物、休闲、娱乐应有尽有。淝河新中心商圈是政府重点打造的集生态、科技、商业和文化为一体的综合性商圈 【教育】项目周边两公里，共计有幼儿园8所项目北边有屯溪路小学龙川路校区、西北侧有四十八中，另有合肥实验学校、合肥大地中学等多所学校 【医疗】省儿童医院、友好医院、妇幼保健院项目北侧规划合肥市中医院和合肥市第三人民医院新区，将打造包河区亿元走廊，为您和家人健康保驾护航。 【景观生态】南淝河生态景观带、高铁沿线郊野绿廊，实现300米见绿，500米见园淝河智慧生态公园、1.3万方绿轴公园', '项目周边拥有3条地铁线（分别为地铁一号线、地铁四号线以及地铁五号线）其中4号线花山路站与本项目距离约700米，随着合肥轨道交通的不断发展，未来业主将可以用最短的时间通达全城各个区域。道路交通方面，项目被“四纵两横”城市主干道围绕，四纵为徽州大道、包河大道、上海路及北京路，可快速到达老城区、滨湖新区。二横为南二环、龙川路，可快速到达政务区、经开区；四通八达的交通路网完美地保障了未来业主的便捷出行。', 7402, 15, '2020', '202011');
INSERT INTO `house` VALUES (16683, 0, 0, '2021-05-26 15:50:30', 0, '2021-05-26 16:19:28', 202011030, '翡丽东方花园', 'G6', ' 7497.34  ', 72, 13740, '瑶海区半塔北路东、丰乐亭路北', '瑶海区', '住宅', '高层、洋房', '合肥玖叁置业有限公司', '华东建筑设计研究院有限公司', '南京弘阳物业管理有限公司合肥分公司', '项目周边有华联、满天星购物中心等生活超市。附近还有瑶海天街商业综合体、瑶海万达、保利广场。医疗方面有合肥广慈医院，瑶海区龙岗卫生服务站。合肥市第二人民医院。', '项目北边包公大道，南边紧邻临泉路，西边郎溪路，附近不远处就是地铁轨道2号线三十埠站，也有2路、146路、154路、39路等公交线路可供选择。', 7415, 15, '2020', '202011');
INSERT INTO `house` VALUES (16684, 0, 0, '2021-05-26 15:50:30', 0, '2021-05-26 16:19:29', 202011031, '翡丽东方花园', 'G1,G2,G3,G5', ' 36405.33  ', 361, 13198, '瑶海区半塔北路东、丰乐亭路北', '瑶海区', '住宅', '高层、洋房', '合肥玖叁置业有限公司', '华东建筑设计研究院有限公司', '南京弘阳物业管理有限公司合肥分公司', '项目周边有华联、满天星购物中心等生活超市。附近还有瑶海天街商业综合体、瑶海万达、保利广场。医疗方面有合肥广慈医院，瑶海区龙岗卫生服务站。合肥市第二人民医院。', '项目北边包公大道，南边紧邻临泉路，西边郎溪路，附近不远处就是地铁轨道2号线三十埠站，也有2路、146路、154路、39路等公交线路可供选择。', 7414, 15, '2020', '202011');
INSERT INTO `house` VALUES (16685, 0, 0, '2021-05-26 15:50:30', 0, '2021-05-26 16:19:29', 202011018, '郎溪尚里', '2#,7#,17#', ' 18069.59  ', 162, 15349, '郎溪路与明皇路交口', '瑶海区', '住宅', '高层 跃层复式', '合肥泽翔房地产开发有限公司', '上海宝厦建筑设计有限公司', '禹洲物业服务有限公司', '作为瑶海中心，商业配套十分成熟，5分钟车程可到达瑶海万达广场,15分钟车程的保利广场、宝业东城广场。', '毗邻地铁2号线东二十埠站，地铁3号线经三路站（在建中），执掌双轨交通，郎溪路、包公大道等城市主干道环绕周边 小区门口设有303路公交站，同时明皇路设有502路等11条公交线路，出行方便', 7406, 15, '2020', '202011');
INSERT INTO `house` VALUES (16686, 0, 0, '2021-05-26 15:50:30', 0, '2021-05-26 16:19:30', 202011021, '文一塘溪津门', '56,57', ' 9597.95  ', 60, 27152, '滨湖新区包河大道与杭州路交口', '滨湖区', '住宅', '高层、洋房', '安徽省文一投资控股集团滨江置业有限公司', '北京高能筑博建筑设计有限公司', '安徽省文一物业管理有限公司', '环境：项目紧邻方兴湖和巢湖两大水系，同时为塘西河公园、金斗公园、方兴湖公园和岸上草原所环抱，公园面积高达万亩。商业：项目自持近10万方的文化商业街，打造合肥城市会客厅。此外，南接万达文旅城和恒大中心，东邻银泰中心和中心书城，北连悦方IDmall和世纪金源，众多商业中心伺散。学区：项目南面沿云谷路建有幼儿园和小学。同时一中、四十八中、四十六中和师范附小等名校坐落周边，教育资源得天独厚。医疗：滨湖医院距离项目仅4公里。省立医院总部正在规划筹建，位于项目北侧，相距不过5分钟车程。旅游：万达文化旅游城、牛角大圩生态旅游区、滨湖湿地公园、巢湖岸边的岸上草原、滨湖十大省级文化场馆，加上会申报国家AAAA级景区的塘溪津门水街将，形成一片完整的环巢湖旅游带。', '项目交通状况用“一环二铁三纵四横”来概括。“一环”，即环巢湖大道，被誉为“合肥最美道路”之一。沿线向东可达巢湖城区，向西达国家AAAAA级风景区——三河古镇。“二铁”，指高铁南站和三条地铁线。高铁南站距项目约10公里，借此可达省外；其次项目紧邻三条地铁，1号线已开通营运，由滨湖新区直达合肥火车站，是合肥南北向交通的主动脉，距项目最近的云谷路站约为1.1公里；5号线已经开建，其东史岗路站与华山路站与项目无缝对接。S1号线，途经新桥机场、新高铁西站、高铁南站最终抵达巢湖岸边，将于项目东南角设站。“三纵”指三条南北向主干道——徽州大道、庐州大道和包河大道，连接滨湖新区与老城核心。“四横 ”为锦绣大道、紫云路、方兴大道和云谷路，贯穿滨湖新区和经开区。沿方兴大道向西驱车10分钟可上京台高速，30分钟可达机场高速入口，构成全方位、立体化的交通体系网，通达四周。', 7409, 15, '2020', '202011');
INSERT INTO `house` VALUES (16687, 0, 0, '2021-05-26 15:50:30', 0, '2021-05-26 16:19:30', 202011015, '金茂湾', 'D2', ' 2597.85  ', 12, 24882, '文曲路和习友路东南角', '高新区', '住宅、商业', '高层、其他住宅', '安徽新华新茂置业有限公司', '华东建筑设计研究院有限公司', '中国金茂物业管理（北京）有限公司', '安徽医科大学附属口腔医院，小区配套幼儿园，梦园小学，中加国际学校，合肥七中新校区', '地铁2号线、4号线，7号线。习友路西接方兴大道，向北直达政务区，向南直通滨湖新区，交通四通八达。', 7374, 15, '2020', '202011');
INSERT INTO `house` VALUES (16688, 0, 0, '2021-05-26 15:50:30', 0, '2021-05-26 16:19:30', 202011013, '琥珀晴川里', '1#,2#,9#,10#', ' 18940.16  ', 110, 21749, '上海路东大圩路北', '包河区', '住宅', '小高层、洋房', '合肥城建发展股份有限公司', '安徽地平线建筑设计有限公司', '安徽琥珀物业服务有限公司', '周边配套：目前项目中小学配套有西安路学校（实验学校）、黄河路小学、合肥上海外国语学校 综合商场：悦方IDmall、百大心悦城、滨湖银泰城、茶里水街、禾润阳光购物广场 医院：滨湖医院、项目南侧安徽省立医院滨湖总部在建 银行：中国银行（花园大道自助），徽商银行（延安路自助），交通银行（北京路支行），邮政储蓄银行（晓星营业厅）', '交通状况：公交：517路公交车 地铁：5号线黄河路站，花园大道站（预计2021年开通使用） 主干道：双向8车道上海路、包河大道、锦绣大道', 7364, 15, '2020', '202011');
INSERT INTO `house` VALUES (16689, 0, 0, '2021-05-26 15:50:30', 0, '2021-05-26 16:19:31', 202011008, '知庐台', 'Y8#,Y9#', ' 11416.02  ', 64, 24199, '高新区天智路以东、天达路以南', '高新区', '住宅', '剪力墙', '合肥银沣房地产开发有限公司', '上海水石建筑规划设计股份有限公司', '南京银城物业服务有限公司', '周边商圈有高新区鼓楼商厦、1912商业街；学校有中科大附中高新校区、梦园小学、桂花园小学。', '项目位于西二环路与黄山路交口西北侧，两条城市主干道交汇处，交通通达性良好。距离项目北侧长江西路地铁2号线1.5公里，距离项目南侧望江西路即将开通的地铁4号线1公里，出行便利。', 7404, 16, '2020', '202011');
INSERT INTO `house` VALUES (16690, 0, 0, '2021-05-26 15:50:30', 0, '2021-05-26 16:19:32', 202011009, '知庐台', 'G1#,G2#,Y7#', ' 21030.60  ', 172, 21699, '高新区天智路以东、天达路以南', '高新区', '住宅', '剪力墙', '合肥银沣房地产开发有限公司', '上海水石建筑规划设计股份有限公司', '南京银城物业服务有限公司', '周边商圈有高新区鼓楼商厦、1912商业街；学校有中科大附中高新校区、梦园小学、桂花园小学。', '项目位于西二环路与黄山路交口西北侧，两条城市主干道交汇处，交通通达性良好。距离项目北侧长江西路地铁2号线1.5公里，距离项目南侧望江西路即将开通的地铁4号线1公里，出行便利。', 7400, 16, '2020', '202011');
INSERT INTO `house` VALUES (16691, 0, 0, '2021-05-26 15:50:30', 0, '2021-05-26 16:19:32', 202011010, '玖悦花园', 'Y3,Y8,Y16,Y19', ' 22825.17  ', 128, 23998, '成都路以南，云南路以东', '滨湖区', '住宅', '高层、小高层、洋房', '合肥中海宏洋海晟房地产开发有限公司', '梁黄顾建筑设计（深圳）有限公司', '中海宏洋物业管理有限公司合肥分公司', '临近滨湖文旅城、银泰城、悦方IDMALL 、首创奥特莱斯等商业配套，近享金斗公园、塘西河沙滩公园、方兴湖湿地公园天然氧吧，滨湖妇幼保健院、口腔医院滨湖分院、滨湖医院等24小时护航健康。同时1公里范围内交通配套完善，出行较为便捷，同时项目周边临近地铁5号线成都路站（规划）；自建约12万方旗舰商业，毗邻周边云谷金融城、金谷广场等已建成商业；临近合肥师范附小三小、阳光中学等学校；项目西侧为市政规划绿地，整体来看，项目周边居住氛围较好。', '项目位于滨湖区金融板块，位于成都路与贵州路交汇处西南角。项目紧邻地铁5号线成都路站（规划），与1号线交汇。沿成都路往西约800米，达徽州大道，向北约200米达云谷路，以城市主干道交织滨湖枢纽核心轴。区域交通较为便捷。', 7399, 16, '2020', '202011');
INSERT INTO `house` VALUES (16692, 0, 0, '2021-05-26 15:50:30', 0, '2021-05-26 16:19:33', 202011006, '珑玥府', '7#,9#,10#', ' 12659.24  ', 98, 15742, '新安江路与天门山路交口', '瑶海区', '住宅', '高层、跃层复式', '合肥泽翔房地产开发有限公司', '上海水石建筑规划设计有限公司', '禹洲物业服务有限公司', '周边临近新安江路，可直达市区及肥东，周边商业配套有保利广场、万达广场等，学校有马岗小学、五十五中东校区、三十八中、新十中等。', '临近新安江路，15分钟直达市中心，距离地铁2号线王岗站1公里，周边公交37路，T10路，305路，538路。', 7265, 16, '2020', '202011');
