INSERT INTO `house` VALUES (16695, 0, 0, '2021-05-26 15:50:30', 0, '2021-05-26 16:19:35', 202011002, '悦湖西岸小区', '10', ' 4262.20  ', 32, 18037, '高新区火龙地路与彩虹西路交口东北角', '高新区', '住宅', '高层、洋房', '合肥乐富强房地产开发有限公司', '安徽五维空间建筑设计咨询有限公司', '安徽乐富强物业管理有限公司', '周边配套： 自然资源：2100亩蜀西湖、大蜀山等山湖资源； 医疗配套：安徽医科大学附属医院高新区分院，安徽最大省级三甲医院；安徽妇幼保健院西区等。 教育配套：高新实验学校湖滨校区、永和中学 商业配套：砂之船奥特莱斯艺术商业广场、银泰城购物中心也即将于2020年开业。', '交通路网：临近长江西路、方兴大道等交通主干道； 轨道交通：2号线南岗站、建设中4号线、规划中7号； 公交路线：29路、650路、665路等', 7381, 16, '2020', '202011');
INSERT INTO `house` VALUES (16696, 0, 0, '2021-05-26 15:50:30', 0, '2021-05-26 16:19:35', 202010034, '悦和院', '6,7,8', ' 15880.10  ', 96, 21106, '东至宿松路，西至仰光街，南至水阳江路，北至牧童路。', '包河区', '住宅、商业、办公', '高层、小高层、洋房', '中铁四局集团房地产开发有限公司', '中铁四局集团有限公司', '合肥市佳家物业管理有限责任公司', '本案西侧地块为在建老年大学；北侧以住宅区为主，同时包含南七菜市场及合肥市61中学。 ', '包河区老城区核心地段，蜀山区及包河区交界处；距离高铁南站3.5km，本案位于包河区宿松路与水阳江路交口，距地铁5号线休宁路站约300米，距地铁5、6号线交口望江路站约500米，离高铁南站约10分钟车程。周边公交线路117路、150路、16路、41路、163路等交通便利。 ', 7376, 16, '2020', '202010');
INSERT INTO `house` VALUES (16697, 0, 0, '2021-05-26 15:50:30', 0, '2021-05-26 16:19:36', 202010035, '和锦南园', 'Y1,Y2,Y3,Y5', ' 19747.20  ', 120, 23998, '滨湖区上海路以东、紫云路以北', '滨湖区', '住宅，商业', '洋房、小高层、高层', '合肥和禹房地产开发有限公司', '安徽地平线建筑设计有限公司', '保利物业发展股份有限公司安徽分公司', '项目自建约5000㎡社区商业，一路之隔为在建的招商花漫里商业街区，3公里范围内有百大心悦城、悦方IDMALL等商业综合体；自建2座21班幼儿园，02地块西南侧规划学校用地；临近在建的省立医院总院；享十五里河公园、方兴湖公园等景观。', '西侧上海路，南侧紫云路；紧邻在建的地铁5号线与规划的地铁7号线交汇站“紫云路”站，靠近在建的地铁5号线“扬子江路”站。', 7378, 16, '2020', '202010');
