INSERT INTO `house` VALUES (16701, 0, 0, '2021-05-26 15:50:31', 0, '2021-05-26 16:19:37', 202010013, '中和府', '3,4,5,6,7,10', ' 27075.50  ', 161, 35600, '洞庭湖路与华山路交口', '滨湖区', '商住', '住宅', '合肥市葛洲坝房地产开发有限公司', '安徽寰宇建筑设计院', '葛洲坝物业管理有限公司', '教育：望湖小学洞庭湖路校区，中山路中学商业：悦方IDMALL，百大心悦城 医疗：滨湖医院 公园：天山公园 滨湖会展中心', '北地块西侧有地铁1号线，距离项目1公里左右，南向有规划地铁5号线，距离项目2.5公里左右。', 7359, 17, '2020', '202010');
INSERT INTO `house` VALUES (16702, 0, 0, '2021-05-26 15:50:31', 0, '2021-05-26 16:19:38', 202010010, '云琅花园', '2#,3#,6#', ' 21780.71  ', 188, 21749, '龙川路与棠樾路交口', '包河区', '住宅', '小高层', '安徽瑞正置业有限公司', '上海天华建筑设计有限公司', '河南宏港物业服务有限公司', '【商业】沿线分布加侨国际广场、星隆购物广场、万达广场等多个成熟商业，购物、休闲、娱乐应有尽有。淝河新中心商圈是政府重点打造的集生态、科技、商业和文化为一体的综合性商圈 【教育】项目周边两公里，共计有幼儿园8所项目北边有屯溪路小学龙川路校区、西北侧有四十八中，另有合肥实验学校、合肥大地中学等多所学校 【医疗】省儿童医院、友好医院、妇幼保健院项目北侧规划合肥市中医院和合肥市第三人民医院新区，将打造包河区亿元走廊，为您和家人健康保驾护航。 【景观生态】南淝河生态景观带、高铁沿线郊野绿廊，实现300米见绿，500米见园淝河智慧生态公园、1.3万方绿轴公园', '项目周边拥有3条地铁线（分别为地铁一号线、地铁四号线以及地铁五号线）其中4号线花山路站与本项目距离约700米，随着合肥轨道交通的不断发展，未来业主将可以用最短的时间通达全城各个区域。道路交通方面，项目被“四纵两横”城市主干道围绕，四纵为徽州大道、包河大道、上海路及北京路，可快速到达老城区、滨湖新区。二横为南二环、龙川路，可快速到达政务区、经开区；四通八达的交通路网完美地保障了未来业主的便捷出行。', 7283, 17, '2020', '202010');
INSERT INTO `house` VALUES (16703, 0, 0, '2021-05-26 15:50:31', 0, '2021-05-26 16:19:38', 202010028, '国 开 公 馆', '6,12', ' 1411.70  ', 10, 14530, '重庆路与大连路交口', '包河区', '住宅', '高层', '安徽国开置业有限公司', '上海现代建筑设计（集团）有限公司', '深证市嘉城物业管理有限公司', '', '公交线路：141路：吴小郢南站，国开公馆站，周冲村站 23路：晓星集站', 7319, 17, '2020', '202010');
INSERT INTO `house` VALUES (16704, 0, 0, '2021-05-26 15:50:31', 0, '2021-05-26 16:19:38', 202010006, '和枫雅园', 'G5#,G8#,G12#,G16#,XG3#', ' 34111.90  ', 320, 20100, '合肥市经济技术开发区宿松路以东、规划支路以北', '经开区', '住宅', '高层、小高层、洋房', '合肥居峰置业有限公司', '安徽省城建设计研究总院股份有限公司 / 华东建筑设计研究院有限公司', '招商局物业管理有限公司合肥分公司', '周边3公里范围内有华润万象城、银泰、万达、正大广场等高端商业，此外距离刚刚签约的华润万象天地约1公里左右，商业配套成熟。距离海恒商业街、海恒农贸市场，日之惠等约1.6公里，生活便利。距离巨无霸“中央公园”仅约1.7公里，尽享中央公园的发展红利。同时中央公园也是天然氧吧，还有十五里河环绕，生态宜人。', '项目位于经开区宿松路与坝下路交口往北100米，位于政务东，中央公园旁，土地资源稀缺，发展潜力无限。距离1号线南站南广场站直线距离约2公里，未来还有4号线（在建），S1号线（规划中）汇聚于此，近距离享受地铁时代的便利。', 7327, 17, '2020', '202010');
INSERT INTO `house` VALUES (16705, 0, 0, '2021-05-26 15:50:31', 0, '2021-05-26 16:19:39', 202010003, '檀悦花园', 'G1,G2,G3,G6,G7', ' 54625.36  ', 464, 23415, '滨湖区包河大道以东，万泉河路路以南', '滨湖区', '一级资质', '高层、小高层、洋房', '合肥光煜房地产开发有限公司', '成都基准方中建筑设计有限公司', '阳光城物业服务有限公司', '商业：世纪金源购物中心、悦方、百大心悦城、利港银河广场、佳源广场等 医疗：在项目东北角在建设安徽省立医院', '四横从北往南分别为锦绣大道、紫云路、方兴大道、云谷路；四纵是从东往西分别为上海路、包河大道、庐州大道、徽州大道；四地铁有现在已经运营的地铁1号线（会展中心站和紫庐站，1号线贯穿合肥南北），已经进入施工阶段地铁5号线（扬子江路，5号线为一条南北向线路，全长32.9公里，共设27座车站，其中有5座轨道交通换乘车站。主要功能是加强主城区与滨湖新区的联系，引导并促进滨湖新区的发展）和规划中的7号线（紫云路站，约300米，7号线贯穿东西城区，主要连接高新区、经开区、滨湖中心）及S1号线（徽富路站，距离项目约400米；地铁S1号线从新桥机场起步，经清溪路附近的新西站交通枢纽，南下与4号线交汇之后，向东南方向前进，在和1号线在合肥南站附近交汇之后，进入滨湖新区，最终抵达巢湖岸边）。沿方兴大道上G3京台高速入口沿六安方向，可快速直达新桥国际机场。公交车：B7/B5/66等', 7249, 17, '2020', '202010');
