INSERT INTO `house` VALUES (16708, 0, 0, '2021-05-26 15:50:31', 0, '2021-05-26 16:19:40', 202010005, '阅庐花园', '8,9,10,11', ' 21532.72  ', 228, 17742, '合肥市庐阳区蒙城北路以西、永幸河路以南', '庐阳区', '高层、小高层、商业', '高层、小高层', '合肥德源房地产开发有限公司', '上海水石建筑规划设计股份有限公司', '浙江佳源物业服务集团有限公司合肥分公司', '项目周边宜家、苏宁广场进驻，教育资源配套完善，代建幼儿园、小学，庐阳中学北校区（规划中）、四十五中（工业园分校）、南门小学、六安路小学（淮北路校区）等，距离主城区距离较近，到达双岗，步行街也都方便', '该项目地块紧邻主干道蒙城北路，距离地铁站5号线丽水路站（在建）约400米，公交路线45路、5路等，交通便利。', 7309, 17, '2020', '202010');
INSERT INTO `house` VALUES (16709, 0, 0, '2021-05-26 15:50:32', 0, '2021-05-26 16:19:41', 202010002, '乐悦湾', '1,2,5', ' 10779.54  ', 110, 12999, '新站区天水路以南九顶山路以西', '新站区', '住宅', '小高层', '合肥瀚德房地产开发有限公司', '启迪设计集团股份有限公司', '安徽乐富强物业管理有限公司', '1、商业配套：项目配建综合社区中心，附近有宜家超市、宝湾国际建材家居城、武里山天街。2、医疗配套：安徽省第二人民医院、长荣医院。3、教育配套：淮合花园幼儿园、小学、中学。', '项目位于三条城市主干道九顶山路与淮南路交口东北角，天水路西侧，出门即有多条公交线，距离地铁1号线延长线和阜阳北路高架仅5分钟车程，距离北二环仅3分钟车程，交通便利，通达性极强。', 7137, 18, '2020', '202010');
INSERT INTO `house` VALUES (16710, 0, 0, '2021-05-26 15:50:32', 0, '2021-05-26 16:19:41', 202009076, '湖滨兰园', 'G13,G16,G18', ' 18648.75  ', 117, 23342, '滨湖区包河大道与南京路交口东南角', '滨湖区', '住宅', '高层，洋房', '安徽舜鸿房地产开发有限公司', '上海联创设计集团股份有限公司', '绿城物业服务集团有限公司', '一路之隔的招商雍华府自带13万方商业综合体、百大心悦城、悦方、利港银河广场、佳源商业购物中心、银泰百货、万达茂等大型购物中心，满足您日常购物、休闲娱乐的的需求。省立总院医疗健康护航，幼儿园、小学、初中全龄教育，2KM多公园环绕，2KM四大商圈环绕', '项目北侧道路为南京路，西侧为包河大道，南侧为万泉河路，东侧为安徽路，1号线、5号线双地铁，项目所在区域整体的交通道路可以简单的概括为三纵三横一轨道，形成一个四通八达的内部交通网。', 7303, 18, '2020', '202009');
