INSERT INTO `house` VALUES (16725, 0, 0, '2021-05-26 15:50:33', 0, '2021-05-26 16:19:49', 202009035, '文宸苑', '2,6,8,9,11', ' 26937.62  ', 268, 17199, '高新区将军岭路与磨子潭路交口东南角', '高新区', '住宅', '小高层', '合肥瀚博房地产开发有限公司', '华东建筑设计研究院有限公司', '安徽乐富强物业管理有限公司', '1、商业配套：附近有砂之船奥特莱斯、银泰。2、医疗配套：安徽医科大学高新分院、妇幼保健院西区。3、教育配套：自建幼儿园、初中，项目对面即是小学。', '项目位于高新区长江西路与将军岭路交口向北300米，临近地铁2号线、合六轻轨，附近有3条公交线，交通便利。', 7199, 19, '2020', '202009');
INSERT INTO `house` VALUES (16726, 0, 0, '2021-05-26 15:50:33', 0, '2021-05-26 16:19:50', 202009036, '和水雅居', '19', ' 6671.05  ', 72, 12997, '项王路和卧龙湖路交口', '新站区', '住宅', '小高层、洋房', '合肥茂旸置业有限公司', '上海方大建筑设计事务所', '优居美家物业服务有限责任公司合肥分公司', '紧邻项目西侧规划的 254 地块未来会设有一个大型的 商业中心，配备不少于 150间客房的星级酒店和 5 万方的街区商业。东方大道与铜陵北路交口还规划一个 5 万方左右的地铁商业，如果您想感受下民族文化氛围，项目周边 2km 左右范围内，有极具特色的 1500 米磨店老街、百大商业广场，拓基广场、黉街和文一陶冲湖城市广场商业圈，包含购物广场、超市、影院等商业配套亦可满足您的日常需求。如果您想去稍微远一点的商场，从新蚌埠路 15 分钟左右可以直达武里山天街、家天下生活广场；30 分钟左右车程即可到达瑶海万达、宝业东城广场、保利广场商圈，满足吃、喝、玩、乐、购一站式购物需求。 学区配套： 项目西北角配备了一个面积达 4500 ㎡的 15班幼儿园，也是作为公立幼儿园的最高标准建设的，东南 1.2 公里左右的庆平学校是由红军战士王庆平的名字命名的，可以说也是红色教育基地，是目前新站最大的公办学校，师资力量也是非常优秀的，同时也是安徽省最大的图书馆流通网点，有利于孩子的成长。项目 1 公里左右还有规划的少荃小学，为孩子提供更好的国际化教育，项目南侧 700 米左右的台湾康桥国际学校更是拥有从幼儿园到高中的一站式国际化教育服务。 医疗配套： 新站区最好的两个医院距离本项目均在10分钟左右车程。安医大第四附属医院，它是省城东北部第一家三甲级医院。以及安徽首家数字化全科医院，京东方数字医院，这是北上广等一线城市才会有的数字化医院，整个医院投资32个亿，并于19年3月21日已经正式开诊。', '项目位于东方大道与卧龙湖路交口，东接合肥东城新区，西与庐阳相通，北连北部新城，南与市区无缝对接。项目周边道路四通八达，形成三横三纵一地铁三维立体交通网，出行十分便捷。三横为魏武路、东方大道、淮海大道，三纵为新蚌埠路、铜陵北路、文忠路。由东方大道到新蚌埠路上三十头绕城高速，迅速到达省内外；而新蚌埠路向南可以到达老城区步行街银泰；而临近项目的铜陵北路高架则是合肥未来最长的一条高架（预计 2021 年通车），到达滨湖融创茂也只需要 30 分钟左右的车程，同时它可以连接包河，滨湖，政务，经开等主要区域。 地铁配套：地铁 4 号线（地铁 4 号线北起新站，途经政务区天鹅湖，西至高新区，预计 2021 年 12月通车），首发站东方大道站距离项目仅 300 米，步行5分钟左右即可到达！可以说是我们最纯正的地铁房，未来的 4 号线可以无缝对接合肥1-2-3-5 等多条地铁线路，让您可以畅通合肥的各个角落，地铁4号线预计2021年1月通车；公交配套：项目周边有 681 路、686 路，直接连通火车站和市区方向，可以快速到达老城区。', 7277, 19, '2020', '202009');
