INSERT INTO `house` VALUES (16728, 0, 0, '2021-05-26 15:50:33', 0, '2021-05-26 16:19:50', 202009047, '鼎元别院', '蘭宫5幢', ' 1716.00  ', 5, 20832, '蜀山区植物园路9号', '蜀山区', '住宅', '高层住宅及其他住宅', '合肥拓基房地产开发有限责任公司', '深圳大学建筑设计研究院', '合肥拓基物业管理有限责任公司', '项目周边商业配套日趋成熟，紧临项目的有上海华联金色池塘店，上海华联超市，福乐门广场、乐购，步行10分钟可达蜀山区的黄金地段—长江西路西区商圈中心，鼓楼商厦高新店，合家福高新店。', '多路公交线路可直达项目或项目周边，其中步行5分钟可直达城市主干道西二环，15分钟可达规划中的城市森林公园；驾车5分钟可快速融入城市动脉长江西路高架；8分钟可达三里庵国购商圈，10分钟可达三孝口主城区；5分钟可达百大高新区鼓楼、合家福商圈；8分钟可达政务区核心区，15分钟可达经开区。项目途经经开区直达滨湖新区仅30分钟，西二环至北二环到达合肥新火车站仅20分钟。', 7217, 19, '2020', '202009');
INSERT INTO `house` VALUES (16729, 0, 0, '2021-05-26 15:50:34', 0, '2021-05-26 16:19:51', 202009029, '尚锦花园', 'G3,G1,Y3,Y6,Y12', ' 32805.85  ', 268, 20985, '经开区繁华大道与宿松路交口', '经开区', '住宅/商业/地库', '洋房、小高层、高层', '合肥中海海荣房地产有限责任公司', '安徽地平线建筑设计有限公司', '中海宏洋物业管理有限公司合肥分公司', '项目毗邻合肥中央公园（规划中），距东南方向南艳湖公园约2.6km，项目自带约1.5万方社区商业配套，距离有信达邻里坊、中海环宇天地商业街约1.5km，生活配套成熟。此外，项目距经开区正大广场、政务区万象城等商业配套群约4km，商业配套齐全。', '项目位城市主干道繁华大道与宿松路交口，项目距离合肥南站、地铁1号线南站南广场站口约2km、绕城高速出入口约4km，区域交通较为便捷。', 7237, 20, '2020', '202009');
