INSERT INTO `house` VALUES (16731, 0, 0, '2021-05-26 15:50:34', 0, '2021-05-26 16:19:52', 202009031, '尚锦花园', 'Y1,Y2,Y5,Y7,Y8,Y9,Y10,Y11,Y15', ' 50974.45  ', 352, 23248, '经开区繁华大道与宿松路交口', '经开区', '住宅/商业/地库', '洋房、小高层、高层', '合肥中海海荣房地产有限责任公司', '安徽地平线建筑设计有限公司', '中海宏洋物业管理有限公司合肥分公司', '项目毗邻合肥中央公园（规划中），距东南方向南艳湖公园约2.6km，项目自带约1.5万方社区商业配套，距离有信达邻里坊、中海环宇天地商业街约1.5km，生活配套成熟。此外，项目距经开区正大广场、政务区万象城等商业配套群约4km，商业配套齐全。', '项目位城市主干道繁华大道与宿松路交口，项目距离合肥南站、地铁1号线南站南广场站口约2km、绕城高速出入口约4km，区域交通较为便捷。', 7238, 20, '2020', '202009');
INSERT INTO `house` VALUES (16732, 0, 0, '2021-05-26 15:50:34', 0, '2021-05-26 16:19:53', 202009032, '新悦里', 'G06,G07,G08,G10,G11,G12,G13', ' 41079.02  ', 468, 12995, '新站高新区铜陵北路与项王东路交口东南角', '瑶海区', '住宅', '高层 小高层', '合肥皖投东方置业有限公司', '上海尤安建筑设计股份有限公司', '安徽外滩物业有限公司', '项目拟开发7栋商业，总建面约14500平方米。另外其中2栋商业楼，1栋商业上盖酒店，建面约9000平方米，规划内需建设客房数不少于150间的酒店，并全部自持。1栋商业上盖办公，建面约8100平方米。1栋独栋睦邻中心，建面约4500平方米。', '新悦里项目位于新站高新区铜陵北路以东、项王东路以南，紧邻在建地铁4号线始发站东方大道站，面积124.14亩，总建面20万方，规划用途为居住、商业用地，其中居住94.38亩，容积率≤1.8，总建面约15万方，商业29.77亩，容积率≤2.0，总建面约5万方。', 7232, 20, '2020', '202009');
INSERT INTO `house` VALUES (16733, 0, 0, '2021-05-26 15:50:34', 0, '2021-05-26 16:19:54', 202009034, '绿地柏轩花园', 'Y8#,Y9#,Y11#,Y12#,Y15#,Y16#', ' 20773.12  ', 160, 13964, '岱河路与烈山路交口', '新站区', '住宅、配套商业', '高层住宅、低层洋房、配套商业', '绿地集团合肥美湖置业有限公司', '安徽地平线建筑设计有限公司', '南都物业服务股份有限公司', '', '', 7220, 20, '2020', '202009');
INSERT INTO `house` VALUES (16734, 0, 0, '2021-05-26 15:50:34', 0, '2021-05-26 16:19:55', 202009018, '旭恒花园', 'Y1,Y2', ' 10317.73  ', 56, 23999, '南京路以南、包河大道以西', '滨湖区', '住宅', '高层，小高层，洋房', '合肥和卓房地产开发有限公司', '安徽寰宇建筑设计院', '上海永升物业管理有限公司', '贯穿多个滨湖核心商圈，利港银河广场，悦方ID Mall还有银泰百货，联投中心书城和融创茂等，被称为商业中轴），项目东南角已经开业的百大心悦城，总规划建筑面积达10万㎡，目前已入驻主力店有合家福新零售超市、滨湖最大亲子家庭娱乐中心、安徽最大的天空农场等，项目东北角正在投资建设的安徽省立医院滨湖项目，西南角就是寿春中学滨湖校区，华山路小学、西侧为实验学校。', '总体为四横四纵四轨一环道：四横从北往南分别为锦绣大道、紫云路、方兴大道、云谷路；四纵是从东往西分别为上海路（北起裕溪路，南至方兴大道，双向八车道，是连接合肥南北交通的重要主干道）、包河大道（地处滨湖的政务中心，被称为政治中轴）、庐州大道（集滨湖主干道、地铁1号线于一体，徽州大道则是连接新老城区的经济中轴；四轨道有现在已经运营的地铁1号线，已经进入施工阶段地铁5号线和规划中的7号线及S1号线（新桥机场起点，经清溪路附近新西站，南下与4号线交汇，向东南与1号线在高铁南站交汇后最终抵达巢湖岸边）。沿方兴大道上G3京台高速入口沿六安方向，可快速直达新桥国际机场，出行便捷。', 7255, 20, '2020', '202009');
INSERT INTO `house` VALUES (16735, 0, 0, '2021-05-26 15:50:34', 0, '2021-05-26 16:19:56', 202009019, '阅庐花园', '3,6', ' 10653.66  ', 112, 17743, '合肥市庐阳区蒙城北路以西、永幸河路以南', '庐阳区', '高层、小高层、商业', '高层、小高层', '合肥德源房地产开发有限公司', '上海水石建筑规划设计股份有限公司', '浙江佳源物业服务集团有限公司合肥分公司', '项目周边宜家、苏宁广场进驻，教育资源配套完善，代建幼儿园、小学，庐阳中学北校区（规划中）、四十五中（工业园分校）、南门小学、六安路小学（淮北路校区）等，距离主城区距离较近，到达双岗，步行街也都方便', '该项目地块紧邻主干道蒙城北路，距离地铁站5号线丽水路站（在建）约400米，公交路线45路、5路等，交通便利。', 7258, 20, '2020', '202009');
INSERT INTO `house` VALUES (16736, 0, 0, '2021-05-26 15:50:34', 0, '2021-05-26 16:19:56', 202009011, '龙川玖著花园', '5#,6#,9#,10#,12#,13#,15#,16#,17#,18#,21#', ' 63427.53  ', 540, 21748, '合肥市包河区淝河镇龙川路与葛大店路交口东南角', '包河区', '住宅', '小高层、洋房', '合肥奥行置业有限公司', '上海联创设计集团股份有限公司', '广州奥园物业服务有限公司', '项目周边有成熟的交付社区，社区底商，葛大店公益性菜市场，世纪华联超市等醇熟商业环伺，北侧约3公里则是合肥市惠民夜市-\"罍街\"，向北与合肥龙虾一条街呼应，且项目北边与我们一路之隔未来将打造约4万方集中式商业，项目沿龙川路往西7公里可到达政务区商圈，天鹅湖万达、银泰城、万象城等高端商场聚集。其次项目距离马鞍山路商圈约2公里，沿线分布了加侨国际广场、百大合家福购物广场、新都会环球购物广场、万达广场，望湖小学葛大店南校区、四十八中学等优秀的教育资源环伺。', '项目紧邻地铁4号线大强路站，与项目无缝对接，距大强路站c出口仅15米，距离高铁南站仅2站，可换乘1号线、5号线，?同时项目道路交通四通八达，到高铁南站仅约2公里，紧邻城市主干道龙川路，龙川路是整个包河区的黄金中轴之路，横贯东西，往西直达政务区。毗邻徽州大道、庐州大道、包河大道等主干道可快速到达老城区、滨湖新区。', 7223, 20, '2020', '202009');
INSERT INTO `house` VALUES (16737, 0, 0, '2021-05-26 15:50:34', 0, '2021-05-26 16:19:57', 202009012, '龙川玖著花园', '1#,2#,3#,7#,8#,11#', ' 19025.23  ', 144, 21749, '合肥市包河区淝河镇龙川路与葛大店路交口东南角', '包河区', '住宅', '小高层、洋房', '合肥奥行置业有限公司', '上海联创设计集团股份有限公司', '广州奥园物业服务有限公司', '项目周边有成熟的交付社区，社区底商，葛大店公益性菜市场，世纪华联超市等醇熟商业环伺，北侧约3公里则是合肥市惠民夜市-\"罍街\"，向北与合肥龙虾一条街呼应，且项目北边与我们一路之隔未来将打造约4万方集中式商业，项目沿龙川路往西7公里可到达政务区商圈，天鹅湖万达、银泰城、万象城等高端商场聚集。其次项目距离马鞍山路商圈约2公里，沿线分布了加侨国际广场、百大合家福购物广场、新都会环球购物广场、万达广场，望湖小学葛大店南校区、四十八中学等优秀的教育资源环伺。', '项目紧邻地铁4号线大强路站，与项目无缝对接，距大强路站c出口仅15米，距离高铁南站仅2站，可换乘1号线、5号线，?同时项目道路交通四通八达，到高铁南站仅约2公里，紧邻城市主干道龙川路，龙川路是整个包河区的黄金中轴之路，横贯东西，往西直达政务区。毗邻徽州大道、庐州大道、包河大道等主干道可快速到达老城区、滨湖新区。', 7228, 20, '2020', '202009');
INSERT INTO `house` VALUES (16738, 0, 0, '2021-05-26 15:50:34', 0, '2021-05-26 16:19:57', 202009013, '鹭湖花园', '9,1,2,3,5', ' 23419.29  ', 156, 19693, '合肥市高新区彩虹西路与方兴大道交口西南角', '高新区', '住宅', '高层、小高层、洋房', '安徽鹏欣房地产开发有限公司', '启迪设计集团股份有限公司', '金鹏祥和物业管理有限公司', ' 以蜀西湖商圈为主，砂之船奥特莱斯商业广场、祥源城商业街、在建银泰城、汇景广场等；北雁湖后期规划大量商业配套，可以提升片区商业环境；“一山两湖”自然景观；', '临近长江路、方兴大道、望江西路多条主干道；距离地铁2号线2km，在建地铁4（6）号线，距离项目0.5km。', 7211, 20, '2020', '202009');
INSERT INTO `house` VALUES (16739, 0, 0, '2021-05-26 15:50:34', 0, '2021-05-26 16:19:58', 202009014, '四季春晓花园', '10#,12#', ' 9388.57  ', 88, 14499, '合肥市瑶海区包公大道和烈山路交口', '瑶海区', '住宅', '高层，小高层', '合肥金科百俊房地产开发有限公司', '成都基准方中建筑设计有限公司合肥分公司', '金科物业服务集团有限公司', '医院：瑶海区龙岗医院 静安中西结合医院 教育：琥珀名城包公大道校区（小学） 、五十五中东校区、合肥十中（省重点高中） 商业：瑶海万达、龙湖天街、长江批发市场 银行：中国建设银行、中国农业银行 社区内配套：自建公园、儿童主题乐活空间 其他：学林公园、云河湾公园、月亮湾公园、瑞泰公园 ', '公交：40路、511路 地铁：地铁2号线（距离地铁站2.5KM）、3号线 ', 7240, 21, '2020', '202009');
INSERT INTO `house` VALUES (16740, 0, 0, '2021-05-26 15:50:34', 0, '2021-05-26 16:19:58', 202009015, '翰林天筑小区', '3#,5#,6#,8#,14#', ' 38782.60  ', 299, 13198, '新安江路与大众路交口东北角', '瑶海区', '住宅', '高层、小高层', '安徽建工地产有限公司', '上海柏涛建筑设计有限公司', '安徽绿城物业管理有限公司', '优质学区：和平路小学三小、38中东校区和新十中已入驻，项目北侧规划有12班的公立幼儿园，另外有9年义务教育用地。 生态环境方面：瑶海湾湿地公园，20万方的月亮湾公园已投入使用，还有街头游园如龙岗游园，思潮游园，项目西南角游园。 商业环境方面：龙湖天街、保利广场、宝业东城广场，瑶海万达距离项目近在咫尺。 医疗资源方面：合肥市新二院，妇幼保健院东区，静安医院，在建的上海长海医院', '“五横”“五纵”十条主干道的完善交通网，“五横”分别为包公大道、临泉东路、长江东路、新安江路和裕溪路高架；“五纵”分别为铜陵路高架、东二环当涂路、郎溪路、龙岗路和大众路。轨道交通方面，地铁2号线。', 7231, 21, '2020', '202009');
INSERT INTO `house` VALUES (16741, 0, 0, '2021-05-26 15:50:34', 0, '2021-05-26 16:19:58', 202009008, '美科公馆', '25,28', ' 19135.74  ', 188, 14500, '淮海大道与相城路交口西南角', '新站区', '住宅', '高层、少量沿街商业', '合肥金骏美合房地产开发有限公司', '成都基准方中', '金科智慧服务有限公司', '学校资源：本项目自带15班幼儿园规划、规划新九中与项目一路之隔； 商超：项目自带6栋沿街商业的规划，可以满足日常的生活消费，职教城商圈还拥有黉街、磨店街、百大商业广场等成熟配套； 医院：坐拥三所大型专业医疗机构，分别是安徽医科大学第四附属医院、安徽首家数字化全科医院（京东方医院）、安徽中医药大学中西医结合医院。', '本项目是多维立体化交通，本项目通过淮海大道、大众路的紧密连接，交通通达性强，地铁3号线始发站相城路站位于小区东北角，可直转地铁1号线和2号线，有效连接与主城区各个区域，交通便捷度高。', 7233, 21, '2020', '202009');
INSERT INTO `house` VALUES (16742, 0, 0, '2021-05-26 15:50:34', 0, '2021-05-26 16:19:59', 202008039, '和水雅居', '17', ' 5563.68  ', 60, 12997, '项王路和卧龙湖路交口', '新站区', '住宅', '小高层、洋房', '合肥茂旸置业有限公司', '上海方大建筑设计事务所', '优居美家物业服务有限责任公司合肥分公司', '紧邻项目西侧规划的 254 地块未来会设有一个大型的 商业中心，配备不少于 150间客房的星级酒店和 5 万方的街区商业。东方大道与铜陵北路交口还规划一个 5 万方左右的地铁商业，如果您想感受下民族文化氛围，项目周边 2km 左右范围内，有极具特色的 1500 米磨店老街、百大商业广场，拓基广场、黉街和文一陶冲湖城市广场商业圈，包含购物广场、超市、影院等商业配套亦可满足您的日常需求。如果您想去稍微远一点的商场，从新蚌埠路 15 分钟左右可以直达武里山天街、家天下生活广场；30 分钟左右车程即可到达瑶海万达、宝业东城广场、保利广场商圈，满足吃、喝、玩、乐、购一站式购物需求。 学区配套： 项目西北角配备了一个面积达 4500 ㎡的 15班幼儿园，也是作为公立幼儿园的最高标准建设的，东南 1.2 公里左右的庆平学校是由红军战士王庆平的名字命名的，可以说也是红色教育基地，是目前新站最大的公办学校，师资力量也是非常优秀的，同时也是安徽省最大的图书馆流通网点，有利于孩子的成长。项目 1 公里左右还有规划的少荃小学，为孩子提供更好的国际化教育，项目南侧 700 米左右的台湾康桥国际学校更是拥有从幼儿园到高中的一站式国际化教育服务。 医疗配套： 新站区最好的两个医院距离本项目均在10分钟左右车程。安医大第四附属医院，它是省城东北部第一家三甲级医院。以及安徽首家数字化全科医院，京东方数字医院，这是北上广等一线城市才会有的数字化医院，整个医院投资32个亿，并于19年3月21日已经正式开诊。', '项目位于东方大道与卧龙湖路交口，东接合肥东城新区，西与庐阳相通，北连北部新城，南与市区无缝对接。项目周边道路四通八达，形成三横三纵一地铁三维立体交通网，出行十分便捷。三横为魏武路、东方大道、淮海大道，三纵为新蚌埠路、铜陵北路、文忠路。由东方大道到新蚌埠路上三十头绕城高速，迅速到达省内外；而新蚌埠路向南可以到达老城区步行街银泰；而临近项目的铜陵北路高架则是合肥未来最长的一条高架（预计 2021 年通车），到达滨湖融创茂也只需要 30 分钟左右的车程，同时它可以连接包河，滨湖，政务，经开等主要区域。 地铁配套：地铁 4 号线（地铁 4 号线北起新站，途经政务区天鹅湖，西至高新区，预计 2021 年 12月通车），首发站东方大道站距离项目仅 300 米，步行5分钟左右即可到达！可以说是我们最纯正的地铁房，未来的 4 号线可以无缝对接合肥1-2-3-5 等多条地铁线路，让您可以畅通合肥的各个角落，地铁4号线预计2021年1月通车；公交配套：项目周边有 681 路、686 路，直接连通火车站和市区方向，可以快速到达老城区。', 7206, 21, '2020', '202008');
INSERT INTO `house` VALUES (16743, 0, 0, '2021-05-26 15:50:34', 0, '2021-05-26 16:19:59', 202009003, '湖滨兰园', 'Y5,Y6', ' 10509.39  ', 64, 28070, '滨湖区包河大道与南京路交口东南角', '滨湖区', '住宅', '高层，洋房', '安徽舜鸿房地产开发有限公司', '上海联创设计集团股份有限公司', '绿城物业服务集团有限公司', '一路之隔的招商雍华府自带13万方商业综合体、百大心悦城、悦方、利港银河广场、佳源商业购物中心、银泰百货、万达茂等大型购物中心，满足您日常购物、休闲娱乐的的需求。省立总院医疗健康护航，幼儿园、小学、初中全龄教育，2KM多公园环绕，2KM四大商圈环绕', '项目北侧道路为南京路，西侧为包河大道，南侧为万泉河路，东侧为安徽路，1号线、5号线双地铁，项目所在区域整体的交通道路可以简单的概括为三纵三横一轨道，形成一个四通八达的内部交通网。', 7076, 21, '2020', '202009');
INSERT INTO `house` VALUES (16744, 0, 0, '2021-05-26 15:50:34', 0, '2021-05-26 16:20:00', 202009004, '悦湖西岸小区', '12,15,16', ' 11572.72  ', 80, 18037, '高新区火龙地路与彩虹西路交口东北角', '高新区', '住宅', '高层、洋房', '合肥乐富强房地产开发有限公司', '安徽五维空间建筑设计咨询有限公司', '安徽乐富强物业管理有限公司', '周边配套： 自然资源：2100亩蜀西湖、大蜀山等山湖资源； 医疗配套：安徽医科大学附属医院高新区分院，安徽最大省级三甲医院；安徽妇幼保健院西区等。 教育配套：高新实验学校湖滨校区、永和中学 商业配套：砂之船奥特莱斯艺术商业广场、银泰城购物中心也即将于2020年开业。', '交通路网：临近长江西路、方兴大道等交通主干道； 轨道交通：2号线南岗站、建设中4号线、规划中7号； 公交路线：29路、650路、665路等', 7202, 21, '2020', '202009');
