INSERT INTO `house` VALUES (16746, 0, 0, '2021-05-26 15:50:34', 0, '2021-05-26 16:20:01', 201801052, '艺境花园', '9,26,27', ' 20337.58  ', 188, 14232, '张衡路以西、龙子湖路以北', '新站区', '住宅', '高层', '安徽皖赣置业有限责任公司', '安徽地平线建筑设计事务所股份有限公司', '南京万科物业管理有限公司', '高校林立，周边职业学校及教育资源丰富，本案与配套学校合肥市庆平小学步行五分钟，附近商业配套为磨站商业，近在咫尺。', '本案临近主干道文忠路与东方大道，城市公交线路完善，有681路、302路、304路等多辆公交经过。规划3、4号线地铁，离项目很近。', 5044, 21, '2018', '201801');
INSERT INTO `house` VALUES (16747, 0, 0, '2021-05-26 15:50:34', 0, '2021-05-26 16:20:01', 202009002, '璞羽东苑', '8,9,10,11,12', ' 23284.87  ', 160, 19499, '蜀山区邓店路以南、渡仙桥以西', '蜀山区', '住宅', '洋房、高层、多层', '合肥市夏一置业有限公司', '中铁合肥建筑市政工程设计研究院有限公司', '龙湖物业服务集团有限公司合肥分公司', '', '', 7182, 21, '2020', '202009');
INSERT INTO `house` VALUES (16748, 0, 0, '2021-05-26 15:50:34', 0, '2021-05-26 16:20:02', 202008056, '翡丽东方花园', 'G8', ' 7257.92  ', 71, 13740, '瑶海区半塔北路东、丰乐亭路北', '瑶海区', '住宅', '高层、洋房', '合肥玖叁置业有限公司', '华东建筑设计研究院有限公司', '南京弘阳物业管理有限公司合肥分公司', '项目周边有华联、满天星购物中心等生活超市。附近还有瑶海天街商业综合体、瑶海万达、保利广场。医疗方面有合肥广慈医院，瑶海区龙岗卫生服务站。合肥市第二人民医院。', '项目北边包公大道，南边紧邻临泉路，西边郎溪路，附近不远处就是地铁轨道2号线三十埠站，也有2路、146路、154路、39路等公交线路可供选择。', 7183, 21, '2020', '202008');
