INSERT INTO `house` VALUES (16750, 0, 0, '2021-05-26 15:50:35', 0, '2021-05-26 16:20:03', 202008036, '瑞禧园', '10#,11#,12#,16#', ' 19758.33  ', 120, 21749, '合肥市包河区合巢路以北、马鞍山路以西', '包河区', '小高层；洋房', '剪力墙', '安徽汇和置业有限公司', '柏涛建筑设计（深圳）有限公司', '安徽信联物业服务有限公司', '商业配套：此处生活氛围浓厚醇熟，罍街、后街，5分钟即可到达，一路之隔就是百大购物中心，绿地缤纷城等城市综合体，除此之外，开车五、十分钟车程（地铁三站路）即可到达银泰中心或包河万达商圈。 教育配套：作为积累多年的主城区核心位置，占据最优质的学区资源：项目自建二十四班制的幼儿园，周边卫岗小学、六十五中、三十二中、合工大、中科大. 医疗配套：项目周边医疗资源十分丰富，西向是合肥市第二人民医院、合肥市第三人民医院，还可以快速的抵达安医附院、省立医院，10分钟左右即可到达安徽省儿童医院等，众多大型三级甲等综合性医院环伺。', '公共交通：项目紧邻地铁1号线(秋浦河路站)相距百米，下楼举步即达，同时与合肥2号线、在建3、4、5号线都有交汇换成站，周边还有一条规划6号线地铁，届时将形成米字型地铁交通网。项目周边有多条公交线路：51路、99路、109路、138路、515路、902路、B7路等； 道路交通：坐拥便捷多元的立体交通，路网四通八达，项目被“三横三纵”城市主干道围绕：三横为南二环、南一环、望江路，三条主干道贯穿东西，连接合肥城市路网，三纵为徽州大道、马鞍山路、东二环（郎溪路），立体的交通网络，快速通达主城区各个区域，四通八达的交通路网完美地保障了未来业主的出行.', 7188, 22, '2020', '202008');
