INSERT INTO `house` VALUES (16757, 0, 0, '2021-05-26 15:50:35', 0, '2021-05-26 16:20:07', 202008022, '阅庐花园', '1,2,5,7', ' 33714.66  ', 360, 16977, '合肥市庐阳区蒙城北路以西、永幸河路以南', '庐阳区', '高层、小高层、商业', '高层、小高层', '合肥德源房地产开发有限公司', '上海水石建筑规划设计股份有限公司', '浙江佳源物业服务集团有限公司合肥分公司', '项目周边宜家、苏宁广场进驻，教育资源配套完善，代建幼儿园、小学，庐阳中学北校区（规划中）、四十五中（工业园分校）、南门小学、六安路小学（淮北路校区）等，距离主城区距离较近，到达双岗，步行街也都方便', '该项目地块紧邻主干道蒙城北路，距离地铁站5号线丽水路站（在建）约400米，公交路线45路、5路等，交通便利。', 7193, 22, '2020', '202008');
INSERT INTO `house` VALUES (16758, 0, 0, '2021-05-26 15:50:35', 0, '2021-05-26 16:20:07', 202008023, '文一塘溪津门', '40,43', ' 10462.32  ', 64, 26501, '滨湖新区包河大道与杭州路交口', '滨湖区', '住宅', '高层、洋房', '安徽省文一投资控股集团滨江置业有限公司', '北京高能筑博建筑设计有限公司', '安徽省文一物业管理有限公司', '环境：项目紧邻方兴湖和巢湖两大水系，同时为塘西河公园、金斗公园、方兴湖公园和岸上草原所环抱，公园面积高达万亩。商业：项目自持近10万方的文化商业街，打造合肥城市会客厅。此外，南接万达文旅城和恒大中心，东邻银泰中心和中心书城，北连悦方IDmall和世纪金源，众多商业中心伺散。学区：项目南面沿云谷路建有幼儿园和小学。同时一中、四十八中、四十六中和师范附小等名校坐落周边，教育资源得天独厚。医疗：滨湖医院距离项目仅4公里。省立医院总部正在规划筹建，位于项目北侧，相距不过5分钟车程。旅游：万达文化旅游城、牛角大圩生态旅游区、滨湖湿地公园、巢湖岸边的岸上草原、滨湖十大省级文化场馆，加上会申报国家AAAA级景区的塘溪津门水街将，形成一片完整的环巢湖旅游带。', '项目交通状况用“一环二铁三纵四横”来概括。“一环”，即环巢湖大道，被誉为“合肥最美道路”之一。沿线向东可达巢湖城区，向西达国家AAAAA级风景区——三河古镇。“二铁”，指高铁南站和三条地铁线。高铁南站距项目约10公里，借此可达省外；其次项目紧邻三条地铁，1号线已开通营运，由滨湖新区直达合肥火车站，是合肥南北向交通的主动脉，距项目最近的云谷路站约为1.1公里；5号线已经开建，其东史岗路站与华山路站与项目无缝对接。S1号线，途经新桥机场、新高铁西站、高铁南站最终抵达巢湖岸边，将于项目东南角设站。“三纵”指三条南北向主干道——徽州大道、庐州大道和包河大道，连接滨湖新区与老城核心。“四横 ”为锦绣大道、紫云路、方兴大道和云谷路，贯穿滨湖新区和经开区。沿方兴大道向西驱车10分钟可上京台高速，30分钟可达机场高速入口，构成全方位、立体化的交通体系网，通达四周。', 7158, 22, '2020', '202008');
INSERT INTO `house` VALUES (16759, 0, 0, '2021-05-26 15:50:35', 0, '2021-05-26 16:20:08', 202006055, '琥珀东华府', 'D02,D03,D05,D09,D10', ' 23435.47  ', 172, 16896, '襄水路与半塔路交口西北角', '瑶海区', '住宅', '高层，洋房，其他。', '合肥城建发展股份有限公司', '安徽寰宇建筑设计院', '安徽琥珀物业服务有限公司', '项目北侧有龙湖瑶海天街、周边有保利东郡福禄街、宝业东城广场以及瑶海万达广场；安徽静安中西医结合医院、合肥市第二人民医院新区；目前项目小学为建设中襄河路小学，中学为建设中合肥第38中东区，项目临近大店小学，马岗实验小学，55中东区；周边有瑶海湾湿地公园、月亮湾公园', '项目周边有轨道交通地铁2号线可直达大东门、四牌楼、三里街、三里庵、大蜀山等地，还有快速公交5号线、123路、T9路、37路、38路、39路、112路等，其中快速公交5号线可直达市府广场。', 7088, 23, '2020', '202006');
INSERT INTO `house` VALUES (16760, 0, 0, '2021-05-26 15:50:35', 0, '2021-05-26 16:20:08', 202008024, '和枫雅园', 'G9#,G10#,G11#,G17#,G18#,XG1#,XG2#', ' 50141.01  ', 454, 20100, '合肥市经济技术开发区宿松路以东、规划支路以北', '经开区', '住宅', '高层、小高层、洋房', '合肥居峰置业有限公司', '安徽省城建设计研究总院股份有限公司 / 华东建筑设计研究院有限公司', '招商局物业管理有限公司合肥分公司', '周边3公里范围内有华润万象城、银泰、万达、正大广场等高端商业，此外距离刚刚签约的华润万象天地约1公里左右，商业配套成熟。距离海恒商业街、海恒农贸市场，日之惠等约1.6公里，生活便利。距离巨无霸“中央公园”仅约1.7公里，尽享中央公园的发展红利。同时中央公园也是天然氧吧，还有十五里河环绕，生态宜人。', '项目位于经开区宿松路与坝下路交口往北100米，位于政务东，中央公园旁，土地资源稀缺，发展潜力无限。距离1号线南站南广场站直线距离约2公里，未来还有4号线（在建），S1号线（规划中）汇聚于此，近距离享受地铁时代的便利。', 7194, 23, '2020', '202008');
