INSERT INTO `house` VALUES (16764, 0, 0, '2021-05-26 15:50:35', 0, '2021-05-26 16:20:10', 202008019, '双湖公馆', '26#,27#,31#,32#', ' 26823.14  ', 256, 15013, '合肥市庐阳区合淮路以东、文广路以北', '庐阳区', '普通住宅', '高层住宅、小高层、洋房', '合肥碧腾房地产有限公司', '广东博意建筑设计研究院有限公司', '广东碧桂园物业服务有限公司庐阳分公司', '项目周边商业配套成熟完善，紧邻本项目的大型商业体有明发商业广场、万科汇、汇银广场，里面拥有永辉超市、港荣百货、金逸影城，餐饮、银行等配套，购物休闲娱乐应有尽有，基本满足您的日常生活需求，全方位满足您的生活需求。', '四里河路、北一环、西二环、潜山路、长江西路四里河路、东至湖畔路，西至合淮路，南至文广路，北至草堂路，距离高速入口9.8公里，合肥老城区7.6公里。', 7181, 23, '2020', '202008');
INSERT INTO `house` VALUES (16765, 0, 0, '2021-05-26 15:50:35', 0, '2021-05-26 16:20:10', 202008020, '耀东雅园', '7#', ' 6741.86  ', 68, 14498, '明皇路和王岗路交口', '瑶海区', '高层、洋房', '框架剪力墙', '合肥力耀房地产开发有限公司', '华东建筑设计院研究院有限公司', '新力物业集团有限公司合肥分公司', '项目位瑶海万达商圈与龙湖天街商圈的交汇处，开车仅10分钟即可到达瑶海万达广场，另外步行15分钟可到即将开业的龙湖瑶海天街。除此之外，与项目一路之隔有皇马馫街商业中心，1公里内还有永辉超市、满天星购物中心。周边5公里内还有保利广场、保利广场等多个大型城市商业综合体，并且瑞泰公园，华凌游园双园环伺，生活休闲气息浓厚。', '合肥市瑶海区明皇路与王岗路交口西北角。乘坐地铁2号线（三十埠方向），在王岗站下车，向北步行1.7公里到达项目。146路、2路在王岗路公交站下车，向北步行500米左右到达项目。', 7167, 23, '2020', '202008');
INSERT INTO `house` VALUES (16766, 0, 0, '2021-05-26 15:50:35', 0, '2021-05-26 16:20:11', 202008021, '罗兰香谷花园', 'A9,A10,A11,B10', ' 35469.13  ', 344, 14798, '合肥市新站区淮海路与相城路交口西北处', '新站区', '住宅', '高层,洋房', '合肥和淮房地产有限责任公司', '中外建工程设计与顾问有限公司', '保利物业发展股份有限公司', '项目自建12班幼儿园，建成后移交政府；紧邻在建合肥九中新校区。项目西侧配备有12万方的商业配套，未来生活便利。西北方向3公里即为新站区重点打造的少荃湖湿地公园，西南方向2.5公里为学林公园，生态环境优越。', '项目南至淮海大道，零距离接驳地铁三号线首站相城路站，向西临近大众路，为合肥东城重要的主干道，未来将贯通新站、瑶海、包河和经开四大区域。', 7184, 23, '2020', '202008');
INSERT INTO `house` VALUES (16767, 0, 0, '2021-05-26 15:50:35', 0, '2021-05-26 16:20:11', 202008014, '融湖公馆', '15#,17#,18#,12#,16#', ' 50167.43  ', 312, 23790, '东自方兴社区瑞园社居委，西至湖北路，南起南京路，北邻扬子江东路', '滨湖区', '住宅', '高层、洋房', '合肥融创新越置业有限公司', '上海天华建筑设计工程有限公司', '融创物业服务集团有限公司合肥分公司', '悦方ID mall、利港银河广场、百大心悦城', '轨道一号线滨湖会展中心站', 7154, 23, '2020', '202008');
INSERT INTO `house` VALUES (16768, 0, 0, '2021-05-26 15:50:35', 0, '2021-05-26 16:20:12', 202008013, '旭恒花园', 'G2,G3', ' 10362.72  ', 62, 24998, '南京路以南、包河大道以西', '滨湖区', '住宅', '高层，小高层，洋房', '合肥和卓房地产开发有限公司', '安徽寰宇建筑设计院', '上海永升物业管理有限公司', '贯穿多个滨湖核心商圈，利港银河广场，悦方ID Mall还有银泰百货，联投中心书城和融创茂等，被称为商业中轴），项目东南角已经开业的百大心悦城，总规划建筑面积达10万㎡，目前已入驻主力店有合家福新零售超市、滨湖最大亲子家庭娱乐中心、安徽最大的天空农场等，项目东北角正在投资建设的安徽省立医院滨湖项目，西南角就是寿春中学滨湖校区，华山路小学、西侧为实验学校。', '总体为四横四纵四轨一环道：四横从北往南分别为锦绣大道、紫云路、方兴大道、云谷路；四纵是从东往西分别为上海路（北起裕溪路，南至方兴大道，双向八车道，是连接合肥南北交通的重要主干道）、包河大道（地处滨湖的政务中心，被称为政治中轴）、庐州大道（集滨湖主干道、地铁1号线于一体，徽州大道则是连接新老城区的经济中轴；四轨道有现在已经运营的地铁1号线，已经进入施工阶段地铁5号线和规划中的7号线及S1号线（新桥机场起点，经清溪路附近新西站，南下与4号线交汇，向东南与1号线在高铁南站交汇后最终抵达巢湖岸边）。沿方兴大道上G3京台高速入口沿六安方向，可快速直达新桥国际机场，出行便捷。', 7162, 23, '2020', '202008');
