INSERT INTO `house` VALUES (16772, 0, 0, '2021-05-26 15:50:36', 0, '2021-05-26 16:20:15', 202008012, '卓锦园', 'B3,B7,B10', ' 13710.22  ', 128, 18498, '合肥市包河区花园大道与重庆路交口', '包河区', '住宅', '高层、小高层、洋房', '合肥瑞钰置业有限公司', '上海尤安建筑设计院有限公司、安徽地平线建筑设计有限公司', '重庆华宇第一太平戴维斯物业服务集团有限公司', '项目临近地铁5号线花园大道站，位居省府之北，坐拥上海路、北京路、包河大道、繁华大道、锦绣大道等立体交通路网，无缝衔接合肥未来最具魅力的城市新空间、环巢湖国家级科创大走廊的核心区。周边滨湖国家森林公园、十五里河公园、骆岗中央公园三大公园环伺，生态资源丰富。', '', 7166, 24, '2020', '202008');
INSERT INTO `house` VALUES (16773, 0, 0, '2021-05-26 15:50:36', 0, '2021-05-26 16:20:16', 202008003, '新安花园', '2', ' 3730.92  ', 32, 16821, '合肥市瑶海区新安江路以北，广德路以东', '瑶海区', '居住物业', '剪力墙', '合肥崇源房地产开发有限公司', '浙江恒泰建筑设计院有限公司', '浙江佳源物业服务集团公司', '距离周边保利广场600米，2.5公里范围有宝业东城广场、瑶海万达、龙湖天街。对面朱砖井公园、900米龙岗游园、1200米月亮湾公园、1.5公里瑶海湾湿地公园，配套完善。', '距离地铁二号线东二十埠站750米，五号线在建，23、135、303、37、505、519、B3多路公交环绕，距离郎溪路高架800米，交通便利。', 7139, 24, '2020', '202008');
INSERT INTO `house` VALUES (16774, 0, 0, '2021-05-26 15:50:36', 0, '2021-05-26 16:20:16', 202008006, '雍容雅苑', 'C2,C3,C9,C10,C15', ' 38241.44  ', 347, 21594, '包河区北京路与歙县路交叉口', '包河区', '住宅 商业', '高层 小高层 洋房', '合肥禹博房地产开发有限公司', ' 安徽寰宇建筑设计院', '禹洲物业服务有限公司', '项目周边分布马鞍山路沿线商圈，其中包括万达广场、加侨国际广场、绿地瀛海、百大购物广场、新都会环球购物广场等多个醇熟商业，购物、美食、休闲、娱乐应有尽有。', '轨道交通：紧邻的2条地铁线分别是地铁1号线(葛大店站)、地铁4号线(大强路站)；以及规划中的5号线、6号线。 道路交通：项目被“四横五纵”城市主干道围绕。四横为南二环（郎溪路）、祁门路、龙川路、繁华大道，可快速到达政务区、经开区；五纵为徽州大道、庐州大道、包河大道、上海路及北京路，可快速到达老城区、滨湖新区。', 7129, 24, '2020', '202008');
INSERT INTO `house` VALUES (16775, 0, 0, '2021-05-26 15:50:36', 0, '2021-05-26 16:20:17', 202008004, '新安花园', '1,3,5,6,7,8', ' 44544.90  ', 413, 15654, '合肥市瑶海区新安江路以北，广德路以东', '瑶海区', '居住物业', '剪力墙', '合肥崇源房地产开发有限公司', '浙江恒泰建筑设计院有限公司', '浙江佳源物业服务集团公司', '距离周边保利广场600米，2.5公里范围有宝业东城广场、瑶海万达、龙湖天街。对面朱砖井公园、900米龙岗游园、1200米月亮湾公园、1.5公里瑶海湾湿地公园，配套完善。', '距离地铁二号线东二十埠站750米，五号线在建，23、135、303、37、505、519、B3多路公交环绕，距离郎溪路高架800米，交通便利。', 7138, 24, '2020', '202008');
INSERT INTO `house` VALUES (16776, 0, 0, '2021-05-26 15:50:36', 0, '2021-05-26 16:20:17', 201911060, '锦云阁', '3,6,9,11', ' 41585.95  ', 286, 23432, '合肥市滨湖区南京路与华山路交口', '滨湖区', '住宅', '高层/小高层', '合肥瑞远置业有限公司', '浙江恒泰建筑设计院有限公司安徽分公司', '重庆华宇第一太平戴维斯物业服务集团有限公司', '百大心悦城、悦方茂、世纪金源购物中心、省政府、省立医院', '滨湖区扬子江路以南华山路以东', 6623, 24, '2019', '201911');
INSERT INTO `house` VALUES (16777, 0, 0, '2021-05-26 15:50:36', 0, '2021-05-26 16:20:17', 202008002, '和锦东园', 'G1,G2,G3,G5,G6,G7,G8', ' 79575.02  ', 734, 22498, '上海路以东，紫云路以北', '滨湖区', '住宅，商业 ', '洋房、小高层、高层 ', '合肥和禹房地产开发有限公司', '安徽地平线建筑设计有限公司', '保利物业发展股份有限公司安徽分公司', '项目自建约5000㎡社区商业，一路之隔为在建的招商花漫里商业街区，3公里范围内有百大心悦城、悦方IDMALL等商业综合体；自建2座21班幼儿园，02地块西南侧规划学校用地；临近在建的省立医院总院；享十五里河公园、方兴湖公园等景观。', '西侧上海路，南侧紫云路；紧邻在建的地铁5号线与规划的地铁7号线交汇站“紫云路”站，靠近在建的地铁5号线“扬子江路”站。', 7161, 24, '2020', '202008');
INSERT INTO `house` VALUES (16778, 0, 0, '2021-05-26 15:50:36', 0, '2021-05-26 16:20:18', 202008001, '和水雅居', '12,13,20', ' 18857.62  ', 182, 12997, '项王路和卧龙湖路交口', '新站区', '住宅', '小高层、洋房', '合肥茂旸置业有限公司', '上海方大建筑设计事务所', '优居美家物业服务有限责任公司合肥分公司', '紧邻项目西侧规划的 254 地块未来会设有一个大型的 商业中心，配备不少于 150间客房的星级酒店和 5 万方的街区商业。东方大道与铜陵北路交口还规划一个 5 万方左右的地铁商业，如果您想感受下民族文化氛围，项目周边 2km 左右范围内，有极具特色的 1500 米磨店老街、百大商业广场，拓基广场、黉街和文一陶冲湖城市广场商业圈，包含购物广场、超市、影院等商业配套亦可满足您的日常需求。如果您想去稍微远一点的商场，从新蚌埠路 15 分钟左右可以直达武里山天街、家天下生活广场；30 分钟左右车程即可到达瑶海万达、宝业东城广场、保利广场商圈，满足吃、喝、玩、乐、购一站式购物需求。 学区配套： 项目西北角配备了一个面积达 4500 ㎡的 15班幼儿园，也是作为公立幼儿园的最高标准建设的，东南 1.2 公里左右的庆平学校是由红军战士王庆平的名字命名的，可以说也是红色教育基地，是目前新站最大的公办学校，师资力量也是非常优秀的，同时也是安徽省最大的图书馆流通网点，有利于孩子的成长。项目 1 公里左右还有规划的少荃小学，为孩子提供更好的国际化教育，项目南侧 700 米左右的台湾康桥国际学校更是拥有从幼儿园到高中的一站式国际化教育服务。 医疗配套： 新站区最好的两个医院距离本项目均在10分钟左右车程。安医大第四附属医院，它是省城东北部第一家三甲级医院。以及安徽首家数字化全科医院，京东方数字医院，这是北上广等一线城市才会有的数字化医院，整个医院投资32个亿，并于19年3月21日已经正式开诊。', '项目位于东方大道与卧龙湖路交口，东接合肥东城新区，西与庐阳相通，北连北部新城，南与市区无缝对接。项目周边道路四通八达，形成三横三纵一地铁三维立体交通网，出行十分便捷。三横为魏武路、东方大道、淮海大道，三纵为新蚌埠路、铜陵北路、文忠路。由东方大道到新蚌埠路上三十头绕城高速，迅速到达省内外；而新蚌埠路向南可以到达老城区步行街银泰；而临近项目的铜陵北路高架则是合肥未来最长的一条高架（预计 2021 年通车），到达滨湖融创茂也只需要 30 分钟左右的车程，同时它可以连接包河，滨湖，政务，经开等主要区域。 地铁配套：地铁 4 号线（地铁 4 号线北起新站，途经政务区天鹅湖，西至高新区，预计 2021 年 12月通车），首发站东方大道站距离项目仅 300 米，步行5分钟左右即可到达！可以说是我们最纯正的地铁房，未来的 4 号线可以无缝对接合肥1-2-3-5 等多条地铁线路，让您可以畅通合肥的各个角落，地铁4号线预计2021年1月通车；公交配套：项目周边有 681 路、686 路，直接连通火车站和市区方向，可以快速到达老城区。', 7155, 24, '2020', '202008');
INSERT INTO `house` VALUES (16779, 0, 0, '2021-05-26 15:50:36', 0, '2021-05-26 16:20:18', 202008011, '麓湖府', 'G3', ' 5818.80  ', 60, 16500, '庐阳区合淮路和枣园路交口', '庐阳区', '住宅', '高层、洋房', '合肥昌哲房地产开发有限公司', '华东建筑设计研究院有限公司，安徽地平线建筑设计有限公司', '上海永升物业管理有限公司', '小区内幼儿园，学校、商业、银行', '公交站', 7159, 25, '2020', '202008');
INSERT INTO `house` VALUES (16780, 0, 0, '2021-05-26 15:50:36', 0, '2021-05-26 16:20:19', 202008009, '瑞禧园', '15#,23#', ' 16837.52  ', 134, 21746, '合肥市包河区合巢路以北、马鞍山路以西', '包河区', '小高层；洋房', '剪力墙', '安徽汇和置业有限公司', '柏涛建筑设计（深圳）有限公司', '安徽信联物业服务有限公司', '商业配套：此处生活氛围浓厚醇熟，罍街、后街，5分钟即可到达，一路之隔就是百大购物中心，绿地缤纷城等城市综合体，除此之外，开车五、十分钟车程（地铁三站路）即可到达银泰中心或包河万达商圈。 教育配套：作为积累多年的主城区核心位置，占据最优质的学区资源：项目自建二十四班制的幼儿园，周边卫岗小学、六十五中、三十二中、合工大、中科大. 医疗配套：项目周边医疗资源十分丰富，西向是合肥市第二人民医院、合肥市第三人民医院，还可以快速的抵达安医附院、省立医院，10分钟左右即可到达安徽省儿童医院等，众多大型三级甲等综合性医院环伺。', '公共交通：项目紧邻地铁1号线(秋浦河路站)相距百米，下楼举步即达，同时与合肥2号线、在建3、4、5号线都有交汇换成站，周边还有一条规划6号线地铁，届时将形成米字型地铁交通网。项目周边有多条公交线路：51路、99路、109路、138路、515路、902路、B7路等； 道路交通：坐拥便捷多元的立体交通，路网四通八达，项目被“三横三纵”城市主干道围绕：三横为南二环、南一环、望江路，三条主干道贯穿东西，连接合肥城市路网，三纵为徽州大道、马鞍山路、东二环（郎溪路），立体的交通网络，快速通达主城区各个区域，四通八达的交通路网完美地保障了未来业主的出行.', 7127, 25, '2020', '202008');
INSERT INTO `house` VALUES (16781, 0, 0, '2021-05-26 15:50:36', 0, '2021-05-26 16:20:19', 202008005, '四季春晓花园', '9#', ' 4692.89  ', 44, 14499, '合肥市瑶海区包公大道和烈山路交口', '瑶海区', '住宅', '高层，小高层', '合肥金科百俊房地产开发有限公司', '成都基准方中建筑设计有限公司合肥分公司', '金科物业服务集团有限公司', '医院：瑶海区龙岗医院 静安中西结合医院 教育：琥珀名城包公大道校区（小学） 、五十五中东校区、合肥十中（省重点高中） 商业：瑶海万达、龙湖天街、长江批发市场 银行：中国建设银行、中国农业银行 社区内配套：自建公园、儿童主题乐活空间 其他：学林公园、云河湾公园、月亮湾公园、瑞泰公园 ', '公交：40路、511路 地铁：地铁2号线（距离地铁站2.5KM）、3号线 ', 7153, 25, '2020', '202008');
INSERT INTO `house` VALUES (16782, 0, 0, '2021-05-26 15:50:36', 0, '2021-05-26 16:20:20', 202007056, '乐悦湾', '7,10,12,17', ' 21836.38  ', 226, 12999, '新站区天水路以南九顶山路以西', '新站区', '住宅', '小高层', '合肥瀚德房地产开发有限公司', '启迪设计集团股份有限公司', '安徽乐富强物业管理有限公司', '1、商业配套：项目配建综合社区中心，附近有宜家超市、宝湾国际建材家居城、武里山天街。2、医疗配套：安徽省第二人民医院、长荣医院。3、教育配套：淮合花园幼儿园、小学、中学。', '项目位于三条城市主干道九顶山路与淮南路交口东北角，天水路西侧，出门即有多条公交线，距离地铁1号线延长线和阜阳北路高架仅5分钟车程，距离北二环仅3分钟车程，交通便利，通达性极强。', 7017, 25, '2020', '202007');
INSERT INTO `house` VALUES (16783, 0, 0, '2021-05-26 15:50:36', 0, '2021-05-26 16:20:20', 202007057, '映月湾', '11#,16#,5#', ' 28127.68  ', 224, 21199, '规划固镇路以南、规划大房郢路以东', '庐阳区', '住宅、商业', '洋房、小高层、高层', '合肥市明誉房地产开发有限公司', '华东建筑设计研究院有限公司', '广州市宁骏物业管理有限公司', '', '', 7131, 25, '2020', '202007');
INSERT INTO `house` VALUES (16784, 0, 0, '2021-05-26 15:50:36', 0, '2021-05-26 16:20:21', 201911059, '旭恒花园', 'G15#,G13#,G6#,G7#,G8#,G9#', ' 47793.58  ', 268, 24998, '南京路以南、包河大道以西', '滨湖区', '住宅', '高层，小高层，洋房', '合肥和卓房地产开发有限公司', '安徽寰宇建筑设计院', '上海永升物业管理有限公司', '贯穿多个滨湖核心商圈，利港银河广场，悦方ID Mall还有银泰百货，联投中心书城和融创茂等，被称为商业中轴），项目东南角已经开业的百大心悦城，总规划建筑面积达10万㎡，目前已入驻主力店有合家福新零售超市、滨湖最大亲子家庭娱乐中心、安徽最大的天空农场等，项目东北角正在投资建设的安徽省立医院滨湖项目，西南角就是寿春中学滨湖校区，华山路小学、西侧为实验学校。', '总体为四横四纵四轨一环道：四横从北往南分别为锦绣大道、紫云路、方兴大道、云谷路；四纵是从东往西分别为上海路（北起裕溪路，南至方兴大道，双向八车道，是连接合肥南北交通的重要主干道）、包河大道（地处滨湖的政务中心，被称为政治中轴）、庐州大道（集滨湖主干道、地铁1号线于一体，徽州大道则是连接新老城区的经济中轴；四轨道有现在已经运营的地铁1号线，已经进入施工阶段地铁5号线和规划中的7号线及S1号线（新桥机场起点，经清溪路附近新西站，南下与4号线交汇，向东南与1号线在高铁南站交汇后最终抵达巢湖岸边）。沿方兴大道上G3京台高速入口沿六安方向，可快速直达新桥国际机场，出行便捷。', 6631, 25, '2019', '201911');
INSERT INTO `house` VALUES (16785, 0, 0, '2021-05-26 15:50:36', 0, '2021-05-26 16:20:21', 201912034, '旭恒花园', 'G10#,G11#,G12#', ' 41931.07  ', 292, 22499, '南京路以南、包河大道以西', '滨湖区', '住宅', '高层，小高层，洋房', '合肥和卓房地产开发有限公司', '安徽寰宇建筑设计院', '上海永升物业管理有限公司', '贯穿多个滨湖核心商圈，利港银河广场，悦方ID Mall还有银泰百货，联投中心书城和融创茂等，被称为商业中轴），项目东南角已经开业的百大心悦城，总规划建筑面积达10万㎡，目前已入驻主力店有合家福新零售超市、滨湖最大亲子家庭娱乐中心、安徽最大的天空农场等，项目东北角正在投资建设的安徽省立医院滨湖项目，西南角就是寿春中学滨湖校区，华山路小学、西侧为实验学校。', '总体为四横四纵四轨一环道：四横从北往南分别为锦绣大道、紫云路、方兴大道、云谷路；四纵是从东往西分别为上海路（北起裕溪路，南至方兴大道，双向八车道，是连接合肥南北交通的重要主干道）、包河大道（地处滨湖的政务中心，被称为政治中轴）、庐州大道（集滨湖主干道、地铁1号线于一体，徽州大道则是连接新老城区的经济中轴；四轨道有现在已经运营的地铁1号线，已经进入施工阶段地铁5号线和规划中的7号线及S1号线（新桥机场起点，经清溪路附近新西站，南下与4号线交汇，向东南与1号线在高铁南站交汇后最终抵达巢湖岸边）。沿方兴大道上G3京台高速入口沿六安方向，可快速直达新桥国际机场，出行便捷。', 6726, 25, '2019', '201912');
INSERT INTO `house` VALUES (16786, 0, 0, '2021-05-26 15:50:36', 0, '2021-05-26 16:20:22', 202007022, '锦云阁', '10', ' 8969.75  ', 60, 23651, '合肥市滨湖区南京路与华山路交口', '滨湖区', '住宅', '高层/小高层', '合肥瑞远置业有限公司', '浙江恒泰建筑设计院有限公司安徽分公司', '重庆华宇第一太平戴维斯物业服务集团有限公司', '百大心悦城、悦方茂、世纪金源购物中心、省政府、省立医院', '滨湖区扬子江路以南华山路以东', 7112, 25, '2020', '202007');
INSERT INTO `house` VALUES (16787, 0, 0, '2021-05-26 15:50:36', 0, '2021-05-26 16:20:22', 202007031, '云锦别院', 'Y13,Y17,Y18', ' 22016.74  ', 176, 14473, '梦溪路以东，浍水路以南', '新站区', '住宅', '洋房，高层', '合肥盛哲房地产开发有限公司', '悉地国际设计顾问（深圳）有限公司', '上海永升物业管理股份有限公司', '学校、商业、银行', '公交站', 7126, 25, '2020', '202007');
INSERT INTO `house` VALUES (16788, 0, 0, '2021-05-26 15:50:36', 0, '2021-05-26 16:20:23', 202007033, '文一塘溪津门', '41', ' 3757.14  ', 20, 25303, '滨湖新区包河大道与杭州路交口', '滨湖区', '住宅', '高层、洋房', '安徽省文一投资控股集团滨江置业有限公司', '北京高能筑博建筑设计有限公司', '安徽省文一物业管理有限公司', '环境：项目紧邻方兴湖和巢湖两大水系，同时为塘西河公园、金斗公园、方兴湖公园和岸上草原所环抱，公园面积高达万亩。商业：项目自持近10万方的文化商业街，打造合肥城市会客厅。此外，南接万达文旅城和恒大中心，东邻银泰中心和中心书城，北连悦方IDmall和世纪金源，众多商业中心伺散。学区：项目南面沿云谷路建有幼儿园和小学。同时一中、四十八中、四十六中和师范附小等名校坐落周边，教育资源得天独厚。医疗：滨湖医院距离项目仅4公里。省立医院总部正在规划筹建，位于项目北侧，相距不过5分钟车程。旅游：万达文化旅游城、牛角大圩生态旅游区、滨湖湿地公园、巢湖岸边的岸上草原、滨湖十大省级文化场馆，加上会申报国家AAAA级景区的塘溪津门水街将，形成一片完整的环巢湖旅游带。', '项目交通状况用“一环二铁三纵四横”来概括。“一环”，即环巢湖大道，被誉为“合肥最美道路”之一。沿线向东可达巢湖城区，向西达国家AAAAA级风景区——三河古镇。“二铁”，指高铁南站和三条地铁线。高铁南站距项目约10公里，借此可达省外；其次项目紧邻三条地铁，1号线已开通营运，由滨湖新区直达合肥火车站，是合肥南北向交通的主动脉，距项目最近的云谷路站约为1.1公里；5号线已经开建，其东史岗路站与华山路站与项目无缝对接。S1号线，途经新桥机场、新高铁西站、高铁南站最终抵达巢湖岸边，将于项目东南角设站。“三纵”指三条南北向主干道——徽州大道、庐州大道和包河大道，连接滨湖新区与老城核心。“四横 ”为锦绣大道、紫云路、方兴大道和云谷路，贯穿滨湖新区和经开区。沿方兴大道向西驱车10分钟可上京台高速，30分钟可达机场高速入口，构成全方位、立体化的交通体系网，通达四周。', 7111, 25, '2020', '202007');
INSERT INTO `house` VALUES (16789, 0, 0, '2021-05-26 15:50:37', 0, '2021-05-26 16:20:23', 202007024, '悦湖西岸小区', '8', ' 2380.42  ', 16, 18037, '高新区火龙地路与彩虹西路交口东北角', '高新区', '住宅', '高层、洋房', '合肥乐富强房地产开发有限公司', '安徽五维空间建筑设计咨询有限公司', '安徽乐富强物业管理有限公司', '周边配套： 自然资源：2100亩蜀西湖、大蜀山等山湖资源； 医疗配套：安徽医科大学附属医院高新区分院，安徽最大省级三甲医院；安徽妇幼保健院西区等。 教育配套：高新实验学校湖滨校区、永和中学 商业配套：砂之船奥特莱斯艺术商业广场、银泰城购物中心也即将于2020年开业。', '交通路网：临近长江西路、方兴大道等交通主干道； 轨道交通：2号线南岗站、建设中4号线、规划中7号； 公交路线：29路、650路、665路等', 7119, 26, '2020', '202007');
INSERT INTO `house` VALUES (16790, 0, 0, '2021-05-26 15:50:37', 0, '2021-05-26 16:20:24', 202007018, '昆仑府', 'Y01,Y02,Y03,Y05,Y06,Y07,Y08,Y09,Y10,Y11,Y16,Y21', ' 53612.58  ', 360, 23998, '成都路与贵州路交口', '滨湖区', '住宅', '高层、小高层、洋房', '合肥润创房地产开发有限公司', '上海地东建筑设计事务所', '华润置地（武汉）物业管理有限公司', '银泰商圈、融创商圈、奥特莱斯商圈三大商圈交汇；滨湖湿地公园、金斗公园、塘西河公园等六大城市公园', '项目临近建设中的地铁5号线和1号线，5横5纵交通路网', 7130, 26, '2020', '202007');
INSERT INTO `house` VALUES (16791, 0, 0, '2021-05-26 15:50:37', 0, '2021-05-26 16:20:25', 202007019, '悦和院', '2,3,4,9,10,11,12,13', ' 46000.58  ', 398, 21999, '东至宿松路，西至仰光街，南至水阳江路，北至牧童路。', '包河区', '住宅、商业、办公', '高层、小高层、洋房', '中铁四局集团房地产开发有限公司', '中铁四局集团有限公司', '合肥市佳家物业管理有限责任公司', '本案西侧地块为在建老年大学；北侧以住宅区为主，同时包含南七菜市场及合肥市61中学。 ', '包河区老城区核心地段，蜀山区及包河区交界处；距离高铁南站3.5km，本案位于包河区宿松路与水阳江路交口，距地铁5号线休宁路站约300米，距地铁5、6号线交口望江路站约500米，离高铁南站约10分钟车程。周边公交线路117路、150路、16路、41路、163路等交通便利。 ', 7132, 26, '2020', '202007');
INSERT INTO `house` VALUES (16792, 0, 0, '2021-05-26 15:50:37', 0, '2021-05-26 16:20:25', 202007020, '玖悦花园', 'G5,G3', ' 15672.60  ', 128, 21499, '成都路以南，云南路以东', '滨湖区', '住宅', '高层、小高层、洋房', '合肥中海宏洋海晟房地产开发有限公司', '梁黄顾建筑设计（深圳）有限公司', '中海宏洋物业管理有限公司合肥分公司', '临近滨湖文旅城、银泰城、悦方IDMALL 、首创奥特莱斯等商业配套，近享金斗公园、塘西河沙滩公园、方兴湖湿地公园天然氧吧，滨湖妇幼保健院、口腔医院滨湖分院、滨湖医院等24小时护航健康。同时1公里范围内交通配套完善，出行较为便捷，同时项目周边临近地铁5号线成都路站（规划）；自建约12万方旗舰商业，毗邻周边云谷金融城、金谷广场等已建成商业；临近合肥师范附小三小、阳光中学等学校；项目西侧为市政规划绿地，整体来看，项目周边居住氛围较好。', '项目位于滨湖区金融板块，位于成都路与贵州路交汇处西南角。项目紧邻地铁5号线成都路站（规划），与1号线交汇。沿成都路往西约800米，达徽州大道，向北约200米达云谷路，以城市主干道交织滨湖枢纽核心轴。区域交通较为便捷。', 7121, 26, '2020', '202007');
INSERT INTO `house` VALUES (16793, 0, 0, '2021-05-26 15:50:37', 0, '2021-05-26 16:20:26', 202007021, '玖悦花园', 'Y7,Y17,Y27', ' 21021.89  ', 150, 24897, '成都路以南，云南路以东', '滨湖区', '住宅', '高层、小高层、洋房', '合肥中海宏洋海晟房地产开发有限公司', '梁黄顾建筑设计（深圳）有限公司', '中海宏洋物业管理有限公司合肥分公司', '临近滨湖文旅城、银泰城、悦方IDMALL 、首创奥特莱斯等商业配套，近享金斗公园、塘西河沙滩公园、方兴湖湿地公园天然氧吧，滨湖妇幼保健院、口腔医院滨湖分院、滨湖医院等24小时护航健康。同时1公里范围内交通配套完善，出行较为便捷，同时项目周边临近地铁5号线成都路站（规划）；自建约12万方旗舰商业，毗邻周边云谷金融城、金谷广场等已建成商业；临近合肥师范附小三小、阳光中学等学校；项目西侧为市政规划绿地，整体来看，项目周边居住氛围较好。', '项目位于滨湖区金融板块，位于成都路与贵州路交汇处西南角。项目紧邻地铁5号线成都路站（规划），与1号线交汇。沿成都路往西约800米，达徽州大道，向北约200米达云谷路，以城市主干道交织滨湖枢纽核心轴。区域交通较为便捷。', 7122, 26, '2020', '202007');
INSERT INTO `house` VALUES (16794, 0, 0, '2021-05-26 15:50:37', 0, '2021-05-26 16:20:26', 202007023, '翡丽东方花园', 'Y5,Y6', ' 10440.81  ', 88, 14305, '瑶海区半塔北路东、丰乐亭路北', '瑶海区', '住宅', '高层、洋房', '合肥玖叁置业有限公司', '华东建筑设计研究院有限公司', '南京弘阳物业管理有限公司合肥分公司', '项目周边有华联、满天星购物中心等生活超市。附近还有瑶海天街商业综合体、瑶海万达、保利广场。医疗方面有合肥广慈医院，瑶海区龙岗卫生服务站。合肥市第二人民医院。', '项目北边包公大道，南边紧邻临泉路，西边郎溪路，附近不远处就是地铁轨道2号线三十埠站，也有2路、146路、154路、39路等公交线路可供选择。', 7079, 26, '2020', '202007');
INSERT INTO `house` VALUES (16795, 0, 0, '2021-05-26 15:50:37', 0, '2021-05-26 16:20:26', 202007011, '鹭湖花园', '8,13', ' 10350.16  ', 96, 19366, '合肥市高新区彩虹西路与方兴大道交口西南角', '高新区', '住宅', '高层、小高层、洋房', '安徽鹏欣房地产开发有限公司', '启迪设计集团股份有限公司', '金鹏祥和物业管理有限公司', ' 以蜀西湖商圈为主，砂之船奥特莱斯商业广场、祥源城商业街、在建银泰城、汇景广场等；北雁湖后期规划大量商业配套，可以提升片区商业环境；“一山两湖”自然景观；', '临近长江路、方兴大道、望江西路多条主干道；距离地铁2号线2km，在建地铁4（6）号线，距离项目0.5km。', 7110, 26, '2020', '202007');
INSERT INTO `house` VALUES (16796, 0, 0, '2021-05-26 15:50:37', 0, '2021-05-26 16:20:27', 202007012, '麓湖府', 'X23', ' 5848.82  ', 36, 18957, '庐阳区合淮路和枣园路交口', '庐阳区', '住宅', '高层、洋房', '合肥昌哲房地产开发有限公司', '华东建筑设计研究院有限公司，安徽地平线建筑设计有限公司', '上海永升物业管理有限公司', '小区内幼儿园，学校、商业、银行', '公交站', 7120, 26, '2020', '202007');
INSERT INTO `house` VALUES (16797, 0, 0, '2021-05-26 15:50:37', 0, '2021-05-26 16:20:27', 202007013, '旭恒花园', 'G1#,G5#', ' 22031.10  ', 126, 22499, '南京路以南、包河大道以西', '滨湖区', '住宅', '高层，小高层，洋房', '合肥和卓房地产开发有限公司', '安徽寰宇建筑设计院', '上海永升物业管理有限公司', '贯穿多个滨湖核心商圈，利港银河广场，悦方ID Mall还有银泰百货，联投中心书城和融创茂等，被称为商业中轴），项目东南角已经开业的百大心悦城，总规划建筑面积达10万㎡，目前已入驻主力店有合家福新零售超市、滨湖最大亲子家庭娱乐中心、安徽最大的天空农场等，项目东北角正在投资建设的安徽省立医院滨湖项目，西南角就是寿春中学滨湖校区，华山路小学、西侧为实验学校。', '总体为四横四纵四轨一环道：四横从北往南分别为锦绣大道、紫云路、方兴大道、云谷路；四纵是从东往西分别为上海路（北起裕溪路，南至方兴大道，双向八车道，是连接合肥南北交通的重要主干道）、包河大道（地处滨湖的政务中心，被称为政治中轴）、庐州大道（集滨湖主干道、地铁1号线于一体，徽州大道则是连接新老城区的经济中轴；四轨道有现在已经运营的地铁1号线，已经进入施工阶段地铁5号线和规划中的7号线及S1号线（新桥机场起点，经清溪路附近新西站，南下与4号线交汇，向东南与1号线在高铁南站交汇后最终抵达巢湖岸边）。沿方兴大道上G3京台高速入口沿六安方向，可快速直达新桥国际机场，出行便捷。', 7123, 26, '2020', '202007');
