INSERT INTO `house` VALUES (16826, 0, 0, '2021-05-26 15:50:38', 0, '2021-05-26 16:20:42', 202006037, '海悦公馆', 'A3跃层,A5跃层', ' 12638.34  ', 120, 17999, '瑶海区明皇路与龙岗路交口', '瑶海区', '住宅、车位、商业等', '高层、洋房、其他', '合肥和旭房地产有限公司', '中外建工程设计与顾问公司', '保利物业发展股份有限公司安徽分公司', '项目东北边约2km学林公园，总规划面积约1600亩。该公园规划为一座生态休闲游乐型公园，结合高教基地特色商业街区，丰富人们的城市生活，构建环境优美开放式的城市空间。项目东南面是月亮湾公园，东起龙岗路、西至大众路，北起长江东路、南至合裕路，利用二十埠河等河流进行打造。本项目邻近瑶海万达、保利广场、瑶海天街，宝业东城广场四大商圈，完美满足吃喝玩乐购一站式消费。', '我们项目周边交通发达，由城市主干道、高架、地铁、高速、高铁、公交线路等立体交通网络组成，出行十分便捷。项目周边有“五纵五横”的城市主干道：东西向长江东路、新安江路（长江东大街）、裕溪路高架、包公大道、临泉东路成“五横”，内接主城，外辐江浙；南北向铜陵路高架、东二环、郎溪路、大众路、龙岗路为“五纵”。项目距离地铁2号线龙岗站直线距离约1.7KM；另外项目西北边1.5km处是轨道交通3号线，距离3号线的星海大道站直线距离约1.5KM、窦桥湾约1.7KM。', 7075, 29, '2020', '202006');
INSERT INTO `house` VALUES (16827, 0, 0, '2021-05-26 15:50:38', 0, '2021-05-26 16:20:43', 202006041, '文一塘溪津门', '15', ' 8275.36  ', 60, 20999, '滨湖新区包河大道与杭州路交口', '滨湖区', '住宅', '高层、洋房', '安徽省文一投资控股集团滨江置业有限公司', '北京高能筑博建筑设计有限公司', '安徽省文一物业管理有限公司', '环境：项目紧邻方兴湖和巢湖两大水系，同时为塘西河公园、金斗公园、方兴湖公园和岸上草原所环抱，公园面积高达万亩。商业：项目自持近10万方的文化商业街，打造合肥城市会客厅。此外，南接万达文旅城和恒大中心，东邻银泰中心和中心书城，北连悦方IDmall和世纪金源，众多商业中心伺散。学区：项目南面沿云谷路建有幼儿园和小学。同时一中、四十八中、四十六中和师范附小等名校坐落周边，教育资源得天独厚。医疗：滨湖医院距离项目仅4公里。省立医院总部正在规划筹建，位于项目北侧，相距不过5分钟车程。旅游：万达文化旅游城、牛角大圩生态旅游区、滨湖湿地公园、巢湖岸边的岸上草原、滨湖十大省级文化场馆，加上会申报国家AAAA级景区的塘溪津门水街将，形成一片完整的环巢湖旅游带。', '项目交通状况用“一环二铁三纵四横”来概括。“一环”，即环巢湖大道，被誉为“合肥最美道路”之一。沿线向东可达巢湖城区，向西达国家AAAAA级风景区——三河古镇。“二铁”，指高铁南站和三条地铁线。高铁南站距项目约10公里，借此可达省外；其次项目紧邻三条地铁，1号线已开通营运，由滨湖新区直达合肥火车站，是合肥南北向交通的主动脉，距项目最近的云谷路站约为1.1公里；5号线已经开建，其东史岗路站与华山路站与项目无缝对接。S1号线，途经新桥机场、新高铁西站、高铁南站最终抵达巢湖岸边，将于项目东南角设站。“三纵”指三条南北向主干道——徽州大道、庐州大道和包河大道，连接滨湖新区与老城核心。“四横 ”为锦绣大道、紫云路、方兴大道和云谷路，贯穿滨湖新区和经开区。沿方兴大道向西驱车10分钟可上京台高速，30分钟可达机场高速入口，构成全方位、立体化的交通体系网，通达四周。', 7060, 29, '2020', '202006');
INSERT INTO `house` VALUES (16828, 0, 0, '2021-05-26 15:50:38', 0, '2021-05-26 16:20:43', 202006033, '卓锦园', 'C11,C12,C15', ' 17917.61  ', 156, 18498, '合肥市包河区花园大道与重庆路交口', '包河区', '住宅', '高层、小高层、洋房', '合肥瑞钰置业有限公司', '上海尤安建筑设计院有限公司、安徽地平线建筑设计有限公司', '重庆华宇第一太平戴维斯物业服务集团有限公司', '项目临近地铁5号线花园大道站，位居省府之北，坐拥上海路、北京路、包河大道、繁华大道、锦绣大道等立体交通路网，无缝衔接合肥未来最具魅力的城市新空间、环巢湖国家级科创大走廊的核心区。周边滨湖国家森林公园、十五里河公园、骆岗中央公园三大公园环伺，生态资源丰富。', '', 7071, 29, '2020', '202006');
INSERT INTO `house` VALUES (16829, 0, 0, '2021-05-26 15:50:39', 0, '2021-05-26 16:20:44', 202006034, '锦绣龙川府', 'E6,E7,E8', ' 6213.97  ', 40, 20788, '合肥市包河区龙川路以南、唐模路以东', '包河区', '住宅', '高层、小高层、洋房', '合肥宇信龙置业有限公司', '上海沪张思建筑规划设计事务所（有限合伙）', '重庆华宇第一太平戴维斯物业服务集团有限公司', '“四横四纵”城市主干道围绕，四横为南二环、祁门路、龙川路、繁华大道，可快速到达政务区、经开区；四纵为徽州大道、包河大道、北京路、上海路，可快速到达老城区、滨湖新区,附近有淝河智慧中央公园、淝河生态公园、南淝河生态公园、合肥中央公园。', '公交101路、9路、122路', 7007, 30, '2020', '202006');
INSERT INTO `house` VALUES (16830, 0, 0, '2021-05-26 15:50:39', 0, '2021-05-26 16:20:45', 202006038, '和熹花园', 'G1,G2,G3,G5,G6,G7,G8,G9,G10,G11,G12', ' 100250.88  ', 868, 22499, '上海路以东，紫云路以北', '滨湖区', '住宅，商业 ', '洋房、小高层、高层', '合肥和禹房地产开发有限公司', '安徽地平线建筑设计有限公司', '保利物业发展股份有限公司安徽分公司', '项目自建约5000㎡社区商业，一路之隔为在建的招商花漫里商业街区，3公里范围内有百大心悦城、悦方IDMALL等商业综合体；自建2座21班幼儿园，02地块西南侧规划学校用地；临近在建的省立医院总院；享十五里河公园、方兴湖公园等景观。', '西侧上海路，南侧紫云路；紧邻在建的地铁5号线与规划的地铁7号线交汇站“紫云路”站，靠近在建的地铁5号线“扬子江路”站。', 7051, 30, '2020', '202006');
INSERT INTO `house` VALUES (16831, 0, 0, '2021-05-26 15:50:39', 0, '2021-05-26 16:20:45', 202006044, '大成花苑', 'A10#,A12#', ' 11183.66  ', 72, 25821, '庐阳区怀宁路与固镇路交口西南角', '庐阳区', '普通住宅', '高层、洋房、其他', '合肥天沐房地产有限公司', '安徽地平线建筑设计有限公司', '长城物业集团股份有限公司', '项目面朝大蜀山，西观董铺水库，北近大房郢水库，以及庐州公园、植物园等环伺周围，项目的南边是长约4.9公里南淝河环绕；周边有汇银广场、明发商业广场、华润万象汇等，西一环可达三里庵商圈，怀宁路可直达黄潜望及政务区商圈。', '项目周边有东西走向四大城市主干道北二环路、临泉路、北一环路、长江西路，纵向主干道西二环路、潜山路、怀宁路。公交线路有44路、114路、157路、300路、512路，临近地铁3号线。', 7048, 30, '2020', '202006');
INSERT INTO `house` VALUES (16832, 0, 0, '2021-05-26 15:50:39', 0, '2021-05-26 16:20:46', 202006019, '和水雅居', '15,16,21,22', ' 21924.62  ', 220, 12997, '项王路和卧龙湖路交口', '新站区', '住宅', '小高层、洋房', '合肥茂旸置业有限公司', '上海方大建筑设计事务所', '优居美家物业服务有限责任公司合肥分公司', '紧邻项目西侧规划的 254 地块未来会设有一个大型的 商业中心，配备不少于 150间客房的星级酒店和 5 万方的街区商业。东方大道与铜陵北路交口还规划一个 5 万方左右的地铁商业，如果您想感受下民族文化氛围，项目周边 2km 左右范围内，有极具特色的 1500 米磨店老街、百大商业广场，拓基广场、黉街和文一陶冲湖城市广场商业圈，包含购物广场、超市、影院等商业配套亦可满足您的日常需求。如果您想去稍微远一点的商场，从新蚌埠路 15 分钟左右可以直达武里山天街、家天下生活广场；30 分钟左右车程即可到达瑶海万达、宝业东城广场、保利广场商圈，满足吃、喝、玩、乐、购一站式购物需求。 学区配套： 项目西北角配备了一个面积达 4500 ㎡的 15班幼儿园，也是作为公立幼儿园的最高标准建设的，东南 1.2 公里左右的庆平学校是由红军战士王庆平的名字命名的，可以说也是红色教育基地，是目前新站最大的公办学校，师资力量也是非常优秀的，同时也是安徽省最大的图书馆流通网点，有利于孩子的成长。项目 1 公里左右还有规划的少荃小学，为孩子提供更好的国际化教育，项目南侧 700 米左右的台湾康桥国际学校更是拥有从幼儿园到高中的一站式国际化教育服务。 医疗配套： 新站区最好的两个医院距离本项目均在10分钟左右车程。安医大第四附属医院，它是省城东北部第一家三甲级医院。以及安徽首家数字化全科医院，京东方数字医院，这是北上广等一线城市才会有的数字化医院，整个医院投资32个亿，并于19年3月21日已经正式开诊。', '项目位于东方大道与卧龙湖路交口，东接合肥东城新区，西与庐阳相通，北连北部新城，南与市区无缝对接。项目周边道路四通八达，形成三横三纵一地铁三维立体交通网，出行十分便捷。三横为魏武路、东方大道、淮海大道，三纵为新蚌埠路、铜陵北路、文忠路。由东方大道到新蚌埠路上三十头绕城高速，迅速到达省内外；而新蚌埠路向南可以到达老城区步行街银泰；而临近项目的铜陵北路高架则是合肥未来最长的一条高架（预计 2021 年通车），到达滨湖融创茂也只需要 30 分钟左右的车程，同时它可以连接包河，滨湖，政务，经开等主要区域。 地铁配套：地铁 4 号线（地铁 4 号线北起新站，途经政务区天鹅湖，西至高新区，预计 2021 年 12月通车），首发站东方大道站距离项目仅 300 米，步行5分钟左右即可到达！可以说是我们最纯正的地铁房，未来的 4 号线可以无缝对接合肥1-2-3-5 等多条地铁线路，让您可以畅通合肥的各个角落，地铁4号线预计2021年1月通车；公交配套：项目周边有 681 路、686 路，直接连通火车站和市区方向，可以快速到达老城区。', 7064, 30, '2020', '202006');
