INSERT INTO `house` VALUES (16835, 0, 0, '2021-05-26 15:50:39', 0, '2021-05-26 16:20:47', 202006016, '郎溪尚里', '3#,11#', ' 12040.71  ', 108, 15555, '郎溪路与明皇路交口', '瑶海区', '住宅', '高层 跃层复式', '合肥泽翔房地产开发有限公司', '上海宝厦建筑设计有限公司', '禹洲物业服务有限公司', '作为瑶海中心，商业配套十分成熟，5分钟车程可到达瑶海万达广场,15分钟车程的保利广场、宝业东城广场。', '毗邻地铁2号线东二十埠站，地铁3号线经三路站（在建中），执掌双轨交通，郎溪路、包公大道等城市主干道环绕周边 小区门口设有303路公交站，同时明皇路设有502路等11条公交线路，出行方便', 7013, 30, '2020', '202006');
INSERT INTO `house` VALUES (16836, 0, 0, '2021-05-26 15:50:39', 0, '2021-05-26 16:20:48', 202006021, '金茂湾', 'G17,G19,G21', ' 26495.44  ', 188, 19709, '文曲路和习友路东南角', '高新区', '住宅、商业', '高层、其他住宅', '安徽新华新茂置业有限公司', '华东建筑设计研究院有限公司', '中国金茂物业管理（北京）有限公司', '安徽医科大学附属口腔医院，小区配套幼儿园，梦园小学，中加国际学校，合肥七中新校区', '地铁2号线、4号线，7号线。习友路西接方兴大道，向北直达政务区，向南直通滨湖新区，交通四通八达。', 7053, 30, '2020', '202006');
