INSERT INTO `house` VALUES (16856, 0, 0, '2021-05-26 15:50:40', 0, '2021-05-26 16:20:58', 202005016, '听悦湾', '2,3,11,15,17,20,21,22', ' 55694.00  ', 589, 14306, '淮海大道与前岭路交口东南角', '新站区', '住宅', '高层/小高层', '合肥梁锦企业管理咨询有限公司', '上海联创设计集团股份有限公司', '安庆大发物业管理有限公司', '商业：距离项目约2公里拓基广场、黉街、家乐福超市；医疗：距项目约1400米，安徽医科大学第四附属医院；金融：距项目约2000米是百大拓基广场徽商银行、工行ATM机；教育：小区自带9班公办幼儿园，同时在项目东侧就是关井路小学，庆平中小学。片区内北京航空航天大学、安中医大学、合肥九中及周边25所高校', '地铁：地铁3号线和规划中的4号线，东距3号线约1000米，乘车站点是幼儿师范站。西距4号线约1500米，乘车站点是淮海大道站。 公交：项目北侧的淮海大道上有681路公交-安徽艺术学院北门站', 6989, 32, '2020', '202005');
INSERT INTO `house` VALUES (16857, 0, 0, '2021-05-26 15:50:40', 0, '2021-05-26 16:20:58', 202005026, '玖悦花园', 'Y5,Y6', ' 12831.18  ', 88, 24897, '成都路以南，云南路以东', '滨湖区', '住宅', '高层、小高层、洋房', '合肥中海宏洋海晟房地产开发有限公司', '梁黄顾建筑设计（深圳）有限公司', '中海宏洋物业管理有限公司合肥分公司', '临近滨湖文旅城、银泰城、悦方IDMALL 、首创奥特莱斯等商业配套，近享金斗公园、塘西河沙滩公园、方兴湖湿地公园天然氧吧，滨湖妇幼保健院、口腔医院滨湖分院、滨湖医院等24小时护航健康。同时1公里范围内交通配套完善，出行较为便捷，同时项目周边临近地铁5号线成都路站（规划）；自建约12万方旗舰商业，毗邻周边云谷金融城、金谷广场等已建成商业；临近合肥师范附小三小、阳光中学等学校；项目西侧为市政规划绿地，整体来看，项目周边居住氛围较好。', '项目位于滨湖区金融板块，位于成都路与贵州路交汇处西南角。项目紧邻地铁5号线成都路站（规划），与1号线交汇。沿成都路往西约800米，达徽州大道，向北约200米达云谷路，以城市主干道交织滨湖枢纽核心轴。区域交通较为便捷。', 6950, 32, '2020', '202005');
