INSERT INTO `house` VALUES (16864, 0, 0, '2021-05-26 15:50:40', 0, '2021-05-26 16:21:02', 202005005, '大成花苑', 'B3#,B5#,B6#,B9#', ' 41218.67  ', 360, 23295, '庐阳区怀宁路与固镇路交口西南角', '庐阳区', '普通住宅', '高层、洋房、其他', '合肥天沐房地产有限公司', '安徽地平线建筑设计有限公司', '长城物业集团股份有限公司', '项目面朝大蜀山，西观董铺水库，北近大房郢水库，以及庐州公园、植物园等环伺周围，项目的南边是长约4.9公里南淝河环绕；周边有汇银广场、明发商业广场、华润万象汇等，西一环可达三里庵商圈，怀宁路可直达黄潜望及政务区商圈。', '项目周边有东西走向四大城市主干道北二环路、临泉路、北一环路、长江西路，纵向主干道西二环路、潜山路、怀宁路。公交线路有44路、114路、157路、300路、512路，临近地铁3号线。', 6967, 33, '2020', '202005');
