INSERT INTO `house` VALUES (16866, 0, 0, '2021-05-26 15:50:40', 0, '2021-05-26 16:21:03', 202004034, '湖滨兰园', 'G6,G15,G17', ' 25447.57  ', 182, 23331, '滨湖区包河大道与南京路交口东南角', '滨湖区', '住宅', '高层，洋房', '安徽舜鸿房地产开发有限公司', '上海联创设计集团股份有限公司', '绿城物业服务集团有限公司', '一路之隔的招商雍华府自带13万方商业综合体、百大心悦城、悦方、利港银河广场、佳源商业购物中心、银泰百货、万达茂等大型购物中心，满足您日常购物、休闲娱乐的的需求。省立总院医疗健康护航，幼儿园、小学、初中全龄教育，2KM多公园环绕，2KM四大商圈环绕', '项目北侧道路为南京路，西侧为包河大道，南侧为万泉河路，东侧为安徽路，1号线、5号线双地铁，项目所在区域整体的交通道路可以简单的概括为三纵三横一轨道，形成一个四通八达的内部交通网。', 6942, 33, '2020', '202004');
INSERT INTO `house` VALUES (16867, 0, 0, '2021-05-26 15:50:40', 0, '2021-05-26 16:21:04', 202004032, '瑞禧园', '1#,2#,3#,5#,6#,7#', ' 46569.61  ', 386, 19249, '合肥市包河区合巢路以北、马鞍山路以西', '包河区', '小高层；洋房', '剪力墙', '安徽汇和置业有限公司', '柏涛建筑设计（深圳）有限公司', '安徽信联物业服务有限公司', '商业配套：此处生活氛围浓厚醇熟，罍街、后街，5分钟即可到达，一路之隔就是百大购物中心，绿地缤纷城等城市综合体，除此之外，开车五、十分钟车程（地铁三站路）即可到达银泰中心或包河万达商圈。 教育配套：作为积累多年的主城区核心位置，占据最优质的学区资源：项目自建二十四班制的幼儿园，周边卫岗小学、六十五中、三十二中、合工大、中科大. 医疗配套：项目周边医疗资源十分丰富，西向是合肥市第二人民医院、合肥市第三人民医院，还可以快速的抵达安医附院、省立医院，10分钟左右即可到达安徽省儿童医院等，众多大型三级甲等综合性医院环伺。', '公共交通：项目紧邻地铁1号线(秋浦河路站)相距百米，下楼举步即达，同时与合肥2号线、在建3、4、5号线都有交汇换成站，周边还有一条规划6号线地铁，届时将形成米字型地铁交通网。项目周边有多条公交线路：51路、99路、109路、138路、515路、902路、B7路等； 道路交通：坐拥便捷多元的立体交通，路网四通八达，项目被“三横三纵”城市主干道围绕：三横为南二环、南一环、望江路，三条主干道贯穿东西，连接合肥城市路网，三纵为徽州大道、马鞍山路、东二环（郎溪路），立体的交通网络，快速通达主城区各个区域，四通八达的交通路网完美地保障了未来业主的出行.', 6899, 33, '2020', '202004');
INSERT INTO `house` VALUES (16868, 0, 0, '2021-05-26 15:50:40', 0, '2021-05-26 16:21:05', 202004033, '瑞禧园', '8#,9#', ' 9001.89  ', 64, 21749, '合肥市包河区合巢路以北、马鞍山路以西', '包河区', '小高层；洋房', '剪力墙', '安徽汇和置业有限公司', '柏涛建筑设计（深圳）有限公司', '安徽信联物业服务有限公司', '商业配套：此处生活氛围浓厚醇熟，罍街、后街，5分钟即可到达，一路之隔就是百大购物中心，绿地缤纷城等城市综合体，除此之外，开车五、十分钟车程（地铁三站路）即可到达银泰中心或包河万达商圈。 教育配套：作为积累多年的主城区核心位置，占据最优质的学区资源：项目自建二十四班制的幼儿园，周边卫岗小学、六十五中、三十二中、合工大、中科大. 医疗配套：项目周边医疗资源十分丰富，西向是合肥市第二人民医院、合肥市第三人民医院，还可以快速的抵达安医附院、省立医院，10分钟左右即可到达安徽省儿童医院等，众多大型三级甲等综合性医院环伺。', '公共交通：项目紧邻地铁1号线(秋浦河路站)相距百米，下楼举步即达，同时与合肥2号线、在建3、4、5号线都有交汇换成站，周边还有一条规划6号线地铁，届时将形成米字型地铁交通网。项目周边有多条公交线路：51路、99路、109路、138路、515路、902路、B7路等； 道路交通：坐拥便捷多元的立体交通，路网四通八达，项目被“三横三纵”城市主干道围绕：三横为南二环、南一环、望江路，三条主干道贯穿东西，连接合肥城市路网，三纵为徽州大道、马鞍山路、东二环（郎溪路），立体的交通网络，快速通达主城区各个区域，四通八达的交通路网完美地保障了未来业主的出行.', 6900, 33, '2020', '202004');
INSERT INTO `house` VALUES (16869, 0, 0, '2021-05-26 15:50:41', 0, '2021-05-26 16:21:05', 202004031, '雍容雅苑', 'C1,C8', ' 21135.46  ', 196, 21620, '包河区北京路与歙县路交叉口', '包河区', '住宅 商业', '高层 小高层 洋房', '合肥禹博房地产开发有限公司', ' 安徽寰宇建筑设计院', '禹洲物业服务有限公司', '项目周边分布马鞍山路沿线商圈，其中包括万达广场、加侨国际广场、绿地瀛海、百大购物广场、新都会环球购物广场等多个醇熟商业，购物、美食、休闲、娱乐应有尽有。', '轨道交通：紧邻的2条地铁线分别是地铁1号线(葛大店站)、地铁4号线(大强路站)；以及规划中的5号线、6号线。 道路交通：项目被“四横五纵”城市主干道围绕。四横为南二环（郎溪路）、祁门路、龙川路、繁华大道，可快速到达政务区、经开区；五纵为徽州大道、庐州大道、包河大道、上海路及北京路，可快速到达老城区、滨湖新区。', 6929, 34, '2020', '202004');
INSERT INTO `house` VALUES (16870, 0, 0, '2021-05-26 15:50:41', 0, '2021-05-26 16:21:06', 202002001, '和水雅居', '23,25,26', ' 18866.50  ', 204, 12997, '项王路和卧龙湖路交口', '新站区', '住宅', '小高层、洋房', '合肥茂旸置业有限公司', '上海方大建筑设计事务所', '优居美家物业服务有限责任公司合肥分公司', '紧邻项目西侧规划的 254 地块未来会设有一个大型的 商业中心，配备不少于 150间客房的星级酒店和 5 万方的街区商业。东方大道与铜陵北路交口还规划一个 5 万方左右的地铁商业，如果您想感受下民族文化氛围，项目周边 2km 左右范围内，有极具特色的 1500 米磨店老街、百大商业广场，拓基广场、黉街和文一陶冲湖城市广场商业圈，包含购物广场、超市、影院等商业配套亦可满足您的日常需求。如果您想去稍微远一点的商场，从新蚌埠路 15 分钟左右可以直达武里山天街、家天下生活广场；30 分钟左右车程即可到达瑶海万达、宝业东城广场、保利广场商圈，满足吃、喝、玩、乐、购一站式购物需求。 学区配套： 项目西北角配备了一个面积达 4500 ㎡的 15班幼儿园，也是作为公立幼儿园的最高标准建设的，东南 1.2 公里左右的庆平学校是由红军战士王庆平的名字命名的，可以说也是红色教育基地，是目前新站最大的公办学校，师资力量也是非常优秀的，同时也是安徽省最大的图书馆流通网点，有利于孩子的成长。项目 1 公里左右还有规划的少荃小学，为孩子提供更好的国际化教育，项目南侧 700 米左右的台湾康桥国际学校更是拥有从幼儿园到高中的一站式国际化教育服务。 医疗配套： 新站区最好的两个医院距离本项目均在10分钟左右车程。安医大第四附属医院，它是省城东北部第一家三甲级医院。以及安徽首家数字化全科医院，京东方数字医院，这是北上广等一线城市才会有的数字化医院，整个医院投资32个亿，并于19年3月21日已经正式开诊。', '项目位于东方大道与卧龙湖路交口，东接合肥东城新区，西与庐阳相通，北连北部新城，南与市区无缝对接。项目周边道路四通八达，形成三横三纵一地铁三维立体交通网，出行十分便捷。三横为魏武路、东方大道、淮海大道，三纵为新蚌埠路、铜陵北路、文忠路。由东方大道到新蚌埠路上三十头绕城高速，迅速到达省内外；而新蚌埠路向南可以到达老城区步行街银泰；而临近项目的铜陵北路高架则是合肥未来最长的一条高架（预计 2021 年通车），到达滨湖融创茂也只需要 30 分钟左右的车程，同时它可以连接包河，滨湖，政务，经开等主要区域。 地铁配套：地铁 4 号线（地铁 4 号线北起新站，途经政务区天鹅湖，西至高新区，预计 2021 年 12月通车），首发站东方大道站距离项目仅 300 米，步行5分钟左右即可到达！可以说是我们最纯正的地铁房，未来的 4 号线可以无缝对接合肥1-2-3-5 等多条地铁线路，让您可以畅通合肥的各个角落，地铁4号线预计2021年1月通车；公交配套：项目周边有 681 路、686 路，直接连通火车站和市区方向，可以快速到达老城区。', 6834, 34, '2020', '202002');
INSERT INTO `house` VALUES (16871, 0, 0, '2021-05-26 15:50:41', 0, '2021-05-26 16:21:06', 201912039, '森林城D6地块', '6,7,8,12,13,14,15,4,5,9,10,11', ' 14645.36  ', 58, 28999, '含笑路与青松路交口', '庐阳区', '住宅', '高层、其他住宅', '合肥万科瑞翔地产有限公司', '上海天华建筑设计有限公司', '上海万科物业服务有限公司合肥分公司', '除社区自带的森 ·生活汇、万科广场（在建）外，区域内明发商业广场配套成熟；项目内宿州路幼儿园（森林城分园）、南门小学（森林城校区）、四十五中（森林城校区）给居者提供丰富教育资源；南接庐州公园，享“出则繁华，入则宁静”的城市公园生活。', '项目拥有立体化交通脉络“四纵四横1地铁”，社区紧邻城市主干道，多条公交路线通行，项目周边为地铁3号线四里河路站（规划在建）。', 6720, 34, '2019', '201912');
INSERT INTO `house` VALUES (16872, 0, 0, '2021-05-26 15:50:41', 0, '2021-05-26 16:21:07', 202004024, '金茂湾', 'D11', ' 3817.07  ', 18, 24005, '文曲路和习友路东南角', '高新区', '住宅、商业', '高层、其他住宅', '安徽新华新茂置业有限公司', '华东建筑设计研究院有限公司', '中国金茂物业管理（北京）有限公司', '安徽医科大学附属口腔医院，小区配套幼儿园，梦园小学，中加国际学校，合肥七中新校区', '地铁2号线、4号线，7号线。习友路西接方兴大道，向北直达政务区，向南直通滨湖新区，交通四通八达。', 6904, 34, '2020', '202004');
INSERT INTO `house` VALUES (16873, 0, 0, '2021-05-26 15:50:41', 0, '2021-05-26 16:21:07', 202004025, '豪门金地', '53', ' 9033.44  ', 64, 18500, '西藏路与南宁路交口', '滨湖区', '住宅', '高层、洋房、其他住宅', '安徽省文一投资控股集团滨城置业有限公司', '北京高能筑博建筑设计有限公司', '安徽省文一物业管理有限公司', '项目与国际金融后台服务基地一路之隔，工农建中四大行及数家知名金融机构总部（中国人民银行、中国银行、工商银行、建设银行、农业银行、交通银行、邮储银行、徽商银行、浦发银行等）和综合基地及安徽省银行监督管理局落户合肥滨湖新区，与项目咫尺相邻。 繁华商圈：距离繁华世纪金源购物商圈仅10余分钟车程，高速时代广场、银泰城、亚洲最大的8万方中心书城、以及万达文旅城（世界首创第四代恒温水世界—万达水乐园、电影科技乐园，万达宝贝王等）均距离项目较近； 景观资源：滨湖的巢湖湿地公园，将打造 80 万平方米的“人造湿地”、“塘西河公园”、“金斗公园”和“方兴湖公园”等一系列生态项目，带来约 840 万平方米的新生绿化。项目旁边还占有“8万平米城市体育公园”、云川公园景观资源配套； 学区配套：项目周边学区密集，46中南校区、示范附小四小、世纪阳光中学四川路校区、示范附小三小贵阳路校区等', '项目交通状况：可以用”四纵四横一环二轨道“来概括。“四纵”，指的是徽州大道、庐州大道、包河大道和宿松路。宿松路连接方兴大道，直通市区百脑汇；经徽州大道的快速公交 5 分钟即可到达巢湖，10 分钟即可到达高铁南站，15 分钟即可到达合肥老城区。”四横“分别是锦绣大道、紫云路、方兴大道、云谷路。四条横向干道从北向南依次排布，将滨湖新区和经开区相连，西接金寨路高架，东接包河大道高架，构成立体交通网络，其中通过方兴大道和京台高速互通立交桥 30 分钟就可以到达新桥机场。”一环“指环巢湖景观大道，2014年环巢湖景观大道全线通车，全长约155公里，从巢湖东岸的巢湖市区湖光路起，至滨湖新区，可以自行驾车观光环巢湖生态风景，同时实现肥东和滨湖新区实现“无缝连接”。“二轨道”指的是，地铁1号线、5号线，地铁1号线于今年底投入使用，是南北方向的主干线，起点是天水路站和徽州大道站，离我们最近的地铁站口南宁路站距离项目不到1公里，今年年底就通车了，可直达新建的高铁南站和老火车站，后期出差旅行非常便捷。沿云谷路建设的地铁 5 号线，围绕着我们豪门金周边地建设的有三个站点，分别是四川路站、成都路站和云南路站，其中四川路站距离我们项目仅500米左右，后期您的出行也将变得十分方便。', 6880, 34, '2020', '202004');
INSERT INTO `house` VALUES (16874, 0, 0, '2021-05-26 15:50:41', 0, '2021-05-26 16:21:08', 202004026, '卓锦园', 'C8', ' 8947.84  ', 88, 19085, '合肥市包河区花园大道与重庆路交口', '包河区', '住宅', '高层、小高层、洋房', '合肥瑞钰置业有限公司', '上海尤安建筑设计院有限公司、安徽地平线建筑设计有限公司', '重庆华宇第一太平戴维斯物业服务集团有限公司', '项目临近地铁5号线花园大道站，位居省府之北，坐拥上海路、北京路、包河大道、繁华大道、锦绣大道等立体交通路网，无缝衔接合肥未来最具魅力的城市新空间、环巢湖国家级科创大走廊的核心区。周边滨湖国家森林公园、十五里河公园、骆岗中央公园三大公园环伺，生态资源丰富。', '', 6917, 34, '2020', '202004');
