INSERT INTO `house` VALUES (16881, 0, 0, '2021-05-26 15:50:42', 0, '2021-05-26 16:21:11', 202004015, '金港湾公馆', '52#,57#,58#,59#', ' 17826.32  ', 112, 19007, '长宁大道与彩虹路交口西南角', '高新区', '住宅、商业', '高层、洋房', '合肥蜀西祥源房地产开发有限公司', '安徽安德建筑设计有限公司', '合肥祥源物业管理有限公司', '项目自建幼儿园，奥特莱斯商业广场已开业。', '项目位于合肥市高新区，东自长宁大道，西至天堂寨路，南起佛岭寨路，北邻南岗镇南岗村用地。', 6881, 35, '2020', '202004');
INSERT INTO `house` VALUES (16882, 0, 0, '2021-05-26 15:50:42', 0, '2021-05-26 16:21:11', 202004010, '璞羽西苑', '10,12,28,26,25,18,17,16,13,21,22,27,30,20', ' 10853.27  ', 41, 20990, '蜀山区邓店路以南、山茶路以东', '蜀山区', '住宅', '高层，洋房', '合肥市丽丰锦城置业有限公司', '安徽寰宇建筑设计院', '龙湖物业服务集团有限公司', '学校：乐农小学，蜀山中学，规划中小学 公园：四季花海，董铺湖湿地公园（规划中），代建市政公园，刘园 商业：加侨悦山国际，乐客来商业中心，联家超市 医疗：安医附院高新分院，省立妇幼保健院西区 ', '项目周边目前有振兴路、沁园路直通长江西路，距离长江西路约4公里，距离地铁二号线振兴路站约4公里，距离绕城高速蜀山出入口约5公里，可通过绕城高速通达新桥国际机场、合肥火车南站。', 6885, 35, '2020', '202004');
