INSERT INTO `house` VALUES (16904, 0, 0, '2021-05-26 15:50:44', 0, '2021-05-26 16:21:24', 202003011, '雍容雅苑', 'C17,C22,C23,C25,C29,C30,C31', ' 27267.68  ', 184, 20923, '包河区北京路与歙县路交叉口', '包河区', '住宅 商业', '高层 小高层 洋房', '合肥禹博房地产开发有限公司', ' 安徽寰宇建筑设计院', '禹洲物业服务有限公司', '项目周边分布马鞍山路沿线商圈，其中包括万达广场、加侨国际广场、绿地瀛海、百大购物广场、新都会环球购物广场等多个醇熟商业，购物、美食、休闲、娱乐应有尽有。', '轨道交通：紧邻的2条地铁线分别是地铁1号线(葛大店站)、地铁4号线(大强路站)；以及规划中的5号线、6号线。 道路交通：项目被“四横五纵”城市主干道围绕。四横为南二环（郎溪路）、祁门路、龙川路、繁华大道，可快速到达政务区、经开区；五纵为徽州大道、庐州大道、包河大道、上海路及北京路，可快速到达老城区、滨湖新区。', 6856, 37, '2020', '202003');
INSERT INTO `house` VALUES (16905, 0, 0, '2021-05-26 15:50:44', 0, '2021-05-26 16:21:25', 202003013, '玖悦花园', 'G6,Y22,Y23,G7', ' 31445.60  ', 238, 21499, '成都路以南，云南路以东', '滨湖区', '住宅', '高层、小高层、洋房', '合肥中海宏洋海晟房地产开发有限公司', '梁黄顾建筑设计（深圳）有限公司', '中海宏洋物业管理有限公司合肥分公司', '临近滨湖文旅城、银泰城、悦方IDMALL 、首创奥特莱斯等商业配套，近享金斗公园、塘西河沙滩公园、方兴湖湿地公园天然氧吧，滨湖妇幼保健院、口腔医院滨湖分院、滨湖医院等24小时护航健康。同时1公里范围内交通配套完善，出行较为便捷，同时项目周边临近地铁5号线成都路站（规划）；自建约12万方旗舰商业，毗邻周边云谷金融城、金谷广场等已建成商业；临近合肥师范附小三小、阳光中学等学校；项目西侧为市政规划绿地，整体来看，项目周边居住氛围较好。', '项目位于滨湖区金融板块，位于成都路与贵州路交汇处西南角。项目紧邻地铁5号线成都路站（规划），与1号线交汇。沿成都路往西约800米，达徽州大道，向北约200米达云谷路，以城市主干道交织滨湖枢纽核心轴。区域交通较为便捷。', 6728, 37, '2020', '202003');
INSERT INTO `house` VALUES (16906, 0, 0, '2021-05-26 15:50:44', 0, '2021-05-26 16:21:25', 202003014, '玖悦花园', 'G8,G9', ' 20090.96  ', 184, 18999, '成都路以南，云南路以东', '滨湖区', '住宅', '高层、小高层、洋房', '合肥中海宏洋海晟房地产开发有限公司', '梁黄顾建筑设计（深圳）有限公司', '中海宏洋物业管理有限公司合肥分公司', '临近滨湖文旅城、银泰城、悦方IDMALL 、首创奥特莱斯等商业配套，近享金斗公园、塘西河沙滩公园、方兴湖湿地公园天然氧吧，滨湖妇幼保健院、口腔医院滨湖分院、滨湖医院等24小时护航健康。同时1公里范围内交通配套完善，出行较为便捷，同时项目周边临近地铁5号线成都路站（规划）；自建约12万方旗舰商业，毗邻周边云谷金融城、金谷广场等已建成商业；临近合肥师范附小三小、阳光中学等学校；项目西侧为市政规划绿地，整体来看，项目周边居住氛围较好。', '项目位于滨湖区金融板块，位于成都路与贵州路交汇处西南角。项目紧邻地铁5号线成都路站（规划），与1号线交汇。沿成都路往西约800米，达徽州大道，向北约200米达云谷路，以城市主干道交织滨湖枢纽核心轴。区域交通较为便捷。', 6713, 37, '2020', '202003');
INSERT INTO `house` VALUES (16907, 0, 0, '2021-05-26 15:50:44', 0, '2021-05-26 16:21:26', 202003015, '卓锦园', 'C5', ' 9325.12  ', 92, 19085, '合肥市包河区花园大道与重庆路交口', '包河区', '住宅', '高层、小高层、洋房', '合肥瑞钰置业有限公司', '上海尤安建筑设计院有限公司、安徽地平线建筑设计有限公司', '重庆华宇第一太平戴维斯物业服务集团有限公司', '项目临近地铁5号线花园大道站，位居省府之北，坐拥上海路、北京路、包河大道、繁华大道、锦绣大道等立体交通路网，无缝衔接合肥未来最具魅力的城市新空间、环巢湖国家级科创大走廊的核心区。周边滨湖国家森林公园、十五里河公园、骆岗中央公园三大公园环伺，生态资源丰富。', '', 6727, 37, '2020', '202003');
INSERT INTO `house` VALUES (16908, 0, 0, '2021-05-26 15:50:44', 0, '2021-05-26 16:21:26', 202003016, '大成花苑', 'A7#,A8#,A9#', ' 13081.32  ', 84, 25821, '庐阳区怀宁路与固镇路交口西南角', '庐阳区', '普通住宅', '高层、洋房、其他', '合肥天沐房地产有限公司', '安徽地平线建筑设计有限公司', '长城物业集团股份有限公司', '项目面朝大蜀山，西观董铺水库，北近大房郢水库，以及庐州公园、植物园等环伺周围，项目的南边是长约4.9公里南淝河环绕；周边有汇银广场、明发商业广场、华润万象汇等，西一环可达三里庵商圈，怀宁路可直达黄潜望及政务区商圈。', '项目周边有东西走向四大城市主干道北二环路、临泉路、北一环路、长江西路，纵向主干道西二环路、潜山路、怀宁路。公交线路有44路、114路、157路、300路、512路，临近地铁3号线。', 6826, 37, '2020', '202003');
INSERT INTO `house` VALUES (16909, 0, 0, '2021-05-26 15:50:44', 0, '2021-05-26 16:21:27', 202003012, '溪岸观邸', '3,6,7', ' 14394.30  ', 92, 14999, '瑶海区长临路南龙岗路西', '瑶海区', '普通住宅', '洋房、其他住宅', '合肥淮矿置业有限责任公司', '安徽地平线建筑设计有限公司', '淮矿安徽物业服务有限责任公司', '餐饮：三福早点、天天早点、渔留唇小馆（新安江路点）、陆记山里人家、绿味湘、云鼎私房菜、王家酸菜鱼（乐水店）、昌德尚味堂 医院：合肥市第二人民医院新区、安医大附属合肥医院 超市：华联超市(新安江路)、福满家超市(新安江路)、红霞超市、燕婷超市、芙蓉兴盛便利超市、浩宇超市(新安江路)、浦申百货超市、每天惠智慧便利店、云福超市、阿超便利店、昆仑好客便利店(广德路店)、小费超市、盼盼百货超市(茗阳水岸店)、惠发超市、漕冲超市、心连心超市(新安江路) 学校：马岗实验小学、三十八中、十中新校区 药店：百姓缘大药房(静安新城店)、国胜大药房(保利东郡店) 休闲：足享人生（新安江路）、善福缘专业推拿、玉足阁（新安江路）、栀子足浴、龙港湾温泉养生SPA会馆 卖场：保利广场、龙湖天街 公园广场：瑶海湾湿地公园(建设中)、龙岗游园 其他：瑶海图书城、瑶海大剧院。 16:11:43 ', '公交：乘坐37路(郎溪路枢纽站--肥东火车站)到静安医院(公交站)下，乘坐123路(小花园--静安新城)到静安医院(公交站)下；乘坐508路(市二院新区--瑶海科技园)到彭岗(公交站)下；乘坐B3路(公交二公司--市二院新区)到市二院新区(公交站)下；乘坐135路(郎溪路枢纽站--十五里河)到郎溪路枢纽站(广德路)(公交站)下。 其他：地铁9号线、11号线（规划） ', 6824, 38, '2020', '202003');
INSERT INTO `house` VALUES (16910, 0, 0, '2021-05-26 15:50:44', 0, '2021-05-26 16:21:27', 202003009, '文一塘溪津门', '46,47', ' 10449.68  ', 64, 27210, '滨湖新区包河大道与杭州路交口', '滨湖区', '住宅', '高层、洋房', '安徽省文一投资控股集团滨江置业有限公司', '北京高能筑博建筑设计有限公司', '安徽省文一物业管理有限公司', '环境：项目紧邻方兴湖和巢湖两大水系，同时为塘西河公园、金斗公园、方兴湖公园和岸上草原所环抱，公园面积高达万亩。商业：项目自持近10万方的文化商业街，打造合肥城市会客厅。此外，南接万达文旅城和恒大中心，东邻银泰中心和中心书城，北连悦方IDmall和世纪金源，众多商业中心伺散。学区：项目南面沿云谷路建有幼儿园和小学。同时一中、四十八中、四十六中和师范附小等名校坐落周边，教育资源得天独厚。医疗：滨湖医院距离项目仅4公里。省立医院总部正在规划筹建，位于项目北侧，相距不过5分钟车程。旅游：万达文化旅游城、牛角大圩生态旅游区、滨湖湿地公园、巢湖岸边的岸上草原、滨湖十大省级文化场馆，加上会申报国家AAAA级景区的塘溪津门水街将，形成一片完整的环巢湖旅游带。', '项目交通状况用“一环二铁三纵四横”来概括。“一环”，即环巢湖大道，被誉为“合肥最美道路”之一。沿线向东可达巢湖城区，向西达国家AAAAA级风景区——三河古镇。“二铁”，指高铁南站和三条地铁线。高铁南站距项目约10公里，借此可达省外；其次项目紧邻三条地铁，1号线已开通营运，由滨湖新区直达合肥火车站，是合肥南北向交通的主动脉，距项目最近的云谷路站约为1.1公里；5号线已经开建，其东史岗路站与华山路站与项目无缝对接。S1号线，途经新桥机场、新高铁西站、高铁南站最终抵达巢湖岸边，将于项目东南角设站。“三纵”指三条南北向主干道——徽州大道、庐州大道和包河大道，连接滨湖新区与老城核心。“四横 ”为锦绣大道、紫云路、方兴大道和云谷路，贯穿滨湖新区和经开区。沿方兴大道向西驱车10分钟可上京台高速，30分钟可达机场高速入口，构成全方位、立体化的交通体系网，通达四周。', 6784, 38, '2020', '202003');
INSERT INTO `house` VALUES (16911, 0, 0, '2021-05-26 15:50:44', 0, '2021-05-26 16:21:28', 202003007, '湖畔诚园', 'Y7,Y8,Y9,Y10,Y11,Y12,Y13,Y15,Y16,Y17', ' 46670.02  ', 270, 23999, '合肥市滨湖新区大理路与嘉陵江路交口西南角', '滨湖区', '住宅', '高层，洋房', '安徽绿隽置业有限公司', '安徽省人防建筑设计研究院/中铁合肥建筑市政工程设计研究院有限公司', '绿城物业', '商业有世纪金源购物中心、文旅城、银泰城、联投中心、百大、奥特莱斯购物中心、公元天下，还有近10万方商业；有 21家金融机构的总部及金融基地落户；本项目幼儿园、小学、初中、高中环绕，15年全龄教育配套，一站式配齐，毗校而居，为孩子的未来保驾护航；拥有六大公园环绕三大旅游胜地。', '滨湖区域内的道路呈井字型有序排布，交通“五纵五横一环” “双地铁” “一高铁一高速”来形容【五纵：四川路、徽州大道、庐州大道、包河大道高架、上海路（在建）五横：锦绣大道、紫云路、方兴大道、云谷路、珠江路（待建）一环：环湖北路】、“双地铁” 地铁1号线（距离站点约900m、地铁5号线距离站点约500m）（高铁南站、京台高速）：纵向四川路全程2.2公里，双向6车道，未来是联通金融板块的主干道之一。', 6842, 38, '2020', '202003');
INSERT INTO `house` VALUES (16912, 0, 0, '2021-05-26 15:50:44', 0, '2021-05-26 16:21:28', 202003008, '湖滨兰园', 'Y15', ' 5392.52  ', 32, 28699, '滨湖区包河大道与南京路交口东南角', '滨湖区', '住宅', '高层，洋房', '安徽舜鸿房地产开发有限公司', '上海联创设计集团股份有限公司', '绿城物业服务集团有限公司', '一路之隔的招商雍华府自带13万方商业综合体、百大心悦城、悦方、利港银河广场、佳源商业购物中心、银泰百货、万达茂等大型购物中心，满足您日常购物、休闲娱乐的的需求。省立总院医疗健康护航，幼儿园、小学、初中全龄教育，2KM多公园环绕，2KM四大商圈环绕', '项目北侧道路为南京路，西侧为包河大道，南侧为万泉河路，东侧为安徽路，1号线、5号线双地铁，项目所在区域整体的交通道路可以简单的概括为三纵三横一轨道，形成一个四通八达的内部交通网。', 6844, 38, '2020', '202003');
INSERT INTO `house` VALUES (16913, 0, 0, '2021-05-26 15:50:44', 0, '2021-05-26 16:21:28', 202003006, '金茂湾', 'G9,G15', ' 16530.22  ', 100, 20706, '文曲路和习友路东南角', '高新区', '住宅、商业', '高层、其他住宅', '安徽新华新茂置业有限公司', '华东建筑设计研究院有限公司', '中国金茂物业管理（北京）有限公司', '安徽医科大学附属口腔医院，小区配套幼儿园，梦园小学，中加国际学校，合肥七中新校区', '地铁2号线、4号线，7号线。习友路西接方兴大道，向北直达政务区，向南直通滨湖新区，交通四通八达。', 6838, 38, '2020', '202003');
INSERT INTO `house` VALUES (16914, 0, 0, '2021-05-26 15:50:44', 0, '2021-05-26 16:21:29', 202003005, '开元公馆', '8号楼,9号楼,10号楼,12号楼,13号楼', ' 37147.86  ', 329, 13897, '新蚌埠路与淮海大道交口东南角', '新站区', '住宅', '高层、小高层', '合肥中建开元地产开发有限公司', '中建工程设计有限公司', '中海宏洋物业管理有限公司合肥分公司', '毗邻3300亩陶冲湖生态公园、安医大四附院、新站广场及168中学。', '公交：686路、681路、25路、507路。', 6581, 38, '2020', '202003');
INSERT INTO `house` VALUES (16915, 0, 0, '2021-05-26 15:50:44', 0, '2021-05-26 16:21:29', 202003004, '锦云阁', '1', ' 8375.56  ', 85, 23703, '合肥市滨湖区南京路与华山路交口', '滨湖区', '住宅', '高层/小高层', '合肥瑞远置业有限公司', '浙江恒泰建筑设计院有限公司安徽分公司', '重庆华宇第一太平戴维斯物业服务集团有限公司', '百大心悦城、悦方茂、世纪金源购物中心、省政府、省立医院', '滨湖区扬子江路以南华山路以东', 6837, 38, '2020', '202003');
INSERT INTO `house` VALUES (16916, 0, 0, '2021-05-26 15:50:44', 0, '2021-05-26 16:21:30', 202003002, '和玥公馆', 'Y5,Y7,Y8,Y10,Y15', ' 18258.54  ', 108, 19006, '习友路和永和路交口', '高新区', '住宅', '小高层、洋房', '合肥览秀房地产开发有限公司', '安徽寰宇建筑设计院', '安徽天一物业管理有限公司', '项目周边复兴家园菜市场，世纪联华超市，3.3公里到达奥特莱斯商业广场，2公里到达高新区银泰城（在建）、距离高新管委会1.8公里，7.4公里到达天鹅湖商圈。项目毗邻机场高速，周边路网发达，交通便利', '项目位于习友路与永和路交口、永和路与复兴路交口，可连接至望江西路、长江西路等，沿习友路往东可到政务、包河。项目周边656路、652路、158路、166路公交车站台、地铁4号线丰乐河路站、地铁4号线延长线复兴路站', 6833, 38, '2020', '202003');
INSERT INTO `house` VALUES (16917, 0, 0, '2021-05-26 15:50:44', 0, '2021-05-26 16:21:30', 202003010, '文一塘溪津门', '53,55', ' 19787.30  ', 126, 24000, '滨湖新区包河大道与杭州路交口', '滨湖区', '住宅', '高层、洋房', '安徽省文一投资控股集团滨江置业有限公司', '北京高能筑博建筑设计有限公司', '安徽省文一物业管理有限公司', '环境：项目紧邻方兴湖和巢湖两大水系，同时为塘西河公园、金斗公园、方兴湖公园和岸上草原所环抱，公园面积高达万亩。商业：项目自持近10万方的文化商业街，打造合肥城市会客厅。此外，南接万达文旅城和恒大中心，东邻银泰中心和中心书城，北连悦方IDmall和世纪金源，众多商业中心伺散。学区：项目南面沿云谷路建有幼儿园和小学。同时一中、四十八中、四十六中和师范附小等名校坐落周边，教育资源得天独厚。医疗：滨湖医院距离项目仅4公里。省立医院总部正在规划筹建，位于项目北侧，相距不过5分钟车程。旅游：万达文化旅游城、牛角大圩生态旅游区、滨湖湿地公园、巢湖岸边的岸上草原、滨湖十大省级文化场馆，加上会申报国家AAAA级景区的塘溪津门水街将，形成一片完整的环巢湖旅游带。', '项目交通状况用“一环二铁三纵四横”来概括。“一环”，即环巢湖大道，被誉为“合肥最美道路”之一。沿线向东可达巢湖城区，向西达国家AAAAA级风景区——三河古镇。“二铁”，指高铁南站和三条地铁线。高铁南站距项目约10公里，借此可达省外；其次项目紧邻三条地铁，1号线已开通营运，由滨湖新区直达合肥火车站，是合肥南北向交通的主动脉，距项目最近的云谷路站约为1.1公里；5号线已经开建，其东史岗路站与华山路站与项目无缝对接。S1号线，途经新桥机场、新高铁西站、高铁南站最终抵达巢湖岸边，将于项目东南角设站。“三纵”指三条南北向主干道——徽州大道、庐州大道和包河大道，连接滨湖新区与老城核心。“四横 ”为锦绣大道、紫云路、方兴大道和云谷路，贯穿滨湖新区和经开区。沿方兴大道向西驱车10分钟可上京台高速，30分钟可达机场高速入口，构成全方位、立体化的交通体系网，通达四周。', 6785, 38, '2020', '202003');
