INSERT INTO `house` VALUES (16933, 0, 0, '2021-05-26 15:50:45', 0, '2021-05-26 16:21:39', 202001005, '双湖公馆', '17,20', ' 18012.58  ', 168, 16411, '合肥市庐阳区合淮路以东、文广路以北', '庐阳区', '普通住宅', '高层住宅、小高层、洋房', '合肥碧腾房地产有限公司', '广东博意建筑设计研究院有限公司', '广东碧桂园物业服务有限公司庐阳分公司', '项目周边商业配套成熟完善，紧邻本项目的大型商业体有明发商业广场、万科汇、汇银广场，里面拥有永辉超市、港荣百货、金逸影城，餐饮、银行等配套，购物休闲娱乐应有尽有，基本满足您的日常生活需求，全方位满足您的生活需求。', '四里河路、北一环、西二环、潜山路、长江西路四里河路、东至湖畔路，西至合淮路，南至文广路，北至草堂路，距离高速入口9.8公里，合肥老城区7.6公里。', 6757, 40, '2020', '202001');
INSERT INTO `house` VALUES (16934, 0, 0, '2021-05-26 15:50:45', 0, '2021-05-26 16:21:40', 201912064, '豪门金地', '37,51', ' 14769.28  ', 111, 18998, '西藏路与南宁路交口', '滨湖区', '住宅', '高层、洋房、其他住宅', '安徽省文一投资控股集团滨城置业有限公司', '北京高能筑博建筑设计有限公司', '安徽省文一物业管理有限公司', '项目与国际金融后台服务基地一路之隔，工农建中四大行及数家知名金融机构总部（中国人民银行、中国银行、工商银行、建设银行、农业银行、交通银行、邮储银行、徽商银行、浦发银行等）和综合基地及安徽省银行监督管理局落户合肥滨湖新区，与项目咫尺相邻。 繁华商圈：距离繁华世纪金源购物商圈仅10余分钟车程，高速时代广场、银泰城、亚洲最大的8万方中心书城、以及万达文旅城（世界首创第四代恒温水世界—万达水乐园、电影科技乐园，万达宝贝王等）均距离项目较近； 景观资源：滨湖的巢湖湿地公园，将打造 80 万平方米的“人造湿地”、“塘西河公园”、“金斗公园”和“方兴湖公园”等一系列生态项目，带来约 840 万平方米的新生绿化。项目旁边还占有“8万平米城市体育公园”、云川公园景观资源配套； 学区配套：项目周边学区密集，46中南校区、示范附小四小、世纪阳光中学四川路校区、示范附小三小贵阳路校区等', '项目交通状况：可以用”四纵四横一环二轨道“来概括。“四纵”，指的是徽州大道、庐州大道、包河大道和宿松路。宿松路连接方兴大道，直通市区百脑汇；经徽州大道的快速公交 5 分钟即可到达巢湖，10 分钟即可到达高铁南站，15 分钟即可到达合肥老城区。”四横“分别是锦绣大道、紫云路、方兴大道、云谷路。四条横向干道从北向南依次排布，将滨湖新区和经开区相连，西接金寨路高架，东接包河大道高架，构成立体交通网络，其中通过方兴大道和京台高速互通立交桥 30 分钟就可以到达新桥机场。”一环“指环巢湖景观大道，2014年环巢湖景观大道全线通车，全长约155公里，从巢湖东岸的巢湖市区湖光路起，至滨湖新区，可以自行驾车观光环巢湖生态风景，同时实现肥东和滨湖新区实现“无缝连接”。“二轨道”指的是，地铁1号线、5号线，地铁1号线于今年底投入使用，是南北方向的主干线，起点是天水路站和徽州大道站，离我们最近的地铁站口南宁路站距离项目不到1公里，今年年底就通车了，可直达新建的高铁南站和老火车站，后期出差旅行非常便捷。沿云谷路建设的地铁 5 号线，围绕着我们豪门金周边地建设的有三个站点，分别是四川路站、成都路站和云南路站，其中四川路站距离我们项目仅500米左右，后期您的出行也将变得十分方便。', 6746, 40, '2019', '201912');
