INSERT INTO `house` VALUES (16946, 0, 0, '2021-05-26 15:50:46', 0, '2021-05-26 16:21:47', 201912019, '琥珀东华府', '12', ' 6768.90  ', 54, 16899, '襄水路与半塔路交口西北角', '瑶海区', '住宅', '高层，洋房，其他。', '合肥城建发展股份有限公司', '安徽寰宇建筑设计院', '安徽琥珀物业服务有限公司', '项目北侧有龙湖瑶海天街、周边有保利东郡福禄街、宝业东城广场以及瑶海万达广场；安徽静安中西医结合医院、合肥市第二人民医院新区；目前项目小学为建设中襄河路小学，中学为建设中合肥第38中东区，项目临近大店小学，马岗实验小学，55中东区；周边有瑶海湾湿地公园、月亮湾公园', '项目周边有轨道交通地铁2号线可直达大东门、四牌楼、三里街、三里庵、大蜀山等地，还有快速公交5号线、123路、T9路、37路、38路、39路、112路等，其中快速公交5号线可直达市府广场。', 6399, 41, '2019', '201912');
INSERT INTO `house` VALUES (16947, 0, 0, '2021-05-26 15:50:46', 0, '2021-05-26 16:21:47', 201912015, '云栖雅苑', 'A2#,A5#,A6#', ' 13825.71  ', 141, 13399, '瑶海区戚继光路以东、程士范路以南', '瑶海区', '住宅', '小高层', '合肥瑜阳房地产开发有限公司', '广州市天作建筑规划设计有限公司', '安徽省文一物业管理有限公司', '? 学区配套：家门口市政配套幼儿园（规划中），皇马花园幼儿园，合肥市琥珀名城小学(明皇路校区)，合肥市五十五中东校区（原龙岗中学）； ? 商业配套：距在建的瑶海天街（预计年底开业） 约1.5公里，同时保利广场和瑶海万达广场环伺， 1公里范围内有满天星购物中心、永辉超市，2公里范围内有百思购，3公里范围内有万欢购物广场和大润发购物广场； ? 医疗配套：板桥河东边为医疗用地（规划中），1.5公里范围广慈医院，2公里龙岗医院，5公里范围内合肥市第二人民医院； ? 生活休闲配套：南边市场配套公园（规划中），瑞泰公园，华凌游园； ', '距离项目1.5公里处地铁2号线王岗站，便捷全城；地块700米以内的王岗路公交车站有2、146、154、502路公交，花神郢公交车站有39、508等多条公交路线', 6585, 41, '2019', '201912');
