INSERT INTO `house` VALUES (16958, 0, 0, '2021-05-26 15:50:46', 0, '2021-05-26 16:21:53', 201607049, '昊天园', '34#楼', ' 4939.52  ', 54, 10500, '合肥市新站区砀山路北星火路西', '新站区', '住宅、商业、办公', '高层', '合肥隆昊房地产投资有限公司', '安徽寰宇建筑设计院', '合肥东宇物业管理有限公司', '砀山路12车道景观大街纵横东西、张洼路立交桥畅通南北，畅通后可直达市中心。此外建设中的轻轨1号线，北城段停靠张洼路，距昊天园仅300余米。从昊天园东行5分钟，即可达胜利路商圈，南行5分钟，即可达双岗商业圈，各类生活配套设施一应俱全。', '小区位于砀山路与星火路交口，乘坐157.139.147等公交车可到达。', 3739, 42, '2016', '201607');
INSERT INTO `house` VALUES (16959, 0, 0, '2021-05-26 15:50:47', 0, '2021-05-26 16:21:54', 201912002, '悦湖西岸小区', '23,25,26,27', ' 31263.00  ', 272, 15098, '高新区火龙地路与彩虹西路交口东北角', '高新区', '住宅', '高层、洋房', '合肥乐富强房地产开发有限公司', '安徽五维空间建筑设计咨询有限公司', '安徽乐富强物业管理有限公司', '周边配套： 自然资源：2100亩蜀西湖、大蜀山等山湖资源； 医疗配套：安徽医科大学附属医院高新区分院，安徽最大省级三甲医院；安徽妇幼保健院西区等。 教育配套：高新实验学校湖滨校区、永和中学 商业配套：砂之船奥特莱斯艺术商业广场、银泰城购物中心也即将于2020年开业。', '交通路网：临近长江西路、方兴大道等交通主干道； 轨道交通：2号线南岗站、建设中4号线、规划中7号； 公交路线：29路、650路、665路等', 6685, 43, '2019', '201912');
INSERT INTO `house` VALUES (16960, 0, 0, '2021-05-26 15:50:47', 0, '2021-05-26 16:21:55', 201912012, '公园里', '57#', ' 8165.68  ', 36, 18179, '杭州路以北金斗路以东', '滨湖区', '住宅、商铺', '多层、高层', '安徽金湖信达置业有限公司', '安徽地平线建筑设计有限公司', '安徽信达建银物业管理有限公司', '金斗公园和塘西河公园，屯溪路小学滨湖校区，滨湖医院，滨湖银泰中心、万达文旅城', '项目位于滨湖区核心地段，交通发达便利，四大城市主干道交汇，有多条公交线路及地铁1号线 ', 6642, 43, '2019', '201912');
INSERT INTO `house` VALUES (16961, 0, 0, '2021-05-26 15:50:47', 0, '2021-05-26 16:21:55', 201911072, '文一塘溪津门', '16', ' 8318.28  ', 60, 20999, '滨湖新区包河大道与杭州路交口', '滨湖区', '住宅', '高层、洋房', '安徽省文一投资控股集团滨江置业有限公司', '北京高能筑博建筑设计有限公司', '安徽省文一物业管理有限公司', '环境：项目紧邻方兴湖和巢湖两大水系，同时为塘西河公园、金斗公园、方兴湖公园和岸上草原所环抱，公园面积高达万亩。商业：项目自持近10万方的文化商业街，打造合肥城市会客厅。此外，南接万达文旅城和恒大中心，东邻银泰中心和中心书城，北连悦方IDmall和世纪金源，众多商业中心伺散。学区：项目南面沿云谷路建有幼儿园和小学。同时一中、四十八中、四十六中和师范附小等名校坐落周边，教育资源得天独厚。医疗：滨湖医院距离项目仅4公里。省立医院总部正在规划筹建，位于项目北侧，相距不过5分钟车程。旅游：万达文化旅游城、牛角大圩生态旅游区、滨湖湿地公园、巢湖岸边的岸上草原、滨湖十大省级文化场馆，加上会申报国家AAAA级景区的塘溪津门水街将，形成一片完整的环巢湖旅游带。', '项目交通状况用“一环二铁三纵四横”来概括。“一环”，即环巢湖大道，被誉为“合肥最美道路”之一。沿线向东可达巢湖城区，向西达国家AAAAA级风景区——三河古镇。“二铁”，指高铁南站和三条地铁线。高铁南站距项目约10公里，借此可达省外；其次项目紧邻三条地铁，1号线已开通营运，由滨湖新区直达合肥火车站，是合肥南北向交通的主动脉，距项目最近的云谷路站约为1.1公里；5号线已经开建，其东史岗路站与华山路站与项目无缝对接。S1号线，途经新桥机场、新高铁西站、高铁南站最终抵达巢湖岸边，将于项目东南角设站。“三纵”指三条南北向主干道——徽州大道、庐州大道和包河大道，连接滨湖新区与老城核心。“四横 ”为锦绣大道、紫云路、方兴大道和云谷路，贯穿滨湖新区和经开区。沿方兴大道向西驱车10分钟可上京台高速，30分钟可达机场高速入口，构成全方位、立体化的交通体系网，通达四周。', 6621, 43, '2019', '201911');
