INSERT INTO `house` VALUES (17066, 0, 0, '2021-05-26 15:50:53', 0, '2021-05-26 16:22:52', 201908050, '君荣府', '8#,11#,15#,16#', ' 40189.14  ', 364, 21086, '合肥市滨湖新区贵阳路与云南路西北角', '滨湖区', '住宅、商业', '洋房、高层', '合肥新城亿盛房地产有限公司', '江苏筑森建筑设计有限公司', '西藏新城悦物业服务股份有限公司合肥分公司 ', '学校资源：本项目周边配套规划幼儿园、已建成示范附小三小贵阳路校区和阳光中学四川路校区，项目周边规划国际双语学校； 景观资源：本项目周边3公里内分布城市体育公园（规划）、云川公园、金斗公园、岸上草原； 商超：周边规划建设银泰城、奥特莱斯、万达茂； 医院：市滨湖医院、规划省立医院医疗保健中心； 银行：项目1公里内分布中国银行、交通银行、农业银行等22家银行和金融保险机构。 内部配套：项目自身配套约1500平米商业，设置小区配套商业。', '本项目是多维立体化交通，项目周边交通体系“五纵无横一环”多维交通网通达全城，本项目通过贵阳路、四川路与徽州大道、庐州大道、云谷路紧密连接，交通通达性强，“双地铁”贯穿城市核心区域，距离地铁1号线九联圩站直线距离2公里、无缝对接地铁5号线贵阳路站点。本项目有效连接与主城区各个区域，交通便捷度高。', 6379, 53, '2019', '201908');
