INSERT INTO `house` VALUES (17077, 0, 0, '2021-05-26 15:50:54', 0, '2021-05-26 16:22:58', 201908023, '樾溪台', '23#,2#,3#,8#', ' 17059.51  ', 176, 14722, '合肥市新站区淮海大道以南，张衡路以东', '新站区', '住宅', '洋房，小高层', '合肥银弘房地产开发有限公司', '安徽地平线建筑设计有限公司', '上海永升物业管理有限公司', '医疗：三所大型专业医疗机构——安徽医科大学第四附属医院，安徽首家数字化全科医院-京东方医院，安徽中医药大学中西医结合医院 教育：项目周边教育资源也十分丰富，有168中学、北京航空航天大学、寿春中学、马克汉姆国际学校、合肥九中等等 商业：有百大商业街和黉街，其他的大型商场瑶海万达广场、家天下生活广场，宝业东城广场，保利广场都能快速到达 自然景观：新站目前规划的有8大公园，目前新海公园、铁路公园、陶冲湖公园已经部分投入使用。未来将着力打造少荃湖湿地公园、学林公园、二十埠河生态廊道、铁路公园、滁河干渠休闲风光带等“五大生态工程”。', '本项目毗邻新站主干动脉淮海大道（双向八车道），目前正在进行高架、下穿、拓宽改造，预计今年10月份通车，合肥市铜陵路高架北延至淮海大道也已开工建设，预计今年8月通车，临近文忠路接驳主城，未来在出行上，将拥有多维化的立体交通体系。 项目距离合肥地铁3号线学林路站仅700米，预计今年9月份试运行通车，距离地铁4号线约1公里。轨道交通3号线可以直达政务天鹅湖商圈，可以快速换乘1号线2号线，到达庐阳主城和滨湖新区。纵观世界各地，无论是纽约华尔街，香港中环还是上海浦东，这些世界著名的繁华商圈都是依靠地铁而兴，生动地说明了地铁惊人的区域推动力。 项目周边有301路、302路、304路、681路等可畅达全城，直达合肥各大商圈及交通要点。 ', 6341, 54, '2019', '201908');
