INSERT INTO `house` VALUES (17153, 0, 0, '2021-05-26 15:50:57', 0, '2021-05-26 16:24:09', 201905010, '天宸花园', '38,39,40,15,21,24', ' 45612.85  ', 386, 21917, '北京路与黄河路交口', '包河区', '住宅', '高层、洋房', '合肥金科天宸房地产开发有限公司', '寰宇建筑设计院', '金科物业服务集团有限公司', '项目周边商业配套丰富，茶里水街商业与项目仅一路之隔，5公里范围内尽享悦方IDmall、世纪金源等大型商业配套；高端医疗资源汇聚。', '项目位于包河经济开发区北京路和黄河路的交口。北承老城，衔接高铁，包河区政府，南融滨湖省府板块。地铁5号线、北京路、上海路以及包河大道高架等组成立体环绕交通体系。', 6094, 62, '2019', '201905');
INSERT INTO `house` VALUES (17154, 0, 0, '2021-05-26 15:50:57', 0, '2021-05-26 16:24:09', 201905011, '万橡府', '65,66,67,68,69', ' 17093.93  ', 126, 13997, '合肥市新站高新区', '新站区', '高层，小高层，洋房', '框架', '合肥润祥房地产开发有限公司', 'DC国际、美国摩高', '华润置地（武汉）物业管理有限公司合肥分公司', '拓基广场、合家福超市、黉街、磨店菜市场、教育配套：项目自建幼儿园、庆平学校、168中学东校区、寿春中学、马克汉姆国际学校等。医疗配套：京东方数字化全科医院、安医四附院', '公交线路：681、301、302、303等，地铁3号线大众路站，长江西路高架', 6100, 62, '2019', '201905');
INSERT INTO `house` VALUES (17155, 0, 0, '2021-05-26 15:50:57', 0, '2021-05-26 16:24:10', 201905013, '湖畔诚园', 'G1,G2,G3,G5,G6,G7,G8,G9,G10,G11', ' 87697.25  ', 754, 23299, '合肥市滨湖新区大理路与嘉陵江路交口西南角', '滨湖区', '住宅', '高层，洋房', '安徽绿隽置业有限公司', '安徽省人防建筑设计研究院/中铁合肥建筑市政工程设计研究院有限公司', '绿城物业', '商业有世纪金源购物中心、文旅城、银泰城、联投中心、百大、奥特莱斯购物中心、公元天下，还有近10万方商业；有 21家金融机构的总部及金融基地落户；本项目幼儿园、小学、初中、高中环绕，15年全龄教育配套，一站式配齐，毗校而居，为孩子的未来保驾护航；拥有六大公园环绕三大旅游胜地。', '滨湖区域内的道路呈井字型有序排布，交通“五纵五横一环” “双地铁” “一高铁一高速”来形容【五纵：四川路、徽州大道、庐州大道、包河大道高架、上海路（在建）五横：锦绣大道、紫云路、方兴大道、云谷路、珠江路（待建）一环：环湖北路】、“双地铁” 地铁1号线（距离站点约900m、地铁5号线距离站点约500m）（高铁南站、京台高速）：纵向四川路全程2.2公里，双向6车道，未来是联通金融板块的主干道之一。', 6121, 62, '2019', '201905');
INSERT INTO `house` VALUES (17156, 0, 0, '2021-05-26 15:50:57', 0, '2021-05-26 16:24:10', 201905007, '翡玉公馆', 'C-2,C-3,C-7,C-11', ' 45127.90  ', 344, 21999, '龙川路与唐模路交叉口', '包河区', '住宅', '高层、洋房、别墅', '安徽信万华房地产开发有限公司', '致逸设计、LOCUS源点、张唐景观', '南京万科物业管理有限公司', '加侨国际广场、百大合家福购物广场、新都会环球购物广场、万达广场，项目自建4.7万方商业办公；教育配套：项目自建幼儿园。', '公交路线9路、101路、122路、138路；马鞍山路高架；地铁四号线花山路站（规划建设中）；高铁南站', 6106, 62, '2019', '201905');
INSERT INTO `house` VALUES (17157, 0, 0, '2021-05-26 15:50:57', 0, '2021-05-26 16:24:11', 201905012, '大成花苑', 'A5#,A6#', ' 13632.22  ', 96, 24063, '庐阳区怀宁路与固镇路交口西南角', '庐阳区', '普通住宅', '高层、洋房、其他', '合肥天沐房地产有限公司', '安徽地平线建筑设计有限公司', '长城物业集团股份有限公司', '项目面朝大蜀山，西观董铺水库，北近大房郢水库，以及庐州公园、植物园等环伺周围，项目的南边是长约4.9公里南淝河环绕；周边有汇银广场、明发商业广场、华润万象汇等，西一环可达三里庵商圈，怀宁路可直达黄潜望及政务区商圈。', '项目周边有东西走向四大城市主干道北二环路、临泉路、北一环路、长江西路，纵向主干道西二环路、潜山路、怀宁路。公交线路有44路、114路、157路、300路、512路，临近地铁3号线。', 6111, 62, '2019', '201905');
INSERT INTO `house` VALUES (17158, 0, 0, '2021-05-26 15:50:57', 0, '2021-05-26 16:24:11', 201905002, '璞羽西苑', '6#,1#', ' 15162.82  ', 124, 16999, '蜀山区邓店路以南、山茶路以东', '蜀山区', '住宅', '高层，洋房', '合肥市丽丰锦城置业有限公司', '安徽寰宇建筑设计院', '龙湖物业服务集团有限公司', '学校：乐农小学，蜀山中学，规划中小学 公园：四季花海，董铺湖湿地公园（规划中），代建市政公园，刘园 商业：加侨悦山国际，乐客来商业中心，联家超市 医疗：安医附院高新分院，省立妇幼保健院西区 ', '项目周边目前有振兴路、沁园路直通长江西路，距离长江西路约4公里，距离地铁二号线振兴路站约4公里，距离绕城高速蜀山出入口约5公里，可通过绕城高速通达新桥国际机场、合肥火车南站。', 6092, 62, '2019', '201905');
INSERT INTO `house` VALUES (17159, 0, 0, '2021-05-26 15:50:58', 0, '2021-05-26 16:24:12', 201905003, '万橡华府', '50,51', ' 15254.44  ', 136, 14846, '新站高新区东方大道与相山路交口', '新站区', '高层，小高层，洋房', '框架', '合肥润置房地产开发有限公司', 'DC国际、美国摩高', '华润置地（武汉）物业管理有限公司合肥分公司', '拓基广场、合家福超市、黉街、磨店菜市场、教育配套：项目自建幼儿园、庆平学校、168中学东校区、寿春中学、马克汉姆国际学校等。医疗配套：京东方数字化全科医院、安医四附院', '公交线路：681、301、302、303等，地铁3号线大众路站', 5969, 63, '2019', '201905');
INSERT INTO `house` VALUES (17160, 0, 0, '2021-05-26 15:50:58', 0, '2021-05-26 16:24:13', 201905004, '悦澜府', '3,5,6,7,8,9', ' 41160.30  ', 340, 21999, '包河区望江东路以北，铜陵路以西', '包河区', '住宅', '洋房、小高层、高层', '安徽阳耀光城房地产开发有限公司', '安徽省建筑设计研究总院股份有限公司', '阳光城物业服务（福建）有限公司合肥分公司', '商业：项目一路之隔就是百大购物中心和绿地缤纷城，步行5分钟即可到达兴隆国际购物广场，项目周边还毗邻着星光天地、新都会环球购物广场和漫乐城购物中心，满足您的吃喝玩乐购一站式的购物消费需求。除此之外，开车5分钟车程，即可到达包河万达商圈，并且和一号线无缝对接，公共交通同样非常便捷。包河万达集休闲、娱乐、购物为一体的大型Shopping mall，是合肥的第一个万达也是目前包河区规模最大、业态最丰富、完善的大型商业综合体 教育：作为积累多年的主城区核心位置，项目周边的教育资源更是丰富！项目旁紧邻的就是十班制的贝乐海顿公馆幼儿园，打造从托班到大班学龄前儿童全龄化的教育服务。除此之外，一路之隔的就是九年制义务教育的合肥市海顿学校，教学质量在包河区名列前茅，占地近两万平方米，欧式风格校园，环境优美，有一流的体育运动设施和现代化的教学，在包河区拥有非常良好的口碑。另外卫岗小学，阳光中学，合肥65中都在项目1.5公里范围之内 医疗：项目周边医疗资源十分丰富，合肥长庚医院是合肥市卫计委批准设立的一家集医疗、教学、科研、预防与康复保健于一体的省市二级综合医院。项目西向还有合肥市第三人民医院，开车经南北一号高架，还可以快速的抵达安医附院、省立医院，15分钟左右即可到达安徽省儿童医院等，都是大型三级甲等综合性医院 ', '地块周边有望江东路、铜陵路高架等主干道。沿望江东路到高新，铜陵路高架往滨湖。铜陵路高架，还衔接着北二环、临泉路、长江东路、长江东大街、裕溪路、南淝河路等。 紧邻地铁1号线，地铁4号线（在建）也经过周边。公交站有望铜路口和小朱岗。', 6088, 63, '2019', '201905');
INSERT INTO `house` VALUES (17161, 0, 0, '2021-05-26 15:50:58', 0, '2021-05-26 16:24:14', 201905005, '悦澜府', '1,2', ' 7338.20  ', 56, 20999, '包河区望江东路以北，铜陵路以西', '包河区', '住宅', '洋房、小高层、高层', '安徽阳耀光城房地产开发有限公司', '安徽省建筑设计研究总院股份有限公司', '阳光城物业服务（福建）有限公司合肥分公司', '商业：项目一路之隔就是百大购物中心和绿地缤纷城，步行5分钟即可到达兴隆国际购物广场，项目周边还毗邻着星光天地、新都会环球购物广场和漫乐城购物中心，满足您的吃喝玩乐购一站式的购物消费需求。除此之外，开车5分钟车程，即可到达包河万达商圈，并且和一号线无缝对接，公共交通同样非常便捷。包河万达集休闲、娱乐、购物为一体的大型Shopping mall，是合肥的第一个万达也是目前包河区规模最大、业态最丰富、完善的大型商业综合体 教育：作为积累多年的主城区核心位置，项目周边的教育资源更是丰富！项目旁紧邻的就是十班制的贝乐海顿公馆幼儿园，打造从托班到大班学龄前儿童全龄化的教育服务。除此之外，一路之隔的就是九年制义务教育的合肥市海顿学校，教学质量在包河区名列前茅，占地近两万平方米，欧式风格校园，环境优美，有一流的体育运动设施和现代化的教学，在包河区拥有非常良好的口碑。另外卫岗小学，阳光中学，合肥65中都在项目1.5公里范围之内 医疗：项目周边医疗资源十分丰富，合肥长庚医院是合肥市卫计委批准设立的一家集医疗、教学、科研、预防与康复保健于一体的省市二级综合医院。项目西向还有合肥市第三人民医院，开车经南北一号高架，还可以快速的抵达安医附院、省立医院，15分钟左右即可到达安徽省儿童医院等，都是大型三级甲等综合性医院 ', '地块周边有望江东路、铜陵路高架等主干道。沿望江东路到高新，铜陵路高架往滨湖。铜陵路高架，还衔接着北二环、临泉路、长江东路、长江东大街、裕溪路、南淝河路等。 紧邻地铁1号线，地铁4号线（在建）也经过周边。公交站有望铜路口和小朱岗。', 6087, 63, '2019', '201905');
INSERT INTO `house` VALUES (17162, 0, 0, '2021-05-26 15:50:58', 0, '2021-05-26 16:24:15', 201905006, '琥珀东华府', '11,16', ' 26367.41  ', 226, 15719, '襄水路与半塔路交口西北角', '瑶海区', '住宅', '高层，洋房，其他。', '合肥城建发展股份有限公司', '安徽寰宇建筑设计院', '安徽琥珀物业服务有限公司', '项目北侧有龙湖瑶海天街、周边有保利东郡福禄街、宝业东城广场以及瑶海万达广场；安徽静安中西医结合医院、合肥市第二人民医院新区；目前项目小学为建设中襄河路小学，中学为建设中合肥第38中东区，项目临近大店小学，马岗实验小学，55中东区；周边有瑶海湾湿地公园、月亮湾公园', '项目周边有轨道交通地铁2号线可直达大东门、四牌楼、三里街、三里庵、大蜀山等地，还有快速公交5号线、123路、T9路、37路、38路、39路、112路等，其中快速公交5号线可直达市府广场。', 6082, 63, '2019', '201905');
INSERT INTO `house` VALUES (17163, 0, 0, '2021-05-26 15:50:58', 0, '2021-05-26 16:24:15', 201904034, '翰林天筑小区', '10#,11#', ' 14738.66  ', 108, 16699, '新安江路与大众路交口东北角', '瑶海区', '住宅', '高层、小高层', '安徽建工地产有限公司', '上海柏涛建筑设计有限公司', '安徽绿城物业管理有限公司', '优质学区：和平路小学三小、38中东校区和新十中已入驻，项目北侧规划有12班的公立幼儿园，另外有9年义务教育用地。 生态环境方面：瑶海湾湿地公园，20万方的月亮湾公园已投入使用，还有街头游园如龙岗游园，思潮游园，项目西南角游园。 商业环境方面：龙湖天街、保利广场、宝业东城广场，瑶海万达距离项目近在咫尺。 医疗资源方面：合肥市新二院，妇幼保健院东区，静安医院，在建的上海长海医院', '“五横”“五纵”十条主干道的完善交通网，“五横”分别为包公大道、临泉东路、长江东路、新安江路和裕溪路高架；“五纵”分别为铜陵路高架、东二环当涂路、郎溪路、龙岗路和大众路。轨道交通方面，地铁2号线。', 6091, 63, '2019', '201904');
INSERT INTO `house` VALUES (17164, 0, 0, '2021-05-26 15:50:58', 0, '2021-05-26 16:24:16', 201904031, '高铁都市花园', '18#,19#,20#,22#', ' 40599.43  ', 352, 16160, '龙川路与合作化路交口西北角', '包河区', '住宅', '高层', '安徽沪铁房地产开发经营有限公司', '安徽华盛国际建筑设计工程咨询有限公司', '绿城物业管理有限公司', '项目位于政务东高铁经济圈，四区交汇，往东驱车10分钟可迅速到达合肥市高铁南站，通勤全国。承接合肥市政务区优质配套资源，1.5公里即为华润万象城商圈，3公里即为天鹅湖万达商圈和银泰城。合肥知名地标建筑如奥体中心、安徽省博物馆、安徽省广电中心等坐落于此。生态资源配套有十五里河中段景观公园，天鹅湖公园、南艳湖公园。居住于此能享受最便捷的配套服务。', '周边公交有140路，项目西侧有18路、148路、149路、901路、701路可畅达全城，直达合肥各大商圈及交通要点。', 6074, 63, '2019', '201904');
INSERT INTO `house` VALUES (17165, 0, 0, '2021-05-26 15:50:58', 0, '2021-05-26 16:24:16', 201904024, '御源公馆', '3#,4#,5#,6#,8#,9#', ' 44030.32  ', 438, 17100, '蒙城北路以东，天水路以北', '庐阳区', '住宅、商办', '高层、洋房', '合肥中环亿城置业有限公司', '华东建筑设计研究院有限公司', '安徽信达建银物业管理有限公司', '一湖五园高品质人居，自带商业配套，45中、6中、安庆路3小等合肥名校坐落左右，庐州医院为健康护航', '蒙城路，阜阳北路高架，临近地铁5号线、8号线 ', 6069, 63, '2019', '201904');
INSERT INTO `house` VALUES (17166, 0, 0, '2021-05-26 15:50:58', 0, '2021-05-26 16:24:17', 201904025, '锦绣龙川府', 'B1,B2,B3,B5,B6,B7', ' 31835.97  ', 269, 21499, '合肥市包河区龙川路以南、唐模路以东', '包河区', '住宅', '高层、小高层、洋房', '合肥宇信龙置业有限公司', '上海沪张思建筑规划设计事务所（有限合伙）', '重庆华宇第一太平戴维斯物业服务集团有限公司', '“四横四纵”城市主干道围绕，四横为南二环、祁门路、龙川路、繁华大道，可快速到达政务区、经开区；四纵为徽州大道、包河大道、北京路、上海路，可快速到达老城区、滨湖新区,附近有淝河智慧中央公园、淝河生态公园、南淝河生态公园、合肥中央公园。', '公交101路、9路、122路', 6089, 63, '2019', '201904');
