INSERT INTO `house` VALUES (17168, 0, 0, '2021-05-26 15:50:58', 0, '2021-05-26 16:24:18', 201904026, '湖岸澜庭', 'V01,V02,V03,V05,V06,V07,V08,V09,V10,V11,V12', ' 20375.42  ', 68, 20999, '合肥市蜀山区邓店路以南、千丈路以东', '蜀山区', '住宅', '低层、多层', '中海宏洋地产（合肥）有限公司', '上海原构设计咨询有限公司', '中海宏洋物业管理有限公司合肥分公司', '项目毗邻天然氧吧蜀山湖及蜀山湖湿地公园，邻近大蜀山，自然生态环境优越。从项目出发2.5公里可直达长江西路商圈，4km范围内覆盖乐客来国际广场、奥特莱斯、CBC拓基广场。此外，沿长江西路可快速通达国购、之心城、天鹅湖万达、万象城、银泰中心等合肥高端的商业配套群。', '项目位于蜀山经济开发区北部，位于沁源路与宝月路交口东北角。项目距离长江西路、地铁2号线站口、绕城高速出入口约3.5km，距离机场17km，区域交通较为便捷。', 6054, 63, '2019', '201904');
