INSERT INTO `house` VALUES (17170, 0, 0, '2021-05-26 15:50:58', 0, '2021-05-26 16:24:19', 201904012, '樾和府', '1#,7#,10#,14#,20#,22#', ' 45323.66  ', 442, 18699, '合肥市高新区方兴大道与彩虹路交口', '高新区', '住宅', '高层、洋房', '合肥晟南置业有限公司', '中铁合肥建筑市政工程设计研究院有限公司', '江苏中南物业服务有限公司', '砂之船奥莱购物中心，工商银行、农业银行', '临近方兴大道，665路公交车', 6065, 64, '2019', '201904');
INSERT INTO `house` VALUES (17171, 0, 0, '2021-05-26 15:50:58', 0, '2021-05-26 16:24:20', 201904019, '碧桂公馆', '17#,18#,19#,20#', ' 44243.48  ', 400, 22189, '合肥市嵩山路与南京路交口', '滨湖区', '住宅', '高层、洋房', '合肥碧祥房地产有限公司', '广东博意建筑设计院有限公司', '广东碧桂园物业服务股份有限公司合肥分公司', '五横五纵立体交通网络，紧邻包河大道、徽州大道等多条城市主干道，高铁、地铁连接城市风华。合肥实验学校、华山路小学等优质学校，全龄教育陪伴。合肥市滨湖医院、待建省立医院总部落址于旁。约百万方商业配套，涵盖3公里生活圈的吃喝玩乐购。', '包河大道高架、地铁1号线', 6056, 64, '2019', '201904');
INSERT INTO `house` VALUES (17172, 0, 0, '2021-05-26 15:50:58', 0, '2021-05-26 16:24:20', 201904018, '文一塘溪津门', '11', ' 8857.68  ', 64, 24500, '滨湖新区包河大道与杭州路交口', '滨湖区', '住宅', '高层、洋房', '安徽省文一投资控股集团滨江置业有限公司', '北京高能筑博建筑设计有限公司', '安徽省文一物业管理有限公司', '环境：项目紧邻方兴湖和巢湖两大水系，同时为塘西河公园、金斗公园、方兴湖公园和岸上草原所环抱，公园面积高达万亩。商业：项目自持近10万方的文化商业街，打造合肥城市会客厅。此外，南接万达文旅城和恒大中心，东邻银泰中心和中心书城，北连悦方IDmall和世纪金源，众多商业中心伺散。学区：项目南面沿云谷路建有幼儿园和小学。同时一中、四十八中、四十六中和师范附小等名校坐落周边，教育资源得天独厚。医疗：滨湖医院距离项目仅4公里。省立医院总部正在规划筹建，位于项目北侧，相距不过5分钟车程。旅游：万达文化旅游城、牛角大圩生态旅游区、滨湖湿地公园、巢湖岸边的岸上草原、滨湖十大省级文化场馆，加上会申报国家AAAA级景区的塘溪津门水街将，形成一片完整的环巢湖旅游带。', '项目交通状况用“一环二铁三纵四横”来概括。“一环”，即环巢湖大道，被誉为“合肥最美道路”之一。沿线向东可达巢湖城区，向西达国家AAAAA级风景区——三河古镇。“二铁”，指高铁南站和三条地铁线。高铁南站距项目约10公里，借此可达省外；其次项目紧邻三条地铁，1号线已开通营运，由滨湖新区直达合肥火车站，是合肥南北向交通的主动脉，距项目最近的云谷路站约为1.1公里；5号线已经开建，其东史岗路站与华山路站与项目无缝对接。S1号线，途经新桥机场、新高铁西站、高铁南站最终抵达巢湖岸边，将于项目东南角设站。“三纵”指三条南北向主干道——徽州大道、庐州大道和包河大道，连接滨湖新区与老城核心。“四横 ”为锦绣大道、紫云路、方兴大道和云谷路，贯穿滨湖新区和经开区。沿方兴大道向西驱车10分钟可上京台高速，30分钟可达机场高速入口，构成全方位、立体化的交通体系网，通达四周。', 6061, 64, '2019', '201904');
INSERT INTO `house` VALUES (17173, 0, 0, '2021-05-26 15:50:58', 0, '2021-05-26 16:24:21', 201904003, '中礼府', '12,15,16,11', ' 19717.94  ', 142, 29008, '嵩山路与紫云路交汇处', '滨湖区', '住宅', '花园洋房、其他住宅', '合肥葛洲坝房地产开发有限公司', '汇张思建筑设计咨询（上海）有限公司', '葛洲坝物业管理有限公司', '项目周边配有悦方茂，万达茂等大型商场，三甲医院滨湖医院等，并且紧临塘西河公园、金斗公园、方兴湖公园，三园环绕，板块配套资源非常丰富。', '项目所处滨湖核心区位，在交通配套与居住环境方面具有很强的优越性。东接包河大道前往市中心约20分钟，西距已开通的地铁1号线紫庐站仅1公里。', 6035, 64, '2019', '201904');
INSERT INTO `house` VALUES (17174, 0, 0, '2021-05-26 15:50:58', 0, '2021-05-26 16:24:22', 201904007, '翰林天筑小区', '15#,16#', ' 18337.62  ', 188, 13199, '新安江路与大众路交口东北角', '瑶海区', '住宅', '高层、小高层', '安徽建工地产有限公司', '上海柏涛建筑设计有限公司', '安徽绿城物业管理有限公司', '优质学区：和平路小学三小、38中东校区和新十中已入驻，项目北侧规划有12班的公立幼儿园，另外有9年义务教育用地。 生态环境方面：瑶海湾湿地公园，20万方的月亮湾公园已投入使用，还有街头游园如龙岗游园，思潮游园，项目西南角游园。 商业环境方面：龙湖天街、保利广场、宝业东城广场，瑶海万达距离项目近在咫尺。 医疗资源方面：合肥市新二院，妇幼保健院东区，静安医院，在建的上海长海医院', '“五横”“五纵”十条主干道的完善交通网，“五横”分别为包公大道、临泉东路、长江东路、新安江路和裕溪路高架；“五纵”分别为铜陵路高架、东二环当涂路、郎溪路、龙岗路和大众路。轨道交通方面，地铁2号线。', 5960, 64, '2019', '201904');
INSERT INTO `house` VALUES (17175, 0, 0, '2021-05-26 15:50:58', 0, '2021-05-26 16:24:22', 201904028, '大成花苑', 'A11#,A13#', ' 9310.08  ', 60, 25565, '庐阳区怀宁路与固镇路交口西南角', '庐阳区', '普通住宅', '高层、洋房、其他', '合肥天沐房地产有限公司', '安徽地平线建筑设计有限公司', '长城物业集团股份有限公司', '项目面朝大蜀山，西观董铺水库，北近大房郢水库，以及庐州公园、植物园等环伺周围，项目的南边是长约4.9公里南淝河环绕；周边有汇银广场、明发商业广场、华润万象汇等，西一环可达三里庵商圈，怀宁路可直达黄潜望及政务区商圈。', '项目周边有东西走向四大城市主干道北二环路、临泉路、北一环路、长江西路，纵向主干道西二环路、潜山路、怀宁路。公交线路有44路、114路、157路、300路、512路，临近地铁3号线。', 6058, 64, '2019', '201904');
INSERT INTO `house` VALUES (17176, 0, 0, '2021-05-26 15:50:58', 0, '2021-05-26 16:24:23', 201904014, '水木园', '10#', ' 19608.60  ', 132, 19071, '宿松路以西，海恒街以北', '经开区', '住宅', '居住建筑', '安徽启迪科技城投资发展有限公司', '上海天华建筑设计有限公司', '安徽启迪物业服务有限公司', '景区：南艳湖公园，南艳湖全民健身中心（建设中）； 学校：清华附中合肥学校（九年一贯制）、自建幼儿园； 商场：政府规划商业中心、世纪金源购物中心、万尚百货、居然之家、永辉超市； 银行：中国工商银行（明珠支行）；招商银行（合肥滨湖支行）； 医院：滨湖医院、安医二附院； 酒店：白金汉爵大酒店、世纪金源大饭店； ', '道路交通：63路、64路、115路、602路，地铁7号线（规划）', 6066, 64, '2019', '201904');
INSERT INTO `house` VALUES (17177, 0, 0, '2021-05-26 15:50:58', 0, '2021-05-26 16:24:24', 201904008, '蜀山别院', '3#,7#,11#,15#', ' 10704.77  ', 52, 24871, '望江西路以南，枫林路以西', '高新区', '洋房', '洋房', '合肥冠升置业投资有限公司', '安徽寰宇建筑设计院', '合肥华邦物业服务有限公司', '大蜀山，1.3万亩蜀山森林公园，野生动物园，蜀峰湾体育公园，四季花海公园，北雁湖，蜀西湖，奥特莱斯、祥源银泰城（在建）近邻周边。', '公交102，665，651至枫林路站下车即可到达，周边有地铁2号线蜀山西站，正在建设的4号线，规划中的6号线。', 6055, 64, '2019', '201904');
INSERT INTO `house` VALUES (17178, 0, 0, '2021-05-26 15:50:58', 0, '2021-05-26 16:24:24', 201904005, '文一塘溪津门', '58,59', ' 24401.27  ', 157, 24000, '滨湖新区包河大道与杭州路交口', '滨湖区', '住宅', '高层、洋房', '安徽省文一投资控股集团滨江置业有限公司', '北京高能筑博建筑设计有限公司', '安徽省文一物业管理有限公司', '环境：项目紧邻方兴湖和巢湖两大水系，同时为塘西河公园、金斗公园、方兴湖公园和岸上草原所环抱，公园面积高达万亩。商业：项目自持近10万方的文化商业街，打造合肥城市会客厅。此外，南接万达文旅城和恒大中心，东邻银泰中心和中心书城，北连悦方IDmall和世纪金源，众多商业中心伺散。学区：项目南面沿云谷路建有幼儿园和小学。同时一中、四十八中、四十六中和师范附小等名校坐落周边，教育资源得天独厚。医疗：滨湖医院距离项目仅4公里。省立医院总部正在规划筹建，位于项目北侧，相距不过5分钟车程。旅游：万达文化旅游城、牛角大圩生态旅游区、滨湖湿地公园、巢湖岸边的岸上草原、滨湖十大省级文化场馆，加上会申报国家AAAA级景区的塘溪津门水街将，形成一片完整的环巢湖旅游带。', '项目交通状况用“一环二铁三纵四横”来概括。“一环”，即环巢湖大道，被誉为“合肥最美道路”之一。沿线向东可达巢湖城区，向西达国家AAAAA级风景区——三河古镇。“二铁”，指高铁南站和三条地铁线。高铁南站距项目约10公里，借此可达省外；其次项目紧邻三条地铁，1号线已开通营运，由滨湖新区直达合肥火车站，是合肥南北向交通的主动脉，距项目最近的云谷路站约为1.1公里；5号线已经开建，其东史岗路站与华山路站与项目无缝对接。S1号线，途经新桥机场、新高铁西站、高铁南站最终抵达巢湖岸边，将于项目东南角设站。“三纵”指三条南北向主干道——徽州大道、庐州大道和包河大道，连接滨湖新区与老城核心。“四横 ”为锦绣大道、紫云路、方兴大道和云谷路，贯穿滨湖新区和经开区。沿方兴大道向西驱车10分钟可上京台高速，30分钟可达机场高速入口，构成全方位、立体化的交通体系网，通达四周。', 6060, 64, '2019', '201904');
