INSERT INTO `house` VALUES (17180, 0, 0, '2021-05-26 15:50:59', 0, '2021-05-26 16:24:25', 201904013, '雍龙府', 'A5#,A6#,A8#', ' 9608.99  ', 70, 26799, '包河区龙川路与塔川路交口', '包河区', '住宅', '高层、洋房、其他住宅', '建发房地产集团合肥有限公司', '安徽地平线建筑设计有限公司', '怡家园（厦门）物业管理有限公司合肥分公司', '项目毗邻政务区，万象城、新地中心、银泰城、天鹅湖万达、大摩广场、麦德龙等大型综合体咫尺可达，奥体中心、大剧院、天鹅湖等文娱配套触手可及。项目北侧规划十五里河公园及邻里中心，环境优美，生活便捷。', '南北走向禀赋金寨路、宿松路、徽州大道3条城市主干道，东西走向拥有龙川路、祁门路、南二环、绕城高速等主干道，方便到达市区各个地方和新桥机场。同时，项目东面有汽车南站和高铁南站，快速通道省内外众多城市。此外，项目北面祁门路规划有地铁4号线，享便捷出行。', 6051, 65, '2019', '201904');
INSERT INTO `house` VALUES (17181, 0, 0, '2021-05-26 15:50:59', 0, '2021-05-26 16:24:26', 201904002, '君荣府', '1#,2#,3#,17#,5#', ' 47619.48  ', 440, 21141, '合肥市滨湖新区贵阳路与云南路西北角', '滨湖区', '住宅、商业', '洋房、高层', '合肥新城亿盛房地产有限公司', '江苏筑森建筑设计有限公司', '西藏新城悦物业服务股份有限公司合肥分公司 ', '学校资源：本项目周边配套规划幼儿园、已建成示范附小三小贵阳路校区和阳光中学四川路校区，项目周边规划国际双语学校； 景观资源：本项目周边3公里内分布城市体育公园（规划）、云川公园、金斗公园、岸上草原； 商超：周边规划建设银泰城、奥特莱斯、万达茂； 医院：市滨湖医院、规划省立医院医疗保健中心； 银行：项目1公里内分布中国银行、交通银行、农业银行等22家银行和金融保险机构。 内部配套：项目自身配套约1500平米商业，设置小区配套商业。', '本项目是多维立体化交通，项目周边交通体系“五纵无横一环”多维交通网通达全城，本项目通过贵阳路、四川路与徽州大道、庐州大道、云谷路紧密连接，交通通达性强，“双地铁”贯穿城市核心区域，距离地铁1号线九联圩站直线距离2公里、无缝对接地铁5号线贵阳路站点。本项目有效连接与主城区各个区域，交通便捷度高。', 6027, 65, '2019', '201904');
