INSERT INTO `house` VALUES (17311, 0, 0, '2021-05-26 15:51:07', 0, '2021-05-26 16:25:35', 201809026, '融科城创泽园', '1,2,25', ' 36791.13  ', 277, 17659, '明珠路以南、金炉路以西', '经开区', '住宅', '高层', '合肥联创智融房地产开发有限公司', '华东建筑设计研究院有限公司', '融创物业服务集团有限公司合肥分公司', '生活配套充足，医疗配套先进，市政设施完善，社区及教育氛围浓厚，学校、超市、医院、大型商业、星级酒店、市政、风景区、娱乐休闲等一应齐全。 ', '位于城市主干道翡翠路西侧，交通便利。直达项目的公交线路20、128、605路，周边邻近项目的公交线路有126、149、150、226、602、608路。 ', 5614, 78, '2018', '201809');
INSERT INTO `house` VALUES (17312, 0, 0, '2021-05-26 15:51:07', 0, '2021-05-26 16:25:36', 201809025, '文一塘溪津门', '50', ' 8956.35  ', 57, 24000, '滨湖新区包河大道与杭州路交口', '滨湖区', '住宅', '高层、洋房', '安徽省文一投资控股集团滨江置业有限公司', '北京高能筑博建筑设计有限公司', '安徽省文一物业管理有限公司', '环境：项目紧邻方兴湖和巢湖两大水系，同时为塘西河公园、金斗公园、方兴湖公园和岸上草原所环抱，公园面积高达万亩。商业：项目自持近10万方的文化商业街，打造合肥城市会客厅。此外，南接万达文旅城和恒大中心，东邻银泰中心和中心书城，北连悦方IDmall和世纪金源，众多商业中心伺散。学区：项目南面沿云谷路建有幼儿园和小学。同时一中、四十八中、四十六中和师范附小等名校坐落周边，教育资源得天独厚。医疗：滨湖医院距离项目仅4公里。省立医院总部正在规划筹建，位于项目北侧，相距不过5分钟车程。旅游：万达文化旅游城、牛角大圩生态旅游区、滨湖湿地公园、巢湖岸边的岸上草原、滨湖十大省级文化场馆，加上会申报国家AAAA级景区的塘溪津门水街将，形成一片完整的环巢湖旅游带。', '项目交通状况用“一环二铁三纵四横”来概括。“一环”，即环巢湖大道，被誉为“合肥最美道路”之一。沿线向东可达巢湖城区，向西达国家AAAAA级风景区——三河古镇。“二铁”，指高铁南站和三条地铁线。高铁南站距项目约10公里，借此可达省外；其次项目紧邻三条地铁，1号线已开通营运，由滨湖新区直达合肥火车站，是合肥南北向交通的主动脉，距项目最近的云谷路站约为1.1公里；5号线已经开建，其东史岗路站与华山路站与项目无缝对接。S1号线，途经新桥机场、新高铁西站、高铁南站最终抵达巢湖岸边，将于项目东南角设站。“三纵”指三条南北向主干道——徽州大道、庐州大道和包河大道，连接滨湖新区与老城核心。“四横 ”为锦绣大道、紫云路、方兴大道和云谷路，贯穿滨湖新区和经开区。沿方兴大道向西驱车10分钟可上京台高速，30分钟可达机场高速入口，构成全方位、立体化的交通体系网，通达四周。', 5590, 78, '2018', '201809');
INSERT INTO `house` VALUES (17313, 0, 0, '2021-05-26 15:51:07', 0, '2021-05-26 16:25:36', 201809034, '雍龙府', 'C1#,C9#,C11#,C12#', ' 6675.99  ', 47, 27821, '包河区龙川路与塔川路交口', '包河区', '住宅', '高层、洋房、其他住宅', '建发房地产集团合肥有限公司', '安徽地平线建筑设计有限公司', '怡家园（厦门）物业管理有限公司合肥分公司', '项目毗邻政务区，万象城、新地中心、银泰城、天鹅湖万达、大摩广场、麦德龙等大型综合体咫尺可达，奥体中心、大剧院、天鹅湖等文娱配套触手可及。项目北侧规划十五里河公园及邻里中心，环境优美，生活便捷。', '南北走向禀赋金寨路、宿松路、徽州大道3条城市主干道，东西走向拥有龙川路、祁门路、南二环、绕城高速等主干道，方便到达市区各个地方和新桥机场。同时，项目东面有汽车南站和高铁南站，快速通道省内外众多城市。此外，项目北面祁门路规划有地铁4号线，享便捷出行。', 5612, 78, '2018', '201809');
INSERT INTO `house` VALUES (17314, 0, 0, '2021-05-26 15:51:07', 0, '2021-05-26 16:25:37', 201809023, '君悦府', '6#,8#,18#', ' 25345.72  ', 216, 22999, '合肥市滨湖新区南京路与华山路东南角', '滨湖区', '住宅、商业', '洋房、高层', '合肥新城创晟房地产有限公司', '华东建筑设计研究院有限公司', '西藏新城悦物业服务股份有限公司合肥分公司 ', '项目南侧为琥珀瑞安家园，品质较好。 西侧为合肥实验学校、公园等。目前休闲、娱乐、购物配套齐全，不仅有十分繁华的世纪金源商圈之外，还有悦方、万达茂大型购物超市。', '地块位于滨湖新区，东至未建嵩山路，西侧紧邻公园绿地至华山路、邻合界高速，南至万泉河路，北至南京路。项目周边的交通路网发达，东侧包河大道，北连南北1号高架，南至环湖大道。合肥地铁1号线，距离本案最近的滨湖会展中心站约1公里，规划的地铁5号线、7号线，其中的包河大道站，可以与本项目无缝对接，同时周边也有公交线路。', 5534, 78, '2018', '201809');
