INSERT INTO `house` VALUES (17316, 0, 0, '2021-05-26 15:51:07', 0, '2021-05-26 16:25:38', 201809022, '湖光别院', 'Y7,Y16,G11,G18', ' 24231.42  ', 208, 16059, '珠江路与云南路交口', '滨湖区', '高层', '新建', '合肥和桂房地产有限公司', '上海水石建筑规划设计股份有限公司', '保利物业管理有限公司安徽分公司', '项目自身带有7.7万方商业，周边5-10分钟车程直达15万方万达茂，10万方悦方IDMALL，40万方的世纪金源；项目自建幼儿园，南侧配套教育用地，区域内教育资源优厚；地块南侧一路之隔北涝圩生态湿地，未来自然资源配套优质。', '五横五纵两轨道，沿徽州大道往北20分钟车程即可到达合肥老城区，两条地铁覆盖，地铁1号线（始发站九联圩距离项目2km左右），正在建设的地铁5号线（始发站贵阳路站与本项目是零距离无缝对接）。', 5607, 78, '2018', '201809');
