INSERT INTO `house` VALUES (17351, 0, 0, '2021-05-26 15:51:09', 0, '2021-05-26 16:26:28', 201808036, '城市公馆', 'A-6,A-7', ' 4687.12  ', 28, 21714, '合肥市庐阳区一环路与四里河路交口', '庐阳区', '高层、洋房、别墅、商办', '钢筋混凝土', '合肥万科金湾地产有限公司', '上海日清设计院', '上海万科物业服务有限公司合肥分公司', '项目位于市中心一环边，大润发、北一环欢乐颂、乐购和三里庵国购广场、之心城近在咫尺。学区是小区自建幼儿园、南门小学森林城校区、四十五中森林城校区。小区商业部分与规划3号线（四里河站）相连，交通极其方便。', '53路、13路、12路、59路、124路、131路、143路、233路、22路、17路、59路、232路、705路东线、705路西线公交车；地铁规划建设3号线（四里河站）。', 5532, 82, '2018', '201808');
INSERT INTO `house` VALUES (17352, 0, 0, '2021-05-26 15:51:09', 0, '2021-05-26 16:26:29', 201808032, '熙悦府', '1#,2#,3#,5#,6#,7#,8#,9#', ' 90943.53  ', 916, 17300, '铜陵路与裕溪路交口西北角', '瑶海区', '住宅', '高层', '合肥保利和裕房地产有限公司', '安徽地平线建筑设计有限公司', '保利物业发展股份有限公司', '本项目毗邻包河万达、银泰中心、淮河路步行街三大商圈，项目西侧百米之隔有繁昌路菜市场。繁昌路菜市场是瑶海区最全的综合性菜市场，辐射上万户居民。生鲜品种多样，更新及时。除了菜市场外，项目南侧不到500米就是永辉超市，满足您家庭日常所需。 此外，项目周边有五星级万达威斯汀、希尔顿酒店，车行10分钟即到。同时，项目1公里内有十几家银行网点，包含四大国有银行以及光大银行、民生银行等。项目附近常住人口近50万人次，加上周边带来的流动客流，为我们商业提供了充足的消费人群。 ', '项目周边形成三纵三横的交通网，出行十分便捷。“三纵”是指南北走向马鞍山路、东一环、铜陵路；“三横“是指东西走向长江东路、长江东大街、裕溪路。其中，铜陵路高架直通合肥北部，到达新站区、庐阳区等；裕溪路高架向东连接合肥东大门，向西直达南一环，进入一环生活圈。 “三纵三横”的城市道路网，快速直达合肥各个区域，10分钟即可到达合肥火车站、汽车站，可转乘到新桥机场的直达班车；20分钟可到达合肥高铁南站，25分钟可到达合肥滨湖万达文化旅游城，形成半小时生活圈。 值得一提的是，项目周边有地铁1号线包公园站、2号线铜陵路站，以及可以换乘1、2号线的大东门站。同时项目紧邻裕铜路口、繁昌路、市二院等公交站台，20多条公交线路经过，便捷的交通带来了非常大的客户流动群。 ', 5478, 82, '2018', '201808');
