INSERT INTO `house` VALUES (17357, 0, 0, '2021-05-26 15:51:09', 0, '2021-05-26 16:26:32', 201808033, '翰林天筑小区', '17#,18#,19#,20#,21#,22#,23#', ' 63657.50  ', 744, 13199, '新安江路与大众路交口东北角', '瑶海区', '住宅', '高层、小高层', '安徽建工地产有限公司', '上海柏涛建筑设计有限公司', '安徽绿城物业管理有限公司', '优质学区：和平路小学三小、38中东校区和新十中已入驻，项目北侧规划有12班的公立幼儿园，另外有9年义务教育用地。 生态环境方面：瑶海湾湿地公园，20万方的月亮湾公园已投入使用，还有街头游园如龙岗游园，思潮游园，项目西南角游园。 商业环境方面：龙湖天街、保利广场、宝业东城广场，瑶海万达距离项目近在咫尺。 医疗资源方面：合肥市新二院，妇幼保健院东区，静安医院，在建的上海长海医院', '“五横”“五纵”十条主干道的完善交通网，“五横”分别为包公大道、临泉东路、长江东路、新安江路和裕溪路高架；“五纵”分别为铜陵路高架、东二环当涂路、郎溪路、龙岗路和大众路。轨道交通方面，地铁2号线。', 5496, 82, '2018', '201808');
