INSERT INTO `house` VALUES (17379, 0, 0, '2021-05-26 15:51:10', 0, '2021-05-26 16:26:44', 201807051, '龙川里', '1,2,3,4', ' 38568.64  ', 384, 15999, '包河区龙川路与祁山路交口', '包河区', '高层', '住宅', '合肥滨湖投资控股集团有限公司', '安徽寰宇建筑设计院', '合肥湖滨物业公司', '以万象城为代表的大型商业综合体近十余座，天鹅湖万达、银泰城、新地中心、安粮城市广场等，方便日常生活购物需求。', '快速便捷的交通网络，项目位于城际交通、主干道交通、地铁交通三大交通系统的枢纽，可满足日常生活出行出城的需求，公交有140路（九连塘站）、T7（梳背桥站）、26/901/149/701（五十四站）。', 4428, 85, '2018', '201807');
