INSERT INTO `house` VALUES (17381, 0, 0, '2021-05-26 15:51:10', 0, '2021-05-26 16:26:45', 201807042, '紫云别院', 'Y9,Y15,Y11,Y12,Y10', ' 15896.35  ', 78, 19190, '紫云路以南、天津路以西', '滨湖区', '高层、洋房', '新建', '合肥锦顺房地产开发有限公司', '上海中建建筑设计院有限公司', '龙湖物业服务集团有限公司', '悦方购物中心、万达文旅城、百大、紫云山公园、方兴湖公园、湿地公园、森林公园、塘西河公园、合肥新四中（在建中）', '97、66、68等公交，上海路、紫云路、迎淮路目前正在建设中', 5447, 85, '2018', '201807');
INSERT INTO `house` VALUES (17382, 0, 0, '2021-05-26 15:51:10', 0, '2021-05-26 16:26:46', 201807046, '琥珀东华府', '06', ' 6775.02  ', 54, 16899, '襄水路与半塔路交口西北角', '瑶海区', '住宅', '高层，洋房，其他。', '合肥城建发展股份有限公司', '安徽寰宇建筑设计院', '安徽琥珀物业服务有限公司', '项目北侧有龙湖瑶海天街、周边有保利东郡福禄街、宝业东城广场以及瑶海万达广场；安徽静安中西医结合医院、合肥市第二人民医院新区；目前项目小学为建设中襄河路小学，中学为建设中合肥第38中东区，项目临近大店小学，马岗实验小学，55中东区；周边有瑶海湾湿地公园、月亮湾公园', '项目周边有轨道交通地铁2号线可直达大东门、四牌楼、三里街、三里庵、大蜀山等地，还有快速公交5号线、123路、T9路、37路、38路、39路、112路等，其中快速公交5号线可直达市府广场。', 5412, 85, '2018', '201807');
INSERT INTO `house` VALUES (17383, 0, 0, '2021-05-26 15:51:10', 0, '2021-05-26 16:26:46', 201807045, '琥珀东华府', '09', ' 3731.51  ', 28, 16731, '襄水路与半塔路交口西北角', '瑶海区', '住宅', '高层，洋房，其他。', '合肥城建发展股份有限公司', '安徽寰宇建筑设计院', '安徽琥珀物业服务有限公司', '项目北侧有龙湖瑶海天街、周边有保利东郡福禄街、宝业东城广场以及瑶海万达广场；安徽静安中西医结合医院、合肥市第二人民医院新区；目前项目小学为建设中襄河路小学，中学为建设中合肥第38中东区，项目临近大店小学，马岗实验小学，55中东区；周边有瑶海湾湿地公园、月亮湾公园', '项目周边有轨道交通地铁2号线可直达大东门、四牌楼、三里街、三里庵、大蜀山等地，还有快速公交5号线、123路、T9路、37路、38路、39路、112路等，其中快速公交5号线可直达市府广场。', 5449, 85, '2018', '201807');
INSERT INTO `house` VALUES (17384, 0, 0, '2021-05-26 15:51:10', 0, '2021-05-26 16:26:47', 201807037, '君悦府', '7#,9#,12#', ' 25917.32  ', 220, 23000, '合肥市滨湖新区南京路与华山路东南角', '滨湖区', '住宅、商业', '洋房、高层', '合肥新城创晟房地产有限公司', '华东建筑设计研究院有限公司', '西藏新城悦物业服务股份有限公司合肥分公司 ', '项目南侧为琥珀瑞安家园，品质较好。 西侧为合肥实验学校、公园等。目前休闲、娱乐、购物配套齐全，不仅有十分繁华的世纪金源商圈之外，还有悦方、万达茂大型购物超市。', '地块位于滨湖新区，东至未建嵩山路，西侧紧邻公园绿地至华山路、邻合界高速，南至万泉河路，北至南京路。项目周边的交通路网发达，东侧包河大道，北连南北1号高架，南至环湖大道。合肥地铁1号线，距离本案最近的滨湖会展中心站约1公里，规划的地铁5号线、7号线，其中的包河大道站，可以与本项目无缝对接，同时周边也有公交线路。', 5370, 85, '2018', '201807');
INSERT INTO `house` VALUES (17385, 0, 0, '2021-05-26 15:51:10', 0, '2021-05-26 16:26:47', 201807036, '观澜花园', '8,10', ' 6638.84  ', 44, 20999, '龙川路与合作化路交叉口', '包河区', '一级', '高层、花园洋房', '安徽融和房地产开发有限公司', '安徽地平线设计有限公司', '福州融侨物业管理公司', ' 项目位于政务东，紧邻目前合肥市商圈最发达的政务区，承接了成熟的政务区优质资源，一脉龙川路无缝接驳万象城商圈，3公里即为银泰城，3.8公里即为天鹅湖万达，世界各大高端品牌汇聚于此，而且很多的知名品牌只进驻此区域，驱车10分钟左右即满足日常所有需求。以及新地中心、置地广场、百利中心、绿地中心等星级写字楼，另外合肥市许多知名地标建筑也坐落于此，比如安徽广电中心，奥体中心，安徽省博物馆、天鹅湖等，得以让居住于此的人们能享受便捷的生活服务。', '周边公交，项目西侧有54中公交车站，18路、126路、148路、149路、516路、701、901路可畅达全城，直达合肥各大商圈及交通要点。', 5433, 85, '2018', '201807');
INSERT INTO `house` VALUES (17386, 0, 0, '2021-05-26 15:51:10', 0, '2021-05-26 16:26:48', 201807038, '罗兰香谷花园', 'A5,A6,B3,B6,B7', ' 34411.01  ', 320, 14799, '合肥市新站区淮海路与相城路交口西北处', '新站区', '住宅', '高层,洋房', '合肥和淮房地产有限责任公司', '中外建工程设计与顾问有限公司', '保利物业发展股份有限公司', '项目自建12班幼儿园，建成后移交政府；紧邻在建合肥九中新校区。项目西侧配备有12万方的商业配套，未来生活便利。西北方向3公里即为新站区重点打造的少荃湖湿地公园，西南方向2.5公里为学林公园，生态环境优越。', '项目南至淮海大道，零距离接驳地铁三号线首站相城路站，向西临近大众路，为合肥东城重要的主干道，未来将贯通新站、瑶海、包河和经开四大区域。', 5432, 85, '2018', '201807');
INSERT INTO `house` VALUES (17387, 0, 0, '2021-05-26 15:51:10', 0, '2021-05-26 16:26:48', 201807035, '坝上街环球中心', 'R3,R4', ' 78428.05  ', 644, 17000, '长江东路与明光路交口西南角', '瑶海区', '住宅', '综合体项目', '恒盛恒茂（合肥）房地产开发有限公司', '上海创盟国际建筑设计有限公司', '安徽省长城物业管理有限公司', '项目地处集步行交通、商业街区、城市公园、主要干道和未来地铁系统复杂而丰富的城市网络交汇点上，将大大受益于其优越的地理位置和多彩的城市生活，并以动感的建筑曲线，层次分明的绿地植被，与有着1500年历史的古逍遥津公园紧密相连，融入到城市绿化中，连接并延展了合肥整个城市的绿化带。 ', '合肥老城核心，跨距瑶海区、庐阳区、包河区三大区交汇之地。5分钟生活圈内，万达、银泰广场、淮河路步行街等五大商圈环绕，繁华四溢，让您足不出户即可畅享购物的便利。同时，项目毗邻1、2号轻轨线，周边汇集30条公交路线，10分钟抵达汽车站、火车站，顷刻间通达全城，畅通无阻。 ', 5419, 85, '2018', '201807');
INSERT INTO `house` VALUES (17388, 0, 0, '2021-05-26 15:51:10', 0, '2021-05-26 16:26:49', 201807047, '文一塘溪津门', '3,23,26', ' 15484.82  ', 92, 27898, '滨湖新区包河大道与杭州路交口', '滨湖区', '住宅', '高层、洋房', '安徽省文一投资控股集团滨江置业有限公司', '北京高能筑博建筑设计有限公司', '安徽省文一物业管理有限公司', '环境：项目紧邻方兴湖和巢湖两大水系，同时为塘西河公园、金斗公园、方兴湖公园和岸上草原所环抱，公园面积高达万亩。商业：项目自持近10万方的文化商业街，打造合肥城市会客厅。此外，南接万达文旅城和恒大中心，东邻银泰中心和中心书城，北连悦方IDmall和世纪金源，众多商业中心伺散。学区：项目南面沿云谷路建有幼儿园和小学。同时一中、四十八中、四十六中和师范附小等名校坐落周边，教育资源得天独厚。医疗：滨湖医院距离项目仅4公里。省立医院总部正在规划筹建，位于项目北侧，相距不过5分钟车程。旅游：万达文化旅游城、牛角大圩生态旅游区、滨湖湿地公园、巢湖岸边的岸上草原、滨湖十大省级文化场馆，加上会申报国家AAAA级景区的塘溪津门水街将，形成一片完整的环巢湖旅游带。', '项目交通状况用“一环二铁三纵四横”来概括。“一环”，即环巢湖大道，被誉为“合肥最美道路”之一。沿线向东可达巢湖城区，向西达国家AAAAA级风景区——三河古镇。“二铁”，指高铁南站和三条地铁线。高铁南站距项目约10公里，借此可达省外；其次项目紧邻三条地铁，1号线已开通营运，由滨湖新区直达合肥火车站，是合肥南北向交通的主动脉，距项目最近的云谷路站约为1.1公里；5号线已经开建，其东史岗路站与华山路站与项目无缝对接。S1号线，途经新桥机场、新高铁西站、高铁南站最终抵达巢湖岸边，将于项目东南角设站。“三纵”指三条南北向主干道——徽州大道、庐州大道和包河大道，连接滨湖新区与老城核心。“四横 ”为锦绣大道、紫云路、方兴大道和云谷路，贯穿滨湖新区和经开区。沿方兴大道向西驱车10分钟可上京台高速，30分钟可达机场高速入口，构成全方位、立体化的交通体系网，通达四周。', 5425, 85, '2018', '201807');
INSERT INTO `house` VALUES (17389, 0, 0, '2021-05-26 15:51:11', 0, '2021-05-26 16:26:49', 201807029, '琥珀蜀熙府', 'A5', ' 10162.36  ', 104, 17170, '西二环路与樊洼路交口', '蜀山区', '住宅', '住宅', '合肥城建发展股份有限公司', '安徽寰宇建筑设计院', '安徽琥珀物业服务有限公司', '环境资源：一湖两园、蜀山森林公园。静享生态自然。距离董浦湖、植物园直线距离约1公里，距离庐州公园直线距离约2公里，远眺大蜀山，观山、悦湖、揽园、府藏自然深处，阳光、清风、绿氧层层渗入府中，邂逅生态府居之美。三进式园林景观，五重园林景观轴线，，代建2500平方街角公园，让生活回归居住本意。 教育资源：自建幼儿园、南侧规划小学用地。 科技人居:市政冷暖双供，空气能热水器、新风系统。 ', '路网纵横 咫尺万象繁华。城市主干道西二环通达南北，长江西路高架、地铁2号线捷贯东西，多条公交路线纵横交织，城市交通动脉环绕，咫尺畅达三里庵商圈、黄潜望商圈、政务商圈、满足休闲、娱乐、交友、聚会等全方位需求。', 5417, 86, '2018', '201807');
INSERT INTO `house` VALUES (17390, 0, 0, '2021-05-26 15:51:11', 0, '2021-05-26 16:26:50', 201807027, '美好花园', '5#,7#,6#', ' 31178.61  ', 315, 15698, '瑶海区大众路东、襄水路北', '瑶海区', '住宅', '高层、洋房', '合肥中梁筑信置业有限公司', '上海帝奥建筑设计有限公司', '上海中梁物业发展有限公司', '周边学校资源丰富，小区规划幼儿园，紧邻西侧地块规划为教育用地，距离新十中约600米，距离在建38中新校区约800米；周边商业有龙湖瑶海天街（在建）、保利广场等', '项目位于长江东路与大众路交口向南约300米，毗邻主干道，同时，距离地铁2号线三十埠站约300米，周边公交线路有38路、354路等，交通便利', 5405, 86, '2018', '201807');
INSERT INTO `house` VALUES (17391, 0, 0, '2021-05-26 15:51:11', 0, '2021-05-26 16:26:50', 201807041, '栢景湾七期', '书香阁4#,书香阁5#', ' 29360.43  ', 354, 5038, '亳州路以东、沿河路以北', '庐阳区', '住宅', '逸湖居23#为高层，逸湖居24#为花园洋房', '安徽置地投资有限公司', '深圳奥意建筑工程设计有限公司', '安徽信联物业服务有限公司', '项目北临北一环濉溪路，西临亳州路（住宅退亳州路道路红线10米），可直达市中心各个位置，属于市中心核心内一环的绝版地段。具体包括： 银行：中国银行、中信银行、徽商银行、九江银行、中国建设银行、中国光大银行等； 餐饮：栢景湾会所、金满楼、最高台、会宾楼、香格里拉等； 商场：欢乐颂、乐购、华联、置地国际广场、苏果、红府等大型综合性连锁超市； 政府机关：庐阳区政府、省财政厅大楼、省地方税务局、市地方税务局、市地方税务局庐阳分局、省民政厅、市工商行政管理局等； 学区：栢景湾小学、四十七中；此外，周边有栢景湾幼儿园、寿春中学、合肥市图书馆等，人文教育资源丰富； 医院：合肥市第一人民医院、武警医院等。 ', '交通便捷，出入方便，有多路公交车直达本案——12、14、21、22、35、106、125、131、138、232、513、705路（其中138、106、125直达本案西大门） ', 534, 86, '2018', '201807');
