INSERT INTO `house` VALUES (17416, 0, 0, '2021-05-26 15:51:13', 0, '2021-05-26 16:27:04', 201806014, '叶语溪花园', '1#楼,2#楼,3#楼,4#楼', ' 23647.67  ', 225, 22695, '北一环以南，肥西路以西', '庐阳区', '住宅', '高层', '安徽水利（合肥）和顺地产有限公司', '华东建筑设计研究院有限公司', '安徽水利和盛物业管理有限公司合肥分公司', '大型综合休闲购物中心：欢乐颂购物中心、祥源广场、财富广场、铜锣湾广场、金鼎国际广场、国购广场、香港广场、市府广场、国光万豪广场等；医院：武警总医院、105医院、安徽省中医院、合肥金谷医院；银行：中行、建行、工行、交通、邮政、光大、民生；教育机构：金贝贝幼儿园、七彩阳光康居幼儿园。合肥市四河小学、亳州路小学、合肥市奥林小学、合肥市琥珀小学（西区）翠竹园小学、濉溪路小学、合肥市柏景湾小学、庐阳高级中学、合肥市第二十六中、四十七中、四十九中、合肥市琥珀中学、合肥寿春中学、农大附中附小。', '12、13、17、21、22、35、48、53、59、106、110、113、114、127、232、512、705、801贯通合肥市区南北西东，机场巴士2号线直通机场，另外轻轨3号线也已开始建设（预计2019年10月开通）', 4822, 88, '2018', '201806');
INSERT INTO `house` VALUES (17417, 0, 0, '2021-05-26 15:51:13', 0, '2021-05-26 16:27:05', 201806016, '文一塘溪津门', '27', ' 3726.90  ', 20, 25303, '滨湖新区包河大道与杭州路交口', '滨湖区', '住宅', '高层、洋房', '安徽省文一投资控股集团滨江置业有限公司', '北京高能筑博建筑设计有限公司', '安徽省文一物业管理有限公司', '环境：项目紧邻方兴湖和巢湖两大水系，同时为塘西河公园、金斗公园、方兴湖公园和岸上草原所环抱，公园面积高达万亩。商业：项目自持近10万方的文化商业街，打造合肥城市会客厅。此外，南接万达文旅城和恒大中心，东邻银泰中心和中心书城，北连悦方IDmall和世纪金源，众多商业中心伺散。学区：项目南面沿云谷路建有幼儿园和小学。同时一中、四十八中、四十六中和师范附小等名校坐落周边，教育资源得天独厚。医疗：滨湖医院距离项目仅4公里。省立医院总部正在规划筹建，位于项目北侧，相距不过5分钟车程。旅游：万达文化旅游城、牛角大圩生态旅游区、滨湖湿地公园、巢湖岸边的岸上草原、滨湖十大省级文化场馆，加上会申报国家AAAA级景区的塘溪津门水街将，形成一片完整的环巢湖旅游带。', '项目交通状况用“一环二铁三纵四横”来概括。“一环”，即环巢湖大道，被誉为“合肥最美道路”之一。沿线向东可达巢湖城区，向西达国家AAAAA级风景区——三河古镇。“二铁”，指高铁南站和三条地铁线。高铁南站距项目约10公里，借此可达省外；其次项目紧邻三条地铁，1号线已开通营运，由滨湖新区直达合肥火车站，是合肥南北向交通的主动脉，距项目最近的云谷路站约为1.1公里；5号线已经开建，其东史岗路站与华山路站与项目无缝对接。S1号线，途经新桥机场、新高铁西站、高铁南站最终抵达巢湖岸边，将于项目东南角设站。“三纵”指三条南北向主干道——徽州大道、庐州大道和包河大道，连接滨湖新区与老城核心。“四横 ”为锦绣大道、紫云路、方兴大道和云谷路，贯穿滨湖新区和经开区。沿方兴大道向西驱车10分钟可上京台高速，30分钟可达机场高速入口，构成全方位、立体化的交通体系网，通达四周。', 5331, 88, '2018', '201806');
