INSERT INTO `house` VALUES (17419, 0, 0, '2021-05-26 15:51:14', 0, '2021-05-26 16:27:06', 201806013, '湖月公馆', '7#,10#,12#', ' 20335.54  ', 154, 18499, '开福路与天狮路交叉口', '蜀山区', '住宅', '高层、复式、跃层', '合肥翔泽房地产开发有限公司', '上海宝厦建筑设计有限公司', '禹洲物业服务有限公司', '周边配套也非常完善，周边有联家、苏果等大型生活超市；中海原山，悦山国际商业街尽在咫尺；另外项目物管用房负一楼也自带2000平菜市场，可满足业主日常生活需求；大型商场之心城距离项目15分钟车程，西边砂之船奥特莱斯、银泰商业中心等紧邻项目，一站式满足您吃喝玩乐购的需求。', '交通便利，周边公交线路与地铁线均可到达本项目，公交线路为56路、24路、650路、快速公交4号线； 临近地铁2号线蜀峰路站和振兴路站', 5325, 89, '2018', '201806');
