INSERT INTO `house` VALUES (17421, 0, 0, '2021-05-26 15:51:14', 0, '2021-05-26 16:27:07', 201806008, '碧桂公馆', '5#,9#,10#,3#,21#', ' 38214.61  ', 322, 22000, '合肥市嵩山路与南京路交口', '滨湖区', '住宅', '高层、洋房', '合肥碧祥房地产有限公司', '广东博意建筑设计院有限公司', '广东碧桂园物业服务股份有限公司合肥分公司', '五横五纵立体交通网络，紧邻包河大道、徽州大道等多条城市主干道，高铁、地铁连接城市风华。合肥实验学校、华山路小学等优质学校，全龄教育陪伴。合肥市滨湖医院、待建省立医院总部落址于旁。约百万方商业配套，涵盖3公里生活圈的吃喝玩乐购。', '包河大道高架、地铁1号线', 5180, 89, '2018', '201806');
INSERT INTO `house` VALUES (17422, 0, 0, '2021-05-26 15:51:14', 0, '2021-05-26 16:27:07', 201805087, '紫悦府', '2#,5#,6#,9#,10#,13#,15#,18#,19#,22#', ' 64118.00  ', 572, 15847, '大众路以西 浍水路以北', '新站区', '住宅', '高层洋房', '安徽华地融泰房地产有限公司', '安徽省建筑设计研究院有限责任公司', '安徽华地物业管理服务有限公司', '购物：拓基百大，瑶海万达，磨店美食一条街，黉街。 社区内配套：全龄综合活动场地，阳光草坪，幼儿园，彩色沥青跑道，健身设施。 肉菜市场：磨店农贸市场 学校：自建幼儿园，规划小学，规划中学（烈山路西）、磨店初级中学，庆平希望学校，合肥九中。 公园配套：学林公园：公园规划面积约为1633.95亩，公园将依托原有的地形结构来规划公园的景观设计，公园还将建设合肥首个天文爱好者的户外营地。 金融机构：中国建设银行，肥东农村商业银行，中国邮政储蓄银行 药店：远帆大药房，行天下大药房 医院：合肥广慈医院，安医大四附院（在建） ', '交通：301,303,304（安徽粮食学院站），40（刘大郢站）T3路（合肥经贸旅游学校站），T6（合肥工业学校站） 地铁：在建：地铁3号线职教城站：规划：地铁9号线（沿大众路）', 5320, 89, '2018', '201805');
INSERT INTO `house` VALUES (17423, 0, 0, '2021-05-26 15:51:14', 0, '2021-05-26 16:27:08', 201806006, '豪门金地', '29,31,33,36,19,27,28,30,32,35,25,26', ' 45901.73  ', 312, 24000, '西藏路与南宁路交口', '滨湖区', '住宅', '高层、洋房、其他住宅', '安徽省文一投资控股集团滨城置业有限公司', '北京高能筑博建筑设计有限公司', '安徽省文一物业管理有限公司', '项目与国际金融后台服务基地一路之隔，工农建中四大行及数家知名金融机构总部（中国人民银行、中国银行、工商银行、建设银行、农业银行、交通银行、邮储银行、徽商银行、浦发银行等）和综合基地及安徽省银行监督管理局落户合肥滨湖新区，与项目咫尺相邻。 繁华商圈：距离繁华世纪金源购物商圈仅10余分钟车程，高速时代广场、银泰城、亚洲最大的8万方中心书城、以及万达文旅城（世界首创第四代恒温水世界—万达水乐园、电影科技乐园，万达宝贝王等）均距离项目较近； 景观资源：滨湖的巢湖湿地公园，将打造 80 万平方米的“人造湿地”、“塘西河公园”、“金斗公园”和“方兴湖公园”等一系列生态项目，带来约 840 万平方米的新生绿化。项目旁边还占有“8万平米城市体育公园”、云川公园景观资源配套； 学区配套：项目周边学区密集，46中南校区、示范附小四小、世纪阳光中学四川路校区、示范附小三小贵阳路校区等', '项目交通状况：可以用”四纵四横一环二轨道“来概括。“四纵”，指的是徽州大道、庐州大道、包河大道和宿松路。宿松路连接方兴大道，直通市区百脑汇；经徽州大道的快速公交 5 分钟即可到达巢湖，10 分钟即可到达高铁南站，15 分钟即可到达合肥老城区。”四横“分别是锦绣大道、紫云路、方兴大道、云谷路。四条横向干道从北向南依次排布，将滨湖新区和经开区相连，西接金寨路高架，东接包河大道高架，构成立体交通网络，其中通过方兴大道和京台高速互通立交桥 30 分钟就可以到达新桥机场。”一环“指环巢湖景观大道，2014年环巢湖景观大道全线通车，全长约155公里，从巢湖东岸的巢湖市区湖光路起，至滨湖新区，可以自行驾车观光环巢湖生态风景，同时实现肥东和滨湖新区实现“无缝连接”。“二轨道”指的是，地铁1号线、5号线，地铁1号线于今年底投入使用，是南北方向的主干线，起点是天水路站和徽州大道站，离我们最近的地铁站口南宁路站距离项目不到1公里，今年年底就通车了，可直达新建的高铁南站和老火车站，后期出差旅行非常便捷。沿云谷路建设的地铁 5 号线，围绕着我们豪门金周边地建设的有三个站点，分别是四川路站、成都路站和云南路站，其中四川路站距离我们项目仅500米左右，后期您的出行也将变得十分方便。', 5295, 89, '2018', '201806');
INSERT INTO `house` VALUES (17424, 0, 0, '2021-05-26 15:51:14', 0, '2021-05-26 16:27:08', 201806001, '观澜花园', '5,7,9', ' 8660.94  ', 58, 20999, '龙川路与合作化路交叉口', '包河区', '一级', '高层、花园洋房', '安徽融和房地产开发有限公司', '安徽地平线设计有限公司', '福州融侨物业管理公司', ' 项目位于政务东，紧邻目前合肥市商圈最发达的政务区，承接了成熟的政务区优质资源，一脉龙川路无缝接驳万象城商圈，3公里即为银泰城，3.8公里即为天鹅湖万达，世界各大高端品牌汇聚于此，而且很多的知名品牌只进驻此区域，驱车10分钟左右即满足日常所有需求。以及新地中心、置地广场、百利中心、绿地中心等星级写字楼，另外合肥市许多知名地标建筑也坐落于此，比如安徽广电中心，奥体中心，安徽省博物馆、天鹅湖等，得以让居住于此的人们能享受便捷的生活服务。', '周边公交，项目西侧有54中公交车站，18路、126路、148路、149路、516路、701、901路可畅达全城，直达合肥各大商圈及交通要点。', 5317, 89, '2018', '201806');
INSERT INTO `house` VALUES (17425, 0, 0, '2021-05-26 15:51:14', 0, '2021-05-26 16:27:08', 201805082, '福禄园（一区）', '1,2,5,8,10,11', ' 49265.02  ', 520, 4813, '合经区轩辕路北、海恒街东', '经开区', '住宅', '高层', '合肥海恒投资控股集团公司', '中国中建设计集团有限公司', '合肥明珠物业管理有限公司', '', '', 5235, 89, '2018', '201805');
INSERT INTO `house` VALUES (17426, 0, 0, '2021-05-26 15:51:14', 0, '2021-05-26 16:27:09', 201806018, '罗兰香谷花园', 'A1,A2,A3,B1,B8', ' 40270.09  ', 380, 14799, '合肥市新站区淮海路与相城路交口西北处', '新站区', '住宅', '高层,洋房', '合肥和淮房地产有限责任公司', '中外建工程设计与顾问有限公司', '保利物业发展股份有限公司', '项目自建12班幼儿园，建成后移交政府；紧邻在建合肥九中新校区。项目西侧配备有12万方的商业配套，未来生活便利。西北方向3公里即为新站区重点打造的少荃湖湿地公园，西南方向2.5公里为学林公园，生态环境优越。', '项目南至淮海大道，零距离接驳地铁三号线首站相城路站，向西临近大众路，为合肥东城重要的主干道，未来将贯通新站、瑶海、包河和经开四大区域。', 5319, 89, '2018', '201806');
INSERT INTO `house` VALUES (17427, 0, 0, '2021-05-26 15:51:14', 0, '2021-05-26 16:27:10', 201805072, '湾景公馆', '5#,7#', ' 18927.62  ', 172, 16006, '合肥市新蚌埠路与扶疏路交口西南角', '新站区', '住宅、商业', '高层、复式', '安徽兴和昌置业发展有限公司', '杭州森拓建筑设计有限公司', '河南新和昌物业服务有限公司', '购物 ：淮河路步行街、长江路银泰百货20分钟车程、家天下生活广场。 农贸市场 ：凤台路农贸市场、星光菜市场、兴华菜市场。 学校：七里塘小学、兴华苑小学、合肥第三十中学。 医院：安徽省第二人民医院。 公园及其他景观：瑶海公园、生态公园。 商务金融 ：财富广场、招行大厦、祥源广场。 专业市场：瑶海家具市场 安徽大市场 安徽轻工商城。', '项目周边道路四通八达，多条城市主干道环伺周边，其中项目更是坐落在城市核心干道新蚌埠路上，新蚌埠路长达16公里，南北贯穿瑶海区与新站区，南端发起于北一环，北至合肥绕城高速入口，是新站区的主要景观轴线，沿途京东方、合肥综合保税区、家海工业园等著名高新企业，是新站区南北向连通的重要交通通道。同时项目周边双七路（北二环）、物流大道、临泉路更是近在咫尺，形成了通达性非常好的交通网，无论是到市府广场、还是合肥火车站、淮河路步行街、长江路银泰百货核心商圈开车都大约20多分钟。', 5283, 89, '2018', '201805');
