INSERT INTO `house` VALUES (17429, 0, 0, '2021-05-26 15:51:15', 0, '2021-05-26 16:27:10', 201805051, '城市公馆', 'A-19,A-20,A-21,A-22,A-23', ' 9972.44  ', 27, 27327, '合肥市庐阳区一环路与四里河路交口', '庐阳区', '高层、洋房、别墅、商办', '钢筋混凝土', '合肥万科金湾地产有限公司', '上海日清设计院', '上海万科物业服务有限公司合肥分公司', '项目位于市中心一环边，大润发、北一环欢乐颂、乐购和三里庵国购广场、之心城近在咫尺。学区是小区自建幼儿园、南门小学森林城校区、四十五中森林城校区。小区商业部分与规划3号线（四里河站）相连，交通极其方便。', '53路、13路、12路、59路、124路、131路、143路、233路、22路、17路、59路、232路、705路东线、705路西线公交车；地铁规划建设3号线（四里河站）。', 5297, 90, '2018', '201805');
INSERT INTO `house` VALUES (17430, 0, 0, '2021-05-26 15:51:15', 0, '2021-05-26 16:27:11', 201805049, '金樾花园', '4,7', ' 6237.54  ', 55, 21999, '庐阳区五河路', '庐阳区', '洋房、高层', '新建', '合肥金科骏成房地产开发有限公司', '安徽寰宇建筑设计院', '金科物业服务有限公司', '生活配套完善，双岗商圈、市府商圈、三里庵商圈、三孝口商圈、万达商圈，五大商圈汇聚于此；繁华尽揽。', '位于庐阳区五河路与阜阳路交口西', 5241, 90, '2018', '201805');
INSERT INTO `house` VALUES (17431, 0, 0, '2021-05-26 15:51:15', 0, '2021-05-26 16:27:12', 201805042, '大成西苑', '3,5,15', ' 24665.12  ', 195, 21700, '合肥市包河区淝河路与东二环交口', '包河区', '住宅', '高层', '金隅京华房地产开发合肥有限公司', '安徽地平线建筑设计有限公司', '绿城物业服务集团有限公司', '项目外围规划的水肆和云街社区商业；往北10分钟车程即可到达包河万达商圈；往南8分钟即可到达滨湖商圈', '公交线路：152路、122路、9路、T17等等；规划项目门口地铁4号线与6号线在伊宁路站无缝换乘', 5242, 90, '2018', '201805');
