INSERT INTO `house` VALUES (17473, 0, 0, '2021-05-26 15:51:17', 0, '2021-05-26 16:27:39', 201805007, '天宸花园', '14,19,20', ' 13091.47  ', 88, 21699, '北京路与黄河路交口', '包河区', '住宅', '高层、洋房', '合肥金科天宸房地产开发有限公司', '寰宇建筑设计院', '金科物业服务集团有限公司', '项目周边商业配套丰富，茶里水街商业与项目仅一路之隔，5公里范围内尽享悦方IDmall、世纪金源等大型商业配套；高端医疗资源汇聚。', '项目位于包河经济开发区北京路和黄河路的交口。北承老城，衔接高铁，包河区政府，南融滨湖省府板块。地铁5号线、北京路、上海路以及包河大道高架等组成立体环绕交通体系。', 5201, 94, '2018', '201805');
INSERT INTO `house` VALUES (17474, 0, 0, '2021-05-26 15:51:17', 0, '2021-05-26 16:27:39', 201805006, '碧桂公馆', '7#', ' 4781.22  ', 28, 24007, '合肥市嵩山路与南京路交口', '滨湖区', '住宅', '高层、洋房', '合肥碧祥房地产有限公司', '广东博意建筑设计院有限公司', '广东碧桂园物业服务股份有限公司合肥分公司', '五横五纵立体交通网络，紧邻包河大道、徽州大道等多条城市主干道，高铁、地铁连接城市风华。合肥实验学校、华山路小学等优质学校，全龄教育陪伴。合肥市滨湖医院、待建省立医院总部落址于旁。约百万方商业配套，涵盖3公里生活圈的吃喝玩乐购。', '包河大道高架、地铁1号线', 4979, 94, '2018', '201805');
INSERT INTO `house` VALUES (17475, 0, 0, '2021-05-26 15:51:17', 0, '2021-05-26 16:27:40', 201804044, '豪门金地', '39', ' 16366.18  ', 114, 21999, '西藏路与南宁路交口', '滨湖区', '住宅', '高层、洋房、其他住宅', '安徽省文一投资控股集团滨城置业有限公司', '北京高能筑博建筑设计有限公司', '安徽省文一物业管理有限公司', '项目与国际金融后台服务基地一路之隔，工农建中四大行及数家知名金融机构总部（中国人民银行、中国银行、工商银行、建设银行、农业银行、交通银行、邮储银行、徽商银行、浦发银行等）和综合基地及安徽省银行监督管理局落户合肥滨湖新区，与项目咫尺相邻。 繁华商圈：距离繁华世纪金源购物商圈仅10余分钟车程，高速时代广场、银泰城、亚洲最大的8万方中心书城、以及万达文旅城（世界首创第四代恒温水世界—万达水乐园、电影科技乐园，万达宝贝王等）均距离项目较近； 景观资源：滨湖的巢湖湿地公园，将打造 80 万平方米的“人造湿地”、“塘西河公园”、“金斗公园”和“方兴湖公园”等一系列生态项目，带来约 840 万平方米的新生绿化。项目旁边还占有“8万平米城市体育公园”、云川公园景观资源配套； 学区配套：项目周边学区密集，46中南校区、示范附小四小、世纪阳光中学四川路校区、示范附小三小贵阳路校区等', '项目交通状况：可以用”四纵四横一环二轨道“来概括。“四纵”，指的是徽州大道、庐州大道、包河大道和宿松路。宿松路连接方兴大道，直通市区百脑汇；经徽州大道的快速公交 5 分钟即可到达巢湖，10 分钟即可到达高铁南站，15 分钟即可到达合肥老城区。”四横“分别是锦绣大道、紫云路、方兴大道、云谷路。四条横向干道从北向南依次排布，将滨湖新区和经开区相连，西接金寨路高架，东接包河大道高架，构成立体交通网络，其中通过方兴大道和京台高速互通立交桥 30 分钟就可以到达新桥机场。”一环“指环巢湖景观大道，2014年环巢湖景观大道全线通车，全长约155公里，从巢湖东岸的巢湖市区湖光路起，至滨湖新区，可以自行驾车观光环巢湖生态风景，同时实现肥东和滨湖新区实现“无缝连接”。“二轨道”指的是，地铁1号线、5号线，地铁1号线于今年底投入使用，是南北方向的主干线，起点是天水路站和徽州大道站，离我们最近的地铁站口南宁路站距离项目不到1公里，今年年底就通车了，可直达新建的高铁南站和老火车站，后期出差旅行非常便捷。沿云谷路建设的地铁 5 号线，围绕着我们豪门金周边地建设的有三个站点，分别是四川路站、成都路站和云南路站，其中四川路站距离我们项目仅500米左右，后期您的出行也将变得十分方便。', 5191, 94, '2018', '201804');
