INSERT INTO `house` VALUES (17517, 0, 0, '2021-05-26 15:51:19', 0, '2021-05-26 16:28:01', 201802008, '都会花园', '11,19,20,37', ' 25909.29  ', 222, 16999, '滨湖新区嘉陵江以南、贵州路以东', '滨湖区', '住宅、商业', '高层、小高层、洋房', '合肥永拓置业发展有限公司', '安徽寰宇建筑设计院', '南京万科物业管理有限公司', '学区配套：师范附小三小贵阳路校区、阳光中学四川路校区及滨湖国际双语学校（规划中）； 商业配套：云谷商业MALL（约40万方）、万达茂（约15万方）、银泰商业（约12万方、在建中）、恒大商业MALL（约40万方）、奥特莱斯（在建中）、部分自带沿街商业等', '\"公交：42路、61路、63路、T15路、531路； 地铁：轨道交通1号线（九联圩站）、5号线（云南路站）； 云谷路、西藏路、四川路、徽州大道、\" ', 5062, 98, '2018', '201802');
INSERT INTO `house` VALUES (17518, 0, 0, '2021-05-26 15:51:19', 0, '2021-05-26 16:28:02', 201802011, '森林城D3地块', '1,2', ' 33968.92  ', 256, 18819, '青松路与固镇路交口东北角', '庐阳区', '住宅、商业 ', '高层、社区商业', '合肥万科瑞翔地产有限公司 ', '上海天华建筑设计有限公司', '上海万科物业服务有限公司合肥分公司', '生活配套齐全，除社区自带的森·生活汇、万科广场集中商业外，另有明发商业广场、永辉商超、汇银广场等商业环绕', '项目拥有立体化交通脉络，“四纵四横1地铁”，出门即城市主干道，多条公交路线通行，城市轨道交通3号线四里河路站（建设中）在项目周边', 5059, 98, '2018', '201802');
INSERT INTO `house` VALUES (17519, 0, 0, '2021-05-26 15:51:19', 0, '2021-05-26 16:28:02', 201802002, '昊天园', '35#楼', ' 9757.79  ', 106, 10078, '合肥市新站区砀山路北星火路西', '新站区', '住宅、商业、办公', '高层', '合肥隆昊房地产投资有限公司', '安徽寰宇建筑设计院', '合肥东宇物业管理有限公司', '砀山路12车道景观大街纵横东西、张洼路立交桥畅通南北，畅通后可直达市中心。此外建设中的轻轨1号线，北城段停靠张洼路，距昊天园仅300余米。从昊天园东行5分钟，即可达胜利路商圈，南行5分钟，即可达双岗商业圈，各类生活配套设施一应俱全。', '小区位于砀山路与星火路交口，乘坐157.139.147等公交车可到达。', 5056, 99, '2018', '201802');
