INSERT INTO `house` VALUES (17522, 0, 0, '2021-05-26 15:51:19', 0, '2021-05-26 16:28:04', 201801051, '悦湖山院', '18', ' 13099.28  ', 76, 14500, '高新区石莲南路与云飞路交口东北角', '高新区', '住宅', '高层 洋房', '合肥乐富强房地产开发有限公司', '安徽新时代建筑设计有限公司', '安徽乐富强物业管理有限公司', '1.教育： A、幼儿园：项目自建幼儿园 B、小学：高新创新实验小学（紧邻项目规划的小学） 2.医疗机构： 安医附院高新分院、南岗镇卫生院 3.购物、餐饮、娱乐：砂之船奥特莱斯艺术商业广场、乐客来商业广场、大铺头商圈 4.银行：中国银行、工商银行、徽商银行、招商银行（周边动漫基地附近） 5.社区自身配套 ①幼儿园 ②商业配套：社区管理用房、物业服务用房、文体活动室、老年活动站 ③养老公馆', '651 656 665 合肥市客运西站', 5029, 99, '2018', '201801');
INSERT INTO `house` VALUES (17523, 0, 0, '2021-05-26 15:51:19', 0, '2021-05-26 16:28:05', 201801009, '碧桂公馆', '2#,22#,8#', ' 20202.89  ', 170, 21999, '合肥市嵩山路与南京路交口', '滨湖区', '住宅', '高层、洋房', '合肥碧祥房地产有限公司', '广东博意建筑设计院有限公司', '广东碧桂园物业服务股份有限公司合肥分公司', '五横五纵立体交通网络，紧邻包河大道、徽州大道等多条城市主干道，高铁、地铁连接城市风华。合肥实验学校、华山路小学等优质学校，全龄教育陪伴。合肥市滨湖医院、待建省立医院总部落址于旁。约百万方商业配套，涵盖3公里生活圈的吃喝玩乐购。', '包河大道高架、地铁1号线', 4988, 99, '2018', '201801');
INSERT INTO `house` VALUES (17524, 0, 0, '2021-05-26 15:51:19', 0, '2021-05-26 16:28:06', 201801043, '豪门金地', '57', ' 21705.66  ', 120, 17400, '西藏路与南宁路交口', '滨湖区', '住宅', '高层、洋房、其他住宅', '安徽省文一投资控股集团滨城置业有限公司', '北京高能筑博建筑设计有限公司', '安徽省文一物业管理有限公司', '项目与国际金融后台服务基地一路之隔，工农建中四大行及数家知名金融机构总部（中国人民银行、中国银行、工商银行、建设银行、农业银行、交通银行、邮储银行、徽商银行、浦发银行等）和综合基地及安徽省银行监督管理局落户合肥滨湖新区，与项目咫尺相邻。 繁华商圈：距离繁华世纪金源购物商圈仅10余分钟车程，高速时代广场、银泰城、亚洲最大的8万方中心书城、以及万达文旅城（世界首创第四代恒温水世界—万达水乐园、电影科技乐园，万达宝贝王等）均距离项目较近； 景观资源：滨湖的巢湖湿地公园，将打造 80 万平方米的“人造湿地”、“塘西河公园”、“金斗公园”和“方兴湖公园”等一系列生态项目，带来约 840 万平方米的新生绿化。项目旁边还占有“8万平米城市体育公园”、云川公园景观资源配套； 学区配套：项目周边学区密集，46中南校区、示范附小四小、世纪阳光中学四川路校区、示范附小三小贵阳路校区等', '项目交通状况：可以用”四纵四横一环二轨道“来概括。“四纵”，指的是徽州大道、庐州大道、包河大道和宿松路。宿松路连接方兴大道，直通市区百脑汇；经徽州大道的快速公交 5 分钟即可到达巢湖，10 分钟即可到达高铁南站，15 分钟即可到达合肥老城区。”四横“分别是锦绣大道、紫云路、方兴大道、云谷路。四条横向干道从北向南依次排布，将滨湖新区和经开区相连，西接金寨路高架，东接包河大道高架，构成立体交通网络，其中通过方兴大道和京台高速互通立交桥 30 分钟就可以到达新桥机场。”一环“指环巢湖景观大道，2014年环巢湖景观大道全线通车，全长约155公里，从巢湖东岸的巢湖市区湖光路起，至滨湖新区，可以自行驾车观光环巢湖生态风景，同时实现肥东和滨湖新区实现“无缝连接”。“二轨道”指的是，地铁1号线、5号线，地铁1号线于今年底投入使用，是南北方向的主干线，起点是天水路站和徽州大道站，离我们最近的地铁站口南宁路站距离项目不到1公里，今年年底就通车了，可直达新建的高铁南站和老火车站，后期出差旅行非常便捷。沿云谷路建设的地铁 5 号线，围绕着我们豪门金周边地建设的有三个站点，分别是四川路站、成都路站和云南路站，其中四川路站距离我们项目仅500米左右，后期您的出行也将变得十分方便。', 5038, 99, '2018', '201801');
