INSERT INTO `house` VALUES (17535, 0, 0, '2021-05-26 15:51:20', 0, '2021-05-26 16:28:10', 201801012, '天珑广场', '11#', ' 13287.17  ', 116, 18500, '政务区潜山路与万佛湖路交叉口', '政务区', '商业、住宅', '商业、住宅、办公', '安徽骏誉投资置业有限公司', '广州市天作建筑规划设计有限公司', '安兴华安', '50中南区、合肥市嘉和苑小学、嘉和苑小森林艺术幼儿园、新地中心、华润万象城、银泰城、万达广场、合肥政务区文化新区邮政所、工商银行、民生银行、邮政银行、建设银行、徽商银行、农业银行、招商银行、中信银行、安徽省立医院南区、安徽省心脑血管医院、安医大二附院、合肥市口腔医院、天鹅湖、省文博园、省广电中心、合肥大剧院', '公交18路、129路、502路、516路等到翠澜站、香径站；地铁：地铁3号线、地铁4号线；高速公路：芜合高速、京台高速、绕城高速、蚌合高速、合徐高速、沪蓉高速等', 3087, 100, '2018', '201801');
INSERT INTO `house` VALUES (17536, 0, 0, '2021-05-26 15:51:20', 0, '2021-05-26 16:28:11', 201801014, '万橡府', '56,57,58,59,60,61,62,63,70', ' 69615.46  ', 596, 14700, '合肥市新站高新区', '新站区', '高层，小高层，洋房', '框架', '合肥润祥房地产开发有限公司', 'DC国际、美国摩高', '华润置地（武汉）物业管理有限公司合肥分公司', '拓基广场、合家福超市、黉街、磨店菜市场、教育配套：项目自建幼儿园、庆平学校、168中学东校区、寿春中学、马克汉姆国际学校等。医疗配套：京东方数字化全科医院、安医四附院', '公交线路：681、301、302、303等，地铁3号线大众路站，长江西路高架', 5027, 100, '2018', '201801');
INSERT INTO `house` VALUES (17537, 0, 0, '2021-05-26 15:51:20', 0, '2021-05-26 16:28:12', 201801013, '西子花园', '2#,3#,17#', ' 33146.54  ', 312, 13199, '合肥市高新区望江西路与鸡鸣山路交口', '高新区', '住宅', '高层住宅', '合肥盛卓房地产开发有限公司', '上海天华建筑设计有限公司', '西藏新城悦物业服务股份有限公司', '1.景观资源： 本项目周边拥有一山两湖城市顶级自然资源。距离合肥近郊唯一的一座大山——大蜀山仅7公里。项目距离蜀西湖仅3公里，同时项目距离北雁湖6公里。 2.商业配套： 项目东侧3公里即为蜀西湖商圈，分布奥特莱斯和银泰城(规划中，已签约)两座大型商业中心及汇景城市广场（建设中）大型购物中心。此外项目南侧建设邻里中心，项目自建2000平菜市场。 3.医疗配套： 项目东北直线距离5公里就是40余万方安医附院高新分院，即将试运营。“三级甲等”妇幼保健专科医院安徽省国际妇女儿童医学中心位于长江西路与石镜路交口西北角，已正式开工建设。合肥离子医学中心质子治疗项目位于长宁大道与习友路交口东北角，已正式开工建设。 4.教育配套： 项目西南角自建12班幼儿园，项目北侧规划有36班小学和48班中学。另外项目沿望江西路向东1.5公里就是合肥七中新校区，向东4.5公里就是规划3000亩中科大高新校区，同时项目东南5公里就是中加国际学校。项目拥有诸多的教育资源，是为数不多的全龄教育社区。', '项目位于望江西路与鸡鸣山路（规划中）交口，周边形成了“三横三纵两轨道”的便利交通网，四通八达,出行异常便捷。 “三横”：项目北侧2公里的长江西路是连接合肥东西部的主干道。项目南邻望江西路，沿望江西路向东可到政务区和蜀山区。项目南侧1公里就是习友路，向东可直达天鹅湖商圈。 “三纵”：项目东侧1.5公里就是城市主干道方兴大道，向北连接新桥国际机场；向南连接经开区，直通滨湖区；创新大道是合肥西南片区交通主动脉，连接高新区和经开区。 “两轨道”在建地铁4号线始发站口鸡鸣山路站距离本项目不到100米。串联高新区、政务文化中心、合肥南站中心三大中心，同时与10条轨道线路均设置换乘站点，预计2020年底通车。地铁二号线位于长江西路，贯穿合肥东西，目前已经进入试运营阶段。', 5021, 100, '2018', '201801');
INSERT INTO `house` VALUES (17538, 0, 0, '2021-05-26 15:51:20', 0, '2021-05-26 16:28:12', 201801004, '金色湖畔小区', '1,2', ' 22518.88  ', 216, 15900, '蜀山区科学院路与樊洼路交口', '蜀山区', '住宅', '高层', '合肥凯泰置业有限公司', '合肥工业大学建筑设计研究院', '安徽恒德物业管理有限责任公司', '项目周边有蜀山园幼儿园，蜀山小学，蜀山中学，合肥剑桥学校等教育配套。生活配套有永达家具城，合肥市第一人民医院，大浦头农贸市场，银行。南边靠近大蜀山，北面正对董铺水库，西边有四季花海城市公园，植物园，国家森林公园等。环境舒适，生活便利。周边小区有山湖新村，蜀秀苑。', '交通十分便捷，出行方便，周边有西二环路、长江西路、玉兰大道等主干道，3路，20路，903路，605,156,56等公交车。', 4922, 100, '2018', '201801');
INSERT INTO `house` VALUES (17539, 0, 0, '2021-05-26 15:51:20', 0, '2021-05-26 16:28:13', 201801011, '森林城A5地块', '6,7', ' 18500.80  ', 208, 18819, '固镇路与青松路交口', '庐阳区', '住宅', '高层', '合肥万科瑞翔地产有限公司', '上海天华建筑设计有限公司', '上海万科物业服务有限公司合肥分公司', '生活配套齐全，除社区自带的森·生活汇、万科广场集中商业外，另有明发商业广场、永辉商超、汇银广场等商业环绕；教育资源：宿州路幼儿园（森林城园区）、南门小学（森林公校区）、四十五中（森林城校区）；周边环境，环抱庐州公园依董铺水库而居，尽享城市公园生活。 ', ' 项目拥有立体化交通脉络，“四纵四横1地铁”，出门即城市主干道，13路、17路、233路、143路、131路等多条公交路线通行，城市轨道交通3号线四里河路站（建设中）在项目周边 ', 5005, 101, '2018', '201801');
INSERT INTO `house` VALUES (17540, 0, 0, '2021-05-26 15:51:20', 0, '2021-05-26 16:28:14', 201712060, '雍龙府', 'C3#,C5#,C6#,C7#,C10#', ' 49623.31  ', 396, 23821, '包河区龙川路与塔川路交口', '包河区', '住宅', '高层、洋房、其他住宅', '建发房地产集团合肥有限公司', '安徽地平线建筑设计有限公司', '怡家园（厦门）物业管理有限公司合肥分公司', '项目毗邻政务区，万象城、新地中心、银泰城、天鹅湖万达、大摩广场、麦德龙等大型综合体咫尺可达，奥体中心、大剧院、天鹅湖等文娱配套触手可及。项目北侧规划十五里河公园及邻里中心，环境优美，生活便捷。', '南北走向禀赋金寨路、宿松路、徽州大道3条城市主干道，东西走向拥有龙川路、祁门路、南二环、绕城高速等主干道，方便到达市区各个地方和新桥机场。同时，项目东面有汽车南站和高铁南站，快速通道省内外众多城市。此外，项目北面祁门路规划有地铁4号线，享便捷出行。', 4991, 101, '2017', '201712');
INSERT INTO `house` VALUES (17541, 0, 0, '2021-05-26 15:51:20', 0, '2021-05-26 16:28:14', 201712059, '文一塘溪津门', '25,28', ' 8311.18  ', 58, 24008, '滨湖新区包河大道与杭州路交口', '滨湖区', '住宅', '高层、洋房', '安徽省文一投资控股集团滨江置业有限公司', '北京高能筑博建筑设计有限公司', '安徽省文一物业管理有限公司', '环境：项目紧邻方兴湖和巢湖两大水系，同时为塘西河公园、金斗公园、方兴湖公园和岸上草原所环抱，公园面积高达万亩。商业：项目自持近10万方的文化商业街，打造合肥城市会客厅。此外，南接万达文旅城和恒大中心，东邻银泰中心和中心书城，北连悦方IDmall和世纪金源，众多商业中心伺散。学区：项目南面沿云谷路建有幼儿园和小学。同时一中、四十八中、四十六中和师范附小等名校坐落周边，教育资源得天独厚。医疗：滨湖医院距离项目仅4公里。省立医院总部正在规划筹建，位于项目北侧，相距不过5分钟车程。旅游：万达文化旅游城、牛角大圩生态旅游区、滨湖湿地公园、巢湖岸边的岸上草原、滨湖十大省级文化场馆，加上会申报国家AAAA级景区的塘溪津门水街将，形成一片完整的环巢湖旅游带。', '项目交通状况用“一环二铁三纵四横”来概括。“一环”，即环巢湖大道，被誉为“合肥最美道路”之一。沿线向东可达巢湖城区，向西达国家AAAAA级风景区——三河古镇。“二铁”，指高铁南站和三条地铁线。高铁南站距项目约10公里，借此可达省外；其次项目紧邻三条地铁，1号线已开通营运，由滨湖新区直达合肥火车站，是合肥南北向交通的主动脉，距项目最近的云谷路站约为1.1公里；5号线已经开建，其东史岗路站与华山路站与项目无缝对接。S1号线，途经新桥机场、新高铁西站、高铁南站最终抵达巢湖岸边，将于项目东南角设站。“三纵”指三条南北向主干道——徽州大道、庐州大道和包河大道，连接滨湖新区与老城核心。“四横 ”为锦绣大道、紫云路、方兴大道和云谷路，贯穿滨湖新区和经开区。沿方兴大道向西驱车10分钟可上京台高速，30分钟可达机场高速入口，构成全方位、立体化的交通体系网，通达四周。', 5004, 101, '2017', '201712');
INSERT INTO `house` VALUES (17542, 0, 0, '2021-05-26 15:51:20', 0, '2021-05-26 16:28:15', 201712056, '紫悦府', '8#,12#,21#,17#', ' 19957.70  ', 178, 14798, '大众路以西 浍水路以北', '新站区', '住宅', '高层洋房', '安徽华地融泰房地产有限公司', '安徽省建筑设计研究院有限责任公司', '安徽华地物业管理服务有限公司', '购物：拓基百大，瑶海万达，磨店美食一条街，黉街。 社区内配套：全龄综合活动场地，阳光草坪，幼儿园，彩色沥青跑道，健身设施。 肉菜市场：磨店农贸市场 学校：自建幼儿园，规划小学，规划中学（烈山路西）、磨店初级中学，庆平希望学校，合肥九中。 公园配套：学林公园：公园规划面积约为1633.95亩，公园将依托原有的地形结构来规划公园的景观设计，公园还将建设合肥首个天文爱好者的户外营地。 金融机构：中国建设银行，肥东农村商业银行，中国邮政储蓄银行 药店：远帆大药房，行天下大药房 医院：合肥广慈医院，安医大四附院（在建） ', '交通：301,303,304（安徽粮食学院站），40（刘大郢站）T3路（合肥经贸旅游学校站），T6（合肥工业学校站） 地铁：在建：地铁3号线职教城站：规划：地铁9号线（沿大众路）', 4796, 101, '2017', '201712');
INSERT INTO `house` VALUES (17543, 0, 0, '2021-05-26 15:51:20', 0, '2021-05-26 16:28:16', 201712055, '御晖花园', 'G10#,G15#,G16#', ' 28847.21  ', 177, 22220, '汤泉路与宏村路交口', '包河区', '住宅', '高层住宅', '绿地集团合肥鑫峰置业有限公司', '安徽地平线建筑设计有限公司', '长城物业集团股份有限公司', '金融：合肥科技农村商业银行(望江路支行)、徽商银行(合肥南七支行)、兴业银行、徽商银行(合肥合作化路支行)、中国农业发展银行(金寨路支行) 医院：合肥市第三人民医院、合肥市第三人民医院南区、江淮汽车集团医院、安徽建筑大学北校区校医院、仁爱医院儿科、中国科学技术大学医院，老人、孩子体检更便捷。 学校：小森林琥珀幼儿园、竹苑小区幼儿园、合肥市包河区琥珀新天地幼儿园、东流路小学、合肥市第六十一中学(南区)、合肥市第六十一中学、小森林紫竹苑幼儿园 休闲：绿芒果KTV、合肥一页量贩KTV、维果自助式KTV(南七店)、伊人宫国际会所、豪情会所(望江东路)、今晚10点俱乐部、大众健身练歌厅、欢乐坊量贩式KTV(望江东路)、合肥一页量贩KTV、8分贝量贩式KTV 卖场：与80万方商业综合体绿地中心一路之隔，世界级都会资源配套。缤纷荟，最前沿时尚的shopping mall；春台街，最具特色的徽派文化街区；半生缘，中国城市小文艺街区典范。 公园广场：市政公园比邻而居，绿地·御徽在寸土寸金中心稀贵之地，独辟万方中央公园，梧桐大道、百转回庭、林荫十区，身心栖息地。', '公交路线：135、16、152路到张小郢下 距离高铁南站2.3km,金寨路高架、马鞍山路高架近在咫尺。城市三环方兴大道的开通，南二环迎来极致风景线。', 4957, 101, '2017', '201712');
INSERT INTO `house` VALUES (17544, 0, 0, '2021-05-26 15:51:20', 0, '2021-05-26 16:28:16', 201712054, '文泰院', '18#', ' 4323.19  ', 22, 21667, '庐阳区合淮路与四里河路交汇处以西', '庐阳区', '住宅、商业', '高层、洋房、别墅', '安徽省文一投资控股集团庐阳置业有限公司', '华东建筑设计研究院有限公司', '福州泰禾物业管理有限公司', '项目位于董铺水库及大房郢水库两湖之间，在国家二级水源保护区范围中，南望大蜀山；合肥市南门小学、合肥市第四十五中学（森林城校区），第十九中学；安徽医科大学二附院省立医院西区，省级大型三级甲等综合性医院', '四里河路往南直接到合肥一环，董铺路往南就是整个合肥二环，合淮路往城市外延可到绕城高速，机场方向。', 4950, 101, '2017', '201712');
INSERT INTO `house` VALUES (17545, 0, 0, '2021-05-26 15:51:20', 0, '2021-05-26 16:28:16', 201712047, '天宸花园', '2,7,8,10', ' 17730.76  ', 110, 21699, '北京路与黄河路交口', '包河区', '住宅', '高层、洋房', '合肥金科天宸房地产开发有限公司', '寰宇建筑设计院', '金科物业服务集团有限公司', '项目周边商业配套丰富，茶里水街商业与项目仅一路之隔，5公里范围内尽享悦方IDmall、世纪金源等大型商业配套；高端医疗资源汇聚。', '项目位于包河经济开发区北京路和黄河路的交口。北承老城，衔接高铁，包河区政府，南融滨湖省府板块。地铁5号线、北京路、上海路以及包河大道高架等组成立体环绕交通体系。', 4924, 101, '2017', '201712');
INSERT INTO `house` VALUES (17546, 0, 0, '2021-05-26 15:51:20', 0, '2021-05-26 16:28:17', 201712046, '天宸花园', '1,3', ' 8364.51  ', 64, 20999, '北京路与黄河路交口', '包河区', '住宅', '高层、洋房', '合肥金科天宸房地产开发有限公司', '寰宇建筑设计院', '金科物业服务集团有限公司', '项目周边商业配套丰富，茶里水街商业与项目仅一路之隔，5公里范围内尽享悦方IDmall、世纪金源等大型商业配套；高端医疗资源汇聚。', '项目位于包河经济开发区北京路和黄河路的交口。北承老城，衔接高铁，包河区政府，南融滨湖省府板块。地铁5号线、北京路、上海路以及包河大道高架等组成立体环绕交通体系。', 4923, 101, '2017', '201712');
INSERT INTO `house` VALUES (17547, 0, 0, '2021-05-26 15:51:20', 0, '2021-05-26 16:28:17', 201712048, '时代观邸', '12,15,17,19', ' 10708.92  ', 56, 25556, '滨湖新区庐州大道以东、南京路以北', '滨湖区', '住宅', '高层、小高层、多层', '合肥万科瑞益地产地产有限公司', '安徽地平线建筑设计事务所有限公司', '上海万科物业服务有限公司 ', '\" 项目紧邻新省政府办公区，周边配套完善醇熟。 购物、休闲、娱乐：项目西边就是滨湖商业成熟的启动区，拥有约40万方的世纪金源购物中心和五星级酒店，商业氛围浓厚，满足购物、休闲、娱乐需求。 医疗：项目西边三级甲等滨湖医院，技术先进，设备齐全。 学校：项目西南方向合肥一中，是省重点中学，师资力量雄厚，教学质量一流。 景观环境：项目南边840万方塘西河公园、金斗公园，环境优美，是滨湖的天然氧吧。\" ', '\"地铁1号线： 项目地处地铁1号线沿线，并且在项目西北角设有滨湖会展中心站点，此站点是地铁1号线连接老城区与滨湖新区的第一站。 三纵四横交通网： 项目拥有四通八达的交通网络，纵向可通过南北向的徽州大道、庐州大道和包河大道快速到达老城区，横向通过东西向的锦绣大道、紫云路和方兴大道快速到达经开区。 纵向的庐州大道，后期将全线贯通，直接连接主城区，方兴大道更是一条双向十二车道，具有老城区无法比拟的道路畅通优势。\" ', 4989, 101, '2017', '201712');
