INSERT INTO `house` VALUES (17549, 0, 0, '2021-05-26 15:51:21', 0, '2021-05-26 16:28:18', 201712042, '都会花园', '12,17', ' 17867.50  ', 152, 16999, '滨湖新区嘉陵江以南、贵州路以东', '滨湖区', '住宅、商业', '高层、小高层、洋房', '合肥永拓置业发展有限公司', '安徽寰宇建筑设计院', '南京万科物业管理有限公司', '学区配套：师范附小三小贵阳路校区、阳光中学四川路校区及滨湖国际双语学校（规划中）； 商业配套：云谷商业MALL（约40万方）、万达茂（约15万方）、银泰商业（约12万方、在建中）、恒大商业MALL（约40万方）、奥特莱斯（在建中）、部分自带沿街商业等', '\"公交：42路、61路、63路、T15路、531路； 地铁：轨道交通1号线（九联圩站）、5号线（云南路站）； 云谷路、西藏路、四川路、徽州大道、\" ', 4948, 102, '2017', '201712');
INSERT INTO `house` VALUES (17550, 0, 0, '2021-05-26 15:51:21', 0, '2021-05-26 16:28:19', 201712034, '时光印象', 'A15,A16,A17,A22,B6,B7', ' 52775.85  ', 448, 16799, '滨湖新区贵阳路以南，贵州路以东', '滨湖区', '住宅、商业', '洋房、高层', '合肥新城创域房地产有限公司', '上海霍普建筑设计事务所股份有限公司', '西藏新城悦物业服务股份有限公司合肥分公司 ', '学校资源：本项目周边配套规划幼儿园、已建成师范附小三小贵阳路校区和阳光中学四川路校区，项目周边规划国际双语学校； 景观资源：本项目周边3公里内分布城市体育公园（规划）、云川公园、金斗公园、岸上草原； 商超：周边规划建设银泰城、奥特莱斯；万达茂； 医院：市滨湖医院、规划省立医院医疗保健中心； 银行：项目1公里内分布中国银行、交通银行、农业银行等22家银行和金融保险机构。 内部配套： 项目自身配套约5000平米商业，设置小区配套商业。 ', '本项目是多维立体化交通，项目周边交通体系“五纵五横一环”多维交通网通达全城，本项目通过贵阳路、四川路与徽州大道、庐州大道、云谷路紧密连接，交通通达性强，“双地铁”贯穿城市核心区域，1KM内通达地铁1号线、5号线的出站点，本项目有效连接与主城区各个区域，交通便捷度高', 4949, 102, '2017', '201712');
