INSERT INTO `house` VALUES (17570, 0, 0, '2021-05-26 15:51:22', 0, '2021-05-26 16:28:29', 201711052, '都会花园', '32,33,35,40,41', ' 15085.83  ', 98, 19799, '滨湖新区嘉陵江以南、贵州路以东', '滨湖区', '住宅、商业', '高层、小高层、洋房', '合肥永拓置业发展有限公司', '安徽寰宇建筑设计院', '南京万科物业管理有限公司', '学区配套：师范附小三小贵阳路校区、阳光中学四川路校区及滨湖国际双语学校（规划中）； 商业配套：云谷商业MALL（约40万方）、万达茂（约15万方）、银泰商业（约12万方、在建中）、恒大商业MALL（约40万方）、奥特莱斯（在建中）、部分自带沿街商业等', '\"公交：42路、61路、63路、T15路、531路； 地铁：轨道交通1号线（九联圩站）、5号线（云南路站）； 云谷路、西藏路、四川路、徽州大道、\" ', 4904, 104, '2017', '201711');
