INSERT INTO `house` VALUES (17572, 0, 0, '2021-05-26 15:51:22', 0, '2021-05-26 16:28:30', 201712009, '城市公馆', 'A-16,A-17', ' 4080.44  ', 11, 27327, '合肥市庐阳区一环路与四里河路交口', '庐阳区', '高层、洋房、别墅、商办', '钢筋混凝土', '合肥万科金湾地产有限公司', '上海日清设计院', '上海万科物业服务有限公司合肥分公司', '项目位于市中心一环边，大润发、北一环欢乐颂、乐购和三里庵国购广场、之心城近在咫尺。学区是小区自建幼儿园、南门小学森林城校区、四十五中森林城校区。小区商业部分与规划3号线（四里河站）相连，交通极其方便。', '53路、13路、12路、59路、124路、131路、143路、233路、22路、17路、59路、232路、705路东线、705路西线公交车；地铁规划建设3号线（四里河站）。', 4875, 104, '2017', '201712');
INSERT INTO `house` VALUES (17573, 0, 0, '2021-05-26 15:51:22', 0, '2021-05-26 16:28:30', 201712006, '时代观邸', '20,23', ' 4579.14  ', 24, 25556, '滨湖新区庐州大道以东、南京路以北', '滨湖区', '住宅', '高层、小高层、多层', '合肥万科瑞益地产地产有限公司', '安徽地平线建筑设计事务所有限公司', '上海万科物业服务有限公司 ', '\" 项目紧邻新省政府办公区，周边配套完善醇熟。 购物、休闲、娱乐：项目西边就是滨湖商业成熟的启动区，拥有约40万方的世纪金源购物中心和五星级酒店，商业氛围浓厚，满足购物、休闲、娱乐需求。 医疗：项目西边三级甲等滨湖医院，技术先进，设备齐全。 学校：项目西南方向合肥一中，是省重点中学，师资力量雄厚，教学质量一流。 景观环境：项目南边840万方塘西河公园、金斗公园，环境优美，是滨湖的天然氧吧。\" ', '\"地铁1号线： 项目地处地铁1号线沿线，并且在项目西北角设有滨湖会展中心站点，此站点是地铁1号线连接老城区与滨湖新区的第一站。 三纵四横交通网： 项目拥有四通八达的交通网络，纵向可通过南北向的徽州大道、庐州大道和包河大道快速到达老城区，横向通过东西向的锦绣大道、紫云路和方兴大道快速到达经开区。 纵向的庐州大道，后期将全线贯通，直接连接主城区，方兴大道更是一条双向十二车道，具有老城区无法比拟的道路畅通优势。\" ', 4860, 104, '2017', '201712');
INSERT INTO `house` VALUES (17574, 0, 0, '2021-05-26 15:51:22', 0, '2021-05-26 16:28:31', 201711051, '艺境花园', '2,8,17,20', ' 26960.54  ', 234, 14500, '张衡路以西、龙子湖路以北', '新站区', '住宅', '高层', '安徽皖赣置业有限责任公司', '安徽地平线建筑设计事务所股份有限公司', '南京万科物业管理有限公司', '高校林立，周边职业学校及教育资源丰富，本案与配套学校合肥市庆平小学步行五分钟，附近商业配套为磨站商业，近在咫尺。', '本案临近主干道文忠路与东方大道，城市公交线路完善，有681路、302路、304路等多辆公交经过。规划3、4号线地铁，离项目很近。', 4905, 104, '2017', '201711');
