INSERT INTO `house` VALUES (17612, 0, 0, '2021-05-26 15:51:25', 0, '2021-05-26 16:29:22', 201711011, '豪门金地', '21,22,23', ' 7920.66  ', 54, 24000, '西藏路与南宁路交口', '滨湖区', '住宅', '高层、洋房、其他住宅', '安徽省文一投资控股集团滨城置业有限公司', '北京高能筑博建筑设计有限公司', '安徽省文一物业管理有限公司', '项目与国际金融后台服务基地一路之隔，工农建中四大行及数家知名金融机构总部（中国人民银行、中国银行、工商银行、建设银行、农业银行、交通银行、邮储银行、徽商银行、浦发银行等）和综合基地及安徽省银行监督管理局落户合肥滨湖新区，与项目咫尺相邻。 繁华商圈：距离繁华世纪金源购物商圈仅10余分钟车程，高速时代广场、银泰城、亚洲最大的8万方中心书城、以及万达文旅城（世界首创第四代恒温水世界—万达水乐园、电影科技乐园，万达宝贝王等）均距离项目较近； 景观资源：滨湖的巢湖湿地公园，将打造 80 万平方米的“人造湿地”、“塘西河公园”、“金斗公园”和“方兴湖公园”等一系列生态项目，带来约 840 万平方米的新生绿化。项目旁边还占有“8万平米城市体育公园”、云川公园景观资源配套； 学区配套：项目周边学区密集，46中南校区、示范附小四小、世纪阳光中学四川路校区、示范附小三小贵阳路校区等', '项目交通状况：可以用”四纵四横一环二轨道“来概括。“四纵”，指的是徽州大道、庐州大道、包河大道和宿松路。宿松路连接方兴大道，直通市区百脑汇；经徽州大道的快速公交 5 分钟即可到达巢湖，10 分钟即可到达高铁南站，15 分钟即可到达合肥老城区。”四横“分别是锦绣大道、紫云路、方兴大道、云谷路。四条横向干道从北向南依次排布，将滨湖新区和经开区相连，西接金寨路高架，东接包河大道高架，构成立体交通网络，其中通过方兴大道和京台高速互通立交桥 30 分钟就可以到达新桥机场。”一环“指环巢湖景观大道，2014年环巢湖景观大道全线通车，全长约155公里，从巢湖东岸的巢湖市区湖光路起，至滨湖新区，可以自行驾车观光环巢湖生态风景，同时实现肥东和滨湖新区实现“无缝连接”。“二轨道”指的是，地铁1号线、5号线，地铁1号线于今年底投入使用，是南北方向的主干线，起点是天水路站和徽州大道站，离我们最近的地铁站口南宁路站距离项目不到1公里，今年年底就通车了，可直达新建的高铁南站和老火车站，后期出差旅行非常便捷。沿云谷路建设的地铁 5 号线，围绕着我们豪门金周边地建设的有三个站点，分别是四川路站、成都路站和云南路站，其中四川路站距离我们项目仅500米左右，后期您的出行也将变得十分方便。', 4785, 108, '2017', '201711');
INSERT INTO `house` VALUES (17613, 0, 0, '2021-05-26 15:51:25', 0, '2021-05-26 16:29:23', 201711010, '庐月湾', '6#,10#', ' 16065.80  ', 160, 20800, '规划二路以南、规划大房郢路以东', '庐阳区', '高层', '住宅', '合肥市弘韬房地产开发有限公司', '华东建筑设计研究院有限公司', '广州市宁骏物业管理有限公司', '医疗：项目南边有武警医院，长江路上一零五医院。 学校：项目东接第四十五中学橡树湾分校，社区内开发代建24班小学；周边有第四十二中学中铁国际城校区、庐阳中学、寿春中学、长江路第二小学、红星路小学等。 商业：项目东南角有在建的10万方华润万象汇、在运营的约4万方九余三特色商业街；北一环商务中心、新天地商圈、四里河商圈等构筑繁华生活版图。', '项目位于三横三纵一轨道的立体式交通网络之中：三横有北二环、临泉路、北一环；三纵有四里河路、蒙城北路、阜阳北路；一轨道指的是地铁3号线，距离本案最近的站点在临泉路与肥西路交口临泉西路站。', 4826, 108, '2017', '201711');
INSERT INTO `house` VALUES (17614, 0, 0, '2021-05-26 15:51:25', 0, '2021-05-26 16:29:23', 201711012, '融公馆', '6#,12#,8#', ' 20620.65  ', 107, 34887, '政务区齐云山路与花亭湖路交口东北角', '政务区', '住宅、商业、办公', '高层、洋房', '合肥融创新领置业有限公司', '浙江绿城建筑设计有限公司', '融创物业服务集团有限公司', '政务区商圈、经济开发区商业圈', '41、66、129、162、166路华邦世贸城', 4791, 108, '2017', '201711');
INSERT INTO `house` VALUES (17615, 0, 0, '2021-05-26 15:51:25', 0, '2021-05-26 16:29:23', 201711019, '森林城A5地块', '2,4', ' 30426.48  ', 299, 18819, '固镇路与青松路交口', '庐阳区', '住宅', '高层', '合肥万科瑞翔地产有限公司', '上海天华建筑设计有限公司', '上海万科物业服务有限公司合肥分公司', '生活配套齐全，除社区自带的森·生活汇、万科广场集中商业外，另有明发商业广场、永辉商超、汇银广场等商业环绕；教育资源：宿州路幼儿园（森林城园区）、南门小学（森林公校区）、四十五中（森林城校区）；周边环境，环抱庐州公园依董铺水库而居，尽享城市公园生活。 ', ' 项目拥有立体化交通脉络，“四纵四横1地铁”，出门即城市主干道，13路、17路、233路、143路、131路等多条公交路线通行，城市轨道交通3号线四里河路站（建设中）在项目周边 ', 4825, 108, '2017', '201711');
INSERT INTO `house` VALUES (17616, 0, 0, '2021-05-26 15:51:25', 0, '2021-05-26 16:29:24', 201711001, '西子花园', '1#,5#,6#,7#,8#,19#,22#', ' 71008.40  ', 704, 13199, '合肥市高新区望江西路与鸡鸣山路交口', '高新区', '住宅', '高层住宅', '合肥盛卓房地产开发有限公司', '上海天华建筑设计有限公司', '西藏新城悦物业服务股份有限公司', '1.景观资源： 本项目周边拥有一山两湖城市顶级自然资源。距离合肥近郊唯一的一座大山——大蜀山仅7公里。项目距离蜀西湖仅3公里，同时项目距离北雁湖6公里。 2.商业配套： 项目东侧3公里即为蜀西湖商圈，分布奥特莱斯和银泰城(规划中，已签约)两座大型商业中心及汇景城市广场（建设中）大型购物中心。此外项目南侧建设邻里中心，项目自建2000平菜市场。 3.医疗配套： 项目东北直线距离5公里就是40余万方安医附院高新分院，即将试运营。“三级甲等”妇幼保健专科医院安徽省国际妇女儿童医学中心位于长江西路与石镜路交口西北角，已正式开工建设。合肥离子医学中心质子治疗项目位于长宁大道与习友路交口东北角，已正式开工建设。 4.教育配套： 项目西南角自建12班幼儿园，项目北侧规划有36班小学和48班中学。另外项目沿望江西路向东1.5公里就是合肥七中新校区，向东4.5公里就是规划3000亩中科大高新校区，同时项目东南5公里就是中加国际学校。项目拥有诸多的教育资源，是为数不多的全龄教育社区。', '项目位于望江西路与鸡鸣山路（规划中）交口，周边形成了“三横三纵两轨道”的便利交通网，四通八达,出行异常便捷。 “三横”：项目北侧2公里的长江西路是连接合肥东西部的主干道。项目南邻望江西路，沿望江西路向东可到政务区和蜀山区。项目南侧1公里就是习友路，向东可直达天鹅湖商圈。 “三纵”：项目东侧1.5公里就是城市主干道方兴大道，向北连接新桥国际机场；向南连接经开区，直通滨湖区；创新大道是合肥西南片区交通主动脉，连接高新区和经开区。 “两轨道”在建地铁4号线始发站口鸡鸣山路站距离本项目不到100米。串联高新区、政务文化中心、合肥南站中心三大中心，同时与10条轨道线路均设置换乘站点，预计2020年底通车。地铁二号线位于长江西路，贯穿合肥东西，目前已经进入试运营阶段。', 4832, 108, '2017', '201711');
INSERT INTO `house` VALUES (17617, 0, 0, '2021-05-26 15:51:25', 0, '2021-05-26 16:29:25', 201711007, '铂悦府', 'Y3#,Y28#,Y29#,Y30#,Y31#,Y32#,Y35#,Y33#', ' 20664.70  ', 124, 22356, '庐阳区红叶路以东固镇路以北', '庐阳区', '高层、洋房、别墅', '新建', '合肥辰旭房地产开发有限公司', '安徽寰宇建筑设计院', '上海永升物业管理有限公司', '银行、超市、商场、学校、社区医院', '公交站', 4680, 108, '2017', '201711');
INSERT INTO `house` VALUES (17618, 0, 0, '2021-05-26 15:51:25', 0, '2021-05-26 16:29:25', 201710034, '琥珀蜀熙府', 'A1,A2,A3,A7,B9,B10,B11,B12,B13', ' 63057.70  ', 600, 17000, '西二环路与樊洼路交口', '蜀山区', '住宅', '住宅', '合肥城建发展股份有限公司', '安徽寰宇建筑设计院', '安徽琥珀物业服务有限公司', '环境资源：一湖两园、蜀山森林公园。静享生态自然。距离董浦湖、植物园直线距离约1公里，距离庐州公园直线距离约2公里，远眺大蜀山，观山、悦湖、揽园、府藏自然深处，阳光、清风、绿氧层层渗入府中，邂逅生态府居之美。三进式园林景观，五重园林景观轴线，，代建2500平方街角公园，让生活回归居住本意。 教育资源：自建幼儿园、南侧规划小学用地。 科技人居:市政冷暖双供，空气能热水器、新风系统。 ', '路网纵横 咫尺万象繁华。城市主干道西二环通达南北，长江西路高架、地铁2号线捷贯东西，多条公交路线纵横交织，城市交通动脉环绕，咫尺畅达三里庵商圈、黄潜望商圈、政务商圈、满足休闲、娱乐、交友、聚会等全方位需求。', 4767, 108, '2017', '201710');
