INSERT INTO `house` VALUES (17620, 0, 0, '2021-05-26 15:51:25', 0, '2021-05-26 16:29:26', 201711008, '凤曦府', '7#,8#,11#,12#', ' 30040.27  ', 260, 23890, '石台路与汤池路交口东北角；祁门路与石台路交口东北角；祁门路与东至路交口西北角', '政务区', '住宅、公寓、商业', '钢筋混凝土', '安徽当代万国府置业有限公司', '安徽寰宇建筑设计院', '第一物业（北京）股份有限公司合肥分公司', '综合商场：万象城、银泰百货、万千百货、欧尚超市、红星美凯龙 银行：建设银行、农业银行、工商银行、徽商银行、杭州银行 医院： 省立医院南区 学校：嘉和苑小学、50中新区、新8中', '129、18、43、166路到翠澜站下', 4821, 109, '2017', '201711');
INSERT INTO `house` VALUES (17621, 0, 0, '2021-05-26 15:51:25', 0, '2021-05-26 16:29:27', 201710027, '学林花园', '4', ' 8035.38  ', 80, 14447, '云锦路以东、浍水路以南', '新站区', '住宅', '高层、洋房', '合肥蓝光盛景置业有限公司', '华东建筑设计研究院有限公司', '四川嘉宝资产管理集团股份有限公司合肥分公司', '高教城商圈，周边规划中学/小区及社区自建幼儿园；医疗资源齐全，餐饮、教育、医疗一应俱全，生活便捷；约1400亩学林公园在侧，纯净鲜氧蕴生园创森活大境。', '地铁三号线（在建）、大众路/包公大道等主干道，40路公交车到达。', 4790, 109, '2017', '201710');
INSERT INTO `house` VALUES (17622, 0, 0, '2021-05-26 15:51:25', 0, '2021-05-26 16:29:57', 201710026, '海悦东方花园', '12,16,17', ' 17454.35  ', 172, 13199, '和平路与障山路交口', '瑶海区', '高层', '新建', '合肥金科百俊房地产开发有限公司', '安徽寰宇建筑设计院', '金科物业服务集团有限公司', '商业配套：合家福超市，瑶海万达，长江批发市场，宝业东城广场等。临近医院：市二院分院，市五院分院', '项目位于瑶海区和平路与障山路交口', 4818, 109, '2017', '201710');
INSERT INTO `house` VALUES (17623, 0, 0, '2021-05-26 15:51:25', 0, '2021-05-26 16:29:58', 201710002, '乐湖公馆', 'G-7#,G-8#', ' 15731.00  ', 144, 15499, '芙蓉路以西、繁华大道以南', '经开区', '住宅', '高层', '安徽福满城置业有限责任公司', '安徽地平线建筑设计有限公司', '安徽新亚物业管理发展有限公司', '项目北接政务区，东承高铁南站，外壤天鹅湖、明珠广场商圈，内揽3000亩南艳湖湿地公园。周边社区林立，生活配套醇熟，46中海恒分校、习友小学，更氤氲学风、才子辈出', '项目紧邻合肥主干道繁华大道而建，繁华大道为城南片区最主要的交通枢纽之一。 31路、52路、57路等完善的公交路线通达全城', 4783, 109, '2017', '201710');
INSERT INTO `house` VALUES (17624, 0, 0, '2021-05-26 15:51:25', 0, '2021-05-26 16:29:58', 201710019, '少荃湖名苑', 'E-1,E-2,E-3,E-4', ' 5210.30  ', 44, 13000, '东方大道与前岭路交口', '新站区', '住宅', '高层、洋房、叠墅', '合肥当代英赫置业有限公司', '安徽地平线建筑设计有限公司', '合肥安景物业服务有限责任公司', '15班幼儿园、商业配套、磨店老街、百大拓基', '项目北面预留有公交站，地铁三号线学林路站距离项目约2.7公里，地铁四号线东方大道站距离项目1.4公里。项目所临东方大道为双向4车道公路，向西通达新蚌埠路，向东可由文忠路至北二环，此外在建铜陵路高架直达市区，且同行状况良好完全能满足通行所需', 4801, 109, '2017', '201710');
