INSERT INTO `house` VALUES (17628, 0, 0, '2021-05-26 15:51:25', 0, '2021-05-26 16:30:00', 201711006, '鼎元别院', '蘭宫1幢', ' 2259.87  ', 7, 20821, '蜀山区植物园路9号', '蜀山区', '住宅', '高层住宅及其他住宅', '合肥拓基房地产开发有限责任公司', '深圳大学建筑设计研究院', '合肥拓基物业管理有限责任公司', '项目周边商业配套日趋成熟，紧临项目的有上海华联金色池塘店，上海华联超市，福乐门广场、乐购，步行10分钟可达蜀山区的黄金地段—长江西路西区商圈中心，鼓楼商厦高新店，合家福高新店。', '多路公交线路可直达项目或项目周边，其中步行5分钟可直达城市主干道西二环，15分钟可达规划中的城市森林公园；驾车5分钟可快速融入城市动脉长江西路高架；8分钟可达三里庵国购商圈，10分钟可达三孝口主城区；5分钟可达百大高新区鼓楼、合家福商圈；8分钟可达政务区核心区，15分钟可达经开区。项目途经经开区直达滨湖新区仅30分钟，西二环至北二环到达合肥新火车站仅20分钟。', 4759, 109, '2017', '201711');
INSERT INTO `house` VALUES (17629, 0, 0, '2021-05-26 15:51:26', 0, '2021-05-26 16:30:00', 201710036, '双玺公馆', 'G1#', ' 24287.99  ', 112, 22000, '滨湖新区金斗北路与万年埠路交口', '滨湖区', '住宅', '多层、高层', '安徽双玺置业有限公司', '浙江绿城建筑设计研究院', '安徽信联物业服务有限公司', '目前项目旁有规划中学、小学、幼儿园用地等基础教育资源，周边拥有国际金融后台服务基地，21家金融机构总部签约入驻，目前有中国银行、中国工商银行、浦发银行、中国农业银行、邮政储蓄银行、中国建设银行、交通银行等7家金融总部已经投入运营。项目周边规划有大型商业综合体，比如：万达茂、银泰中心、恒大518Mall、奥特莱斯等。生态环境优美，三大公园围绕：塘西河公园、金斗公园、方兴湖公园。医疗配套设施齐全，滨湖医院为您的家人健康保驾护航。', '位于合肥市滨湖新区金斗北路与万年埠路交口西南侧，交通便利，小区周边有地铁1号线、531、1路、18路、26路、34路、42路、60路等多路公交直达线路。 ', 4764, 110, '2017', '201710');
INSERT INTO `house` VALUES (17630, 0, 0, '2021-05-26 15:51:26', 0, '2021-05-26 16:30:01', 201709057, '振荣·锦尚公馆', '11', ' 9478.08  ', 96, 5059, '高刘镇海棠路与莲荷路交口', '高刘', '住宅、商铺', '多层、小高层、高层', '安徽振荣置业投资有限公司', '安徽华盛国际建筑设计工程咨询有限公司', '合肥铭威物业管理有限公司', '合肥市第五十中学西校高刘分校、高刘镇政府、派出所、医院、邮政储蓄、农贸市场、购物超市、合肥经开实验高刘小学、幼儿园等。', '该项目位于高刘镇核心生活区的海棠路与莲荷路交口，临近合六叶高速和机场高速。多条巴士通往合肥，至市区仅需30分钟。 ', 4669, 110, '2017', '201709');
