INSERT INTO `house` VALUES (17632, 0, 0, '2021-05-26 15:51:26', 0, '2021-05-26 16:30:02', 201710001, '庐月湾', '11#,12#', ' 25499.45  ', 264, 20800, '规划二路以南、规划大房郢路以东', '庐阳区', '高层', '住宅', '合肥市弘韬房地产开发有限公司', '华东建筑设计研究院有限公司', '广州市宁骏物业管理有限公司', '医疗：项目南边有武警医院，长江路上一零五医院。 学校：项目东接第四十五中学橡树湾分校，社区内开发代建24班小学；周边有第四十二中学中铁国际城校区、庐阳中学、寿春中学、长江路第二小学、红星路小学等。 商业：项目东南角有在建的10万方华润万象汇、在运营的约4万方九余三特色商业街；北一环商务中心、新天地商圈、四里河商圈等构筑繁华生活版图。', '项目位于三横三纵一轨道的立体式交通网络之中：三横有北二环、临泉路、北一环；三纵有四里河路、蒙城北路、阜阳北路；一轨道指的是地铁3号线，距离本案最近的站点在临泉路与肥西路交口临泉西路站。', 4681, 110, '2017', '201710');
INSERT INTO `house` VALUES (17633, 0, 0, '2021-05-26 15:51:26', 0, '2021-05-26 16:30:02', 201709051, '栢悦府北院', '24#,25#,26#,27#,29#,33#,35#,39#,50#,52#,55#,57#,59#', ' 18653.88  ', 26, 29990, '政务区万佛湖路与怀宁路交口', '政务区', '别墅', '框架', '安徽置地投资（合肥）有限公司', '深圳奥意建筑工程设计有限公司', '安徽信联物业服务有限公司', '绿洲公园，奥体中心、省博物馆、天鹅湖、万象城购物中心。地理位置优越，周边环境优美，配套齐全。', '我单位开发建设的置地广场项目位于政务区习友路与绿洲西路交口。东临城市绿洲西路，西侧为主干道怀宁路可直接通达祁门路与习友路，紧邻地铁3、4号线。出行十分便捷。', 4740, 110, '2017', '201709');
INSERT INTO `house` VALUES (17634, 0, 0, '2021-05-26 15:51:26', 0, '2021-05-26 16:30:03', 201709047, '文一塘溪津门', '17,20', ' 7228.12  ', 50, 24008, '滨湖新区包河大道与杭州路交口', '滨湖区', '住宅', '高层、洋房', '安徽省文一投资控股集团滨江置业有限公司', '北京高能筑博建筑设计有限公司', '安徽省文一物业管理有限公司', '环境：项目紧邻方兴湖和巢湖两大水系，同时为塘西河公园、金斗公园、方兴湖公园和岸上草原所环抱，公园面积高达万亩。商业：项目自持近10万方的文化商业街，打造合肥城市会客厅。此外，南接万达文旅城和恒大中心，东邻银泰中心和中心书城，北连悦方IDmall和世纪金源，众多商业中心伺散。学区：项目南面沿云谷路建有幼儿园和小学。同时一中、四十八中、四十六中和师范附小等名校坐落周边，教育资源得天独厚。医疗：滨湖医院距离项目仅4公里。省立医院总部正在规划筹建，位于项目北侧，相距不过5分钟车程。旅游：万达文化旅游城、牛角大圩生态旅游区、滨湖湿地公园、巢湖岸边的岸上草原、滨湖十大省级文化场馆，加上会申报国家AAAA级景区的塘溪津门水街将，形成一片完整的环巢湖旅游带。', '项目交通状况用“一环二铁三纵四横”来概括。“一环”，即环巢湖大道，被誉为“合肥最美道路”之一。沿线向东可达巢湖城区，向西达国家AAAAA级风景区——三河古镇。“二铁”，指高铁南站和三条地铁线。高铁南站距项目约10公里，借此可达省外；其次项目紧邻三条地铁，1号线已开通营运，由滨湖新区直达合肥火车站，是合肥南北向交通的主动脉，距项目最近的云谷路站约为1.1公里；5号线已经开建，其东史岗路站与华山路站与项目无缝对接。S1号线，途经新桥机场、新高铁西站、高铁南站最终抵达巢湖岸边，将于项目东南角设站。“三纵”指三条南北向主干道——徽州大道、庐州大道和包河大道，连接滨湖新区与老城核心。“四横 ”为锦绣大道、紫云路、方兴大道和云谷路，贯穿滨湖新区和经开区。沿方兴大道向西驱车10分钟可上京台高速，30分钟可达机场高速入口，构成全方位、立体化的交通体系网，通达四周。', 4765, 110, '2017', '201709');
INSERT INTO `house` VALUES (17635, 0, 0, '2021-05-26 15:51:26', 0, '2021-05-26 16:30:04', 201709048, '铂悦府', 'B10#,B16#,B17#,B18#,B19#,B20#,B21#,B22#,B23#,B25#,B26#,B27#,B28#,B29#,B30#', ' 13417.06  ', 30, 23282, '庐阳区红叶路以东固镇路以北', '庐阳区', '高层、洋房、别墅', '新建', '合肥辰旭房地产开发有限公司', '安徽寰宇建筑设计院', '上海永升物业管理有限公司', '银行、超市、商场、学校、社区医院', '公交站', 4758, 110, '2017', '201709');
INSERT INTO `house` VALUES (17636, 0, 0, '2021-05-26 15:51:26', 0, '2021-05-26 16:30:04', 201709043, '观澜花园', '2,1,3,6', ' 26901.50  ', 222, 21700, '龙川路与合作化路交叉口', '包河区', '一级', '高层、花园洋房', '安徽融和房地产开发有限公司', '安徽地平线设计有限公司', '福州融侨物业管理公司', ' 项目位于政务东，紧邻目前合肥市商圈最发达的政务区，承接了成熟的政务区优质资源，一脉龙川路无缝接驳万象城商圈，3公里即为银泰城，3.8公里即为天鹅湖万达，世界各大高端品牌汇聚于此，而且很多的知名品牌只进驻此区域，驱车10分钟左右即满足日常所有需求。以及新地中心、置地广场、百利中心、绿地中心等星级写字楼，另外合肥市许多知名地标建筑也坐落于此，比如安徽广电中心，奥体中心，安徽省博物馆、天鹅湖等，得以让居住于此的人们能享受便捷的生活服务。', '周边公交，项目西侧有54中公交车站，18路、126路、148路、149路、516路、701、901路可畅达全城，直达合肥各大商圈及交通要点。', 4660, 110, '2017', '201709');
INSERT INTO `house` VALUES (17637, 0, 0, '2021-05-26 15:51:26', 0, '2021-05-26 16:30:05', 201709040, '时光印象', 'A7,A8,B9', ' 31031.89  ', 268, 16799, '滨湖新区贵阳路以南，贵州路以东', '滨湖区', '住宅、商业', '洋房、高层', '合肥新城创域房地产有限公司', '上海霍普建筑设计事务所股份有限公司', '西藏新城悦物业服务股份有限公司合肥分公司 ', '学校资源：本项目周边配套规划幼儿园、已建成师范附小三小贵阳路校区和阳光中学四川路校区，项目周边规划国际双语学校； 景观资源：本项目周边3公里内分布城市体育公园（规划）、云川公园、金斗公园、岸上草原； 商超：周边规划建设银泰城、奥特莱斯；万达茂； 医院：市滨湖医院、规划省立医院医疗保健中心； 银行：项目1公里内分布中国银行、交通银行、农业银行等22家银行和金融保险机构。 内部配套： 项目自身配套约5000平米商业，设置小区配套商业。 ', '本项目是多维立体化交通，项目周边交通体系“五纵五横一环”多维交通网通达全城，本项目通过贵阳路、四川路与徽州大道、庐州大道、云谷路紧密连接，交通通达性强，“双地铁”贯穿城市核心区域，1KM内通达地铁1号线、5号线的出站点，本项目有效连接与主城区各个区域，交通便捷度高', 4756, 110, '2017', '201709');
INSERT INTO `house` VALUES (17638, 0, 0, '2021-05-26 15:51:26', 0, '2021-05-26 16:30:06', 201709041, '森林城A5地块', '1', ' 15134.80  ', 167, 18819, '固镇路与青松路交口', '庐阳区', '住宅', '高层', '合肥万科瑞翔地产有限公司', '上海天华建筑设计有限公司', '上海万科物业服务有限公司合肥分公司', '生活配套齐全，除社区自带的森·生活汇、万科广场集中商业外，另有明发商业广场、永辉商超、汇银广场等商业环绕；教育资源：宿州路幼儿园（森林城园区）、南门小学（森林公校区）、四十五中（森林城校区）；周边环境，环抱庐州公园依董铺水库而居，尽享城市公园生活。 ', ' 项目拥有立体化交通脉络，“四纵四横1地铁”，出门即城市主干道，13路、17路、233路、143路、131路等多条公交路线通行，城市轨道交通3号线四里河路站（建设中）在项目周边 ', 4752, 110, '2017', '201709');
