INSERT INTO `house` VALUES (17642, 0, 0, '2021-05-26 15:51:26', 0, '2021-05-26 16:30:08', 201709036, '少荃湖名苑', 'E-5,E-6', ' 2835.36  ', 24, 13000, '东方大道与前岭路交口', '新站区', '住宅', '高层、洋房、叠墅', '合肥当代英赫置业有限公司', '安徽地平线建筑设计有限公司', '合肥安景物业服务有限责任公司', '15班幼儿园、商业配套、磨店老街、百大拓基', '项目北面预留有公交站，地铁三号线学林路站距离项目约2.7公里，地铁四号线东方大道站距离项目1.4公里。项目所临东方大道为双向4车道公路，向西通达新蚌埠路，向东可由文忠路至北二环，此外在建铜陵路高架直达市区，且同行状况良好完全能满足通行所需', 4735, 111, '2017', '201709');
INSERT INTO `house` VALUES (17643, 0, 0, '2021-05-26 15:51:26', 0, '2021-05-26 16:30:09', 201709030, '湖光别院', 'Y5,G7', ' 14071.00  ', 124, 15900, '珠江路与云南路交口', '滨湖区', '高层', '新建', '合肥和桂房地产有限公司', '上海水石建筑规划设计股份有限公司', '保利物业管理有限公司安徽分公司', '项目自身带有7.7万方商业，周边5-10分钟车程直达15万方万达茂，10万方悦方IDMALL，40万方的世纪金源；项目自建幼儿园，南侧配套教育用地，区域内教育资源优厚；地块南侧一路之隔北涝圩生态湿地，未来自然资源配套优质。', '五横五纵两轨道，沿徽州大道往北20分钟车程即可到达合肥老城区，两条地铁覆盖，地铁1号线（始发站九联圩距离项目2km左右），正在建设的地铁5号线（始发站贵阳路站与本项目是零距离无缝对接）。', 4739, 111, '2017', '201709');
INSERT INTO `house` VALUES (17644, 0, 0, '2021-05-26 15:51:26', 0, '2021-05-26 16:30:09', 201709035, '高速静安春晖里', '4,5', ' 26403.12  ', 226, 12999, '合肥市瑶海区龙岗路与长临路东北角', '瑶海区', '住宅、商业', '高层', '安徽省静安健康运营管理有限公司', '同济大学建筑设计研究院（集团）有限公司', '绿城物业服务集团有限公司安徽分公司', '教育：项目自建6000㎡幼儿园，是由开发商着力打造的优质幼儿园，让您足不出户即可安全放心的接受优质的幼儿教育； 商圈：周边的商业配套也是非常成熟，瑶海万达、百思购广场商圈、火车站商圈、中心商圈，距离瑶海万达、百思购广场商圈 医疗：项目周边有合肥市第五人民医院、合肥市第二人民医院、龙岗医院，另本项目规划建设超过4.5万平米的医院', '位于合肥市瑶海区龙岗路与长临路东北角，交通便利，小区周边有37路、123路、T9路、135路、303路、505路、快5路、519路等多路公交直达线路。', 4730, 111, '2017', '201709');
INSERT INTO `house` VALUES (17645, 0, 0, '2021-05-26 15:51:26', 0, '2021-05-26 16:30:10', 201709029, '西子花园', '20#,21#,23#,25#', ' 34822.21  ', 341, 13199, '合肥市高新区望江西路与鸡鸣山路交口', '高新区', '住宅', '高层住宅', '合肥盛卓房地产开发有限公司', '上海天华建筑设计有限公司', '西藏新城悦物业服务股份有限公司', '1.景观资源： 本项目周边拥有一山两湖城市顶级自然资源。距离合肥近郊唯一的一座大山——大蜀山仅7公里。项目距离蜀西湖仅3公里，同时项目距离北雁湖6公里。 2.商业配套： 项目东侧3公里即为蜀西湖商圈，分布奥特莱斯和银泰城(规划中，已签约)两座大型商业中心及汇景城市广场（建设中）大型购物中心。此外项目南侧建设邻里中心，项目自建2000平菜市场。 3.医疗配套： 项目东北直线距离5公里就是40余万方安医附院高新分院，即将试运营。“三级甲等”妇幼保健专科医院安徽省国际妇女儿童医学中心位于长江西路与石镜路交口西北角，已正式开工建设。合肥离子医学中心质子治疗项目位于长宁大道与习友路交口东北角，已正式开工建设。 4.教育配套： 项目西南角自建12班幼儿园，项目北侧规划有36班小学和48班中学。另外项目沿望江西路向东1.5公里就是合肥七中新校区，向东4.5公里就是规划3000亩中科大高新校区，同时项目东南5公里就是中加国际学校。项目拥有诸多的教育资源，是为数不多的全龄教育社区。', '项目位于望江西路与鸡鸣山路（规划中）交口，周边形成了“三横三纵两轨道”的便利交通网，四通八达,出行异常便捷。 “三横”：项目北侧2公里的长江西路是连接合肥东西部的主干道。项目南邻望江西路，沿望江西路向东可到政务区和蜀山区。项目南侧1公里就是习友路，向东可直达天鹅湖商圈。 “三纵”：项目东侧1.5公里就是城市主干道方兴大道，向北连接新桥国际机场；向南连接经开区，直通滨湖区；创新大道是合肥西南片区交通主动脉，连接高新区和经开区。 “两轨道”在建地铁4号线始发站口鸡鸣山路站距离本项目不到100米。串联高新区、政务文化中心、合肥南站中心三大中心，同时与10条轨道线路均设置换乘站点，预计2020年底通车。地铁二号线位于长江西路，贯穿合肥东西，目前已经进入试运营阶段。', 4727, 111, '2017', '201709');
INSERT INTO `house` VALUES (17646, 0, 0, '2021-05-26 15:51:26', 0, '2021-05-26 16:30:10', 201709028, '佳源都市小区', '10幢,11幢', ' 13808.95  ', 102, 17978, '合肥市滨湖区长沙路与洞庭湖路交口西南', '滨湖区', '住宅、商业', '高层、其他住宅', '浙江佳源安徽房地产开发有限公司', '上海华东建设发展设计有限公司', '浙江佳源物业管理有限公司合肥分公司', '项目周边有洞庭湖路小学、中山路中学、寿春中学等优质教育资源；塘西河公园位于小区南侧；另小区内配备10万方购物中心。', '佳源都市小区纵向通过徽州大道、庐州大道、包河大道可与老城区对接；横向通过紫云路、方兴大道、锦绣大道与经开区连接；公交线路有26路、60路等；轨道交通1号线塘西河站位于项目13号地块。', 4736, 111, '2017', '201709');
INSERT INTO `house` VALUES (17647, 0, 0, '2021-05-26 15:51:26', 0, '2021-05-26 16:30:10', 201709025, '时代观邸', '21,22', ' 6126.52  ', 32, 25555, '滨湖新区庐州大道以东、南京路以北', '滨湖区', '住宅', '高层、小高层、多层', '合肥万科瑞益地产地产有限公司', '安徽地平线建筑设计事务所有限公司', '上海万科物业服务有限公司 ', '\" 项目紧邻新省政府办公区，周边配套完善醇熟。 购物、休闲、娱乐：项目西边就是滨湖商业成熟的启动区，拥有约40万方的世纪金源购物中心和五星级酒店，商业氛围浓厚，满足购物、休闲、娱乐需求。 医疗：项目西边三级甲等滨湖医院，技术先进，设备齐全。 学校：项目西南方向合肥一中，是省重点中学，师资力量雄厚，教学质量一流。 景观环境：项目南边840万方塘西河公园、金斗公园，环境优美，是滨湖的天然氧吧。\" ', '\"地铁1号线： 项目地处地铁1号线沿线，并且在项目西北角设有滨湖会展中心站点，此站点是地铁1号线连接老城区与滨湖新区的第一站。 三纵四横交通网： 项目拥有四通八达的交通网络，纵向可通过南北向的徽州大道、庐州大道和包河大道快速到达老城区，横向通过东西向的锦绣大道、紫云路和方兴大道快速到达经开区。 纵向的庐州大道，后期将全线贯通，直接连接主城区，方兴大道更是一条双向十二车道，具有老城区无法比拟的道路畅通优势。\" ', 4726, 111, '2017', '201709');
