INSERT INTO `house` VALUES (17667, 0, 0, '2021-05-26 15:51:27', 0, '2021-05-26 16:30:21', 201708043, '双玺公馆', 'G2#', ' 24348.75  ', 112, 22000, '滨湖新区金斗北路与万年埠路交口', '滨湖区', '住宅', '多层、高层', '安徽双玺置业有限公司', '浙江绿城建筑设计研究院', '安徽信联物业服务有限公司', '目前项目旁有规划中学、小学、幼儿园用地等基础教育资源，周边拥有国际金融后台服务基地，21家金融机构总部签约入驻，目前有中国银行、中国工商银行、浦发银行、中国农业银行、邮政储蓄银行、中国建设银行、交通银行等7家金融总部已经投入运营。项目周边规划有大型商业综合体，比如：万达茂、银泰中心、恒大518Mall、奥特莱斯等。生态环境优美，三大公园围绕：塘西河公园、金斗公园、方兴湖公园。医疗配套设施齐全，滨湖医院为您的家人健康保驾护航。', '位于合肥市滨湖新区金斗北路与万年埠路交口西南侧，交通便利，小区周边有地铁1号线、531、1路、18路、26路、34路、42路、60路等多路公交直达线路。 ', 4643, 113, '2017', '201708');
INSERT INTO `house` VALUES (17668, 0, 0, '2021-05-26 15:51:27', 0, '2021-05-26 16:30:51', 201708035, '海悦东方花园', '21,18', ' 15495.35  ', 144, 13199, '和平路与障山路交口', '瑶海区', '高层', '新建', '合肥金科百俊房地产开发有限公司', '安徽寰宇建筑设计院', '金科物业服务集团有限公司', '商业配套：合家福超市，瑶海万达，长江批发市场，宝业东城广场等。临近医院：市二院分院，市五院分院', '项目位于瑶海区和平路与障山路交口', 4601, 113, '2017', '201708');
INSERT INTO `house` VALUES (17669, 0, 0, '2021-05-26 15:51:28', 0, '2021-05-26 16:30:52', 201708036, '金樾花园', '1,2,3', ' 11212.26  ', 96, 22000, '庐阳区五河路', '庐阳区', '洋房、高层', '新建', '合肥金科骏成房地产开发有限公司', '安徽寰宇建筑设计院', '金科物业服务有限公司', '生活配套完善，双岗商圈、市府商圈、三里庵商圈、三孝口商圈、万达商圈，五大商圈汇聚于此；繁华尽揽。', '位于庐阳区五河路与阜阳路交口西', 4640, 114, '2017', '201708');
INSERT INTO `house` VALUES (17670, 0, 0, '2021-05-26 15:51:28', 0, '2021-05-26 16:30:53', 201708037, '豪门金地', '59', ' 13195.65  ', 108, 21999, '西藏路与南宁路交口', '滨湖区', '住宅', '高层、洋房、其他住宅', '安徽省文一投资控股集团滨城置业有限公司', '北京高能筑博建筑设计有限公司', '安徽省文一物业管理有限公司', '项目与国际金融后台服务基地一路之隔，工农建中四大行及数家知名金融机构总部（中国人民银行、中国银行、工商银行、建设银行、农业银行、交通银行、邮储银行、徽商银行、浦发银行等）和综合基地及安徽省银行监督管理局落户合肥滨湖新区，与项目咫尺相邻。 繁华商圈：距离繁华世纪金源购物商圈仅10余分钟车程，高速时代广场、银泰城、亚洲最大的8万方中心书城、以及万达文旅城（世界首创第四代恒温水世界—万达水乐园、电影科技乐园，万达宝贝王等）均距离项目较近； 景观资源：滨湖的巢湖湿地公园，将打造 80 万平方米的“人造湿地”、“塘西河公园”、“金斗公园”和“方兴湖公园”等一系列生态项目，带来约 840 万平方米的新生绿化。项目旁边还占有“8万平米城市体育公园”、云川公园景观资源配套； 学区配套：项目周边学区密集，46中南校区、示范附小四小、世纪阳光中学四川路校区、示范附小三小贵阳路校区等', '项目交通状况：可以用”四纵四横一环二轨道“来概括。“四纵”，指的是徽州大道、庐州大道、包河大道和宿松路。宿松路连接方兴大道，直通市区百脑汇；经徽州大道的快速公交 5 分钟即可到达巢湖，10 分钟即可到达高铁南站，15 分钟即可到达合肥老城区。”四横“分别是锦绣大道、紫云路、方兴大道、云谷路。四条横向干道从北向南依次排布，将滨湖新区和经开区相连，西接金寨路高架，东接包河大道高架，构成立体交通网络，其中通过方兴大道和京台高速互通立交桥 30 分钟就可以到达新桥机场。”一环“指环巢湖景观大道，2014年环巢湖景观大道全线通车，全长约155公里，从巢湖东岸的巢湖市区湖光路起，至滨湖新区，可以自行驾车观光环巢湖生态风景，同时实现肥东和滨湖新区实现“无缝连接”。“二轨道”指的是，地铁1号线、5号线，地铁1号线于今年底投入使用，是南北方向的主干线，起点是天水路站和徽州大道站，离我们最近的地铁站口南宁路站距离项目不到1公里，今年年底就通车了，可直达新建的高铁南站和老火车站，后期出差旅行非常便捷。沿云谷路建设的地铁 5 号线，围绕着我们豪门金周边地建设的有三个站点，分别是四川路站、成都路站和云南路站，其中四川路站距离我们项目仅500米左右，后期您的出行也将变得十分方便。', 4647, 114, '2017', '201708');
INSERT INTO `house` VALUES (17671, 0, 0, '2021-05-26 15:51:28', 0, '2021-05-26 16:30:54', 201708039, '金港湾公馆', '9#,17#', ' 26917.97  ', 232, 15350, '长宁大道与彩虹路交口西南角', '高新区', '住宅、商业', '高层、洋房', '合肥蜀西祥源房地产开发有限公司', '安徽安德建筑设计有限公司', '合肥祥源物业管理有限公司', '项目自建幼儿园，奥特莱斯商业广场已开业。', '项目位于合肥市高新区，东自长宁大道，西至天堂寨路，南起佛岭寨路，北邻南岗镇南岗村用地。', 4651, 114, '2017', '201708');
INSERT INTO `house` VALUES (17672, 0, 0, '2021-05-26 15:51:28', 0, '2021-05-26 16:30:55', 201708029, '都会花园', '1,2,3,7,8,9,25,26', ' 63591.14  ', 564, 17000, '滨湖新区嘉陵江以南、贵州路以东', '滨湖区', '住宅、商业', '高层、小高层、洋房', '合肥永拓置业发展有限公司', '安徽寰宇建筑设计院', '南京万科物业管理有限公司', '学区配套：师范附小三小贵阳路校区、阳光中学四川路校区及滨湖国际双语学校（规划中）； 商业配套：云谷商业MALL（约40万方）、万达茂（约15万方）、银泰商业（约12万方、在建中）、恒大商业MALL（约40万方）、奥特莱斯（在建中）、部分自带沿街商业等', '\"公交：42路、61路、63路、T15路、531路； 地铁：轨道交通1号线（九联圩站）、5号线（云南路站）； 云谷路、西藏路、四川路、徽州大道、\" ', 4668, 114, '2017', '201708');
INSERT INTO `house` VALUES (17673, 0, 0, '2021-05-26 15:51:28', 0, '2021-05-26 16:30:55', 201708024, '西子花园', '9#,10#,11#,12#,15#,16#,18#', ' 82053.71  ', 792, 13199, '合肥市高新区望江西路与鸡鸣山路交口', '高新区', '住宅', '高层住宅', '合肥盛卓房地产开发有限公司', '上海天华建筑设计有限公司', '西藏新城悦物业服务股份有限公司', '1.景观资源： 本项目周边拥有一山两湖城市顶级自然资源。距离合肥近郊唯一的一座大山——大蜀山仅7公里。项目距离蜀西湖仅3公里，同时项目距离北雁湖6公里。 2.商业配套： 项目东侧3公里即为蜀西湖商圈，分布奥特莱斯和银泰城(规划中，已签约)两座大型商业中心及汇景城市广场（建设中）大型购物中心。此外项目南侧建设邻里中心，项目自建2000平菜市场。 3.医疗配套： 项目东北直线距离5公里就是40余万方安医附院高新分院，即将试运营。“三级甲等”妇幼保健专科医院安徽省国际妇女儿童医学中心位于长江西路与石镜路交口西北角，已正式开工建设。合肥离子医学中心质子治疗项目位于长宁大道与习友路交口东北角，已正式开工建设。 4.教育配套： 项目西南角自建12班幼儿园，项目北侧规划有36班小学和48班中学。另外项目沿望江西路向东1.5公里就是合肥七中新校区，向东4.5公里就是规划3000亩中科大高新校区，同时项目东南5公里就是中加国际学校。项目拥有诸多的教育资源，是为数不多的全龄教育社区。', '项目位于望江西路与鸡鸣山路（规划中）交口，周边形成了“三横三纵两轨道”的便利交通网，四通八达,出行异常便捷。 “三横”：项目北侧2公里的长江西路是连接合肥东西部的主干道。项目南邻望江西路，沿望江西路向东可到政务区和蜀山区。项目南侧1公里就是习友路，向东可直达天鹅湖商圈。 “三纵”：项目东侧1.5公里就是城市主干道方兴大道，向北连接新桥国际机场；向南连接经开区，直通滨湖区；创新大道是合肥西南片区交通主动脉，连接高新区和经开区。 “两轨道”在建地铁4号线始发站口鸡鸣山路站距离本项目不到100米。串联高新区、政务文化中心、合肥南站中心三大中心，同时与10条轨道线路均设置换乘站点，预计2020年底通车。地铁二号线位于长江西路，贯穿合肥东西，目前已经进入试运营阶段。', 4663, 114, '2017', '201708');
INSERT INTO `house` VALUES (17674, 0, 0, '2021-05-26 15:51:28', 0, '2021-05-26 16:30:56', 201708023, '世纪荣廷小区', '46', ' 11508.32  ', 136, 9877, '天水路以南，河东路以东', '新站区', '住宅', '住宅', '安徽鑫昊等离子显示器件有限公司', '南京长江都市建筑设计有限公司', '四川长虹物业服务有限责任公司合肥分公司', '世纪天乐商业广场、馥帮商业广场、乐活商业广场、合家福超市、苏宁电器、永辉超市、安徽省第二人民医院', '163、127、302、683、35路', 4661, 114, '2017', '201708');
INSERT INTO `house` VALUES (17675, 0, 0, '2021-05-26 15:51:28', 0, '2021-05-26 16:30:56', 201708038, '锦门里', '16', ' 16090.50  ', 150, 10499, '文忠路与学府路交口', '新站区', '住宅', '多层、高层', '安徽省文一投资控股集团新站置业有限公司', '安徽安德建筑设计有限公司', '安徽省文一物业管理有限公司', '项目周边庆平希望小学、168中学、安医附院四附院，东侧是百大商业广场、磨店商业街。', '301、302、303、304、681', 4667, 114, '2017', '201708');
INSERT INTO `house` VALUES (17676, 0, 0, '2021-05-26 15:51:28', 0, '2021-05-26 16:30:57', 201708020, '文一塘溪津门', '6,8,9', ' 33228.70  ', 268, 22000, '滨湖新区包河大道与杭州路交口', '滨湖区', '住宅', '高层、洋房', '安徽省文一投资控股集团滨江置业有限公司', '北京高能筑博建筑设计有限公司', '安徽省文一物业管理有限公司', '环境：项目紧邻方兴湖和巢湖两大水系，同时为塘西河公园、金斗公园、方兴湖公园和岸上草原所环抱，公园面积高达万亩。商业：项目自持近10万方的文化商业街，打造合肥城市会客厅。此外，南接万达文旅城和恒大中心，东邻银泰中心和中心书城，北连悦方IDmall和世纪金源，众多商业中心伺散。学区：项目南面沿云谷路建有幼儿园和小学。同时一中、四十八中、四十六中和师范附小等名校坐落周边，教育资源得天独厚。医疗：滨湖医院距离项目仅4公里。省立医院总部正在规划筹建，位于项目北侧，相距不过5分钟车程。旅游：万达文化旅游城、牛角大圩生态旅游区、滨湖湿地公园、巢湖岸边的岸上草原、滨湖十大省级文化场馆，加上会申报国家AAAA级景区的塘溪津门水街将，形成一片完整的环巢湖旅游带。', '项目交通状况用“一环二铁三纵四横”来概括。“一环”，即环巢湖大道，被誉为“合肥最美道路”之一。沿线向东可达巢湖城区，向西达国家AAAAA级风景区——三河古镇。“二铁”，指高铁南站和三条地铁线。高铁南站距项目约10公里，借此可达省外；其次项目紧邻三条地铁，1号线已开通营运，由滨湖新区直达合肥火车站，是合肥南北向交通的主动脉，距项目最近的云谷路站约为1.1公里；5号线已经开建，其东史岗路站与华山路站与项目无缝对接。S1号线，途经新桥机场、新高铁西站、高铁南站最终抵达巢湖岸边，将于项目东南角设站。“三纵”指三条南北向主干道——徽州大道、庐州大道和包河大道，连接滨湖新区与老城核心。“四横 ”为锦绣大道、紫云路、方兴大道和云谷路，贯穿滨湖新区和经开区。沿方兴大道向西驱车10分钟可上京台高速，30分钟可达机场高速入口，构成全方位、立体化的交通体系网，通达四周。', 4590, 114, '2017', '201708');
