INSERT INTO `house` VALUES (17680, 0, 0, '2021-05-26 15:51:29', 0, '2021-05-26 16:30:58', 201708025, '翡翠府邸', '44,45,46,47,48,49', ' 6451.64  ', 28, 19899, '翡翠路与紫云路交汇口', '经开区', '住宅 商业 ', '高层 洋房 联排', '合肥世茂房地产开发有限公司', '上海霍普建筑设计事务所有限公司', '世茂天成物业服务集团有限公司', '翡翠公园 中环城 港澳广场 金星商业城商圈 安徽大学 合肥工业大学 安徽三联学院 肥西人民医院 安医二附院 翡翠湖国宾馆 金满楼国际大酒店 ', '26 30 33 32 150 602 609 691 ', 4642, 115, '2017', '201708');
INSERT INTO `house` VALUES (17681, 0, 0, '2021-05-26 15:51:29', 0, '2021-05-26 16:30:59', 201708010, '时光印象', 'A1,A2,A3,A5,B1,B2,B5', ' 50878.75  ', 448, 16799, '滨湖新区贵阳路以南，贵州路以东', '滨湖区', '住宅、商业', '洋房、高层', '合肥新城创域房地产有限公司', '上海霍普建筑设计事务所股份有限公司', '西藏新城悦物业服务股份有限公司合肥分公司 ', '学校资源：本项目周边配套规划幼儿园、已建成师范附小三小贵阳路校区和阳光中学四川路校区，项目周边规划国际双语学校； 景观资源：本项目周边3公里内分布城市体育公园（规划）、云川公园、金斗公园、岸上草原； 商超：周边规划建设银泰城、奥特莱斯；万达茂； 医院：市滨湖医院、规划省立医院医疗保健中心； 银行：项目1公里内分布中国银行、交通银行、农业银行等22家银行和金融保险机构。 内部配套： 项目自身配套约5000平米商业，设置小区配套商业。 ', '本项目是多维立体化交通，项目周边交通体系“五纵五横一环”多维交通网通达全城，本项目通过贵阳路、四川路与徽州大道、庐州大道、云谷路紧密连接，交通通达性强，“双地铁”贯穿城市核心区域，1KM内通达地铁1号线、5号线的出站点，本项目有效连接与主城区各个区域，交通便捷度高', 4658, 115, '2017', '201708');
