INSERT INTO `house` VALUES (17684, 0, 0, '2021-05-26 15:51:29', 0, '2021-05-26 16:31:00', 201708007, '湾景公馆', '2#,3#', ' 19593.17  ', 188, 14798, '合肥市新蚌埠路与扶疏路交口西南角', '新站区', '住宅、商业', '高层、复式', '安徽兴和昌置业发展有限公司', '杭州森拓建筑设计有限公司', '河南新和昌物业服务有限公司', '购物 ：淮河路步行街、长江路银泰百货20分钟车程、家天下生活广场。 农贸市场 ：凤台路农贸市场、星光菜市场、兴华菜市场。 学校：七里塘小学、兴华苑小学、合肥第三十中学。 医院：安徽省第二人民医院。 公园及其他景观：瑶海公园、生态公园。 商务金融 ：财富广场、招行大厦、祥源广场。 专业市场：瑶海家具市场 安徽大市场 安徽轻工商城。', '项目周边道路四通八达，多条城市主干道环伺周边，其中项目更是坐落在城市核心干道新蚌埠路上，新蚌埠路长达16公里，南北贯穿瑶海区与新站区，南端发起于北一环，北至合肥绕城高速入口，是新站区的主要景观轴线，沿途京东方、合肥综合保税区、家海工业园等著名高新企业，是新站区南北向连通的重要交通通道。同时项目周边双七路（北二环）、物流大道、临泉路更是近在咫尺，形成了通达性非常好的交通网，无论是到市府广场、还是合肥火车站、淮河路步行街、长江路银泰百货核心商圈开车都大约20多分钟。', 4631, 115, '2017', '201708');
