INSERT INTO `house` VALUES (17729, 0, 0, '2021-05-26 15:51:36', 0, '2021-05-26 16:31:25', 201705056, '紫悦府', '3#,7#', ' 17995.74  ', 184, 14798, '大众路以西 浍水路以北', '新站区', '住宅', '高层洋房', '安徽华地融泰房地产有限公司', '安徽省建筑设计研究院有限责任公司', '安徽华地物业管理服务有限公司', '购物：拓基百大，瑶海万达，磨店美食一条街，黉街。 社区内配套：全龄综合活动场地，阳光草坪，幼儿园，彩色沥青跑道，健身设施。 肉菜市场：磨店农贸市场 学校：自建幼儿园，规划小学，规划中学（烈山路西）、磨店初级中学，庆平希望学校，合肥九中。 公园配套：学林公园：公园规划面积约为1633.95亩，公园将依托原有的地形结构来规划公园的景观设计，公园还将建设合肥首个天文爱好者的户外营地。 金融机构：中国建设银行，肥东农村商业银行，中国邮政储蓄银行 药店：远帆大药房，行天下大药房 医院：合肥广慈医院，安医大四附院（在建） ', '交通：301,303,304（安徽粮食学院站），40（刘大郢站）T3路（合肥经贸旅游学校站），T6（合肥工业学校站） 地铁：在建：地铁3号线职教城站：规划：地铁9号线（沿大众路）', 4467, 120, '2017', '201705');
INSERT INTO `house` VALUES (17730, 0, 0, '2021-05-26 15:51:36', 0, '2021-05-26 16:31:26', 201705040, '时代观邸', '8,10', ' 24015.60  ', 174, 24029, '滨湖新区庐州大道以东、南京路以北', '滨湖区', '住宅', '高层、小高层、多层', '合肥万科瑞益地产地产有限公司', '安徽地平线建筑设计事务所有限公司', '上海万科物业服务有限公司 ', '\" 项目紧邻新省政府办公区，周边配套完善醇熟。 购物、休闲、娱乐：项目西边就是滨湖商业成熟的启动区，拥有约40万方的世纪金源购物中心和五星级酒店，商业氛围浓厚，满足购物、休闲、娱乐需求。 医疗：项目西边三级甲等滨湖医院，技术先进，设备齐全。 学校：项目西南方向合肥一中，是省重点中学，师资力量雄厚，教学质量一流。 景观环境：项目南边840万方塘西河公园、金斗公园，环境优美，是滨湖的天然氧吧。\" ', '\"地铁1号线： 项目地处地铁1号线沿线，并且在项目西北角设有滨湖会展中心站点，此站点是地铁1号线连接老城区与滨湖新区的第一站。 三纵四横交通网： 项目拥有四通八达的交通网络，纵向可通过南北向的徽州大道、庐州大道和包河大道快速到达老城区，横向通过东西向的锦绣大道、紫云路和方兴大道快速到达经开区。 纵向的庐州大道，后期将全线贯通，直接连接主城区，方兴大道更是一条双向十二车道，具有老城区无法比拟的道路畅通优势。\" ', 4460, 120, '2017', '201705');
