INSERT INTO `house` VALUES (17752, 0, 0, '2021-05-26 15:51:38', 0, '2021-05-26 16:31:37', 201704045, '国贸天悦花园', '3#', ' 11832.44  ', 98, 16157, '合肥市包河区宿松路南门换乘中心正对面', '包河区', '普通住宅、商办', '高层、花园洋房', '合肥天同地产有限公司', '中国中建设计集团有限公司', '合肥居安物业管理有限公司', '高铁商圈，围绕铁路枢纽开发，汇聚安徽最大的高铁首席综合体绿地中心、美生中央广场、加侨国际广场等大型商住综合体；南七商圈，聚集曙光商厦、百大商业广场、北京华联等大型百货商超；政务商圈，坐拥天鹅湖万达商业广场、华润万象城、新地中心等顶级商业中心', '1路、117路、150路、41路、43路、126路、163路等公交车至南门换乘中心站下 地铁：地铁4号线站点祁门路与宿松路交口，地铁1号、4号、5号线交汇站点汽车南站；', 4387, 122, '2017', '201704');
