INSERT INTO `house` VALUES (17775, 0, 0, '2021-05-26 15:51:40', 0, '2021-05-26 16:31:48', 201703050, '万锦花园', 'B06,B07', ' 8988.73  ', 48, 20998, '宿松路与龙川路交口', '包河区', '住宅', '高层、多层', '中海宏洋海富（合肥）房地产开发有限公司', '南京长江都市建筑设计股份有限公司', '中海宏洋物业管理有限公司合肥分公司', '项目毗邻政务区，位于高铁板块核心板块，东侧自建约2万方的商业，周边拥有万象城、新地中心、绿地中心等众多大型商业综合体项目，北侧为十五里河以及代建的约3.5万平方米的城市公园，环境优美。', '项目周边南北走向的有宿松路、金寨路和徽州大道3条合肥城市主干道,东西走向的有龙川路、祁门路、南二环、绕城高速等主干道，方便到达市区各个地方和新桥机场。同时项目东侧为汽车南站和高铁南站，可以快速通达省内外众多城市。项目北面祁门路规划有地铁4号线，在宿松路与祁门路交口规划设有宿松路站，同时规划地铁1、4、5号线交汇于高铁南站。', 4290, 124, '2017', '201703');
INSERT INTO `house` VALUES (17776, 0, 0, '2021-05-26 15:51:40', 0, '2021-05-26 16:31:49', 201703048, '金港湾公馆', '7#,8#,72#', ' 31833.42  ', 276, 15351, '长宁大道与彩虹路交口西南角', '高新区', '住宅、商业', '高层、洋房', '合肥蜀西祥源房地产开发有限公司', '安徽安德建筑设计有限公司', '合肥祥源物业管理有限公司', '项目自建幼儿园，奥特莱斯商业广场已开业。', '项目位于合肥市高新区，东自长宁大道，西至天堂寨路，南起佛岭寨路，北邻南岗镇南岗村用地。', 4351, 124, '2017', '201703');
INSERT INTO `house` VALUES (17777, 0, 0, '2021-05-26 15:51:40', 0, '2021-05-26 16:31:49', 201703043, '时代观邸', '26,31', ' 5410.10  ', 28, 25303, '滨湖新区庐州大道以东、南京路以北', '滨湖区', '住宅', '高层、小高层、多层', '合肥万科瑞益地产地产有限公司', '安徽地平线建筑设计事务所有限公司', '上海万科物业服务有限公司 ', '\" 项目紧邻新省政府办公区，周边配套完善醇熟。 购物、休闲、娱乐：项目西边就是滨湖商业成熟的启动区，拥有约40万方的世纪金源购物中心和五星级酒店，商业氛围浓厚，满足购物、休闲、娱乐需求。 医疗：项目西边三级甲等滨湖医院，技术先进，设备齐全。 学校：项目西南方向合肥一中，是省重点中学，师资力量雄厚，教学质量一流。 景观环境：项目南边840万方塘西河公园、金斗公园，环境优美，是滨湖的天然氧吧。\" ', '\"地铁1号线： 项目地处地铁1号线沿线，并且在项目西北角设有滨湖会展中心站点，此站点是地铁1号线连接老城区与滨湖新区的第一站。 三纵四横交通网： 项目拥有四通八达的交通网络，纵向可通过南北向的徽州大道、庐州大道和包河大道快速到达老城区，横向通过东西向的锦绣大道、紫云路和方兴大道快速到达经开区。 纵向的庐州大道，后期将全线贯通，直接连接主城区，方兴大道更是一条双向十二车道，具有老城区无法比拟的道路畅通优势。\" ', 4315, 124, '2017', '201703');
