INSERT INTO `house` VALUES (17819, 0, 0, '2021-05-26 15:51:46', 0, '2021-05-26 16:32:11', 201701072, '金色湖畔小区', '3', ' 12095.32  ', 116, 15900, '蜀山区科学院路与樊洼路交口', '蜀山区', '住宅', '高层', '合肥凯泰置业有限公司', '合肥工业大学建筑设计研究院', '安徽恒德物业管理有限责任公司', '项目周边有蜀山园幼儿园，蜀山小学，蜀山中学，合肥剑桥学校等教育配套。生活配套有永达家具城，合肥市第一人民医院，大浦头农贸市场，银行。南边靠近大蜀山，北面正对董铺水库，西边有四季花海城市公园，植物园，国家森林公园等。环境舒适，生活便利。周边小区有山湖新村，蜀秀苑。', '交通十分便捷，出行方便，周边有西二环路、长江西路、玉兰大道等主干道，3路，20路，903路，605,156,56等公交车。', 4166, 129, '2017', '201701');
INSERT INTO `house` VALUES (17820, 0, 0, '2021-05-26 15:51:46', 0, '2021-05-26 16:32:12', 201701048, '凌湖花园', '7,14,20', ' 35282.96  ', 320, 13140, '蒙城北路与凌湖路交口', '庐阳区', '高层、洋房', '住宅', '安徽皖投置业有限责任公司', '北京维拓时代建筑设计有限公司 ', '安徽省外滩物业有限公司', '学校：六安路小学、南门小学、四十五中；商场：华孚城隍庙商业广场、银瑞林国际大酒店、自带农贸市场、风情商业街、永辉超市、世纪华联、好又多超市、；医院：省立医院北区、城建医院、铁路医院、中铁四局医院银行：中国工商银行（蒙城北路支行）、中国邮政储蓄银行（华府城隍庙支行）、中国农业银行（城北支行） ', '510 路、4 路、232 路、5 路、45 路、503 路', 4221, 129, '2017', '201701');
INSERT INTO `house` VALUES (17821, 0, 0, '2021-05-26 15:51:46', 0, '2021-05-26 16:32:13', 201701045, '豪门金地', '58', ' 13210.15  ', 108, 21999, '西藏路与南宁路交口', '滨湖区', '住宅', '高层、洋房、其他住宅', '安徽省文一投资控股集团滨城置业有限公司', '北京高能筑博建筑设计有限公司', '安徽省文一物业管理有限公司', '项目与国际金融后台服务基地一路之隔，工农建中四大行及数家知名金融机构总部（中国人民银行、中国银行、工商银行、建设银行、农业银行、交通银行、邮储银行、徽商银行、浦发银行等）和综合基地及安徽省银行监督管理局落户合肥滨湖新区，与项目咫尺相邻。 繁华商圈：距离繁华世纪金源购物商圈仅10余分钟车程，高速时代广场、银泰城、亚洲最大的8万方中心书城、以及万达文旅城（世界首创第四代恒温水世界—万达水乐园、电影科技乐园，万达宝贝王等）均距离项目较近； 景观资源：滨湖的巢湖湿地公园，将打造 80 万平方米的“人造湿地”、“塘西河公园”、“金斗公园”和“方兴湖公园”等一系列生态项目，带来约 840 万平方米的新生绿化。项目旁边还占有“8万平米城市体育公园”、云川公园景观资源配套； 学区配套：项目周边学区密集，46中南校区、示范附小四小、世纪阳光中学四川路校区、示范附小三小贵阳路校区等', '项目交通状况：可以用”四纵四横一环二轨道“来概括。“四纵”，指的是徽州大道、庐州大道、包河大道和宿松路。宿松路连接方兴大道，直通市区百脑汇；经徽州大道的快速公交 5 分钟即可到达巢湖，10 分钟即可到达高铁南站，15 分钟即可到达合肥老城区。”四横“分别是锦绣大道、紫云路、方兴大道、云谷路。四条横向干道从北向南依次排布，将滨湖新区和经开区相连，西接金寨路高架，东接包河大道高架，构成立体交通网络，其中通过方兴大道和京台高速互通立交桥 30 分钟就可以到达新桥机场。”一环“指环巢湖景观大道，2014年环巢湖景观大道全线通车，全长约155公里，从巢湖东岸的巢湖市区湖光路起，至滨湖新区，可以自行驾车观光环巢湖生态风景，同时实现肥东和滨湖新区实现“无缝连接”。“二轨道”指的是，地铁1号线、5号线，地铁1号线于今年底投入使用，是南北方向的主干线，起点是天水路站和徽州大道站，离我们最近的地铁站口南宁路站距离项目不到1公里，今年年底就通车了，可直达新建的高铁南站和老火车站，后期出差旅行非常便捷。沿云谷路建设的地铁 5 号线，围绕着我们豪门金周边地建设的有三个站点，分别是四川路站、成都路站和云南路站，其中四川路站距离我们项目仅500米左右，后期您的出行也将变得十分方便。', 4210, 129, '2017', '201701');
INSERT INTO `house` VALUES (17822, 0, 0, '2021-05-26 15:51:46', 0, '2021-05-26 16:32:13', 201701049, '御晖花园', 'G6#,G7#,G12#', ' 31150.71  ', 211, 22000, '汤泉路与宏村路交口', '包河区', '住宅', '高层住宅', '绿地集团合肥鑫峰置业有限公司', '安徽地平线建筑设计有限公司', '长城物业集团股份有限公司', '金融：合肥科技农村商业银行(望江路支行)、徽商银行(合肥南七支行)、兴业银行、徽商银行(合肥合作化路支行)、中国农业发展银行(金寨路支行) 医院：合肥市第三人民医院、合肥市第三人民医院南区、江淮汽车集团医院、安徽建筑大学北校区校医院、仁爱医院儿科、中国科学技术大学医院，老人、孩子体检更便捷。 学校：小森林琥珀幼儿园、竹苑小区幼儿园、合肥市包河区琥珀新天地幼儿园、东流路小学、合肥市第六十一中学(南区)、合肥市第六十一中学、小森林紫竹苑幼儿园 休闲：绿芒果KTV、合肥一页量贩KTV、维果自助式KTV(南七店)、伊人宫国际会所、豪情会所(望江东路)、今晚10点俱乐部、大众健身练歌厅、欢乐坊量贩式KTV(望江东路)、合肥一页量贩KTV、8分贝量贩式KTV 卖场：与80万方商业综合体绿地中心一路之隔，世界级都会资源配套。缤纷荟，最前沿时尚的shopping mall；春台街，最具特色的徽派文化街区；半生缘，中国城市小文艺街区典范。 公园广场：市政公园比邻而居，绿地·御徽在寸土寸金中心稀贵之地，独辟万方中央公园，梧桐大道、百转回庭、林荫十区，身心栖息地。', '公交路线：135、16、152路到张小郢下 距离高铁南站2.3km,金寨路高架、马鞍山路高架近在咫尺。城市三环方兴大道的开通，南二环迎来极致风景线。', 4227, 129, '2017', '201701');
