INSERT INTO `house` VALUES (17828, 0, 0, '2021-05-26 15:51:46', 0, '2021-05-26 16:32:17', 201701009, '时代观邸', '25', ' 3095.12  ', 16, 25303, '滨湖新区庐州大道以东、南京路以北', '滨湖区', '住宅', '高层、小高层、多层', '合肥万科瑞益地产地产有限公司', '安徽地平线建筑设计事务所有限公司', '上海万科物业服务有限公司 ', '\" 项目紧邻新省政府办公区，周边配套完善醇熟。 购物、休闲、娱乐：项目西边就是滨湖商业成熟的启动区，拥有约40万方的世纪金源购物中心和五星级酒店，商业氛围浓厚，满足购物、休闲、娱乐需求。 医疗：项目西边三级甲等滨湖医院，技术先进，设备齐全。 学校：项目西南方向合肥一中，是省重点中学，师资力量雄厚，教学质量一流。 景观环境：项目南边840万方塘西河公园、金斗公园，环境优美，是滨湖的天然氧吧。\" ', '\"地铁1号线： 项目地处地铁1号线沿线，并且在项目西北角设有滨湖会展中心站点，此站点是地铁1号线连接老城区与滨湖新区的第一站。 三纵四横交通网： 项目拥有四通八达的交通网络，纵向可通过南北向的徽州大道、庐州大道和包河大道快速到达老城区，横向通过东西向的锦绣大道、紫云路和方兴大道快速到达经开区。 纵向的庐州大道，后期将全线贯通，直接连接主城区，方兴大道更是一条双向十二车道，具有老城区无法比拟的道路畅通优势。\" ', 4187, 129, '2017', '201701');
INSERT INTO `house` VALUES (17829, 0, 0, '2021-05-26 15:51:47', 0, '2021-05-26 16:32:17', 201701010, '沈塘花园', '1#,2#', ' 9616.77  ', 89, 7500, '经济区高刘社区银杏路与怡园路交口', '经开区', '小高层，多层住宅，商业', '框架结构', '合肥德润置业有限公司', '杭州华茗设计集团有限公司', '肥西鸿海物业管理有限公司', '小区周围具有完善的配套，半径1000米内即可满足生活所需。政府配套及公共设施齐全。汽车站。大卖场，满足您的日常所需。 高刘镇政府 高刘卫生院 邮局 邮政储蓄 农贸市场 等等相关配套也是一应俱全，基本上汇集于本项目周边交汇处，步行10分钟即可到达。', '项目地处合肥市经济技术开发区高刘镇怡园路北街。周围汇聚了机场高速，合六叶高速，新桥大道等城市主干道，团肥路往南可到达新桥大道，可以很方便的到达合肥主城区及肥西，团肥路往东10分钟就可以到新桥国际机场，新建成的机场高速与市区方兴大道与长江西路快速结。', 4088, 130, '2017', '201701');
INSERT INTO `house` VALUES (17830, 0, 0, '2021-05-26 15:51:47', 0, '2021-05-26 16:32:17', 201701011, '金港湾公馆', '13#,16#', ' 28859.16  ', 264, 15199, '长宁大道与彩虹路交口西南角', '高新区', '住宅、商业', '高层、洋房', '合肥蜀西祥源房地产开发有限公司', '安徽安德建筑设计有限公司', '合肥祥源物业管理有限公司', '项目自建幼儿园，奥特莱斯商业广场已开业。', '项目位于合肥市高新区，东自长宁大道，西至天堂寨路，南起佛岭寨路，北邻南岗镇南岗村用地。', 4186, 130, '2017', '201701');
