INSERT INTO `house` VALUES (17866, 0, 0, '2021-05-26 15:51:51', 0, '2021-05-26 16:32:37', 201611043, '佳源都市小区', '20幢', ' 15239.82  ', 136, 17800, '合肥市滨湖区长沙路与洞庭湖路交口西南', '滨湖区', '住宅、商业', '高层、其他住宅', '浙江佳源安徽房地产开发有限公司', '上海华东建设发展设计有限公司', '浙江佳源物业管理有限公司合肥分公司', '项目周边有洞庭湖路小学、中山路中学、寿春中学等优质教育资源；塘西河公园位于小区南侧；另小区内配备10万方购物中心。', '佳源都市小区纵向通过徽州大道、庐州大道、包河大道可与老城区对接；横向通过紫云路、方兴大道、锦绣大道与经开区连接；公交线路有26路、60路等；轨道交通1号线塘西河站位于项目13号地块。', 4040, 133, '2016', '201611');
INSERT INTO `house` VALUES (17867, 0, 0, '2021-05-26 15:51:51', 0, '2021-05-26 16:32:37', 201611044, '佳源都市小区', '19幢', ' 24938.32  ', 238, 17800, '合肥市滨湖区长沙路与洞庭湖路交口西南', '滨湖区', '住宅、商业', '高层、其他住宅', '浙江佳源安徽房地产开发有限公司', '上海华东建设发展设计有限公司', '浙江佳源物业管理有限公司合肥分公司', '项目周边有洞庭湖路小学、中山路中学、寿春中学等优质教育资源；塘西河公园位于小区南侧；另小区内配备10万方购物中心。', '佳源都市小区纵向通过徽州大道、庐州大道、包河大道可与老城区对接；横向通过紫云路、方兴大道、锦绣大道与经开区连接；公交线路有26路、60路等；轨道交通1号线塘西河站位于项目13号地块。', 4045, 133, '2016', '201611');
INSERT INTO `house` VALUES (17868, 0, 0, '2021-05-26 15:51:51', 0, '2021-05-26 16:33:08', 201611041, '时代观邸', '28,30', ' 4483.86  ', 24, 25304, '滨湖新区庐州大道以东、南京路以北', '滨湖区', '住宅', '高层、小高层、多层', '合肥万科瑞益地产地产有限公司', '安徽地平线建筑设计事务所有限公司', '上海万科物业服务有限公司 ', '\" 项目紧邻新省政府办公区，周边配套完善醇熟。 购物、休闲、娱乐：项目西边就是滨湖商业成熟的启动区，拥有约40万方的世纪金源购物中心和五星级酒店，商业氛围浓厚，满足购物、休闲、娱乐需求。 医疗：项目西边三级甲等滨湖医院，技术先进，设备齐全。 学校：项目西南方向合肥一中，是省重点中学，师资力量雄厚，教学质量一流。 景观环境：项目南边840万方塘西河公园、金斗公园，环境优美，是滨湖的天然氧吧。\" ', '\"地铁1号线： 项目地处地铁1号线沿线，并且在项目西北角设有滨湖会展中心站点，此站点是地铁1号线连接老城区与滨湖新区的第一站。 三纵四横交通网： 项目拥有四通八达的交通网络，纵向可通过南北向的徽州大道、庐州大道和包河大道快速到达老城区，横向通过东西向的锦绣大道、紫云路和方兴大道快速到达经开区。 纵向的庐州大道，后期将全线贯通，直接连接主城区，方兴大道更是一条双向十二车道，具有老城区无法比拟的道路畅通优势。\" ', 4076, 133, '2016', '201611');
INSERT INTO `house` VALUES (17869, 0, 0, '2021-05-26 15:51:53', 0, '2021-05-26 16:33:08', 201611042, '城市公馆', 'B-28,B-29', ' 3381.11  ', 11, 27327, '合肥市庐阳区一环路与四里河路交口', '庐阳区', '高层、洋房、别墅、商办', '钢筋混凝土', '合肥万科金湾地产有限公司', '上海日清设计院', '上海万科物业服务有限公司合肥分公司', '项目位于市中心一环边，大润发、北一环欢乐颂、乐购和三里庵国购广场、之心城近在咫尺。学区是小区自建幼儿园、南门小学森林城校区、四十五中森林城校区。小区商业部分与规划3号线（四里河站）相连，交通极其方便。', '53路、13路、12路、59路、124路、131路、143路、233路、22路、17路、59路、232路、705路东线、705路西线公交车；地铁规划建设3号线（四里河站）。', 4054, 134, '2016', '201611');
