INSERT INTO `house` VALUES (17915, 0, 0, '2021-05-26 15:51:56', 0, '2021-05-26 16:33:31', 201609088, '南七花园', 'A1,A2,A5', ' 39480.81  ', 348, 19599, '合肥市蜀山区金寨路与望江路交口西南角A02地块', '蜀山区', '高层 洋房', '钢筋混凝土', '金隅房地产开发合肥有限公司', 'DC国际；安徽地平线建筑设计有限公司', '绿城物业服务集团有限公司', '安粮城市广场、华润五彩城、西湖国际广场、百大集团商业大厦 项目自建的小学、幼儿园 ', '705路东线,1路,126路,166路,901路,701路,148路,120路,134路,145路,33路,124路,19路,16路,111路,8路至南七里站；地铁5号线、地铁6号线', 3960, 138, '2016', '201609');
INSERT INTO `house` VALUES (17916, 0, 0, '2021-05-26 15:51:56', 0, '2021-05-26 16:33:32', 201609085, '罗兰春天小区', 'B11,B12', ' 7447.92  ', 64, 14999, '瑶海区包公大道南、大众路西', '瑶海区', '住宅、商业', '高层住宅、洋房', '合肥保利和众房地产有限公司', '中外建工程设计与顾问有限公司', '保利物业管理有限公司', '项目自建约9000平米社区商业保障小区业主日常生活需求，自建约2800平米的幼儿园让业主小孩在家门口即能接受学前教育，项目南侧规划了教育用地，未来将打造一所具有现代化水平的小学。项目南侧油坊新城还规划有大型的农贸市场和社区卫生服务站，大众路眼线规划有游园景观，向西南约2.5公里为瑞泰公园，向西约4公里为新海公园，向西约5公里为生态公园，向西约7公里为瑶海公园，周边生态环境较为优越。此外，项目还临近正在建设的保利广场以及瑶海万达广场，未来业主购物消费十分便捷。', '项目位于瑶海区、新站区和肥东县城三区交汇处，地处包公大道和大众路交口，均为城市主干道，其中包公大道为城市快速干道，40路公交车从项目经过。临近轨道交通2号线站点以及未来地铁6号线延长线，距合肥汽车站和火车站仅10分钟车程，交通十分便利。', 3943, 138, '2016', '201609');
INSERT INTO `house` VALUES (17917, 0, 0, '2021-05-26 15:51:56', 0, '2021-05-26 16:33:33', 201609084, '力高·君御世家', '15,17', ' 24711.21  ', 272, 10499, '新站区天水路与凤山路交口', '新站区', '一级', '剪力墙', '合肥力高宏业地产开发有限公司', '安徽地平线建筑设计事务所有限公司', '江西恒丰行物业服务有限公司', '学校、医院、银行、商业中心、公园、菜场等生活配套设施齐全', '力高·君御世家距离火车站仅4公里之遥，进可直通绕城高速，出则联通南北、呼应东西，交通路网阡陌覆盖，15分钟生活圈可覆盖庐阳区、新站区、瑶海区三大醇熟版块，多条公交线路覆盖，真正实现了三维立体便捷出行方式，使得每一位居住于此的业主都能乐享生活情趣，成就家门口最优越的安心保障。', 3878, 138, '2016', '201609');
