INSERT INTO `house` VALUES (17924, 0, 0, '2021-05-26 15:51:58', 0, '2021-05-26 16:34:06', 201609077, '鼎元别院', '蘭宫7幢', ' 1373.08  ', 4, 21064, '蜀山区植物园路9号', '蜀山区', '住宅', '高层住宅及其他住宅', '合肥拓基房地产开发有限责任公司', '深圳大学建筑设计研究院', '合肥拓基物业管理有限责任公司', '项目周边商业配套日趋成熟，紧临项目的有上海华联金色池塘店，上海华联超市，福乐门广场、乐购，步行10分钟可达蜀山区的黄金地段—长江西路西区商圈中心，鼓楼商厦高新店，合家福高新店。', '多路公交线路可直达项目或项目周边，其中步行5分钟可直达城市主干道西二环，15分钟可达规划中的城市森林公园；驾车5分钟可快速融入城市动脉长江西路高架；8分钟可达三里庵国购商圈，10分钟可达三孝口主城区；5分钟可达百大高新区鼓楼、合家福商圈；8分钟可达政务区核心区，15分钟可达经开区。项目途经经开区直达滨湖新区仅30分钟，西二环至北二环到达合肥新火车站仅20分钟。', 3940, 139, '2016', '201609');
INSERT INTO `house` VALUES (17925, 0, 0, '2021-05-26 15:51:58', 0, '2021-05-26 16:34:07', 201609076, '祥源城', 'L5', ' 1868.91  ', 5, 24506, '合肥市高新区创新大道与望江西路交口西北角', '高新区', '高层，别墅，商业', '框架', '安徽新祥源房地产开发有限公司', '广东建筑艺术设计院', '祥源物业', '项目东边邻近高新区管委会。 项目周边生活配套：北部安医附院高新分院已动工建设，西边七中——合肥省示范高中之一即将整体搬迁，、奥特莱斯等也将落户项目周边，西客站、新桥机场、高速口也分布项目周边，另外有中科大研究院、合肥中加（国际）学校等。', '项目位于合肥市高新区，北边为云飞路（原潜水东路），东边为创新大道，西边为石莲南路，南边为望江西路。公交情况：665，651路公交车。 在项目的北面约1200米处，轨道二号线即将开工，未来轨道交通4号线、7号线也将于项目周边交汇。', 3935, 139, '2016', '201609');
INSERT INTO `house` VALUES (17926, 0, 0, '2021-05-26 15:51:58', 0, '2021-05-26 16:34:07', 201609078, '佳源都市小区', '17幢', ' 13586.68  ', 124, 17800, '合肥市滨湖区长沙路与洞庭湖路交口西南', '滨湖区', '住宅、商业', '高层、其他住宅', '浙江佳源安徽房地产开发有限公司', '上海华东建设发展设计有限公司', '浙江佳源物业管理有限公司合肥分公司', '项目周边有洞庭湖路小学、中山路中学、寿春中学等优质教育资源；塘西河公园位于小区南侧；另小区内配备10万方购物中心。', '佳源都市小区纵向通过徽州大道、庐州大道、包河大道可与老城区对接；横向通过紫云路、方兴大道、锦绣大道与经开区连接；公交线路有26路、60路等；轨道交通1号线塘西河站位于项目13号地块。', 3938, 139, '2016', '201609');
INSERT INTO `house` VALUES (17927, 0, 0, '2021-05-26 15:51:58', 0, '2021-05-26 16:34:08', 201609062, '雍锦花园', '18,19,20,34', ' 3592.64  ', 8, 29999, '高新区长宁大道与彩虹路交口', '高新区', '高层、洋房、别墅', '高层', '合肥蓝光房地产开发有限公司', '安徽寰宇建筑设计院', '四川嘉宝资产管理集团股份有限公司合肥分公司', '醇熟配套、优质教育：祥源商业中心、砂之船艺术中心等各大商圈环绕；永和小学、合肥第七中学、中加国际学校等优质学府；', '交通便利，公交线路汇集于此651、快4等；地铁2号线4号线7号线黄金交汇点', 3920, 139, '2016', '201609');
INSERT INTO `house` VALUES (17928, 0, 0, '2021-05-26 15:51:58', 0, '2021-05-26 16:34:08', 201609056, '豪门金地', '2,3,5,8,9,13', ' 19969.44  ', 138, 24008, '西藏路与南宁路交口', '滨湖区', '住宅', '高层、洋房、其他住宅', '安徽省文一投资控股集团滨城置业有限公司', '北京高能筑博建筑设计有限公司', '安徽省文一物业管理有限公司', '项目与国际金融后台服务基地一路之隔，工农建中四大行及数家知名金融机构总部（中国人民银行、中国银行、工商银行、建设银行、农业银行、交通银行、邮储银行、徽商银行、浦发银行等）和综合基地及安徽省银行监督管理局落户合肥滨湖新区，与项目咫尺相邻。 繁华商圈：距离繁华世纪金源购物商圈仅10余分钟车程，高速时代广场、银泰城、亚洲最大的8万方中心书城、以及万达文旅城（世界首创第四代恒温水世界—万达水乐园、电影科技乐园，万达宝贝王等）均距离项目较近； 景观资源：滨湖的巢湖湿地公园，将打造 80 万平方米的“人造湿地”、“塘西河公园”、“金斗公园”和“方兴湖公园”等一系列生态项目，带来约 840 万平方米的新生绿化。项目旁边还占有“8万平米城市体育公园”、云川公园景观资源配套； 学区配套：项目周边学区密集，46中南校区、示范附小四小、世纪阳光中学四川路校区、示范附小三小贵阳路校区等', '项目交通状况：可以用”四纵四横一环二轨道“来概括。“四纵”，指的是徽州大道、庐州大道、包河大道和宿松路。宿松路连接方兴大道，直通市区百脑汇；经徽州大道的快速公交 5 分钟即可到达巢湖，10 分钟即可到达高铁南站，15 分钟即可到达合肥老城区。”四横“分别是锦绣大道、紫云路、方兴大道、云谷路。四条横向干道从北向南依次排布，将滨湖新区和经开区相连，西接金寨路高架，东接包河大道高架，构成立体交通网络，其中通过方兴大道和京台高速互通立交桥 30 分钟就可以到达新桥机场。”一环“指环巢湖景观大道，2014年环巢湖景观大道全线通车，全长约155公里，从巢湖东岸的巢湖市区湖光路起，至滨湖新区，可以自行驾车观光环巢湖生态风景，同时实现肥东和滨湖新区实现“无缝连接”。“二轨道”指的是，地铁1号线、5号线，地铁1号线于今年底投入使用，是南北方向的主干线，起点是天水路站和徽州大道站，离我们最近的地铁站口南宁路站距离项目不到1公里，今年年底就通车了，可直达新建的高铁南站和老火车站，后期出差旅行非常便捷。沿云谷路建设的地铁 5 号线，围绕着我们豪门金周边地建设的有三个站点，分别是四川路站、成都路站和云南路站，其中四川路站距离我们项目仅500米左右，后期您的出行也将变得十分方便。', 3922, 139, '2016', '201609');
