INSERT INTO `house` VALUES (17938, 0, 0, '2021-05-26 15:51:59', 0, '2021-05-26 16:34:13', 201609051, '鼎元别院', '蘭宫8幢,蘭宫9幢', ' 2623.64  ', 8, 21025, '蜀山区植物园路9号', '蜀山区', '住宅', '高层住宅及其他住宅', '合肥拓基房地产开发有限责任公司', '深圳大学建筑设计研究院', '合肥拓基物业管理有限责任公司', '项目周边商业配套日趋成熟，紧临项目的有上海华联金色池塘店，上海华联超市，福乐门广场、乐购，步行10分钟可达蜀山区的黄金地段—长江西路西区商圈中心，鼓楼商厦高新店，合家福高新店。', '多路公交线路可直达项目或项目周边，其中步行5分钟可直达城市主干道西二环，15分钟可达规划中的城市森林公园；驾车5分钟可快速融入城市动脉长江西路高架；8分钟可达三里庵国购商圈，10分钟可达三孝口主城区；5分钟可达百大高新区鼓楼、合家福商圈；8分钟可达政务区核心区，15分钟可达经开区。项目途经经开区直达滨湖新区仅30分钟，西二环至北二环到达合肥新火车站仅20分钟。', 3890, 140, '2016', '201609');
