INSERT INTO `house` VALUES (18003, 0, 0, '2021-05-26 15:52:07', 0, '2021-05-26 16:34:46', 201607053, '罗兰春天小区', 'B6', ' 3725.04  ', 32, 14005, '瑶海区包公大道南、大众路西', '瑶海区', '住宅、商业', '高层住宅、洋房', '合肥保利和众房地产有限公司', '中外建工程设计与顾问有限公司', '保利物业管理有限公司', '项目自建约9000平米社区商业保障小区业主日常生活需求，自建约2800平米的幼儿园让业主小孩在家门口即能接受学前教育，项目南侧规划了教育用地，未来将打造一所具有现代化水平的小学。项目南侧油坊新城还规划有大型的农贸市场和社区卫生服务站，大众路眼线规划有游园景观，向西南约2.5公里为瑞泰公园，向西约4公里为新海公园，向西约5公里为生态公园，向西约7公里为瑶海公园，周边生态环境较为优越。此外，项目还临近正在建设的保利广场以及瑶海万达广场，未来业主购物消费十分便捷。', '项目位于瑶海区、新站区和肥东县城三区交汇处，地处包公大道和大众路交口，均为城市主干道，其中包公大道为城市快速干道，40路公交车从项目经过。临近轨道交通2号线站点以及未来地铁6号线延长线，距合肥汽车站和火车站仅10分钟车程，交通十分便利。', 3745, 147, '2016', '201607');
