INSERT INTO `house` VALUES (18014, 0, 0, '2021-05-26 15:52:08', 0, '2021-05-26 16:34:50', 201607037, '城市公馆', 'B-7', ' 12441.15  ', 108, 18999, '合肥市庐阳区一环路与四里河路交口', '庐阳区', '高层、洋房、别墅、商办', '钢筋混凝土', '合肥万科金湾地产有限公司', '上海日清设计院', '上海万科物业服务有限公司合肥分公司', '项目位于市中心一环边，大润发、北一环欢乐颂、乐购和三里庵国购广场、之心城近在咫尺。学区是小区自建幼儿园、南门小学森林城校区、四十五中森林城校区。小区商业部分与规划3号线（四里河站）相连，交通极其方便。', '53路、13路、12路、59路、124路、131路、143路、233路、22路、17路、59路、232路、705路东线、705路西线公交车；地铁规划建设3号线（四里河站）。', 3658, 148, '2016', '201607');
INSERT INTO `house` VALUES (18015, 0, 0, '2021-05-26 15:52:08', 0, '2021-05-26 16:34:51', 201607036, '时代观邸', '1,2', ' 29393.91  ', 263, 18999, '滨湖新区庐州大道以东、南京路以北', '滨湖区', '住宅', '高层、小高层、多层', '合肥万科瑞益地产地产有限公司', '安徽地平线建筑设计事务所有限公司', '上海万科物业服务有限公司 ', '\" 项目紧邻新省政府办公区，周边配套完善醇熟。 购物、休闲、娱乐：项目西边就是滨湖商业成熟的启动区，拥有约40万方的世纪金源购物中心和五星级酒店，商业氛围浓厚，满足购物、休闲、娱乐需求。 医疗：项目西边三级甲等滨湖医院，技术先进，设备齐全。 学校：项目西南方向合肥一中，是省重点中学，师资力量雄厚，教学质量一流。 景观环境：项目南边840万方塘西河公园、金斗公园，环境优美，是滨湖的天然氧吧。\" ', '\"地铁1号线： 项目地处地铁1号线沿线，并且在项目西北角设有滨湖会展中心站点，此站点是地铁1号线连接老城区与滨湖新区的第一站。 三纵四横交通网： 项目拥有四通八达的交通网络，纵向可通过南北向的徽州大道、庐州大道和包河大道快速到达老城区，横向通过东西向的锦绣大道、紫云路和方兴大道快速到达经开区。 纵向的庐州大道，后期将全线贯通，直接连接主城区，方兴大道更是一条双向十二车道，具有老城区无法比拟的道路畅通优势。\" ', 3716, 148, '2016', '201607');
INSERT INTO `house` VALUES (18016, 0, 0, '2021-05-26 15:52:08', 0, '2021-05-26 16:34:51', 201607035, '祥源城', 'L12', ' 2300.66  ', 6, 18421, '合肥市高新区创新大道与望江西路交口西北角', '高新区', '高层，别墅，商业', '框架', '安徽新祥源房地产开发有限公司', '广东建筑艺术设计院', '祥源物业', '项目东边邻近高新区管委会。 项目周边生活配套：北部安医附院高新分院已动工建设，西边七中——合肥省示范高中之一即将整体搬迁，、奥特莱斯等也将落户项目周边，西客站、新桥机场、高速口也分布项目周边，另外有中科大研究院、合肥中加（国际）学校等。', '项目位于合肥市高新区，北边为云飞路（原潜水东路），东边为创新大道，西边为石莲南路，南边为望江西路。公交情况：665，651路公交车。 在项目的北面约1200米处，轨道二号线即将开工，未来轨道交通4号线、7号线也将于项目周边交汇。', 3726, 148, '2016', '201607');
