INSERT INTO `house` VALUES (18127, 0, 0, '2021-05-26 15:52:20', 0, '2021-05-26 16:35:48', 201604023, '学府里', '9#', ' 3340.37  ', 64, 15499, '高新区方兴大道与云飞路交口', '高新区', '住宅、商业', '多层、小高层', '安徽省文一投资控股集团高新置业有限公司', '安徽地平线建筑设计有限公司', '安徽省文一物业管理有限公司', '我们项目东紧邻砂之船（合肥）奥特莱斯艺术商业街，总建筑面积约32万方超大创新式商业复合体，汇集奥特莱斯、意式生活中心、儿童世界、国际美食休闲街四大主题mall，已然将成为区域核心商业中心，建成后可形成住在学府里，吃喝玩乐在奥特莱斯的一站式家居生活体验。同时更加便利的是我们项目本身规划有3000平米的沿街商业街区，完全满足了您基本的生活购物需求。', '地铁2号线、7号线中的长宁大道站、4号线中的方兴大道站均在本项目旁边，将贯通城市东西，连接蜀山板块及市区；未来交通便利，“城市主干道+地铁”的道路价值使得未来该区域必将最为便捷。另外目前到达我们项目的公交线路有：81路，651路,655路，656路，高新1号线等，出行也是非常的方便', 3337, 159, '2016', '201604');
INSERT INTO `house` VALUES (18128, 0, 0, '2021-05-26 15:52:20', 0, '2021-05-26 16:35:48', 201604020, '大富新领地', '1,2', ' 33225.60  ', 372, 7606, '合肥市新站区淮南路与九顶山路交口东南角', '新站区', '商业、住宅', '多层、高层', '安徽大富新时代地产有限公司', '安徽国华建设工程项目管理有限公司', '安徽富坤物业管理有限公司', '项目自带20%商业配套，充分满足业主日常生活购物需求，附近有家天下生活广场、乐活商业广场、馥邦商业广场；学校方面，项目东面新站重点小学淮合小学仅一路之隔，中学为合肥市三十中；周边医院有省二院、安医第四附属医院；随着新站区的崛起，京商商贸城、保税区的营业，项目配套将不断完善。', '大富新领地项目位于新站中心，西临淮南路，北靠九顶山路，离地铁1号线天水路站仅两站路，离合肥火车站3公里路程。项目旁边公交线路：683、681、401等。', 3419, 159, '2016', '201604');
