INSERT INTO `house` VALUES (18182, 0, 0, '2021-05-26 15:52:28', 0, '2021-05-26 16:36:17', 201603009, '大富新领地', '7', ' 15014.74  ', 170, 7261, '合肥市新站区淮南路与九顶山路交口东南角', '新站区', '商业、住宅', '多层、高层', '安徽大富新时代地产有限公司', '安徽国华建设工程项目管理有限公司', '安徽富坤物业管理有限公司', '项目自带20%商业配套，充分满足业主日常生活购物需求，附近有家天下生活广场、乐活商业广场、馥邦商业广场；学校方面，项目东面新站重点小学淮合小学仅一路之隔，中学为合肥市三十中；周边医院有省二院、安医第四附属医院；随着新站区的崛起，京商商贸城、保税区的营业，项目配套将不断完善。', '大富新领地项目位于新站中心，西临淮南路，北靠九顶山路，离地铁1号线天水路站仅两站路，离合肥火车站3公里路程。项目旁边公交线路：683、681、401等。', 3260, 165, '2016', '201603');
