INSERT INTO `house` VALUES (18341, 0, 0, '2021-05-26 15:52:47', 0, '2021-05-26 16:43:16', 201509036, '安粮城市广场', '10#,17#,18#', ' 42533.69  ', 429, 9300, '合肥市金寨南路817', '蜀山区', '商住', '高层', '安徽省安福置业有限公司', '中冶南方工程技术有限公司 安徽省建筑科学研究设计院', '浙江绿城物业管理有限公司安徽省分公司', '安粮城市广场有最全面的生活休闲配套， 包括大型购物中心，休闲街区，下楼就有超市、影院、百货、时尚小店、餐饮食肆等，商业配套可谓十分完善。而且该项目十分钟生活圈内，分布有众多医疗和教育资源：医院有省立医院（南区）、市三院、安医二附院；学校有绿怡小学、阳光小学、金寨南路小学、五十中、五十四中、建工学院、科大、安大、炮院、大学城、社区终身教育体系中品牌早教机构、国际双语幼儿园。市政务中心及众多党政机关、多家银行、天鹅湖大酒店、万豪大酒店、自有五星级酒店、自有全方位立体式商业……众多医疗教育机构、交通网络、政府机关、银行等配套单位齐备，构筑成安粮城市广场尊享城市便捷生活的配套“大世界”。', '安粮城市广场东临金寨路高架桥、西临合作化路、南临二环立交、北临通往政务区的休宁大道，交通十分便利。经过这个附近的公交包括12、30、126、135、148、149、226、701、901路', 2860, 181, '2015', '201509');
