INSERT INTO `house` VALUES (18483, 0, 0, '2021-05-26 15:53:04', 0, '2021-05-26 16:44:40', 201505009, '天玥中心', '4#', ' 11212.80  ', 96, 10527, '蜀山区，潜山路与长江西路交叉口', '蜀山区', '商业、住宅', '商业、住宅、办公', '安徽卓誉房地产开发有限公司', '广州市天作建筑规划设计有限公司', '安徽安兴华安物业管理有限责任公司', '学区：凤凰城小学、颐和中学 购物：合家福超市、永辉超市、北京华联超市等 医院：105医院等 银行：工商银行、交通银行、中国银行、徽商银行、农业银行 餐饮：凤凰美食街、贵池路美食街、美味厨(青阳路);巴蜀演义川菜馆;农家土菜馆;爆椒拉面安居苑店;尚品锅庄(长江西店);煲煲好(青阳路店);斟樽酒楼;庐阳饭店;阿瓦山寨安徽长江西路店;毛家饭店(青阳路)等 ', '公交：三十四中公交站、七里塘公交站、圣电气学校公交站 地铁：2、3号线交汇，目前，合肥市正在建设的地铁2号线、3号线，贯 穿蜀山区的东西南北走向，地铁站周边的商业发展，连同现有的五大商圈， 将为蜀山区商业的提升起到推动作用。高架：天玥中心门前就有长江西路高架桥入口，长江西路高架通车，使高新区与蜀山区以及主城区之间将以“无缝对接”的方式实现前所未有的快捷连通。 高铁：10分钟抵达合肥南站，去往各大城市 火车：20分钟抵达合肥城站，去往全国各地 飞机：30分钟前往新桥机场，去往世界各地 公交：3路,108路,119路,124路,232路,24路,快速公交4号线,502路,518路,8路,22路,48路,51路至三十四中', 2592, 195, '2015', '201505');
