INSERT INTO `house` VALUES (18543, 0, 0, '2021-05-26 15:53:11', 0, '2021-05-26 16:45:10', 201503042, '湖滨公馆', 'A19,A22', ' 27410.82  ', 268, 8162, '滨湖新区云谷路与金斗路交口东北角', '滨湖区', '住宅', '高层、低层', '中海宏洋置业（合肥）有限公司', '华东建筑设计院有限公司安徽分公司', '中海宏洋物业管理有限公司', '项目拥有优质的学区资源，小区旁边规划一所学校，周边汇聚合肥一中、四十六中南区、师范附小（四小）等学校，搭建一站式全程优质教育体系。项目自带了近1.1万平米的社区商业配套，此外还有约6万平米的两栋商业办公楼；周边有世纪金源购物中心（已更名为百大购物中心）和万达文化旅游城等，无论生活还是休闲娱乐，都非常方便。周边五园一湖环伺，坐拥六大稀缺资源，西临金斗公园、北观塘西河公园、东望方兴湖公园与滨湖湿地公园、南临牛角大圩生态农业区，眺望巢湖，尽览无限风光。 ', '项目周边南北走向的有徽州大道、庐州大道和包河大道3条合肥城市主干道,东西走向的有方兴大道和云谷路。项目往东约300米就是庐州大道，未来地铁1号线贯穿其中，在庐州大道与云谷路交叉口设有地铁出入口，预计2016年即可通车。往东约500米就是徽州大道，徽州大道作为合肥南北走向最重要的主干道，方便到达市区各个地方。北侧的方兴大道可直接进入合安高速，南边紧邻云谷路，规划的地铁5号线也是经过云谷路，在小区西南角（云谷路与金斗路交叉口）预留地铁出入口建设用地。', 2482, 201, '2015', '201503');
