INSERT INTO `house` VALUES (18559, 0, 0, '2021-05-26 15:53:15', 0, '2021-05-26 16:45:17', 201503031, '湖滨公馆', 'V60,V61,V62,V63,V69,V70,V71,V72', ' 11632.87  ', 36, 16495, '滨湖新区云谷路与金斗路交口东北角', '滨湖区', '住宅', '高层、低层', '中海宏洋置业（合肥）有限公司', '华东建筑设计院有限公司安徽分公司', '中海宏洋物业管理有限公司', '项目拥有优质的学区资源，小区旁边规划一所学校，周边汇聚合肥一中、四十六中南区、师范附小（四小）等学校，搭建一站式全程优质教育体系。项目自带了近1.1万平米的社区商业配套，此外还有约6万平米的两栋商业办公楼；周边有世纪金源购物中心（已更名为百大购物中心）和万达文化旅游城等，无论生活还是休闲娱乐，都非常方便。周边五园一湖环伺，坐拥六大稀缺资源，西临金斗公园、北观塘西河公园、东望方兴湖公园与滨湖湿地公园、南临牛角大圩生态农业区，眺望巢湖，尽览无限风光。 ', '项目周边南北走向的有徽州大道、庐州大道和包河大道3条合肥城市主干道,东西走向的有方兴大道和云谷路。项目往东约300米就是庐州大道，未来地铁1号线贯穿其中，在庐州大道与云谷路交叉口设有地铁出入口，预计2016年即可通车。往东约500米就是徽州大道，徽州大道作为合肥南北走向最重要的主干道，方便到达市区各个地方。北侧的方兴大道可直接进入合安高速，南边紧邻云谷路，规划的地铁5号线也是经过云谷路，在小区西南角（云谷路与金斗路交叉口）预留地铁出入口建设用地。', 2449, 203, '2015', '201503');
INSERT INTO `house` VALUES (18560, 0, 0, '2021-05-26 15:53:15', 0, '2021-05-26 16:45:18', 201503030, '东郡苑', '16', ' 12574.51  ', 125, 8364, '长江东大街与郎溪路交口', '瑶海区', '住宅、商业', '高层', '合肥保利和恒房地产开发有限公司', '安徽地平线建筑设计事务所有限公司；', '保利物业管理有限公司合肥分公司', '保利东郡城市综合体自身融合多种业态，周边另有胜利路元一环球影城、长江东路花冲剧场、大地院线等，合裕路合钢二厂大门西侧李鸿章享堂。项目南侧一路之隔在建有三大中心：文化艺术中心、全民健身中心、公共卫生中心，场地开阔，场馆众多，满足市民运动健身需求。银行.医院(合肥市新二院） ', '北至新安江路——向东可直接通达肥东，向西连长江东大街，直达市中心。 西至郎溪路——郎溪路系合肥新东二环，将全线架设高架，畅通二环。 项目四至3公里范围内，有合肥东西向中轴长江路，东部进出城干道裕溪路高架，合肥南北向主干道铜陵路高架。 ', 2456, 203, '2015', '201503');
