INSERT INTO `house` VALUES (18599, 0, 0, '2021-05-26 15:53:19', 0, '2021-05-26 16:45:40', 201501047, '合肥大宁缤购商业广场', '6', ' 14324.86  ', 253, 11290, '宁国路美食街与九华山路交汇处', '包河区', '住宅、商业、办公', '多层、高层', '合肥大宁国际投资管理有限公司', '北京森磊源建筑规划设计研究院', '合肥锦庭物业管理有限公司', '小学，中学，生活超市', '我们整个项目所处位置由南一环、黄山路、九华山路、太湖路（四横）徽州大道、宁国路、马鞍山路（三纵）形成四横三纵的城市核心立体交通圈。项目北临南一环路，一环路是合肥最重要的快速交通命脉，快速到达各个片区；南沿九华山路；向西串联徽州大道、金寨路高架，是从市区直抵滨湖新区、经开区的快速通道，也是至合徐、合宁、合芜高速的主要交通干道；向东马鞍山路，目前在建地铁一号线，预计2016年开通使用,到时候出行会更加便捷。', 2345, 207, '2015', '201501');
