INSERT INTO `house` VALUES (18649, 0, 0, '2021-05-26 15:53:26', 0, '2021-05-26 16:46:07', 201412009, '东郡苑', '15,18', ' 43644.06  ', 445, 8200, '长江东大街与郎溪路交口', '瑶海区', '住宅、商业', '高层', '合肥保利和恒房地产开发有限公司', '安徽地平线建筑设计事务所有限公司；', '保利物业管理有限公司合肥分公司', '保利东郡城市综合体自身融合多种业态，周边另有胜利路元一环球影城、长江东路花冲剧场、大地院线等，合裕路合钢二厂大门西侧李鸿章享堂。项目南侧一路之隔在建有三大中心：文化艺术中心、全民健身中心、公共卫生中心，场地开阔，场馆众多，满足市民运动健身需求。银行.医院(合肥市新二院） ', '北至新安江路——向东可直接通达肥东，向西连长江东大街，直达市中心。 西至郎溪路——郎溪路系合肥新东二环，将全线架设高架，畅通二环。 项目四至3公里范围内，有合肥东西向中轴长江路，东部进出城干道裕溪路高架，合肥南北向主干道铜陵路高架。 ', 2225, 212, '2014', '201412');
