INSERT INTO `house` VALUES (18756, 0, 0, '2021-05-26 15:53:39', 0, '2021-05-26 16:47:05', 201408032, '城市之光', '1,2', ' 39961.68  ', 480, 7986, '合肥市瑶海区裕溪路与南陵路交口', '瑶海区', '住宅', '高层', '安徽新大众房地产开发有限公司', '合肥工业大学建筑设计研究院', '上海大众物业管理有限责任公司合肥分公司', '周边生活商业配套齐全，银行网点多，中国邮政、中国银行、建设银行、徽商银行等。紧邻和平路市二院，项目周边有南陵路菜市场和茂林路菜市场。省建幼儿园、城市绿苑幼儿园、隆岗小学、五十五中。', '紧邻裕溪路高架，东接东二环，西接铜陵路高架及东一环、南一环。交通便利。', 1990, 222, '2014', '201408');
INSERT INTO `house` VALUES (18757, 0, 0, '2021-05-26 15:53:39', 0, '2021-05-26 16:47:05', 201408026, '恒大中心一期', '1#,2#,3#,4#,5#,6#', ' 74431.98  ', 612, 9417, '成都路与华山路交口', '滨湖区', '住宅、商业', '框架、剪力墙', '合肥粤泰置业有限公司', '恒大集团建筑设计院', '金碧物业有限公司合肥分公司', '基础配套目前有徽州大道上的世纪金源购物中心，金融中心，旁边是万达文旅城，我们项目本身就是一个商业综合体，拥有518m标志性建筑，滨湖区是整个合肥市名校资源最密集的区域。在滨湖，师范附小、四十六中、合肥一中从小学到高中一个非常完整的教育体系。我们项目因为刚刚启动，最终确定的学区还确定，不过看看周边的学校也可以发现，整个滨湖的学区都不差的。而且我们项目一线临800里巢湖，靠近金斗公园、塘西河公园、湿地公园，是个天然的氧吧。', '包河大道全线贯通，从老城区到滨湖新区仅需15分钟。横向呢通过锦绣大道、紫云路和方兴大道能够快速到达经开区。并且现在通过方兴大道跟京台高速的互通立交桥这条快速通道从滨湖到新桥机场也就半个小时的时间就直达新桥国际机场了，公交呢，在滨湖区我们有快速公交1号线，半个小时左右就可到达市中心，26路公交车到达经开区，18路公交车到达政务区，61路公交在整个滨湖区绕行，地铁1号线吧，它将于2016年开通，而我们项目就紧邻着地铁一号线的“南宁路”站点，步行大概几分钟的路程。', 1989, 222, '2014', '201408');
