INSERT INTO `house` VALUES (18777, 0, 0, '2021-05-26 15:53:41', 0, '2021-05-26 16:47:15', 201407058, '和盛公馆', '20#', ' 15345.32  ', 136, 8262, '滨湖新区杭州路与四川路交口西南侧', '滨湖区', '住宅', '高层', '合肥保利和盛房地产有限公司', '合肥工业大学建筑设计研究院', '保利物业管理有限公司', '1、商业配套：与世纪金源购物中心仅有数分钟车程，靠近规划在建的滨湖区万达广场，紧邻滨湖高速时代广场，周边购物中心、大中型生活超市、星级酒店等齐全；项目自有规划近2万平米商业，为社区提供完善的商业生活配套。 2、金融配套：紧邻合肥国际金融后台基地，包含中国建设银行安徽省分行、中国银行安徽省分行、中国农业银行安徽省分行等主要银行相继入驻滨湖国际金融中心；周边建行、邮政储蓄银行、合肥农村科技银行等提供基本的金融配套服务。 3、医疗配套：合肥市人民医院南区（滨湖医院），属于特大型三级甲等医院，距离本项目仅数分钟车程。 4、教育配套：合肥师范附小四小、四十六中南区学区，另靠近合肥一中滨湖新校区。 ', '项目位于滨湖区四川路与杭州路交口，交通便利，周边有云谷路、西藏路、徽州大道、庐州大道、包河大道等市政主干道，靠近在建的轨道交通1号线，与市中心快速连接，方便快捷；距离在建的高铁南站仅15分钟路程，另有环城高速、京台高速与区域外畅通连接。', 1959, 224, '2014', '201407');
INSERT INTO `house` VALUES (18778, 0, 0, '2021-05-26 15:53:41', 0, '2021-05-26 16:47:16', 201407059, '森林城B2地块', '5', ' 15219.23  ', 136, 9454, '二环路与四里河路交口东南角', '庐阳区', '住宅', '住宅', '合肥万科瑞翔地产有限公司', '汉嘉设计集团', '上海万科物业服务有限公司', '\"中小学：南门小学森林公园校区、45中森林公园校区； 周边幼儿园：安然绿洲幼儿园、紫桐新村幼儿园等； 医院：市城建医院； 其 他：利港四季华庭、NBA主题公园、新桥机场、北部公交中转站、城市森林公园等配套。 自建学区、社区服务中心、老年服务中心等\" ', '乘13路，17路，131路，143路，233路车到五里拐站下 ', 1957, 224, '2014', '201407');
