INSERT INTO `house` VALUES (18784, 0, 0, '2021-05-26 15:53:43', 0, '2021-05-26 16:47:18', 201407041, '馥邦天下', '6', ' 2579.71  ', 12, 8491, '科学大道与海棠路交口西南角', '高新区', '住宅', '高层、多层', '淮矿地产合肥高新有限责任公司', '深圳华森建筑与工程设计顾问有限公司', '浙江盛全物业管理有限公司', '教育：小区内配建幼儿园、中学，医院、银行环绕周边 ', '紧邻科学大道、习友路两大城市主干道，5分钟车程畅达西高架桥，7分钟车程直抵金寨路高架，实现与主城区的无缝链接；附近有312国道景观带，与政务区仅一河之隔。 附近公交站牌有柳树塘站，可坐652路、651路、158路下车向东步行约200米即到；也可到海科路口下车步行约50米即到。', 1931, 225, '2014', '201407');
INSERT INTO `house` VALUES (18785, 0, 0, '2021-05-26 15:53:43', 0, '2021-05-26 16:47:19', 201407040, '岭湖墅', '2', ' 1511.35  ', 6, 13478, '高新区习友路与浮山路交口西北角', '高新区', '住宅', '高层、低层', '合肥中海新华房地产有限公司', '上海现代建筑设计院（集团）有限公司', '光大物业管理有限公司', '岭湖墅坐享合肥两大CBD中心配套，距王咀湖CBD仅2公里，离天鹅湖CBD仅6公里，自由享受5分钟生活圈。 同时，安徽省规模最大的三甲医院之一——安医附院高新分院2011年已经动工。 省级示范性高中合肥七中也将搬迁至附近。 ', '项目南踞习友路，紧邻望江西路、长江西路，四周外达内通。 嶺湖墅距市政府约7公里，距高新区管委会约2公里。是离新桥机场最近的主城区,约25公里。', 1928, 225, '2014', '201407');
INSERT INTO `house` VALUES (18786, 0, 0, '2021-05-26 15:53:43', 0, '2021-05-26 16:47:19', 201407039, '湖滨公馆', 'V38,V39,V50,V51,V52,V53,V55,V56,V57,V58,V59', ' 17493.28  ', 54, 14416, '滨湖新区云谷路与金斗路交口东北角', '滨湖区', '住宅', '高层、低层', '中海宏洋置业（合肥）有限公司', '华东建筑设计院有限公司安徽分公司', '中海宏洋物业管理有限公司', '项目拥有优质的学区资源，小区旁边规划一所学校，周边汇聚合肥一中、四十六中南区、师范附小（四小）等学校，搭建一站式全程优质教育体系。项目自带了近1.1万平米的社区商业配套，此外还有约6万平米的两栋商业办公楼；周边有世纪金源购物中心（已更名为百大购物中心）和万达文化旅游城等，无论生活还是休闲娱乐，都非常方便。周边五园一湖环伺，坐拥六大稀缺资源，西临金斗公园、北观塘西河公园、东望方兴湖公园与滨湖湿地公园、南临牛角大圩生态农业区，眺望巢湖，尽览无限风光。 ', '项目周边南北走向的有徽州大道、庐州大道和包河大道3条合肥城市主干道,东西走向的有方兴大道和云谷路。项目往东约300米就是庐州大道，未来地铁1号线贯穿其中，在庐州大道与云谷路交叉口设有地铁出入口，预计2016年即可通车。往东约500米就是徽州大道，徽州大道作为合肥南北走向最重要的主干道，方便到达市区各个地方。北侧的方兴大道可直接进入合安高速，南边紧邻云谷路，规划的地铁5号线也是经过云谷路，在小区西南角（云谷路与金斗路交叉口）预留地铁出入口建设用地。', 1927, 225, '2014', '201407');
