INSERT INTO `house` VALUES (18788, 0, 0, '2021-05-26 15:53:43', 0, '2021-05-26 16:47:21', 201407034, '滨水印象', '8#', ' 25221.12  ', 240, 7418, '紫蓬路北宿松路西', '经开区', '高层住宅', '框架', '绿地集团合肥恒锦置业有限公司', '上海现代建筑设计（集团）有限公司', '安徽省绿安物业管理有限公司', '小区自行配套40000平方米商业', '目前暂无直达公交车', 1925, 225, '2014', '201407');
INSERT INTO `house` VALUES (18789, 0, 0, '2021-05-26 15:53:44', 0, '2021-05-26 16:47:21', 201407031, '皖都徽韵', '13,14', ' 22390.70  ', 408, 8807, '包河区包河大道与延安路交口', '包河区', '住宅', '高层', '安徽友盛房地产有限公司', '安徽省建筑科学研究设计院', '宣城市安居物业有限责任公司', '社区配套完善，有商业街，会所，幼儿园和大量的停车空间，让您的生活更加周到便利。项目周边的发展更为项目的整体环境以及后期业主的生活带来更大的空间。在建省政府提升了项目周边的人文气息；上海红星美凯龙的签约及它后期地块集吃住购娱乐于一体的综合规划，使项目周边的配套更加齐全，生活更加丰富多彩；2012年6月11日，项目学区被划分为合肥市实验学校本部，使本项目的业主不再为孩子上不到好学校而发愁！', '本项目的地理位置优势独特，位于新老城区交汇处，坐落包河万达商圈与省府之间，距省府车程3分钟，距包河万达车程8分钟，距包河区政府仅2分钟车程。27路公交车从市府广场直达包河大道紧邻小区处。小区紧邻包河大道主干道，贯穿南北，北至火车站，南达巢湖环湖大道景区。交通四通八达，距包河大道高速入口2分钟，合肥高铁站3分钟车程，让您轻松享受跨省生活。在建轻轨1号线大连路站距项目仅2公里，出行方便的同时，又不使您的生活受到噪音的干扰。沿锦绣大道或繁华大道可直达经开区，沿南二环高架或祁门路看直达政务区，全方面立体交通出行十分便利。', 1906, 226, '2014', '201407');
