INSERT INTO `house` VALUES (18900, 0, 0, '2021-05-26 15:53:56', 0, '2021-05-26 16:48:21', 201404037, '和盛公馆', '23#', ' 15345.32  ', 136, 8261, '滨湖新区杭州路与四川路交口西南侧', '滨湖区', '住宅', '高层', '合肥保利和盛房地产有限公司', '合肥工业大学建筑设计研究院', '保利物业管理有限公司', '1、商业配套：与世纪金源购物中心仅有数分钟车程，靠近规划在建的滨湖区万达广场，紧邻滨湖高速时代广场，周边购物中心、大中型生活超市、星级酒店等齐全；项目自有规划近2万平米商业，为社区提供完善的商业生活配套。 2、金融配套：紧邻合肥国际金融后台基地，包含中国建设银行安徽省分行、中国银行安徽省分行、中国农业银行安徽省分行等主要银行相继入驻滨湖国际金融中心；周边建行、邮政储蓄银行、合肥农村科技银行等提供基本的金融配套服务。 3、医疗配套：合肥市人民医院南区（滨湖医院），属于特大型三级甲等医院，距离本项目仅数分钟车程。 4、教育配套：合肥师范附小四小、四十六中南区学区，另靠近合肥一中滨湖新校区。 ', '项目位于滨湖区四川路与杭州路交口，交通便利，周边有云谷路、西藏路、徽州大道、庐州大道、包河大道等市政主干道，靠近在建的轨道交通1号线，与市中心快速连接，方便快捷；距离在建的高铁南站仅15分钟路程，另有环城高速、京台高速与区域外畅通连接。', 1713, 237, '2014', '201404');
