INSERT INTO `house` VALUES (19203, 0, 0, '2021-05-26 15:54:16', 0, '2021-05-26 16:51:42', 201307015, '祥源城', 'G1,G14,G13', ' 50398.68  ', 528, 6226, '合肥市高新区创新大道与望江西路交口西北角', '高新区', '高层，别墅，商业', '框架', '安徽新祥源房地产开发有限公司', '广东建筑艺术设计院', '祥源物业', '项目东边邻近高新区管委会。 项目周边生活配套：北部安医附院高新分院已动工建设，西边七中——合肥省示范高中之一即将整体搬迁，、奥特莱斯等也将落户项目周边，西客站、新桥机场、高速口也分布项目周边，另外有中科大研究院、合肥中加（国际）学校等。', '项目位于合肥市高新区，北边为云飞路（原潜水东路），东边为创新大道，西边为石莲南路，南边为望江西路。公交情况：665，651路公交车。 在项目的北面约1200米处，轨道二号线即将开工，未来轨道交通4号线、7号线也将于项目周边交汇。', 986, 267, '2013', '201307');
