INSERT INTO `house` VALUES (19678, 0, 0, '2021-05-26 15:54:45', 0, '2021-05-26 16:57:05', 201204003, '琥珀五环城和风阁', '6#', ' 28338.95  ', 246, 7021, '习友路与潜山路交口', '政务区', '一级', '高层', '合肥城建发展股份有限公司', '安徽省建筑设计研究院', '安徽新长江物业服务有限责任公司', '琥珀五环城汇聚了政、商、文、教、卫、体等一系列高端资源配套，政：政务区；商：三大高端城市综合体（华润万象城、万达广场、置地广场）；文：合肥剧院、天鹅湖风景区；教：50中、嘉和苑小学、小区2000平米配套幼儿园；卫：安徽省立医院南区；体：合肥奥体中心等，是一个极致的理想安居之所。', '琥珀五环城是安徽省唯一一家房地产上市企业——合肥城建集团继琥珀山庄、琥珀名城、琥珀新天地等项目之后，推出的又一个“琥珀”系列的经典之作。小区位于合肥市政务文化新区繁华地段，金寨路、潜山路、习友路三大城市主干道交汇于此。距市中心仅7.56公里的距离，18、166、129路等多条公交路线均可到达项目，十分钟车程即可到达。', 329, 314, '2012', '201204');
