INSERT INTO `house` VALUES (19790, 0, 0, '2021-05-26 15:54:51', 0, '2021-05-26 16:57:59', 201110005, '翡丽时代广场', '4#,6#', ' 37943.29  ', 321, 8705, '北一环路与界首路交口西北角', '庐阳区', '住宅', '高层', '合肥汇博房地产开发有限公司', '中建国际（深圳）设计顾问有限公司', '合肥祥源物业管理有限公司', '项目周边的配套非常成熟：四大综合体SHOPPINGMALL新天地国际购物广场、北京华联购物中心、香格里拉国际大酒店购物中心、华润欢乐颂，分布项目周边，步行均只需几分钟时间。汇集了乐购、北京华联、华润苏果等大型超市；金满楼海鲜城、九乐宫燕鲍翅、星巴克咖啡、栖巢咖啡、元祖蛋糕以及义井路美食一条街、古汤池会所等休闲餐饮咖啡娱乐设施一应俱全，让你的生活更加轻松、惬意。 优质的教育资源是一个好项目必不可少的配套之一！我们项目周边聚集了南国花园小学、柏景湾小学、47中、庐阳中学以及合肥最好的私立中学寿春中学，可谓是名校云集。不但如此，项目周边的人群素质也非常高，目前我们翡丽城成交的客户大部分都是银行高管、公司经理、企业白领、政府公务员等高素质人员！您试想一下，古人“孟母三迁”，今天的您如果在我们祥源广场?翡丽城购房置业，将来孩子教育这个头等大事完全不用发愁，同时节约了您接送孩子的时间、更加便捷的与老师沟通、节约了时间和距离成本。', '项目周边的交通非常便捷，合肥畅通一环濉溪路、中环临泉路、城市南北主干道蒙城路、阜阳路以及亳州路、环伺左右；周边近15条公交路线汇聚，像公交12、14、15、21、22、116、124、131、137、232路等，到市中心、合肥火车站仅需十分钟车程、可以迅速到达合肥各个区域，如此便利的交通体系真正保证了您以后的出行无忧。', 170, 326, '2011', '201110');
