INSERT INTO `house` VALUES (19855, 0, 0, '2021-05-26 15:54:55', 0, '2021-05-26 16:58:32', 201108024, '百汇城市广场', '3,4', ' 11967.25  ', 136, 8417, '瑶海区铜陵路与临淮路交汇处', '瑶海区', '商住', '高层', '合肥港汇置业有限公司', '安徽建筑研究设计院', '南京新鸿运物业有限公司', '在生活方面项目更是拥有成熟区域带来的便捷生活，有多家大型超市坐落于此一站式的便捷生活服务如：超市有：华润苏果、沃尔玛；购物批发商场有：浙江小义乌商城、安徽大市场；家具市场有：红星美凯龙、环宇家具、金太阳家具；医院有：中山医院、合肥市第二人民医院；周边有工商银行、建行、农业银行等，本区域不仅有便捷的商圈和繁荣的商贸且还有花冲公园、生态公园、瑶海公园、新海公园等多家园林式公园环绕，', '项目位于东城核心区域长江东路与铜陵路交汇处，交通生活极其便捷，是合肥居住人气最旺的区域，项目紧邻长江东路与临泉路，且铜陵北路是连接北城与东一环和东二环的一条主干道，距离合肥最富标志性的元一商圈及火车站商圈不到10分钟的车程。', 90, 332, '2011', '201108');
