INSERT INTO `house` VALUES (19861, 0, 0, '2021-05-26 15:54:56', 0, '2021-05-26 16:58:35', 201107007, '望湖嘉苑', '19,13', ' 20480.16  ', 144, 4540, '包河大道美和路交口', '包河区', '高层', '框架', '合肥城建投资控股有限公司', '安徽省建筑设计有限责任公司', '安徽新长江物业', '教育：省政府机关幼儿园望湖分园，合肥市望湖小学，合肥市第四十八中学望湖校区。 商业：红府超市、合家福超市、万浮超市、望湖城商业街、麦德龙超市。 生活：市政供暖，太阳能热水系统，管道天然气，安全出入系统。 ', '地铁：地铁一号线望湖城站计划2016年12月31日开通。 高架：包河大道、马鞍山路高架、徽州大道大高架无缝链接老城区，滨湖新区。 铁路交通：合肥高铁南站总占地约4平方公里，为多条高铁交汇之处，是集各种交通换乘方式为一体的大型综合交通枢纽，属合肥市先行规划设计的重点项目之一，预计2014年7月建成通车。建成后将会成为华东尖端，与南京南站、上海虹桥站、杭州东站并称“华东四大铁路枢纽站 ”，一座比政务区面积大两倍还要多的新城，将逐渐呈现形成。 公交：11路、43路、509路、116路、27路、23路。 ', 37, 333, '2011', '201107');
