INSERT INTO `house` VALUES (19867, 0, 0, '2021-05-26 15:54:56', 0, '2021-05-26 16:58:39', 201108029, '公园道壹号', '8#', ' 14160.36  ', 144, 6746, '长江西路652号', '蜀山区', '商住', '高层', '安徽碧城置业投资有限公司', '安徽寰宇设计院', '安徽长城物业管理有限公司', '项目配套极其便利，位于三里庵家乐福商圈辐射范围内，上海华联超市、合家福超市环伺本案，更有规划大型Shopping Mall嘉茂广场尽在咫尺。十里庙小学、三十四中学，各大银行、酒店等服务配套应有尽有，让您足不出户享受都市生活的时尚快捷。 项目生态环境极佳，近拥城市公园、大蜀山森林公园、清溪公园，远眺董铺水库。并且着重强调建筑与外部景观的对话，三个公园三重景观让本项目牢牢扎根于大蜀山生态区的背景当中，给业主带来强烈的亲近自然的归属感，以及身处公园板块生态人居的清新感受 ', '项目东临十里店路，南接长江西路、西望西二环、北靠创业大道。十余条公交线路途径本项目，与市中心仅仅10分钟车程', 77, 333, '2011', '201108');
INSERT INTO `house` VALUES (19868, 0, 0, '2021-05-26 15:54:56', 0, '2021-05-26 16:58:39', 201107096, '琥珀五环城和风阁', '1#,2#', ' 39389.10  ', 346, 7032, '习友路与潜山路交口', '政务区', '一级', '高层', '合肥城建发展股份有限公司', '安徽省建筑设计研究院', '安徽新长江物业服务有限责任公司', '琥珀五环城汇聚了政、商、文、教、卫、体等一系列高端资源配套，政：政务区；商：三大高端城市综合体（华润万象城、万达广场、置地广场）；文：合肥剧院、天鹅湖风景区；教：50中、嘉和苑小学、小区2000平米配套幼儿园；卫：安徽省立医院南区；体：合肥奥体中心等，是一个极致的理想安居之所。', '琥珀五环城是安徽省唯一一家房地产上市企业——合肥城建集团继琥珀山庄、琥珀名城、琥珀新天地等项目之后，推出的又一个“琥珀”系列的经典之作。小区位于合肥市政务文化新区繁华地段，金寨路、潜山路、习友路三大城市主干道交汇于此。距市中心仅7.56公里的距离，18、166、129路等多条公交路线均可到达项目，十分钟车程即可到达。', 75, 333, '2011', '201107');
