INSERT INTO `house` VALUES (19920, 0, 0, '2021-05-31 17:54:00', 0, '2021-05-31 18:25:52', 202105074, '海悦公馆', 'A1,A9,A10,A11,A12', ' 54304.10  ', 478, 16479, '瑶海区明皇路与龙岗路交口', '瑶海区', '住宅、车位、商业等', '高层、洋房、其他', '合肥和旭房地产有限公司', '中外建工程设计与顾问公司', '保利物业发展股份有限公司安徽分公司', '项目东北边约2km学林公园，总规划面积约1600亩。该公园规划为一座生态休闲游乐型公园，结合高教基地特色商业街区，丰富人们的城市生活，构建环境优美开放式的城市空间。项目东南面是月亮湾公园，东起龙岗路、西至大众路，北起长江东路、南至合裕路，利用二十埠河等河流进行打造。本项目邻近瑶海万达、保利广场、瑶海天街，宝业东城广场四大商圈，完美满足吃喝玩乐购一站式消费。', '我们项目周边交通发达，由城市主干道、高架、地铁、高速、高铁、公交线路等立体交通网络组成，出行十分便捷。项目周边有“五纵五横”的城市主干道：东西向长江东路、新安江路（长江东大街）、裕溪路高架、包公大道、临泉东路成“五横”，内接主城，外辐江浙；南北向铜陵路高架、东二环、郎溪路、大众路、龙岗路为“五纵”。项目距离地铁2号线龙岗站直线距离约1.7KM；另外项目西北边1.5km处是轨道交通3号线，距离3号线的星海大道站直线距离约1.5KM、窦桥湾约1.7KM。', 7837, 1, '2021', '202105');
