INSERT INTO `house` VALUES (19936, 0, 0, '2021-08-09 17:47:36', 0, '2021-08-09 17:47:39', 202107040, '滨奥花园', 'G7,G8,G13,XG3,XG9', ' 29841.61  ', 288, 16499, '龙子湖路与卧龙湖路交口西北角', '新站区', '体育、住宅', '高层，小高层、洋房', '合肥招盛房地产开发有限公司', '北京建谊高能建筑设计研究院有限公司', '招商局物业管理有限公司合肥分公司', '招商奥体公园位于地铁4号线始发站综合保税区站旁，是招商蛇口倾力打造合肥首座45万方奥体TOD综合体项目，规划可容纳万人的室内体育场馆、约9万方长空公园、约3万方活力荟商业、约33万方住宅四大业态。规划低密智慧洋房社区，配有5S智慧管理服务体系 无接触社区生活体验（无接触智能出入、儿童智慧呵护、环境智慧管理、社区智慧安防、社区智慧生活）是区域内首个配置中央空调、智能马桶、品牌油烟机、四合一智能密码锁的品质精装项目。周边少荃湖湿地公园、二十埠生态廊道、京东方数字医院、安医大四附院、康桥国际学校、168校区新店花园学校等生活配套汇聚，打造合肥奥体版块。 ', '地铁3号线（经翡翠湖、天鹅湖、四里河、火车站、生态公园、职教城等区域）、4号线（经综保区、新海公园、望湖公园、合肥南站、天鹅湖、大蜀山、蜀西湖等区域）、地铁9号线（规划中）；与已开通的1、2、3、5号线在方庙、东七里、合肥南站、图书馆站均有换乘站点，穿行全市，交通便利。 三纵三横干道交汇（3纵：新蚌埠路、铜陵北路、文忠路、 3横：魏武路、东方大道、淮海大道）', 7900, 1, '2021', '202107');
