INSERT INTO `house` VALUES (19944, 0, 0, '2021-08-09 17:47:36', 0, '2021-08-09 17:47:42', 202107027, '云栖麓小区', 'G9#,G13#,G15#', ' 12255.10  ', 128, 14999, '三乘寺路以东、金水湾路以北', '蜀山区', '住宅', '小高层、多层', '合肥坤尚置业有限公司', '上海联创设计集团股份有限公司', '上海上坤物业管理有限公司', '地块东侧规划有商业街区、距离砂之船奥莱直线距离约7公里、距离银泰城（在建）直线距离约9公里。十公里范围内医疗资源丰富，安徽医科大学第一附属医院（高新院区），安徽省妇幼保健院（西院）、安徽医科大学临床医学院及附属医院（规划中）。', '距离地铁2号线南岗站直线距离约7公里、距离地铁4号线（在建）鸡鸣山路站直线距离约4公里，地铁6号线（规划中）、地铁2号线延长线（规划中）。', 7927, 2, '2021', '202107');
