INSERT INTO `house` VALUES (19948, 0, 0, '2021-08-09 17:47:37', 0, '2021-08-09 17:47:44', 202107003, '领峰花园', 'E-1#,E-2#,E-3#,E-7#,E-8#,E-9#,E-10#,E-11#', ' 35217.04  ', 312, 21651, '龙川路与历口路交口', '包河区', '住宅 商业 办公', '高层 小高层 洋房', '合肥金玖房地产开发有限公司', '安徽寰宇建筑设计院 ', '上海金地物业服务有限公司', '加侨国际广场、百大合家福购物广场、自建约4万方办公商业、代建1.3万方公园绿地。附近有淝河中央公园、淝河生态公园、南淝河生态公园、合肥中央公园。', '周边公交线路与地铁线路均可抵达本项目，公交线路为101路、122路、9路、138路；地铁线路为四号线花山路站（规划建设中）；马鞍山路高架；高铁南站。', 7891, 2, '2021', '202107');
INSERT INTO `house` VALUES (19949, 0, 0, '2021-08-09 17:47:37', 0, '2021-08-09 17:47:44', 202107004, '嘉誉尚里', '6#,7#,9#,12#,13#,16#,18#', ' 47523.00  ', 484, 15692, '新站区淮海大道与相城路交口', '新站区', '住宅', '高层、小高层', '合肥腾宇房地产开发有限公司', '汉嘉设计集团股份有限公司', '禹洲物业服务有限公司', '项目自带1100㎡社区商业，南侧同时规划有便民商业和邻里中心，而与项目一路之隔是在建约12万方商业综合体。另外项目2公里左右即是合肥唯一的科教文化特色街区——黉街，特色商业集合，配套完善。同时自建有15班制幼儿园，西侧是在建省重点高中合肥九中（本部），人文氛围浓厚，自然资源优越。在项目北侧2.5公里左右即是合肥东北部最大的生态公园——少荃湖湿地公园。区域内还有三所大型专业医院，合肥北部最大的三家医院--安医大四附院、安徽首家“数字化全科医院”--京东方医院、安徽省第二人民医院。资源优渥，生活便利。', '轨道交通：项目北侧为地铁3号线相城路站；并与地铁1、2、4、5号线相连，乘坐转乘地铁即可通达全城； 公交路线：搭乘301、303、304路公交车到职教城站； 城市干道：横向包括东方大道、淮海大道、包公大道高架，以及纵向的铜陵路高架，文忠路高架、大众路、相城路，全程快速车道，可以说路网非常便捷，通达全城。', 7905, 2, '2021', '202107');
INSERT INTO `house` VALUES (19950, 0, 0, '2021-08-09 17:47:37', 0, '2021-08-09 17:47:45', 202107005, '嘉誉尚里', '19#', ' 8680.20  ', 92, 13399, '新站区淮海大道与相城路交口', '新站区', '住宅', '高层、小高层', '合肥腾宇房地产开发有限公司', '汉嘉设计集团股份有限公司', '禹洲物业服务有限公司', '项目自带1100㎡社区商业，南侧同时规划有便民商业和邻里中心，而与项目一路之隔是在建约12万方商业综合体。另外项目2公里左右即是合肥唯一的科教文化特色街区——黉街，特色商业集合，配套完善。同时自建有15班制幼儿园，西侧是在建省重点高中合肥九中（本部），人文氛围浓厚，自然资源优越。在项目北侧2.5公里左右即是合肥东北部最大的生态公园——少荃湖湿地公园。区域内还有三所大型专业医院，合肥北部最大的三家医院--安医大四附院、安徽首家“数字化全科医院”--京东方医院、安徽省第二人民医院。资源优渥，生活便利。', '轨道交通：项目北侧为地铁3号线相城路站；并与地铁1、2、4、5号线相连，乘坐转乘地铁即可通达全城； 公交路线：搭乘301、303、304路公交车到职教城站； 城市干道：横向包括东方大道、淮海大道、包公大道高架，以及纵向的铜陵路高架，文忠路高架、大众路、相城路，全程快速车道，可以说路网非常便捷，通达全城。', 7906, 2, '2021', '202107');
INSERT INTO `house` VALUES (19951, 0, 0, '2021-08-09 17:47:37', 0, '2021-08-09 17:47:45', 202107006, '智慧金融城', 'C2地块25#,C2地块24#,C2地块23#,C2地块22#,C2地块21#', ' 4315.25  ', 10, 28800, '合肥市滨湖区云谷路与四川路交口', '滨湖区', '住宅、洋房', '高层、多层、小高层', '合肥星泓金融城发展有限公司', '上海联创建筑设计有限公司', '上海高地物业管理有限公司', '12万方商业配套、16万方办公、大型超市、医院、21家银行后台基地、地铁5号线、公交枢纽、小学、中学', '地铁：云谷路地铁5号线口、地铁1号线； 公交：快速公交1号线、18路至四十六中，换乘61路公交车底站下、62路公交车滨湖内区间车', 7901, 2, '2021', '202107');
INSERT INTO `house` VALUES (19952, 0, 0, '2021-08-09 17:47:37', 0, '2021-08-09 17:47:45', 202106031, '文一塘溪津门', '42,45', ' 10460.47  ', 64, 28449, '滨湖新区包河大道与杭州路交口', '滨湖区', '住宅', '高层、洋房', '安徽省文一投资控股集团滨江置业有限公司', '北京高能筑博建筑设计有限公司', '安徽省文一物业管理有限公司', '环境：项目紧邻方兴湖和巢湖两大水系，同时为塘西河公园、金斗公园、方兴湖公园和岸上草原所环抱，公园面积高达万亩。商业：项目自持近10万方的文化商业街，打造合肥城市会客厅。此外，南接万达文旅城和恒大中心，东邻银泰中心和中心书城，北连悦方IDmall和世纪金源，众多商业中心伺散。学区：项目南面沿云谷路建有幼儿园和小学。同时一中、四十八中、四十六中和师范附小等名校坐落周边，教育资源得天独厚。医疗：滨湖医院距离项目仅4公里。省立医院总部正在规划筹建，位于项目北侧，相距不过5分钟车程。旅游：万达文化旅游城、牛角大圩生态旅游区、滨湖湿地公园、巢湖岸边的岸上草原、滨湖十大省级文化场馆，加上会申报国家AAAA级景区的塘溪津门水街将，形成一片完整的环巢湖旅游带。', '项目交通状况用“一环二铁三纵四横”来概括。“一环”，即环巢湖大道，被誉为“合肥最美道路”之一。沿线向东可达巢湖城区，向西达国家AAAAA级风景区——三河古镇。“二铁”，指高铁南站和三条地铁线。高铁南站距项目约10公里，借此可达省外；其次项目紧邻三条地铁，1号线已开通营运，由滨湖新区直达合肥火车站，是合肥南北向交通的主动脉，距项目最近的云谷路站约为1.1公里；5号线已经开建，其东史岗路站与华山路站与项目无缝对接。S1号线，途经新桥机场、新高铁西站、高铁南站最终抵达巢湖岸边，将于项目东南角设站。“三纵”指三条南北向主干道——徽州大道、庐州大道和包河大道，连接滨湖新区与老城核心。“四横 ”为锦绣大道、紫云路、方兴大道和云谷路，贯穿滨湖新区和经开区。沿方兴大道向西驱车10分钟可上京台高速，30分钟可达机场高速入口，构成全方位、立体化的交通体系网，通达四周。', 7887, 2, '2021', '202106');
INSERT INTO `house` VALUES (19953, 0, 0, '2021-08-09 17:47:37', 0, '2021-08-09 17:47:46', 202106030, '雍容雅苑', 'A2,A5', ' 18155.22  ', 169, 21806, '包河区北京路与歙县路交叉口', '包河区', '住宅 商业', '高层 小高层 洋房', '合肥禹博房地产开发有限公司', ' 安徽寰宇建筑设计院', '禹洲物业服务有限公司', '项目周边分布马鞍山路沿线商圈，其中包括万达广场、加侨国际广场、绿地瀛海、百大购物广场、新都会环球购物广场等多个醇熟商业，购物、美食、休闲、娱乐应有尽有。', '轨道交通：紧邻的2条地铁线分别是地铁1号线(葛大店站)、地铁4号线(大强路站)；以及规划中的5号线、6号线。 道路交通：项目被“四横五纵”城市主干道围绕。四横为南二环（郎溪路）、祁门路、龙川路、繁华大道，可快速到达政务区、经开区；五纵为徽州大道、庐州大道、包河大道、上海路及北京路，可快速到达老城区、滨湖新区。', 7883, 3, '2021', '202106');
